INSERT INTO `disease_info` VALUES ('DOID:0001816', 'angiosarcoma', 'A malignant Vascular tumor that results_in rapidly proliferating, extensively infiltrating anaplastic cells derives_from blood vessels and derived_from the lining of irregular blood-filled spaces', 'hemangiosarcoma', 'SNOMEDCT_US_2016_03_01:33176006|UMLS_CUI:C0018923|NCI:C3088|UMLS_CUI:C0854893|SNOMEDCT_US_2016_03_01:39000009|NCI:C9275|MESH:D006394|SNOMEDCT_US_2016_03_01:403977003', '2', 'DOID:0001816');
INSERT INTO `disease_info` VALUES ('DOID:0002116', 'pterygium', 'pterygium', 'surfer\'s eye', 'ICD10CM:H11.00|SNOMEDCT_US_2016_03_01:193879003|ICD10CM:H11.009|ICD9CM:372.4|ICD10CM:H11.0|SNOMEDCT_US_2016_03_01:193884009|SNOMEDCT_US_2016_03_01:155165000|SNOMEDCT_US_2016_03_01:77489003|ICD9CM:372.40|UMLS_CUI:C0033999|MESH:D011625', '2', 'DOID:0002116');
INSERT INTO `disease_info` VALUES ('DOID:0014667', 'disease of metabolism', 'A disease that involving errors in metabolic processes of building or degradation of molecules', 'metabolic disease', 'SNOMEDCT_US_2016_03_01:190961002|UMLS_CUI:C0025517|SNOMEDCT_US_2016_03_01:30390004|ICD9CM:277.9|SNOMEDCT_US_2016_03_01:154733004|SNOMEDCT_US_2016_03_01:267456000|MESH:D008659|NCI:C3235|SNOMEDCT_US_2016_03_01:75934005|ICD10CM:E88.9', '2', 'DOID:0014667');
INSERT INTO `disease_info` VALUES ('DOID:0050001', 'Actinomadura madurae infectious disease', 'Actinomadura madurae infectious disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050002', 'Actinomadura pelletieri infectious disease', 'Actinomadura pelletieri infectious disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050003', 'Streptomyces somaliensis infectious disease', 'Streptomyces somaliensis infectious disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050004', 'seminal vesicle acute gonorrhea', 'seminal vesicle acute gonorrhea', '', 'UMLS_CUI:C0578661|SNOMEDCT_US_2016_03_01:301990003', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050007', 'cutaneous strongyloidiasis', 'A strongyloidiasis that involves parasitic infection by the filariform larvae of Strongyloides stercoralis, which penetrate the human skin causing urticarial rashes in the buttocks and waist areas', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050009', 'intestinal strongyloidiasis', 'A strongyloidiasis that involves infection of intestine with Strongyloides stercoralis, which results in abdominal pain, diarrhea, ileus, massive gastrointestinal bleeding, severe malabsorption, and peritonitis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050010', 'Mansonella perstans infectious disease', 'A mansonelliasis that involves parasitic infection by the nematode Mansonella perstans, which resides in body cavities and the surrounding tissues causing angioedema, pruritus, fever, headaches, arthralgias, and neurologic manifestations. Midges transmit the disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050011', 'Mansonella streptocerca infectious disease', 'A mansonelliasis that involves parasitic infection by the nematode Mansonella streptocerca, which resides in the dermis and subcutaneous tissue causing pruritus, papular eruptions and pigmentation changes. Midges transmit the disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050012', 'chikungunya', 'A viral infectious disease that results_in infection located_in joint, has_material_basis_in Chikungunya virus, which is transmitted_by Aedes mosquito bite. The infection has_symptom fever, has_symptom arthralgia, and has_symptom maculopapular rash', 'Chikungunya fever', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050013', 'carbohydrate metabolism disease', 'An acquired metabolic disease that is characterized by abnormal carbohydrate metabolism', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050014', 'epizootic hemorrhagic disease', 'A viral infectious disease that results_in infection in deer, has_material_basis_in Epizootic hemorrhagic disease virus, which is transmitted_by Culicoides biting midges. The infection has_symptom hemorrhages in many tissues including the skin, heart, and gastrointestinal tract, and has_symptom ulcers of the tongue, dental pad, palate, rumen, and omasum', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050015', 'Rocio virus encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Rocio virus, which is transmitted_by Psorophora ferox and transmitted_by Aedes species of mosquitoes. The infection has_symptom abdominal distension, has_symptom confusion, has_symptom motor impairment, has_symptom difficulty in walking and maintaining balance, has_symptom meningeal irritation, and has_symptom cerebellar syndrome', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050024', 'Ehrlichia ewingii ehrlichiosis', 'Ehrlichia ewingii ehrlichiosis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050025', 'human granulocytic anaplasmosis', 'An ehrlichiosis that results_in infection located_in granular leukocyte, has_material_basis_in Anaplasma phagocytophilum, which is transmitted_by lone start tick (Amblyomma americanum ). The infection has_symptom headache, has_symptom muscle aches, has_symptom fatigue, has_symptom fever and has_symptom rash', 'human granulocytic ehrlichiosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050026', 'human monocytic ehrlichiosis', 'An ehrlichiosis that results_in infection located_in monocyte or located_in macrophage, has_material_basis_in Ehrlichia chaffeensis, which is transmitted_by black-legged tick (Ixodes scapularis), transmitted_by western black-legged tick (Ixodes pacificus) or transmitted_by castor bean tick (Ixodes ricinus,). The infection has_symptom headache, has_symptom muscle aches, has_symptom fatigue, has_symptom fever and has_symptom rash', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050032', 'mineral metabolism disease', 'An acquired metabolic disease that is characterized by abnormal mineral metabolism', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050035', 'African tick-bite fever', 'A spotted fever that has_material_basis_in Rickettsia africae, which is transmitted_by ticks (Amblyomma hebraeum and Amblyomma variegatum). The infection has_symptom fever, has_symptom eschar and has_symptom maculopapular rash', 'Rickettsia africae spotted fever|south african tick-bite fever', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050041', 'Astrakhan spotted fever', 'A spotted fever that has_material_basis_in Rickettsia conorii subsp caspia, which is transmitted_by ticks (Rhipicephalus pumilio and Rhipicephalus sanguineus). The infection has_symptom fever, has_symptom eschar (usually single), has_symptom regional adenopathy, has_symptom maculopapular rash on extremities', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050042', 'Indian tick typhus', 'A spotted fever that has_material_basis_in Rickettsia conorii subsp indica, which is transmitted_by ticks (Rhipicephalus sanguineus). The infection has_symptom fever, has_symptom eschar, has_symptom regional adenopathy, and has_symptom maculopapular rash on extremities', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050043', 'Israeli tick typhus', 'A spotted fever that has_material_basis_in Rickettsia conorii subsp israelensis, which is transmitted_by ticks (Rhipicephalus sanguineus). The infection has_symptom fever, has_symptom eschar, has_symptom regional adenopathy, and has_symptom maculopapular rash on extremities', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050046', 'Far Eastern spotted fever', 'A spotted fever that has_material_basis_in Rickettsia heilongjiangensis, which is transmitted_by ticks (Haemaphysalis concinna). The infection has_symptom fever, has_symptom eschar, has_symptom maculopapular rash, and has_symptom regional adenopathy', 'Rickettsia heilongjiangensis spotted fever', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050047', 'Flinders Island spotted fever', 'A spotted fever that has_material_basis_in Rickettsia honei, which is transmitted_by cayenne ticks (Amblyomma cajennense). The infection has_symptom mild spotted fever, has_symptom eschar and has_symptom adenopathy', 'Thai tick typhus', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050050', 'Japanese spotted fever', 'A spotted fever that has_material_basis_in Rickettsia japonica, which is transmitted_by ticks (Dermacentor taiwanensis and Haemaphysalis flava). The infection has_symptom fever, has_symptom eschars, has_symptom regional adenopathy, and has_symptom rash on extremities', 'oriental spotted fever|Rickettsia japonica spotted fever', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050051', 'Rickettsia parkeri spotted fever', 'A spotted fever that has_material_basis_in Rickettsia parkeri, which is transmitted_by Gulf Coast tick (Amblyomma maculatum). The infection has_symptom fever, has_symptom headache, has_symptom eschar, and has_symptom rash', 'maculatum infection', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050052', 'Rocky Mountain spotted fever', 'A spotted fever that has_material_basis_in Rickettsia rickettsii, which is transmitted_by ticks (Dermacentor variabilis and Dermacentor andersoni). The infection has_symptom fever, has_symptom headache, has_symptom abdominal pain, and has_symptom maculopapular rash progressing into papular or petechial rash', 'Tick typhus', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050053', 'Rickettsia honei spotted fever', 'Rickettsia honei spotted fever', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050059', 'oropharyngeal anthrax', 'A gastrointestinal anthrax that results_in infection located_in mucosa of oropharynx, has_material_basis_in Bacillus anthracis, which is transmitted_by ingestion of anthrax-infected meat. The infection has_symptom lesions, has_symptom vomiting of blood, has_symptom severe diarrhea, has_symptom loss of appetite', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050061', 'erysipeloid', 'A primary bacterial infectious disease that results_in infection located_in skin, has_material_basis_in Erysipelothrix rhusiopathiae, which is transmitted_by contact with infected animals. The infection has_symptom redness of skin, has_symptom tenderness of skin and has_symptom warmth of skin', '', 'MESH:D004887', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050063', 'abortive plague', 'abortive plague', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050065', 'cutaneous listeriosis', 'cutaneous listeriosis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050066', 'Listeria meningoencephalitis', 'Listeria meningoencephalitis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050067', 'Listeria septicaemia', 'Listeria septicaemia', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050068', 'pestis minor', 'A bubonic plague that results_in a benign form of bubonic plague, has_symptom fever, has_symptom lymphadenitis, has_symptom headache and has_symptom prostration', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050069', 'Yersinia pestis infectious disease', 'Yersinia pestis infectious disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050070', 'plague meningitis', 'plague meningitis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050072', 'adiaspiromycosis', 'A primary systemic mycosis that is a fungal infection located_in lungs, or located_in skin, which results_in disseminated granulomatous pulmonary process and cutaneous infection in rodents, small wild mammals and humans, has_material_basis_in Chrysosporium parvum or Emmonsia crescens', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050073', 'invasive aspergillosis', 'An aspergillosis that is a serious fungal infection of the lung with pneumonia caused by Aspergillus, which spreads to other parts of the body through bloodstream in patients with acute leukemia and recipients of tissue transplants. Clinical symptoms include pulmonary nodules and hemorrhage', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050074', 'tonsillar aspergillosis', 'An aspergillosis that involves fungal infection of the tonsils by Aspergillus species', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050075', 'pulmonary blastomycosis', 'A primary systemic mycosis that results_in fungal infection located_in lungs, has_material_basis_in Blastomyces dermatitidis, transmitted_by airborne spores and has_symptom lung lesions, has_symptom pleural thickening and results_in_formation_of pulmonary nodules', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050078', 'cervix tuberculosis', 'cervix tuberculosis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050079', 'niacin deficiency', 'niacin deficiency', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050080', 'iodine deficiency', 'iodine deficiency', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050082', 'hepatic Torque teno virus infectious disease', 'A viral infectious disease that results_in infection located_in liver, has_material_basis_in Torque teno virus, which is transmitted_by blood transfusion', 'Transfussion-transmitted virus liver infection|TT virus liver infection', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050083', 'Keshan disease', 'Keshan disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050084', 'obsolete rhinotracheitis', 'An upper respiratory tract disease involving inflammation of the nasal cavities and trachea caused by feline herpesvirus 1, of the family Herpesviridae in cats and especially young kittens that is characterized by sneezing, conjunctivitis with discharge, and nasal discharges', 'feline coryza|feline influenza|Feline viral rhinotracheitis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050085', 'entomophthoromycosis', 'A subcutaneous mycosis that involves fungal infection of the subcutaneous tissue caused by members of the order Entomophthorales', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050086', 'cutaneous mucormycosis', 'An opportunistic mycosis that results_in fungal infection located_in cutaneous tissues or located_in subcutaneous tissues followed by a traumatic implantation of fungal elements through the skin, has_material_basis_in Mucorales molds and has_symptom necrotic lesions which progressively evolve from the epidermis into dermis and even muscle', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050088', 'gastrointestinal mucormycosis', 'A opportunistic mycosis that results_in fungal infection located_in gastrointestinal tract, has_material_basis_in Mucorales molds in immunocompromised patients, results_in_formation_of intra-abdominal abscess and has_symptom abdominal pain, has_symptom distention, has_symptom nausea, and has_symptom vomiting', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050089', 'pulmonary mucormycosis', 'An opportunistic mycosis that results_in fungal infection located_in lungs, has_material_basis_in Mucorales molds and has_symptom hemoptysis and has_symptom necrosis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050090', 'rhinocerebral mucormycosis', 'An opportunistic mycosis that results_in fungal infection located_in nose, located_in sinuses, located_in eyes, and located_in brain of immunocompromised individuals and has_symptom orbital cellulitis, has_symptom proptosis, has_symptom pus discharge from the nose, and has_symptom seizures', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050091', 'disseminated paracoccidioidomycosis', 'A primary systemic mycosis that results_in systemic fungal infection through hematogenous spread, has_material_basis_in Paracoccidioides brasiliensis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050092', 'pulmonary paracoccidioidomycosis', 'A primary systemic mycosis that results_in inflammation located_in lungs, has_material_basis_in Paracoccidioides brasiliensis and has_symptom cough, has_symptom fever, has_symptom night sweats, has_symptom malaise, and has_symptom weight loss', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050093', 'disseminated sporotrichosis', 'A primary systemic mycosis that results_in systemic fungal infection through hematogenous spread, has_material_basis_in Sporothrix schenckii, a dimorphic fungus', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050094', 'lymphocutaneous sporotrichosis', 'A primary systemic mycosis that results_in fungal infection located_in skin and located_in subcutaneous tissue, and located_in lymphatic vessel through direct inoculation from wood splinters or hay, has_material_basis_in Sporothrix schenckii, a dimorphic fungus, which results_in_formation_of erythematous papulonodular lesions at the site of implantation and along the lymphangitic channels which soon become palpable and ulcerate', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050095', 'pulmonary sporotrichosis', 'A primary systemic mycosis that results_in fungal infection located_in lung, has_material_basis_in Sporothrix schenckii, a dimorphic fungus, which is transmitted_by airborne spores and has_symptom productive cough, has_symptom nodules and cavitations of the lungs, has_symptom fibrosis, and has_symptom swollen hilar lymph nodes', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050096', 'tinea barbae', 'A dermatophytosis that results_in fungal infection which effects horny layer of epidermis of the bearded areas located_in face or located_in neck, has_material_basis_in Trichophyton mentagrophytes or has_material_basis_in Trichophyton verrucosum, which also effects hair, and effects nail and has_symptom inflammatory kerion-like plaques, and results_in_formation_of noninflammatory superficial perifollicular pustules', 'dermatophytosis of beard', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050097', 'ectothrix infectious disease', 'A tinea capitis that results_in fungal infection located_in cuticle of hair, has_material_basis_in Microsporum canis, has_material_basis_in Microsporum gypseum, has_material_basis_in Trichophyton equinum, and has_material_basis_in Trichophyton verrucosum, which produce arthroconidia on the exterior of the hair shaft', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050098', 'Microsporum audouinii tinea capitis', 'An ectothrix infectious disease that results_in non-inflammatory fungal infection located_in scalp and located_in skin, has_material_basis_in Microsporum audouinii', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050099', 'Microsporum canis tinea capitis', 'An ectothrix infectious disease that results_in zoophilic fungal infection located_in hair, located_in skin, and located_in nail, has_material_basis_in Microsporum canis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050100', 'Microsporum distortum tinea capitis', 'An ectothrix infectious disease that results_in zoophilic fungal infection located_in skin, and located_in hair, has_material_basis_in Microsporum distortum, which causes infections in cats, dogs and other animals', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050101', 'Microsporum ferrugineum tinea capitis', 'An ectothrix infectious disease that results_in anthropophilic fungal infection located_in skin and located_in hair, has_material_basis_in Microsporum ferrugineum', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050102', 'Microsporum gypseum tinea capitis', 'An ectothrix infectious disease that results_in geophilic fungal infection located_in glabrous skin, located_in scalp and located_in hair, has_material_basis_in Microsporum gypseum, which results_in_formation_of inflammatory lesions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050103', 'Microsporum nanum tinea capitis', 'An ectothrix infectious disease that results_in geophilic and zoophilic fungal infection located_in skin, located_in scalp and located_in hair, has_material_basis_in Microsporum nanum, which results_in_formation_of chronic non-inflammatory lesions in pigs and humans', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050104', 'Trichophyton verrucosum tinea capitis', 'An ectothrix infectious disease that results_in zoophilic inflammatory fungal infection located_in skin, located_in beard, located_in scalp and located_in nail in cattle and humans, has-agent Trichophyton verrucosum', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050105', 'endothrix infectious disease', 'A tinea capitis that results_in fungal infection located_in hair, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes, which produce arthroconidia within the hair shaft only', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050106', 'Trichophyton soudanense tinea capitis', 'An endothrix infectious disease that results_in anthropophilic fungal infection located_in scalp and located_in hair, has_material_basis_in Trichophyton soudanense', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050107', 'Trichophyton tonsurans tinea capitis', 'An endothrix infectious disease that results_in anthropophilic fungal infection located_in skin, located_in nail and located_in scalp, has_material_basis_in Trichophyton tonsurans and results_in_formation_of scaling lesions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050108', 'Trichophyton violaceum tinea capitis', 'An endothrix infectious disease that results_in anthropophilic fungal infection located_in skin, located_in nail, located_in beard, and located_in scalp, has_material_basis_in Trichophyton violaceum and results_in_formation_of scaling lesions. The hairs become notably fragile and break easily at the level of the scalp. The rest of the infected follicle looks like \\\"black dots\\\"', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050110', 'Trichophyton schoenleinii tinea capitis', 'A tinea favosa that results_in anthropophilic fungal infection located_in scalp, has_material_basis_in Trichophyton schoenleinii. It is a chronic, scarring form of tinea capitis, which results_in_formation_of scutula and has_symptom permanent hair loss', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050111', 'Microsporum fulvum tinea capitis', 'An ectothrix infectious disease that results_in geophilic fungal infection located_in scalp and located_in hair in humans and animals, has_material_basis_in Microsporum fulvum', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050112', 'Trichophyton megninii tinea capitis', 'An ectothrix infectious disease that results_in anthropophilic fungal infection located_in scalp and located_in hair, has_material_basis_in Trichophyton megninii', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050113', 'Trichophyton equinum tinea capitis', 'An ectothrix infectious disease that results_in zoophilic fungal infection located_in scalp and located_in hair, has_material_basis_in Trichophyton equinum', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050115', 'Trichophyton yaoundei tinea capitis', 'An endothrix infectious disease that results_in anthropophilic fungal infection located_in scalp and located_in hair, has_material_basis_in Trichophyton yaoundei, results_in_formation_of lesions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050116', 'tinea imbricata', 'A tinea corporis that results_in fungal infection located_in skin, has_material_basis_in Trichophyton concentricum, which is characterized by ring-like growth in overlapping circles that may have an autosomal dominant genetic predisposition', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050117', 'disease by infectious agent', 'A disease that is the consequence of the presence of pathogenic microbial agents, including pathogenic viruses, pathogenic bacteria, fungi, protozoa, multicellular parasites, and aberrant proteins known as prions', 'infectious disease', 'UMLS_CUI:C0001485|ICD9CM:079.0', '2', 'DOID:0050117');
INSERT INTO `disease_info` VALUES ('DOID:0050118', 'La Crosse encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in La Crosse virus, which is transmitted_by treehole mosquito, Ochlerotatus triseriatus. The infection has_symptom seizures, has_symptom headache, has_symptom fever, has_symptom coma, and has_symptom paralysis', 'Neuroinvasive California encephalitis virus infection|California Encephalitis|California virus encephalitis', 'SNOMEDCT_US_2016_03_01:418531007|SNOMEDCT_US_2016_03_01:417075004|SNOMEDCT_US_2016_03_01:266103004|MESH:D004670|SNOMEDCT_US_2016_03_01:416442006|SNOMEDCT_US_2016_03_01:69627004|SNOMEDCT_US_2016_03_01:186588007|ICD9CM:062.5|UMLS_CUI:C0014053|ICD10CM:A83.5', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050119', 'West Nile virus neurological syndrome', 'A West Nile virus infectious disease that has_material_basis_in West Nile virus, which can cause meningitis, encephalitis, acute laccid paralysis, Parkingsonian-like conditions or movement disorder', 'WNND|West nile neuroinvasive disease|WNNS', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050120', 'hemophagocytic lymphohistiocytosis', 'A lymphatic system disease that is characterized by an expansion of the monocyte-macrophage population and intense hemophagocytosis. It can occur de novo, but more often occurs in the setting of another disorder, usually an infection or a malignancy. A clinical picture of fever, hepatosplenomegaly, lymphadenopathy and peripheral pancytopenia. The morphologic hallmark of this syndrome is the phagocytosis of hematopoietic elements by morphologically normal macrophages', 'haemophagocytic syndrome|Hemophagocytic syndrome|HPS', 'SNOMEDCT_US_2016_03_01:190958003|ORDO:540|OMIM:PS267700|SNOMEDCT_US_2016_03_01:234437005|UMLS_CUI:C0024291|NCI:C34792|MESH:D051359|ICD10CM:D76.1', '2', 'OMIM:PS267700|DOID:0050120');
INSERT INTO `disease_info` VALUES ('DOID:0050123', 'tuberculous encephalitis', 'tuberculous encephalitis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050125', 'dengue shock syndrome', 'A dengue disease that involves the most severe form of dengue fever, has_material_basis_in Dengue virus [NCBITaxon:12637] with four serotypes (Dengue virus 1, 2, 3 and 4), which are transmitted_by Aedes mosquito bite. The infection has_symptom easy bruising, has_symptom blood spots, has_symptom bleeding gums, and has_symptom nosebleeds. It is accompanied by circulatory collapse, involves hypotension, narrow pulse pressure (less than or equal to 20mm Hg), or frank shock. The shock occurs after two to six days of symptoms, followed by collapse, weak pulse, and blueness around the mouth', 'DSS', '', '2', 'DOID:0050125');
INSERT INTO `disease_info` VALUES ('DOID:0050126', 'Tahyna virus encephalitis', 'A California virus encephalitis that results_in inflammation located_in brain, has_material_basis_in Tahyna virus, which is transmitted_by Aedes, transmitted_by Culex, and transmitted_by Ochlerotatus mosquitoes. The infection has_symptom headache, has_symptom fever, has_symptom anorexia, and has_symptom seizures', 'valtice fever', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050127', 'sinusitis', 'A paranasal sinus disease involving inflammation of the paranasal sinuses resulting from bacterial, fungal, viral infection, allergic or autoimmune issues. Symptoms can include fever, weakness, fatigue, cough and congestion. There may also be mucus drainage in the back of the throat, called postnasal drip', '', 'SNOMEDCT_US_2016_03_01:266378004|SNOMEDCT_US_2016_03_01:155501004|SNOMEDCT_US_2016_03_01:15805002|UMLS_CUI:C0149512|ICD10CM:J01.9|SNOMEDCT_US_2016_03_01:195653007|SNOMEDCT_US_2016_03_01:195649005|SNOMEDCT_US_2016_03_01:155498004|ICD10CM:J01|ICD9CM:461|ICD10CM:J01.90|ICD9CM:461.9', '2', 'DOID:0050127');
INSERT INTO `disease_info` VALUES ('DOID:0050129', 'secretory diarrhea', 'Secretory diarrhea is a diarrhea where there is an increase in the active secretion, or there is an inhibition of absorption causing little to no structural damage. The most common cause of this type of diarrhea is a cholera toxin that stimulates the secretion of anions, especially chloride ions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050130', 'osmotic diarrhea', 'Osmotic diarrhea is a dirrhea where diarrhea occurs when too much water is drawn into the bowels. This can be the result of maldigestion (e.g., pancreatic disease or Coeliac disease), in which the nutrients are left in the lumen to pull in water. Osmotic diarrhea can also be caused by osmotic laxatives (which work to alleviate constipation by drawing water into the bowels). In healthy individuals, too much magnesium or vitamin C or undigested lactose can produce osmotic diarrhea and distention of the bowel. A person who does not have lactose intolerance can have difficulty absorbing lactose after an extraordinarily high intake of dairy products', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050131', 'motility-related diarrhea', 'Motility-related diarrhea is a diarrhea which is caused by the rapid movement of food through the intestines (hypermotility). If the food moves too quickly through the GI tract, there is not enough time for sufficient nutrients and water to be absorbed', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050132', 'inflammatory diarrhea', 'A gastrointestinal system infectious disease involving diarrhea that occurs when there is damage to the mucosal lining or brush border, which leads to a passive loss of protein-rich fluids, and a decreased ability to absorb these lost fluids. It can be caused by bacterial infections, viral infections, parasitic infections, or autoimmune problems such as inflammatory bowel diseases. It can also be caused by tuberculosis, colon cancer, and enteritis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050133', 'superficial mycosis', 'A fungal infectious disease that results_in infection of the outermost layer located_in skin or located_in hair shaft, has_material_basis_in Fungi. No living tissue is invaded and there is no cellular response from the host', 'piedra|Steroid-modified tinea infection', 'MESH:D010854|ICD10CM:B36.9|UMLS_CUI:C2980104|SNOMEDCT_US_2016_03_01:402135006|SNOMEDCT_US_2016_03_01:187002008|SNOMEDCT_US_2016_03_01:276206000|UMLS_CUI:C0031898|SNOMEDCT_US_2016_03_01:187476003', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050134', 'cutaneous mycosis', 'A fungal infectious disease that results_in infection of the keratinized layers located_in skin, located_in hair or located_in nail, which extends deeper into the epidermis, has_material_basis_in Fungi and results_in_formation_of skin lesions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050135', 'subcutaneous mycosis', 'A fungal infectious disease that results_in infection located_in skin or located_in subcutaneous tissue, has_material_basis_in Fungi, which penetrate the dermis or even deeper during or after a skin trauma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050136', 'systemic mycosis', 'A fungal infectious disease that results_in infection of internal organs and tissues located_in human body, has_material_basis_in Fungi, which enter the body via the respiratory tract, through the gut, paranasal sinuses or skin and spread through the bloodstream to multiple organs', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050138', 'podoconiosis', 'podoconiosis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050139', 'Opisthorchis felineus infectious disease', 'A opisthorchiasis that involves parasitic infection of the liver, biliary ducts, pancreas and pancreatic ducts by Opisthorchis felineus. The symptoms include fever, general malaise, skin rash, gastrointestinal disturbances, severe anemia and liver damage', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050140', 'acute diarrhea', 'A diarrhea that is of rapid onset and course characterized by frequent loose or liquid bowel movements. Acute diarrhea is a common cause of death in developing countries and the second most common cause of infant deaths worldwide', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050141', 'intestinal botulism', 'A botulism that involves intoxication caused by botulinum neurotoxins (BoNTA, B, E and F) in adults, has_material_basis_in Clostridium botulinum A, has_material_basis_in Clostridium botulinum B, has_material_basis_in Clostridium botulinum E and has_material_basis_in Clostridium botulinum F, which are transmitted_by ingestion of bacterial spores, which then grow in the intestine and release toxins', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050143', 'asymptomatic dengue', 'A dengue disease that results_in infection, has_material_basis_in Dengue virus [NCBITaxon:12637] with four serotypes (Dengue virus 1, 2, 3 and 4), which are transmitted_by Aedes mosquito bite. The infection has no manifestations of symptoms', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050144', 'Kartagener syndrome', 'A primary ciliary dyskinesia that is characterized by sinusitis, bronchiectasis and situs inversus with dextrocardia resulting from dysfunction of the cilia during embryologic development', 'Kartagener\'s syndrome', 'NCI:C84797|UMLS_CUI:C0022521|MESH:D007619|SNOMEDCT_US_2016_03_01:86204009|ORDO:98861|SNOMEDCT_US_2016_03_01:42402006', '2', 'DOID:0050144');
INSERT INTO `disease_info` VALUES ('DOID:0050145', 'adenoiditis', 'An upper respiratory tract disease which involves inflammation, pain, and swelling of the adenoid tissue due to the infection by bacteria and viruses. It occurs primarily in children and may be secondary to an allergy, infection of nose or throat and an obstruction of the eustachian tube. The infection has_symptom pain, has_symptom redness, has_symptom swelling, and has_symptom difficulty swallowing', 'chronic adenoiditis', 'ICD10CM:J35.02|SNOMEDCT_US_2016_03_01:232420002|SNOMEDCT_US_2016_03_01:195794009|UMLS_CUI:C0396023|ICD9CM:474.01', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050146', 'autoimmune glomerulonephritis', 'autoimmune glomerulonephritis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050147', 'otomycosis', 'An otitis externa which is a disease of the ear produced by the growth of fungi in the external auditory canal. It is characterized by inflammation, pruritus, scaling and severe discomfort. The most common fungi are Aspergillus niger and Candida albicans', 'Singapore ear', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050148', 'laryngotracheitis', 'An upper respiratory tract disease involving inflammation of both larynx and trachea often caused by viral infection. The infection can close off the windpipe', '', 'SNOMEDCT_US_2016_03_01:276443001|ICD10CM:J04|SNOMEDCT_US_2016_03_01:155505008|ICD10CM:J04.2|ICD9CM:464.2|UMLS_CUI:C0155811|ICD10CM:J37.1|SNOMEDCT_US_2016_03_01:64375000|SNOMEDCT_US_2016_03_01:155508005|SNOMEDCT_US_2016_03_01:195697006|ICD9CM:476.1|UMLS_CUI:C0155837|ICD9CM:464|SNOMEDCT_US_2016_03_01:195694004|SNOMEDCT_US_2016_03_01:195679003|SNOMEDCT_US_2016_03_01:83271005|SNOMEDCT_US_2016_03_01:195703007', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050150', 'Pontiac fever', 'A legionellosis that involves a milder respiratory illness without pneumonia. Symptoms include fever, headache and muscle aches which last for 2 to 5 days', '', '', '5', 'ORPHA:99748');
INSERT INTO `disease_info` VALUES ('DOID:0050151', 'tracheobronchial tuberculosis', 'A pulmonary tuberculosis involving inflammation of trachea and bronchi. The symptoms include dry cough followed by dyspnea, localized wheezing, hemoptysis, hoarseness, anorexia, weight loss, chest pain and fever', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050152', 'aspiration pneumonia', 'A bacterial pneumonia which is an acute pulmonary inflammatory response that develops after the inhalation of colonized oropharyngeal material containing bacteria. It is seen in individuals with dysphagia and gastric dysmotility. The disease has symptom tachypnea and has symptom cough', '', 'SNOMEDCT_US_2016_03_01:47839005|MESH:D011015|UMLS_CUI:C0032290|ICD10CM:J69.0|SNOMEDCT_US_2016_03_01:422588002', '2', 'DOID:0050152');
INSERT INTO `disease_info` VALUES ('DOID:0050153', 'pulmonary aspergilloma', 'An aspergillosis that presents as a clump of tangled mass of Aspergillus fungus fibres, blood clots, and white blood cells, which exists in the cavities of the lungs that develop in an area of previous lung disease or lung scarring', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050154', 'mycoplasmal pneumonia', 'A bacterial pneumonia caused by the genus Mycoplasma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050155', 'sensory system disease', 'A nervous system disease which is located in a part of the nervous system responsible for processing sensory information that consists of sensory receptors, neural pathways, and parts of the brain involved in sensory perception. Commonly recognized sensory systems are those for vision, hearing, somatic sensation (touch), taste and olfaction (smell)', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050156', 'idiopathic pulmonary fibrosis', 'An idiopathic interstitial pneumonia which is a distinctive type of chronic fibrosing interstitial pneumonia with thick scarring in the lung creating a honeycomb appearance. The main symptoms start insidiously as shortness of breath on exertion, cough, and diminished stamina. Other common complaints include weight loss and fatigue. The level of oxygen in the blood decreases, and the skin may take on a bluish tinge (called cyanosis) and the ends of the fingers may become thick or club-shape. In most people, symptoms worsen over a period ranging from about 6 months to several years', 'FIBROCYSTIC PULMONARY DYSPLASIA|IDIOPATHIC PULMONARY FIBROSIS, FAMILIAL|cryptogenic fibrosing alveolitis', 'ICD9CM:516.31|NCI:C35715|SNOMEDCT_US_2016_03_01:196125002|SNOMEDCT_US_2016_03_01:237121003|UMLS_CUI:C1800706|SNOMEDCT_US_2016_03_01:426437004|OMIM:178500|SNOMEDCT_US_2016_03_01:28168000|EFO:0000768|NCI:C35716|ICD10CM:J84.112|SNOMEDCT_US_2016_03_01:233721005|MESH:D054990', '1', 'OMIM:178500|DOID:0050156');
INSERT INTO `disease_info` VALUES ('DOID:0050157', 'cryptogenic organizing pneumonia', 'An idiopathic interstitial pneumonia characterized by lung inflammation and scarring that obstructs the small airways and air sacs of the lungs (alveoli). A flu-like illness, with a cough, fever, a feeling of illness (malaise), fatigue, and weight loss, heralds the onset in about 50% of people. Frequent presence of crackling sounds (called Velcro crackles) when the doctor listens with a stethoscope', 'bronchiolitis obliterans organizing pneumonia|BOOP|Cryptogenic organizing pneumonitis|idiopathic bronchiolitis obliterans with organizing pneumonia', 'ICD10CM:J84.116|SNOMEDCT_US_2016_03_01:129458007|NCI:C62586|MESH:D018549|ICD9CM:516.36|UMLS_CUI:C0242770', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050158', 'desquamative interstitial pneumonia', 'An idiopathic interstitial pneumonia that is characterized by the accumulation of bronchiolocentric alveolar macrophages in alveolar spaces and interstitial inflammation and involves mild bronchiolar fibrosis and chronic inflammation', 'RBILD|respiratory bronchiolitis-associated interstitial lung disease|familial desquamative interstitial pneumonitis', 'UMLS_CUI:C0238378|ICD10CM:J84.115|ICD9CM:516.34|ICD9CM:516.37|MESH:C562470|OMIM:263000|SNOMEDCT_US_2016_03_01:8549006|ICD10CM:J84.117|NCI:C35288', '1', 'DOID:0050158');
INSERT INTO `disease_info` VALUES ('DOID:0050159', 'lymphoid interstitial pneumonia', 'An idiopathic interstitial pneumonia which involves diffuse interstitial infiltration of involved areas mostly with T lymphocytes, plasma cells, and macrophages. Lymphoid hyperplasia is frequently seen. Onset is often slow with gradually increasing cough and breathlessness over 3 or more years. Fever, weight loss, chest pain, and arthralgia are occasionally found. Crackles may be detected as the disease progresses', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050160', 'inhalation anthrax', 'An anthrax disease that results_in infection located_in lung lymph nodes brought on by breathing in the spores of the bacteria Bacillus anthracis. The first symptoms of inhalation anthrax are like cold or flu symptoms and can include a sore throat, mild fever and muscle aches. Later symptoms include cough, chest discomfort, shortness of breath, tiredness and muscle aches', 'woolsorters\' disease|respiratory anthrax|pulmonary anthrax|wool-sorters\' disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050161', 'lower respiratory tract disease', 'A respiratory system disease which involves the lower respiratory tract', '', 'ICD9CM:478.1|UMLS_CUI:C0029581|SNOMEDCT_US_2016_03_01:266346007|SNOMEDCT_US_2016_03_01:195823002|ICD9CM:478.19', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050162', 'influenza encephalopathy', 'influenza encephalopathy', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050163', 'influenza myocarditis', 'influenza myocarditis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050164', 'influenza myositis', 'influenza myositis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050165', 'tuberculous mesenteric gland', 'A tuberculosis that involves infection of the mesenteric glands by tuberculosis causing mycobacteria. The symptoms include distended abdomen, persistent intestinal indigestion, diarrhea, flatulence, and abdominal pain', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050166', 'tuberculous salpingitis', 'An urogenital tuberculosis that results_in formation of granulomas located_in fallopian tube', '', 'SNOMEDCT_US_2016_03_01:186243007|ICD10CM:A18.17|UMLS_CUI:C0152828|ICD9CM:016.6|SNOMEDCT_US_2016_03_01:186242002', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050167', 'autoimmune polyendocrine syndrome type 1', 'An autoimmune polyendocrine syndrome that is inherited in an autosomal recessive fashion, which is characterized by abnormal functioning of the immune system that causes auto-reactivity against endocrine organs', 'Whitaker syndrom|autoimmune polyendocrinopathy-candidiasis-ectodermal dystrophy|Autoimmune Polyglandular Syndrome I', 'OMIM:240300', '1', 'OMIM:240300|DOID:0050167');
INSERT INTO `disease_info` VALUES ('DOID:0050168', 'autoimmune polyendocrine syndrome type 2', 'An autoimmune polyendocrine syndrome that is characterized by abnormal functioning of the immune system that causes auto-reactivity against endocrine organs. It is more heterogeneous and has not been linked to one gene', 'Schmidt syndrome', 'OMIM:269200', '1', 'DOID:0050168');
INSERT INTO `disease_info` VALUES ('DOID:0050169', 'cutaneous lupus erythematosus', 'A lupus erythematosus that causes skin lesions on parts of the body that are exposed to sunlight', '', '', '2', 'DOID:0050169');
INSERT INTO `disease_info` VALUES ('DOID:0050170', 'Jamestown Canyon encephalitis', 'A California virus encephalitis that results_in inflammation located_in brain, has_material_basis_in Jamestown Canyon virus, which is transmitted_by Culiseta, transmitted_by Aedes, and transmitted_by Anopheles species of mosquitoes. The infection has_symptom headache, has_symptom fever, has_symptom neck stiffness, has_symptom photophobia, has_symptom nausea, has_symptom vomiting, and has_symptom seizures', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050171', 'snowshoe hare encephalitis', 'A California virus encephalitis that results_in inflammation located_in brain, has_material_basis_in Snowshoe hare virus, which is transmitted_by Aedes mosquitoes. The infection has_symptom headache, has_symptom fever, has_symptom anorexia, and has_symptom seizures', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050172', 'trivittatus encephalitis', 'A California virus encephalitis that results_in inflammation located_in brain, has_material_basis_in Trivittatus virus, which is transmitted_by Ochlerotatus trivittatus mosquito. The infection has_symptom headache, has_symptom fever, has_symptom disorientation, has_symptom tremors, has_symptom convulsions, has_symptom paralysis, and has_symptom coma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050173', 'inkoo encephalitis', 'A California virus encephalitis that results_in inflammation located_in brain, has_material_basis_in Inkoo virus, which is transmitted_by Ochlerotatus communis mosquito. The infection has_symptom stiff neck, has_symptom lethargy, has_symptom headache, has_symptom fever, and has_symptom seizures', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050174', 'Kunjin encephalitis', 'A West Nile encephalitis that results_in infection located_in brain, has_material_basis_in Kunjin virus, a subtype of West Nile Virus, which is transmitted_by Culex annulirostris mosquito bite. The infection has_symptom fever, has_symptom rigor, has_symptom headache, has_symptom confusion, and has_symptom lethargy', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050175', 'tick-borne encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Tick-borne encephalitis virus, which is transmitted_by Ixodes ticks. The infection has_symptom drowsiness, has_symptom confusion, has_symptom sensory disturbances, and has_symptom paralysis', 'west-Siberian encephalitis|Siberian tick-borne encephalitis|Taiga encephalitis|Far Eastern TBE|Central European encephalitis|Western European tick-borne encephalitis|Russian spring-summer encephalitis', 'ICD10CM:A84.1|SNOMEDCT_US_2016_03_01:16901001|UMLS_CUI:C0014054|ICD9CM:063.2|MESH:D004675', '2', 'DOID:0050175');
INSERT INTO `disease_info` VALUES ('DOID:0050177', 'monogenic disease', 'A genetic disease that is the result of one or more abnormal alleles and may be dominant (a single copy of the abnormal allele is sufficient to give rise to the disease), semi-dominant, or recessive (requiring both copies of the gene to have an abnormal allele)', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050178', 'complex genetic disease', 'A genetic disease that require multiple abnormal alleles to manifest are complex. These diseases are termed multifactorial or polygenic. Expressivity or penetrance of the disease is complex and is associated with multiple genes in combination with lifestyle and environmental factors. Multifactoral genetic diseases include heart disease and diabetes, although a subset of diabetes may be classified as a monogenic disease (due to the presence of a single abnormal allele)', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050179', 'Powassan encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Powassan virus, which is transmitted_by Ixodes and transmitted_by Dermacentor species of ticks. The infection has_symptom headache, has_symptom fever, has_symptom vomiting, has_symptom stiff neck, has_symptom sleepiness, has_symptom breathing distress, has_symptom tremors, has_symptom confusion, has_symptom seizures, has_symptom paralysis, and has_symptom coma', '', '', '2', 'DOID:0050179');
INSERT INTO `disease_info` VALUES ('DOID:0050180', 'Colorado tick fever encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Colorado tick fever virus which is transmitted_by rocky mountain wood tick, Dermacentor andersoni. The infection has_symptom fever, has_symptom headache, has_symptom nausea, has_symptom stiff neck, has_symptom chills, has_symptom hallucinations, has_symptom disorientation, and has_symptom memory loss', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050181', 'Herpes simplex virus encephalitis', 'A Simplexvirus infectious disease that results_in infection located_in brain, has_material_basis_in Human herpesvirus 1 or has_material_basis_in Human herpesvirus 2. The infection has_symptom headache, has_symptom fever, has_symptom personality and behavioral changes, has_symptom seizures, has_symptom partial paralysis, and has_symptom hallucinations', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050182', 'Varicella-zoster virus encephalitis', 'A Varicellovirus infectious disease that results_in infection located_in brain, has_material_basis_in Human herpesvirus 3 and has_symptom lethargy, has_symptom rash, has_symptom confusion, has_symptom hallucinations, has_symptom weakness, has_symptom paralysis, has_symptom numbness, and has_symptom parasthesias', 'Herpes zoster encephalitis|Varicella Zoster Encephalitis|Postchickenpox encephalitis|postvaricella encephalitis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050183', 'Epstein-Barr virus encephalitis', 'An Epstein-Barr virus infectious disease that results_in inflammation, located_in brain, has_material_basis_in Human herpesvirus 4 and has_symptom seizures, has_symptom altered consciousness, and has_symptom cerebellar ataxia', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050184', 'Measles virus encephalitis', 'A Measles virus infectious disease that results_in inflammation located_in brain, has_material_basis_in Measles virus, which is transmitted_by contact with oronasal secretions, or semen of an infected person. The infection has_symptom headache, has_symptom irritability, has_symptom drowsiness, has_symptom abnormal reflexes, has_symptom involuntary movements, has_symptom hemiplagia, has_symptom ataxia, has_symptom nystagmus, and has_symptom dysphasia', 'Post-measles encephalitis|Post measles encephalitis (disorder)|postmeasles encephalitis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050185', 'erythema multiforme', 'A skin disease that is a type of allergic reaction located_in skin, which occurs in response to medications, infections, or illness', '', '', '2', 'DOID:0050185');
INSERT INTO `disease_info` VALUES ('DOID:0050186', 'Cytomegalovirus encephalitis', 'A Cytomegalovirus infectious disease that results_in inflammation, located_in brain, has_material_basis_in Human herpesvirus 5, has_symptom confusional syndrome, has_symptom seizures, has_symptom coma, has_symptom dysphasia, and has_symptom cranial nerve palsies', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050187', 'Rubella virus encephalitis', 'A Rubella virus infectious disease that results_in inflammation located_in brain, has_material_basis_in Rubella virus, which is transmitted_by droplet spread of oronasal secretions from the infected person through coughing and sneezing, and transmitted_by congenital method. The infection has_symptom confusion, has_symptom drowsiness, has_symptom delirium, has_symptom convulsions, has_symptom cranial nerve palsies, and has_symptom coma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050188', 'coxsackievirus encephalitis', 'An Enterovirus infectious disease that involves inflammation located_in brain, has_material_basis_in group A coxsackievirus or has_material_basis_in group B coxsackievirus, which are transmitted_by ingestion of food contaminated with feces, transmitted_by contact with pharyngeal secretions, or transmitted_by droplet spread of oronasal secretions. The infection has_symptom reduced level of consciousness, has_symptom confusion, has_symptom irritability, has_symptom seizures, and has_symptom coma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050189', 'polioencephalitis', 'An Enterovirus infectious disease that results_in inflammation located_in brain, has_material_basis_in polioviruses, which are transmitted_by ingestion of food contaminated with feces. The infection has_symptom tremors, has_symptom nystagmus, has_symptom loss of conjugate eye movements, has_symptom muscle rigidity, has_symptom hemiparesis, and has_symptom coma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050190', 'adenovirus encephalitis', 'An adenovirus infectious disease that results_in inflammation located_in brain, has_material_basis_in Human adenovirus 2 or has_material_basis_in Human adenovirus 4. The symptoms include fever, stupor, nuchal rigidity, loss of consciousness and seizures', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050191', 'influenza virus encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Influenza A virus or has_material_basis_in Influenza B virus, which are transmitted_by droplet spread of oronasal secretions during coughing, sneezing, or talking from an infected person. The infection has_symptom fever, has_symptom reduced consciousness, and has_symptom ocular muscle palsies', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050192', 'Nipah virus encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Nipah virus, which is transmitted_by direct contact with sick person or animals, or their contaminated tissues. The infection has_symptom dizziness, has_symptom drowsiness, has_symptom altered consciousness, has_symptom disorientation, and has_symptom coma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050193', 'Lymphocytic choriomeningitis virus encephalitis', 'A lymphocytic choriomeningitis that results_in inflammation located_in brain, has_material_basis_in Lymphocytic choriomeningitis virus, which is transmitted_by common house mouse, Mus musculus. The infection has_symptom drowsiness, has_symptom confusion, has_symptom sensory disturbances, and has_symptom paralysis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050194', 'Argentine hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Junin virus, which is transmitted_by rodent, Calomys musculinus. The infection has_symptom fever, has_symptom fatigue, has_symptom malaise, has_symptom leukopenia, has_symptom thrombocytopenia, and has_symptom hemorrhagic manifestations', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050195', 'Bolivian hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Machupo virus, which is transmitted_by vesper mouse, Calomys callosus. The infection has_symptom fever, has_symptom headache, has_symptom fatigue, has_symptom myalgia, has_symptom arthralgia, has_symptom bleeding from the oral and nasal mucosa, and has_symptom bleeding from the bronchopulmonary, gastrointestinal and genitourinary tracts', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050196', 'Venezuelan hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Guanarito virus, which is transmitted_by cotton rat, Sigmodon alstoni and transmitted_by cane mouse, Zygodontomys brevicauda. The infection has_symptom fever, has_symptom headache, has_symptom myalgia, has_symptom sore throat, has_symptom weakness, has_symptom anorexia, has_symptom nausea, has_symptom vomiting, has_symptom convulsions, has_symptom epistaxis, has_symptom bleeding gums, has_symptom hematemesis, has_symptom melena, and has_symptom menorrhagia', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050197', 'Brazilian hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has material basis in Sabia virus, which is transmitted by rodents. The infection has symptom fever, has symptom eye redness, has symptom fatigue, has symptom dizziness, has symptom muscle aches, has symptom loss of strength, and has symptom bleeding under the skin, internal organs, or from body orifices like the mouth, eyes or ears', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050198', 'Chapare hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has material basis in Chapare virus. The infection has symptom headache, has symptom joint pain, has symptom muscle pain, has symptom vomiting, has symptom shock, and has symptom bleeding', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050199', 'Whitewater Arroyo hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Whitewater Arroyo virus, which is transmitted_by white-throated woodrats (Neotoma albigula). The infection has_symptom fever, has_symptom headache, has_symptom myalgia, and has_symptom hemorrhagic manifestations', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050200', 'Korean hemorrhagic fever', 'A hemorrhagic fever with renal syndrome that results_in infection located_in kidney, has_material_basis_in Hantaan virus, which is transmitted_by the eurasian field mouse, Apodemus agrarius, or has_material_basis_in Seoul virus, which is transmitted_by norwegian rat, Rattus norvegicus. The infection has_symptom headache, has_symptom back pain, has_symptom abdominal pain, has_symptom fever, has_symptom chills, has_symptom nausea, has_symptom blurred vision, has_symptom flushing of the face, has_symptom redness of the eyes, has_symptom rash, has_symptom low blood pressure, has_symptom acute shock, has_symptom vascular leakage, and has_symptom acute kidney failure, which can cause severe fluid overload', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050201', 'nephropathia epidemica', 'A hemorrhagic fever with renal syndrome that results_in infection located_in kidney, has_material_basis_in Puumala virus, which is transmitted_by bank vole, Myodes glareolus [NCBITaxon:447135]. The infection has_symptom headache, has_symptom nausea, has_symptom back pain, has_symptom vomiting, has_symptom myalgia, has_symptom abdominal pain, has_symptom internal hemorrhage, and has_symptom renal failure', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050202', 'lujo hemorrhagic fever', 'A viral infectious disease that results_in infection, has_material_basis_in Lujo virus, which has_symptom bleeding', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050203', 'Cytomegalovirus hepatitis', 'A Cytomegalovirus infectious disease that results_in inflammation, located_in liver, has_material_basis_in Human herpesvirus 5, has_symptom nausea, has_symptom vomiting, has_symptom headache, has_symptom abdominal pain, has_symptom dark urine, and has_symptom jaundice. Clinical feature includes atypical lymphocytes in the blood', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050204', 'Epstein-Barr virus hepatitis', 'A viral hepatitis that results_in inflammation, located_in liver, has_material_basis_in Human herpesvirus 4 and has_symptom headache, has_symptom fatigue, has_symptom fever, has_symptom abdominal pain, has_symptom nausea, and has_symptom jaundice', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050205', 'Herpes simplex virus hepatitis', 'A Simplexvirus infectious disease that results_in inflammation located_in liver, has-agent Human herpesvirus 1 or has_material_basis_in Human herpesvirus 2, and has_symptom fever, has_symptom nausea, has_symptom vomiting, has_symptom abdominal pain, and has_symptom herpetic lesions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050206', 'adenovirus hepatitis', 'An adenovirus infectious disease that involves inflammation of the liver caused by Human adenovirus 1, has_material_basis_in Human adenovirus 2, or has_material_basis_in Human adenovirus 5. The symptoms include fever, coagulopathy and gastrointestinal bleeding. Histopathological examination reveals widespread hepatic necrosis with hemorrhage', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050207', 'Rubella virus hepatitis', 'A Rubella virus infectious disease that results_in inflammation located_in liver, has_material_basis_in Rubella virus, which is transmitted_by droplet spread of oronasal secretions from the infected person through coughing and sneezing, and transmitted_by congenital method. The infection results in hepatic necrosis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050208', 'yellow fever hepatitis', 'A Yellow fever virus infectious disease that results_in inflammation located_in liver, has_material_basis_in Yellow fever virus. The infection has_symptom fever, has_symptom chills, has_symptom headache, has_symptom myalgia, has_symptom weakness, has_symptom nausea, has_symptom vomiting, has_symptom jaundice, and has_symptom hemorrhagic manifestations', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050209', 'Measles virus hepatitis', 'A Measles virus infectious disease that results_in inflammation located_in liver, has_material_basis_in Measles virus, which is transmitted_by contact with oronasal secretions, or semen of an infected person. The infection causes hepatic dysfunction and has_symptom jaundice', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050210', 'Varicella-zoster virus hepatitis', 'A Varicellovirus infectious disease that results_in inflammation located_in liver, has_material_basis_in Human herpesvirus 3, has_symptom skin rash, has_symptom oral lesions, has_symptom severe abdominal and back pain, has_symptom fever, has_symptom chills, has_symptom malaise, and has_symptom fatigue', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050211', 'swine influenza', 'An influenza that results_in infection located_in respiratory tract of pigs and humans, has_material_basis_in Influenza C virus, or has_material_basis_in Influenza A virus subtypes (H1N1, H1N2, H3N1, H3N2, and H2N3), which are transmitted_by direct contact with infected pigs. The infection in humans has_symptom fever, has_symptom lethargy, has_symptom lack of appetite, has_symptom coughing, has_symptom runny nose, has_symptom sore throat, has_symptom nausea, has_symptom vomiting, and has_symptom diarrhea', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050212', 'Campylobacter jejuni gastroenteritis', 'A primary Campylobacter infectious disease that involves inflammation of the stomach and intestines caused by Campylobacter jejuni infection, which is characterized by diarrhea (may be bloody), abdominal pain, fever and vomiting', 'Campylobacter Gastroenteritis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050213', 'Vibrio gastroenteritis', 'A Vibrio infectious disease that involves inflammation of the stomach and intestines caused by noncholera Vibrio species like Vibrio parahaemolyticus, Vibrio fluvialis and Vibrio vulnificus. Some species produce enterotoxins, which impair intestinal absorption, resulting in watery diarrhea. The symptoms include abdominal cramps, fever, vomiting, nausea and diarrhea', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050214', 'Lambert-Eaton myasthenic syndrome', 'A neuromuscular junction disease that is characterized by an abnormality of acetylcholine (ACh) release at the neuromuscular junction which results from an autoimmune attack against voltage-gated calcium channels (VGCC) on the presynaptic motor nerve terminal', 'LEMS|Eaton-Lambert syndrome|Lambert-Eaton syndrome', 'UMLS_CUI:C0022972|NCI:C3155|SNOMEDCT_US_2016_03_01:230688006|MESH:D015624|ICD9CM:358.3|SNOMEDCT_US_2016_03_01:56989000|ICD10CM:G70.80', '1', 'ORPHA:43393|DOID:0050214');
INSERT INTO `disease_info` VALUES ('DOID:0050215', 'Staphylococcus gastroenteritis', 'A staphylococcal infectious disease that is caused by ingestion of food containing enterotoxins, which are produced by staphylococcal species. The symptoms include abdominal cramps, diarrhea, headache and fever', 'Staphylococcus Aureus Gastroenteritis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050216', 'Bacillus cereus gastroenteritis', 'A primary Bacillaceae infectious disease that is caused by ingestion of food contaminated with Bacillus cereus, which produces enterotoxins in the intestine. The symptoms include vomiting, abdominal cramps, fever and diarrhea', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050217', 'Sapovirus gastroenteritis', 'A viral infectious disease that results_in inflammation located_in stomach and located_in intestine, has_material_basis_in Sapovirus, which is transmitted_by ingestion of contaminated food. The infection has_symptom nausea, has_symptom vomiting, has_symptom abdominal pain, and has_symptom diarrhea', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050218', 'polycystic echinococcosis', 'An echinococcosis that is caused by the larvae of Echinococcus vogeli or Echinococcus oligarthrus, which infect the liver', 'neotropical echinococcosis|human polycystic hydatid disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050219', 'Hepeviridae infectious disease', 'A (+)ssRNA virus infectious disease that results_in infection in animals and humans, located_in liver, has_material_basis_in Hepeviridae viruses', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050220', 'Coxiella burnetii pneumonia', 'A Q fever that is a zoonotic infectious disease caused by Coxiella burnetii, a bacterium which affects both humans and animals. The symptoms include fever, headache, cough, pleuritic chest pain, myalgia and arthralgia. Infection of humans usually occurs by inhalation of these organisms from air that contains airborne barnyard dust contaminated by dried placental material, birth fluids, or excreta of infected herd animals, ingestion of contaminated milk, tick bites and human to human transmission', 'Q fever pneumonia', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050221', 'Coxiella burnetii hepatitis', 'A Q fever that involves inflammation of the liver caused by Coxiella burnetti, which results in the formation of granulomas. The symptoms include fever, malaise, hepatomegaly with right upper abdominal pain, and jaundice', 'Q fever hepatitis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050222', 'selective IgM deficiency disease', 'A selective immunoglobulin deficiency disease thatis a dysgammaglobulinemia resulting from decreased levels of immunoglobulin M (IgM) production to roduction of other antibodies', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050223', 'candidal gastritis', 'A candidiasis that involves inflammation of the gastric mucosa caused by Candida albicans infection. The symptoms include dyspepsia, gastric ulcers, gastric perforations, nausea and vomiting', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050224', 'Helicobacter heilmannii infectious disease', 'A primary Helicobacter infectious disease that involves inflammation of the stomach lining caused by Candidatus Helicobacter heilmannii, which is associated with peptic ulceration', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050225', 'Histoplasma capsulatum gastritis', 'An American histoplasmosis that results_in inflammation, located_in stomach lining in immunocompromised patients, has_material_basis_in Histoplasma capsulatum var capsulatum, transmitted_by airborne spores and results_in_formation_of gastric mass with ulceration, and results_in_formation_of hypertrophic gastric folds', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050226', 'Morganella morganii intestinal infectious disease', 'An opportunistic bacterial infectious disease that involves infection of the intestine caused by Morganella morganii', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050227', 'Vibrio cholerae O139 cholera', 'A cholera that involves infection of the intestine caused by Vibrio cholerae O139 strain', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050228', 'amebic dysentery', 'An amebiasis that involves infection of the intestine with Entamoeba histolytica trophozoites, which adhere to and kill colonic epithelial cells causing diarrhea with blood and mucus. The symptoms inlcude abdominal pain and fever', 'amebic dysentery|amoebic dysentery|Entamoeba histolytica dysentery', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050229', 'Escherichia coli dysentery', 'An enteroinvasive Escherichia coli infectious disease that involves infection of the intestine caused by enteroinvasive Escherichia coli. The symptoms include fever, bloody diarrhea, and dehydration', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050230', 'intestinal capillariasis', 'A capillariasis that involves infection of the intestine with Capillaria causing abdominal pain, weight loss, stomach growling, depressed levels of potassium and albumin in the blood, and diarrhea', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050231', 'hepatic capillariasis', 'A capillariasis that involves infection of the liver with Capillaria, which manifests as an acute or subacute hepatitis with eosinophilia. The symptoms include abdominal pain, fever, chills, hepatitis, ascites, hepatolithiasis, and hepatomegaly', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050232', 'pulmonary capillariasis', 'A capillariasis that involves infection of the lungs with Capillaria, resulting in fever, cough, asthma, and pneumonia', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050233', 'Balamuthia mandrillaris infectious disease', 'A parasitic protozoa infectious disease that involves infection caused by a free-living ameba Balamuthia mandrillaris resulting in encephalitis and skin lesions in humans and animals', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050234', 'Acanthamoeba infectious disease', 'A parasitic protozoa infectious disease that involves an infection in humans and animals caused by a parasitic protozoan of genus Acanthamoeba, which is an opportunistic pathogen occuring in patients with weakened immune system', 'free-living ameba infectious disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050235', 'Alveolata infectious disease', 'A parasitic protozoa infectious disease that involves infection caused by alveolates, which are single-celled eukaryotes', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050236', 'Heterolobosea infectious disease', 'A parasitic protozoa infectious disease that involves infection caused by the members of the class Heterolobosea, which move with eruptive bulges and show transformation to a temporary flagellate stage', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050237', 'Euglenozoa infectious disease', 'A parasitic protozoa infectious disease that involves infection caused by euglenozoans, which are single-celled flagellates', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050238', 'Parabasalia infectious disease', 'A parasitic protozoa infectious disease that involves infection caused by parabasalids, which are anaerobic flagellated protozoans', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050239', 'Fornicata infectious disease', 'A parasitic protozoa infectious disease that involves infection caused by fornicates, which are unicellular flagellates with one or two karyomastigonts per cell', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050240', 'Trichomonadida infectious disease', 'A Parabasalia infectious disease that involves infection with anaerobic flagellate parasites belonging to the order Trichomonadida. They typically have four to six flagella at the cell\'s apical pole', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050241', 'Tritrichomonadida infectious disease', 'A Parabasalia infectious disease that involves infection with anaerobic flagellate parasites belonging to the order Tritrichomonadida, which are characterized by a single mastigont with four flagella, and both a comb-like structure and an infrakinetosomal body', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050242', 'primary amebic meningoencephalitis', 'A parasitic protozoa infectious disease that involves infection of the central nervous system caused by Naegleria fowleri. The symptoms include headache, nausea, rigidity of the neck muscles, vomiting, delirium, seizures and coma', 'Naegleria fowleri infection', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050243', 'Apicomplexa infectious disease', 'An Alveolata infectious disease that involves infection caused by the members of the phylum Apicomplexa, which are unicellular, spore forming parasites of animals and humans', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050244', 'Coccidia infectious disease', 'An Apicomplexa infectious disease that involves infection caused by the members of the class Coccidia, which are spore-forming, single-celled and obligate intracellular parasites of the intestinal tract of animals and humans', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050245', 'Aconoidasida infectious disease', 'An Apicomplexa infectious disease that involves infection caused by the members of the class Aconoidasida', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050246', 'granulomatous amebic encephalitis', 'A parasitic protozoa infectious disease that results in infection of the brain caused by Acanthamoeba or Balamuthia mandrillaris. The symptoms include headaches, altered mental status, and focal neurologic deficit, which progresses over several weeks to death', 'Acanthamoeba granulomatous encephalitis|granulomatous amoebic encephalitis|Acanthamoeba encephalitis|Granulomatous Amebic Encephalitis due to Acanthamoeba', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050247', 'parasitic stramenopiles infectious disease', 'A parasitic infectious disease that involves infection caused by parasitic members of the taxon stramenopiles, in which the flagellate cells possess two different shaped flagella. This taxon contains both unicellular and multicellular organisms', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050249', 'Brugia timori filariasis', 'A filarial elephantiasis that involves parasitic infection by the nematode Brugia timori, which inhabits the lymphatics. The symptoms include fever and chronic lymphedema', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050250', 'philophthalmiasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection of the eyes by Philophthalmus species. External ocular philophthalmiasis manifests as follicular conjunctivitis and superficial keratitis. Sub-conjunctival ocular philophthalmiasis consists of a mild edema with minimal cellular reaction', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050251', 'coenurosis', 'A parasitic helminthiasis infectious disease that involves infection by metacestode larval stage (coenurus) of Taenia multiceps or Taenia serialis. Coenuri in the skin or subcutaneous tissue present as painless nodules, which manifest on the trunk, sclera, subconjuctiva, neck, shoulders, head and limbs. Coenuri in the central nervous system may cause headache, fever, vomiting, nerve palsies, jacksonian epilepsy, pachymeningitis, obstructive or communicating hydrocephalus, and intracranial arteritis with transient hemiparesis. Coenuri in the eye cause both intraocular and orbital infections', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050252', 'Dipylidium caninum infectious disease', 'A parasitic helminthiasis infectious disease that involves parasitic infection in dogs, cats and humans caused by cysticercoid larvae of Dipylidium caninum through ingestion of larvae contaminated flea, which results in diarrhea and restlessness', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050253', 'mesocestoidiasis', 'A parasitic helminthiasis infectious disease that involves parasitic cestode infection caused by Mesocestoides lineatus resulting in nausea, diarrhea, abdominal discomfort and vomiting', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050254', 'acanthocephaliasis', 'A parasitic helminthiasis infectious disease that involves infection of the intestine caused by thorny-headed worms Macracanthorhynchus or Moniliformis moniliformis. The infection has_symptom abdominal pain, has_symptom distension, has_symptom fever, has_symptom decreased appetite, has_symptom nausea, has_symptom vomiting, has_symptom weight loss, has_symptom diarrhea, and has_symptom constipation or has_symptom bloody stools', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050255', 'Uncinaria stenocephala infectious disease', 'A parasitic helminthiasis infectious disease that involves infection of the small intestine in humans, cats, dogs and foxes by the nematode Uncinaria stenocephala. The symptoms include diarrhea and hypoproteinemia in heavier infections', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050256', 'angiostrongyliasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection of the intestine, central nervous system and eyes by Angiostrongylus cantonensis or Angiostrongylus costaricensis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050257', 'Angiostrongylus cantonensis infectious disease', 'An angiostrongyliasis that involves infection of the brain by the larvae of Angiostrongylus cantonensis causing eosinophilic meningitis. The symptoms include severe headache, nausea, vomiting, neck stiffness, seizures, and neurologic abnormalities. Ocular invasion by the larvae can occur', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050258', 'Angiostrongylus costaricensis infectious disease', 'An angiostrongyliasis that involves infection of the intestine by Angiostrongylus costaricensis, which is characterized by the formation of granulomas with heavy eosinophilic infiltration in the abdominal cavity', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050259', 'baylisascariasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection of the intestine caused by the larvae of Baylisascaris procyonis, which can invade the spinal cord, brain, and eye of humans, resulting in permanent neurologic damage, blindness, or death', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050260', 'dioctophymiasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection by the nematode Dioctophyme renale in humans after eating undercooked food. The larvae are found in the subcutaneous nodules and kidneys', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050261', 'thelaziasis', 'A parasitic helminthiasis infectious diseasea that involves infection of the eyes in humans by nematode Thelazia callipaeda causing varying degrees of inflammation and lacrimation. In heavier infections, photophobia, edema, conjunctivitis, and blindness occurs', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050262', 'Acoelomata infectious disease', 'A parasitic helminthiasis infectious disease that involves infection caused by parasitic worms, which are bilaterian, unsegmented, soft-bodied invertebrate animals with no body cavity', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050263', 'Pseudocoelomata infectious disease', 'A parasitic helminthiasis infectious disease that involves infection caused by parasitic invertebrates, which have a pseudocoel. Tissue derived from mesoderm only partly lines the fluid filled body cavity of these animals', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050264', 'Acanthocephala infectious disease', 'A Pseudocoelomata infectious disease that involves infection by parasitic worms known as thorny-headed worms, characterized by the presence of an evertable proboscis, armed with spines, which is used to pierce and hold the gut wall of the host', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050265', 'obsolete tick paralysis', 'obsolete tick paralysis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050266', 'tungiasis', 'A parasitic ectoparasitic infectious disease that is an inflammatory skin disease caused by the parasitic infestation of the female chigoe flea, Tunga penetrans in animals and humans. The symptoms include skin inflammation, severe pain, itching, and a lesion at the site of infection that is characterized by a black dot at the center of a swollen red lesion, surrounded a white halo', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050267', 'Ancylostoma caninum ancylostomiasis', 'Ancylostoma caninum ancylostomiasis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050268', 'ophthalmomyiasis', 'A myiasis that involves parasitic infestation of Oestrus ovis larvae in the eye causing severe irritation, edema, and pain', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050269', 'Trichomonas vaginalis trichomoniasis', 'A trichomoniasis that involves infection of the urogenital tract, has_material_basis_in Trichomonas vaginalis, which is transmitted through sexual contact. Symptoms include inflammation of the cervix, urethra and vagina which produce an itching or burning sensation, and yellow-green, itchy, frothy foul-smelling vaginal discharge', 'urogenital trichomonas', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050270', 'Trichomonas tenax trichomoniasis', 'A trichomoniasis that is caused by a singled-celled protozoan parasite Trichomonas tenax, which is transmitted through oral droplets, by kissing, or on fomites such as eating utensils. Trichomonas tenax causes periodonitis and bronchopulmonary trichomoniasis by aspiration from the oropharynx', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050271', 'cutaneous ascomycota mycosis', 'A cutaneous mycosis that results_in fungal infection located_in skin, located_in hair and located_in nail, has_material_basis_in Ascomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050272', 'cutaneous basidiomycota mycosis', 'A cutaneous mycosis that results_in fungal infection located_in skin, located_in hair and located_in nail, has_material_basis_in Basidiomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050273', 'Neoscytalidium dimidiatum infectious disease', 'A dermatomycosis that results_in fungal infection located_in nail, has_material_basis_in Neoscytalidium dimidiatum and has_symptom rough nail, and has_symptom crumbly nail which can separate from the nail bed', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050274', 'Scopulariopsis infectious disease', 'An opportunistic mycosis that has_material_basis_in Scopulariopsis, which results_in a systemic infection in immunocompromised individuals', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050275', 'onychomycosis', 'A dermatomycosis that results_in fungal infection located_in nail, has_material_basis_in Ascomycota fungi which are not dermatophytes and has_symptom opaque nail, has_symptom yellow-brown nail, has_symptom crumbly nail that can separate from the nail bed', '', '', '2', 'DOID:0050275');
INSERT INTO `disease_info` VALUES ('DOID:0050276', 'subcutaneous ascomycota mycosis', 'A subcutaneous mycosis that results_in fungal infection located_in skin and located_in subcutaneous tissue, has_material_basis_in Ascomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050277', 'subcutaneous fungi incertae sedis mycosis', 'A subcutaneous mycosis that results_in fungal infection located_in skin and located_in subcutaneous tissue, has_material_basis_in Fungi incertae sedis taxon members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050278', 'basidiobolomycosis', 'A subcutaneous mycosis that involves a chronic inflammatory or granulomatous fungal infection of the subcutaneous tissue of the limbs, chest, back or buttocks caused by Basidiobolus ranarum. Lesions appear as subcutaneous nodules which develop into massive, firm, indurated, painless swellings which are freely movable over the underlying muscle, but are attached to the skin which may become hyperpigmented but not ulcerated', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050279', 'conidiobolomycosis', 'An subcutaneous mycosis that is a chronic inflammatory or granulomatous fungal infection caused by Conidiobolus species, which is restricted to the nasal submucosa and characterized by polyps or palpable restricted subcutaneous masses. Symptoms include nasal obstruction, drainage and sinus pain. Subcutaneous nodules develop in the nasal and perinasal regions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050280', 'superficial ascomycota mycosis', 'A superficial mycosis that results_in fungal infection of the outermost layer located_in skin and located_in hair shaft, has_material_basis_in Ascomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050281', 'superficial basidiomycota mycosis', 'A superficial mycosis that results_in fungal infection of the outermost layer located_in skin and located_in hair shaft, has_material_basis_in Basidiomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050282', 'primary systemic ascomycota mycosis', 'A primary systemic mycosis that results_in fungal infection located_in human body, has_material_basis_in Ascomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050283', 'Stachybotrys infectious disease', 'A primary systemic mycosis that results_in systemic fungal infection in animals and humans, has_material_basis_in Stachybotrys chartarum, transmitted_by airborne spores and transmitted_by vehicle-borne ingestion and the fungus produces trichothecene mycotoxins including satratoxins causing pulmonary hemorrhage in infants', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050284', 'opportunistic ascomycota mycosis', 'An opportunistic mycosis that involves infection of the body by fungi belonging to the phylum Ascomycota', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050285', 'opportunistic basidiomycota mycosis', 'An opportunistic mycosis that results_in fungal infection located_in human body, has_material_basis_in Basidiomycota phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050286', 'opportunistic fungi incertae sedis mycosis', 'An opportunistic mycosis that results_in fungal infection located_in human body, has_material_basis_in Fungi incertae sedis taxon members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050287', 'opportunistic microsporidia mycosis', 'An opportunistic mycosis that results_in fungal infection located_in human body, has_material_basis_in Microsporidia phylum members', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050288', 'penicilliosis', 'An opportunistic mycosis that has_material_basis_in Penicillium marneffei, results_in systemic infection and has_symptom fever, has_symptom anemia, has_symptom weight loss, has_symptom lymphadenopathy, has_symptom hepatosplenomegaly, has_symptom respiratory signs, and has_symptom skin lesions', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050289', 'fusariosis', 'An opportunistic mycosis that involves localized or hematogenously disseminated fungal infection by Fusarium solani or Fusarium oxysporum. Skin lesions are seen in neutropenic patients, and indolent cellulitis or soft-tissue necrosis occur in immunocompromised patients at the site of trauma', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050290', 'trichosporonosis', 'An opportunistic mycosis that results_in disseminated infection, has_material_basis_in Trichosporon and results_in_formation_of nontender erythematous nodules anywhere on the body', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050291', 'parasitic Ichthyosporea infectious disease', 'A parasitic infectious disease that involves parasitic infection by the members of the class Ichthyosporea, which are parasites of fish and other animals', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050292', 'primary systemic mycosis', 'A systemic mycosis that results_in infection located_in human body, has_material_basis_in Fungi, which can overcome the physiological and cellular defences of the normal human host. The primary deep pathogens usually gain access to the host via the respiratory tract', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050293', 'Scopulariopsis brevicaulis infectious disease', 'An opportunistic mycosis that results_in fungal infection located_in nail, has_material_basis_in Scopulariopsis brevicaulis and has_symptom rough nail, and has_symptom crumbly nail which can separate from the nail bed', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050294', 'Scytalidium hyalinum infectious disease', 'A dermatomycosis that results_in fungal infection located_in hand, foot and nail of toe by Scytalidium hyalinum, resulting_in_formation_of lesions and has_symptom keratotic plantar surface', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050295', 'cutaneous sporotrichosis', 'A primary systemic mycosis that results_in fungal infection located_in skin and located_in subcutaneous tissue through direct inoculation from wood splinters or hay, has_material_basis_in Sporothrix schenckii, a dimorphic fungus, which results_in_formation_of erythematous papulonodular lesions evolving into either smooth or verrucose painless nodules that may ulcerate and drain', 'plaque sporotrichosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050296', 'Asfarviridae infectious disease', 'A dsDNA virus infectious disease that results_in infection in pigs, has_material_basis_in Asfarviridae viruses, which are transmitted_by soft tick bite', '', '', '5', null);
