INSERT INTO `disease_info` VALUES ('DOID:0050476', 'Barth syndrome', 'A lipid metabolism disorder that has_material_basis_in X-linked inheritance of the tafazzin gene and is characterized by decreased production of an enzyme required to produce cardiolipin', '3-methylglutaconicaciduria type 2|MGA Type 2|3-methylglutaconicaciduria type II|MGA type II', 'SNOMEDCT_US_2016_03_01:297231002|UMLS_CUI:C0574083|MESH:D056889|NCI:C84585|OMIM:302060|ICD10CM:E78.71', '1', 'OMIM:302060|DOID:0050476');
