INSERT INTO `disease_info` VALUES ('DOID:0050480', 'epidemic typhus', 'A typhus that has material basis in Rickettsia prowazekii, which is transmitted by human body louse (Pediculus humanus corporis). The infection has symptom high fever, has symptom cough, has symptom rash, has symptom severe muscle pain, has symptom chills, has symptom falling blood pressure, has symptom stupor, has symptom sensitivity to light, and has symptom delirium', 'sylvatic typhus', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050481', 'endemic typhus', 'A typhus that has_material_basis_in Rickettsia typhi or has_material_basis_in Rickettsia felis, which are transmitted_by fleas (Xenopsylla cheopis). The infection has_symptom headache, has_symptom fever, has_symptom chills, has_symptom myalgia, has_symptom nausea, has_symptom vomiting, has_symptom cough and has_symptom rash', 'Urban Typhus of Malaya|urban typhus|fleaborne typhus|murine typhus|Rat-Flea Typhus|Rickettsia felis spotted fever|toulon typhus|cat flea rickettsiosis', '', '5', null);
