INSERT INTO `disease_info` VALUES ('DOID:0050484', 'aneruptive fever', 'A spotted fever that has_material_basis_in Rickettsia helvetica, which is transmitted_by ticks (Ixodes sp). The infection has_symptom fever, has_symptom headache, has_symptom myalgia', 'Rickettsia helvetica spotted fever', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050485', 'sennetsu fever', 'A primary bacterial infectious disease that results_in infection, has_material_basis_in Neorickettsia sennetsu, which is transmitted_by ingestion of raw or under-cooked gray mullet fish infected with the trematodes. The infection has_symptom fever, has_symptom malaise, has_symptom anorexia, has_symptom lymphadenopathy, has_symptom hepatosplenomegaly, has_symptom fatigue, has_symptom chills, has_symptom headache, has_symptom backache and has_symptom myalgia', 'Sennetsu ehrlichiosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050486', 'exanthem', 'exanthem', 'Rash|exanthema', 'SNOMEDCT_US_2016_03_01:1806006|SNOMEDCT_US_2016_03_01:206864004|SNOMEDCT_US_2016_03_01:158231005|SNOMEDCT_US_2016_03_01:206861007|NCI:C111884|SNOMEDCT_US_2016_03_01:206860008|SNOMEDCT_US_2016_03_01:139684003|ICD10CM:R21|SNOMEDCT_US_2016_03_01:112625008|MESH:D005076|SNOMEDCT_US_2016_03_01:158234002|NCI:C39594|SNOMEDCT_US_2016_03_01:267183006|UMLS_CUI:C0015230|SNOMEDCT_US_2016_03_01:158230006|ICD9CM:782.1|SNOMEDCT_US_2016_03_01:271807003', '2', 'DOID:0050486');
