INSERT INTO `disease_info` VALUES ('DOID:0050490', 'parenchymatous neurosyphilis', 'A tertiary neurosyphilis that results when chronic meningoencephalitis causes destruction of cortical parenchyma. The infection has_symptom irritability, has_symptom difficulty concentrating, has_symptom deterioration of memory, has_symptom defective judgment, has_symptom headaches, has_symptom insomnia, has_symptom fatigue, and has_symptom lethargy', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050491', 'meningovascular neurosyphilis', 'A tertiary neurosyphilis that results_in inflammation located_in arteries of the brain or located_in arteries of spinal cord. The infection has_symptom headache, has_symptom neck stiffness, has_symptom dizziness, has_symptom behavioral abnormalities, has_symptom poor concentration, has_symptom memory loss, has_symptom lassitude, has_symptom insomnia, has_symptom blurred vision, has_symptom weakness and wasting of shoulder-girdle and arm muscles, has_symptom slowly progressive leg weakness with urinary or fecal incontinence or both, and has_symptom paralysis of the legs due to thrombosis of spinal arteries', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050492', 'tertiary syphilitic encephalitis', 'tertiary syphilitic encephalitis', '', '', '5', null);
