INSERT INTO `disease_info` VALUES ('DOID:0050495', 'exanthema subitum', 'A viral infectious disease that results_in infection in infants and children, located_in skin, has_material_basis_in Human herpesvirus 6 or has_material_basis_in Human herpesvirus 7 and has_symptom sudden high fever, and has_symptom red rash that occurs first on the trunk then spreading to legs and neck', 'Sixth Disease|Roseola Infantum', 'ICD10CM:B08.20|ICD9CM:058.1|SNOMEDCT_US_2016_03_01:240559001|SNOMEDCT_US_2016_03_01:266193008|UMLS_CUI:C0015231|SNOMEDCT_US_2016_03_01:154343004|MESH:D005077|SNOMEDCT_US_2016_03_01:54385001|SNOMEDCT_US_2016_03_01:266192003|ICD10CM:B08.2|SNOMEDCT_US_2016_03_01:402902002|SNOMEDCT_US_2016_03_01:154344005|ICD9CM:058.10', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050496', 'Banna virus encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Banna virus, which is transmitted_by Culex, and transmitted_by Anopheles mosquitoes. The infection has_symptom fever, and has_symptom headache', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050497', 'Anelloviridae infectious disease', 'A ssDNA virus infectious disease that results_in infection in humans, has_material_basis_in Anelloviridae viruses', '', '', '5', null);
