INSERT INTO `disease_info` VALUES ('DOID:0050499', 'ssDNA virus infectious disease', 'A DNA virus infectious disease that results_in infection, has_material_basis_in ssDNA viruses, which possess single-stranded DNA', 'ssDNA virus infection|single stranded DNA virus infectious disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050500', 'dsDNA-RT virus infectious disease', 'A DNA virus infectious disease that results_in infection, has_material_basis_in dsDNA retro-transcribing viruses, which possess double-stranded DNA genomes and replicate using reverse transcriptase', 'dsDNA-RT virus infection|double stranded DNA reverse transcribing virus infectious disease|double stranded DNA-reverse transcribing virus infection', '', '5', null);
