INSERT INTO `disease_info` VALUES ('DOID:0050502', '(+)ssRNA virus infectious disease', 'A RNA virus infectious disease that results_in infection, has_material_basis_in ssRNA positive-strand viruses, no DNA stage, which possess positive-sense single-stranded RNA genomes', 'Positive Stranded ssRNA Virus infectious disease|positive-sense ssRNA virus infection|positive-sense ssRNA virus infectious disease|(+)ssRNA virus infection|positive-sense single stranded RNA virus infectious disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050503', '(-)ssRNA virus infectious disease', 'A RNA virus infectious disease that results_in infection, has_material_basis_in ssRNA negative-strand viruses, which have negative-sense single-stranded RNA genomes', 'negative-sense ssRNA virus infectious disease|Negative Stranded ssRNA Virus infectious disease|(-)ssRNA virus infection|negative-sense single stranded RNA virus infectious disease|negative-sense ssRNA virus infection', '', '5', null);
