INSERT INTO `disease_info` VALUES ('DOID:0050508', 'variola major', 'A smallpox that results_in severe infection, located_in skin, has_material_basis_in Variola virus. The infection results_in_formation_of lesions', '', 'SNOMEDCT_US_2016_03_01:154344005|SNOMEDCT_US_2016_03_01:47452006|SNOMEDCT_US_2016_03_01:266193008|UMLS_CUI:C1812609|ICD9CM:050.0', '5', null);
