INSERT INTO `disease_info` VALUES ('DOID:0050511', 'Human torovirus gastroenteritis', 'A viral infectious disease that results_in inflammation located_in stomach and located_in intestine, has_material_basis_in Human torovirus, which is transmitted_by ingestion of food contaminated with feces. The infection has_symptom bloody diarrhea', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050512', 'Saffold virus gastroenteritis', 'A viral infectious disease that results_in inflammation located_in stomach and located_in intestine, has_material_basis_in Saffold virus, which is transmitted_by ingestion of food contaminated with feces. The infection has_symptom watery diarrhea, has_symptom fever, has_symptom nausea, and has_symptom vomiting', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050513', 'spinal polio', 'A paralytic poliomyelitis that results in destruction located in motor neurons of spinal cord, has material basis in Human poliovirus 1, has material basis in Human poliovirus 2, or has material basis in Human poliovirus 3, which are transmitted by ingestion of food or water contaminated with feces, or transmitted by direct contact with the oral secretions. The infection has symptom difficulty breathing, and has symptom paralysis of arms and legs', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050514', 'bulbospinal polio', 'A paralytic poliomyelitis that results in destruction located in motor neurons of brainstem or located in motor neurons of spinal cord, has material basis in Human poliovirus 1, has material basis in Human poliovirus 2, or has material basis in Human poliovirus 3, which are transmitted by ingestion of food or water contaminated with feces, or transmitted by direct contact with the oral secretions. The infection has symptom difficulty breathing, has symptom difficulty swallowing, and has symptom paralysis of arms and legs', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050515', 'paralytic poliomyelitis', 'A poliomyelitis that results in destruction located in motor neurons of central nervous system, has material basis in Human poliovirus 1, has material basis in Human poliovirus 2, or has material basis in Human poliovirus 3, which are transmitted by ingestion of food or water contaminated with feces, or transmitted by direct contact with the oral secretions. The infection has symptom loss of reflexes, has symptom muscle spasms, and has symptom acute flaccid paralysis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050516', 'O\'nyong\'nyong fever', 'A viral infectious disease that results_in infection located_in joint, has_material_basis_in O\'nyong-nyong virus, which is transmitted_by Anopheles gambiae, and transmitted_by Anopheles funestus mosquitoes. The infection has_symptom fever, has_symptom arthralgia, has_symptom rash, and has_symptom lymphadenitis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050517', 'Barmah Forest virus disease', 'A viral infectious disease that results_in infection located_in joint, has_material_basis_in Barmah Forest virus, which is transmitted_by mosquito bite. The infection has_symptom fever, has_symptom arthralgia, and has_symptom rash', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050518', 'Ross River fever', 'A viral infectious disease that results_in infection located_in joint, has_material_basis_in Ross River virus, which is transmitted_by Culex, and transmitted_by Aedes mosquitoes. The infection has_symptom fever, has_symptom arthralgia, and has_symptom rash', 'Ross River virus disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050519', 'Lymphocytic choriomeningitis virus meningitis', 'A lymphocytic choriomeningitis that results_in inflammation located_in meninges, has_material_basis_in Lymphocytic choriomeningitis virus, which is transmitted_by common house mouse, Mus musculus. The infection has_symptom fever, has_symptom headache, and has_symptom stiff neck', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050520', 'Lymphocytic choriomeningitis virus meningoencephalitis', 'A lymphocytic choriomeningitis that results_in inflammation located_in meninges and located_in brain, has_material_basis_in Lymphocytic choriomeningitis virus, which is transmitted_by common house mouse, Mus musculus. The infection has_symptom fever, has_symptom headache, has_symptom stiff neck, has_symptom drowsiness, has_symptom confusion, has_symptom sensory disturbances, and has_symptom paralysis', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050521', 'Oropouche fever', 'A viral infectious disease that results_in infection, has_material_basis_in Oropouche virus, which is transmitted_by biting midge, Culicoides paraensis. The infection has_symptom fever, has_symptom chills, has_symptom headache, has_symptom anorexia, has_symptom muscle pain, has_symptom joint pain, and has_symptom vomiting', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050522', 'Balkan hemorrhagic fever', 'A hemorrhagic fever with renal syndrome that results in infection located in kidney, has material basis in Dobrava-Belgrade virus , which is transmitted by yellow-necked field mouse, Apodemus flavicollis. The infection has symptom headache, has symptom fever, has symptom muscle pains, has symptom facial flush, has symptom petechiae, has symptom hemorrhagic features, has symptom proteinuria, and has symptom renal failure', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0050523', 'adult T-cell leukemia', 'A T-cell leukemia that results_in abnormal increase of lymphocytes, derives_from T-cells, has_material_basis_in Human T-lymphotropic virus 1, which is transmitted_by sexual contact, transmitted_by contaminated needles used by intravenous-drug users, and transmitted_by breast feeding. The infection results_in_formation_of skin lesions', 'Adult T-cell leukemia/lymphoma', 'SNOMEDCT_US_2016_03_01:77430005|SNOMEDCT_US_2016_03_01:188729005|ICD10CM:C91.5|UMLS_CUI:C0023493|SNOMEDCT_US_2016_03_01:110007008|NCI:C3184|ICD10CM:C91.50|MESH:D015459', '2', 'DOID:0050523');
INSERT INTO `disease_info` VALUES ('DOID:0050524', 'maturity-onset diabetes of the young', 'A genetic disease that has_material_basis_in mutations in the MODY genes disrupting insulin production', 'Mason-type diabetes|MODY', 'ICD10CM:E11.8|ORDO:552|OMIM:606391|KEGG:04950', '2', 'OMIM:606391|DOID:0050524');
