INSERT INTO `disease_info` VALUES ('DOID:0050710', '3-Methylcrotonyl-CoA carboxylase deficiency', 'An amino acid metabolic disorder that has_material_basis_in mutations in the MCCC1 and MCCC2 genes causing inadequate levels of the enzyme 3-methylcrotonyl-CoA carboxylase that helps break down proteins containing the amino acid leucine. This disease has_symptom muscular hypotonia (weak muscle tone), has_symptom muscular atrophy, has_symptom feeding difficulties, has_symptom recurrent episodes of vomiting and diarrhea, and has_symptom lethargy', 'BMCC deficiency|3-Methylcrotonylglycinuria|3MCC deficiency', 'OMIM:210210|OMIM:210200', '1', 'OMIM:210210|OMIM:210200|DOID:0050710');
