INSERT INTO `disease_info` VALUES ('DOID:0060006', 'artemis deficiency', 'A severe combined immunodeficiency that is caused when the DCLREI1, DNA cross-link repair 1C gene contains mutations resulting in the inability to repair DNA', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060007', 'CD3zeta deficiency', 'A severe combined immunodeficiency that affects the development and function of T cells', '', '', '5', null);
