INSERT INTO `disease_info` VALUES ('DOID:0060009', 'MHC class I deficiency', 'MHC class I deficiency', 'bare lymphocyte syndrome type I|BLSI|HLA CLASS I DEFICIENCY|BLS, TYPE I', 'OMIM:604571', '1', 'OMIM:604571|DOID:0060009');
INSERT INTO `disease_info` VALUES ('DOID:0060010', 'Omenn syndrome', 'A severe combined immunodeficiency that has_material_basis in the RAG1 and RAG2 genes on chromosome 11p and the Artemis gene on chromosome 10p. It is characterized by erythroderma, desquamation, alopecia, chronic diarrhea, failure to thrive, lymphadenopathy, and hepatosplenomegaly', 'combined immunodeficiency with hypereosinophilia', 'OMIM:603554|ICD10CM:D81.8', '1', 'OMIM:603554|DOID:0060010');
INSERT INTO `disease_info` VALUES ('DOID:0060011', 'recombinase activating gene 1 deficiency', 'A severe combined immunodeficiency that is the result of a mutation on Chromosome 6 RAG1 gene involving genetic rearrangement of both the T- and B-lymphocyte receptor genes', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060012', 'recombinase activating gene 2 deficiency', 'A severe combined immunodeficiency that is the result of a mutation on Chromosome 6 RAG2 gene involving genetic rearrangement of both the T- and B-lymphocyte receptor genes', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060013', 'gamma chain deficiency', 'A severe combined immunodeficiency that is a X-linked SCID that has material basis in mutations in genes encoding common gamma chain proteins shared by the interleukin (IL-2,4,7,9,16 and21) receptors resulting in a non-functional gamma chain, defective interleukin signalling, minimal or ascent T- and NK cells and non-functional B-cells', 'SCID-X1|X-Linked Severe Combined Immunodeficiency|thymic epithelial hypoplasia|XSCID', 'MESH:D053632|NCI:C4682|OMIM:300400|UMLS_CUI:C1279481|SNOMEDCT_US_2016_03_01:203592006|SNOMEDCT_US_2016_03_01:234569003', '1', 'OMIM:300400|DOID:0060013');
INSERT INTO `disease_info` VALUES ('DOID:0060014', 'CD45 deficiency', 'A severe combined immunodeficiency that is an autosomal recessive disease with T and B lymphocyte dysfunction, due to a large deletion at one allelle and a point mutation at the other. The point mutation resulted in the alteration of intervening sequence 13 donor splice site. The population of T lymphocytes is diminished and unresponsive to mitogen stimulation. The level of B lymphocyte numbers, serum immunoglobulin decreased with age', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060015', 'interleukin-7 receptor alpha deficiency', 'A severe combined immunodeficiency that results from defective IL7R expression causes T-B+NK+ SCID. Loss of IL-7R function leads to the loss of an antiapoptotic signal, resulting in a loss of T-cell selection in thymus', 'IL-7R', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060016', 'CD3delta deficiency', 'A severe combined immunodeficiency that is characterized by the absence of T cells but normal numbers of B cells. CD3D is essential for T cell development', 'CD3D', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060017', 'CD3epsilon deficiency', 'A severe combined immunodeficiency that is an autosomal recessive immunodeficiency that has material basis in mutations in the gene coding for T-cell surface glycoprotein CD3epsilon chain precursors. Patients with CD3epsilon deficiency have a severe defect in the expression of the T-cell receptor CD3-complex', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060018', 'CD3gamma deficiency', 'A severe combined immunodeficiency an autosomal recessive immunodeficiency that has material basis in mutations in the gene coding for T-cell surface glycoprotein CD3gamma chain precursors. Patients with CD3gamma deficiency have a severe defect in the expression of the T-cell receptor CD3-complex. Affected patients have decreased T-cell numbers and function; B cells are variably affected', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060019', 'coronin-1A deficiency', 'A severe combined immunodeficiency that is an actin regulator when mutated results in SCID through inhibition of thymic egress of mature thymocytes into peripheral lymphoid organs', '', 'OMIM:615401', '1', 'OMIM:615401');
INSERT INTO `disease_info` VALUES ('DOID:0060020', 'reticular dysgenesis', 'A severe combined immunodeficiency that is the most severe form of SCID and has material basis in mutations in the gene encoding mitochondrial adenylate kinase 2. It is characterized by congenital agranulocytosis, lymphopenia, and lymphoid and thymic hypoplasia with absent cellular and humoral immunity functions', 'De Vaal disease', 'SNOMEDCT_US_2016_03_01:111584000|UMLS_CUI:C0272167|MESH:C538361|NCI:C27070|OMIM:267500', '1', 'OMIM:267500|DOID:0060020');
INSERT INTO `disease_info` VALUES ('DOID:0060021', 'DNA ligase IV deficiency', 'A combined T cell and B cell immunodeficiency that has material basis in a mutation in the LIG4 gene, a DNA ligase, encoding a protein essential for V(D)J recombination and DNA double-strand break (DSB) repair through nonhomologous end joining (NHEJ). Patients present with immunodeficiency and developmental and growth delay', 'LIG4 Syndrome', 'OMIM:606593', '2', 'OMIM:606593|DOID:0060021');
INSERT INTO `disease_info` VALUES ('DOID:0060022', 'CD40 ligand deficiency', 'A combined T cell and B cell immunodeficiency that is a X-linked immunodeficiency with hyperimmunoglobulin M (XHIM) affecting isotype switching and is caused by the absence of CD40 ligand which is normally expressed on activated CD4+ T cells. Individuals with this mutation are unable to switch from IgM to IgG, IgA and IgE', 'X-linked hyper-IgM syndrome|HIGMX-1', 'OMIM:308230', '1', 'OMIM:308230');
INSERT INTO `disease_info` VALUES ('DOID:0060023', 'CD40 deficiency', 'A combined T cell and B cell immunodeficiency that has material basis in mutation in the TNFRSF5 gene, resulting in type 3 hyper-IgM immunodeficiency characterized by an inability of B cells to undergo isotype switching, an inability to mount an antibody-specific immune response, and a lack of germinal center formation', 'hyper-IgM syndrome due to CD40 deficiency|type 3 hyper-IgM immunodeficiency|immunodeficiency with hyper-IgM type 3', 'OMIM:606843|ORDO:101090', '1', 'OMIM:606843');
INSERT INTO `disease_info` VALUES ('DOID:0060024', 'lambda 5 deficiency', 'A B cell deficiency that has material basis in mutations in the IGLL1 gene. Lambda 5 mutations an cause a block in B cell development at the transition between the pro-B cell and the pre-B cell stage', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060025', 'immunoglobulin alpha deficiency', 'A B cell deficiency that is an autosomal recessive disorder that has material basis in mutation in the IgA (CD79 alpha) antigen receptor', 'gamma-A-globulin deficiency|IgA deficiency', 'OMIM:609529|OMIM:269650|OMIM:137100|MESH:D017098|UMLS_CUI:C0162538|SNOMEDCT_US_2016_03_01:29260007|ORDO:69127', '1', 'OMIM:609529|OMIM:269650|OMIM:137100|DOID:0060025');
INSERT INTO `disease_info` VALUES ('DOID:0060026', 'immunoglobulin beta deficiency', 'immunoglobulin beta deficiency', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060027', 'B cell linker protein deficiency', 'A hypobammaglobulinemia that is a B cell deficiency that has material basis in a mutation in a cytoplasmic linker or adaptor protein that plays a critical role in B cell development, the B cell linker protein (BLNK) gene. Mutations in this gene cause hypoglobulinemia and absent B cells, a disease in which the pro- to pre-B-cell transition is developmentally blocked. The BLNK gene is associated with intracellular calcium mobilization, essential for cell activation', 'BLNK deficiency|B-cell linker protein deficiency', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060028', 'Good syndrome', 'An agammaglobulinemia that is a condition where there is co-occurrence of deficient cell-mediated immunity and benign thymoma', 'thymoma with hypogammaglobulinemia', '', '5', 'ORPHA:169105');
