INSERT INTO `disease_info` VALUES ('DOID:0060055', 'popliteal pterygium syndrome', 'An autosomal dominant disease characterized by abnormal development of the face, skin and genitals. Clinical expressions of the disease include cleft lip, with or without cleft palate, contractures of the lower extremities, abnormal external genitalia, syndactyly of fingers and/or toes, and a pyramidal skin fold over the hallux nail. It has material basis in mutations in the IRF6 gene on chromosome 1', 'facio-genito-popliteal syndrome|popliteal web syndrome', 'NCI:C118786|ORDO:294963|UMLS_CUI:C0265259|OMIM:119500|MESH:C562509|ORDO:1300|SNOMEDCT_US_2016_03_01:66783006|SNOMEDCT_US_2016_03_01:205820002|OMIM:263650', '1', 'OMIM:119500|OMIM:263650');
