INSERT INTO `disease_info` VALUES ('DOID:0060316', 'orofaciodigital syndrome I', 'An orofaciodigital syndrome that is characterized by malformations of the face, oral cavity, and digits, has_material_basis_in X-linked dominant inheritance of the OFD1 gene with lethality in males and is associated with polycystic kidney disease', 'orofaciodigital syndrome 1|orofaciodigital syndrome type I|Papillon-Leage-Psaume syndrome', 'MESH:D009958|SNOMEDCT_US_2016_03_01:403773005|SNOMEDCT_US_2016_03_01:52868006|SNOMEDCT_US_2016_03_01:239029009|UMLS_CUI:C1510460|ICD10CM:Q87.0|UMLS_CUI:C0029294|OMIM:311200|SNOMEDCT_US_2016_03_01:1779005|UMLS_CUI:C0026363|ORDO:2750', '1', 'OMIM:311200');
INSERT INTO `disease_info` VALUES ('DOID:0060317', 'lung abscess', 'A lung disease characterized by microbial infection which causes a type of liquefactive necrosis of the pulmonary tissue and formation of cavities containing necrotic debris or fluid', '', 'ICD9CM:513.0|NCI:C99090|SNOMEDCT_US_2016_03_01:155618005|SNOMEDCT_US_2016_03_01:196113000|ICD10CM:J85.2|UMLS_CUI:C0024110|SNOMEDCT_US_2016_03_01:73452002|MESH:D008169', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060318', 'acute promyelocytic leukemia', 'An acute myeloid leukemia characterized by accumulation of promyelocytes in the bone marrow and by a translocation between chromosomes 15 and 17', 'acute myeloid leukemia M3|APL|acute myeloblastic leukemia type 3', 'SNOMEDCT_US_2016_03_01:110004001|OMIM:612376|MESH:D015473|UMLS_CUI:C0023487|SNOMEDCT_US_2016_03_01:28950004|NCI:C3182|ORDO:520|ICD10CM:C92.4|ICD10CM:C92.40', '1', 'OMIM:612376');
INSERT INTO `disease_info` VALUES ('DOID:0060319', 'cardiac arrest', 'A congestive heart failure characterized by a sudden stop in effective blood circulation due to the failure of the heart to contract effectively or at all', 'circulatory arrest|cardiopulmonary arrest', 'SNOMEDCT_US_2016_03_01:410430005|SNOMEDCT_US_2016_03_01:233926006|SNOMEDCT_US_2016_03_01:155372006|ICD10CM:I46|MESH:D006323|NCI:C50483|ICD9CM:427.5|SNOMEDCT_US_2016_03_01:309810002|SNOMEDCT_US_2016_03_01:30298009|SNOMEDCT_US_2016_03_01:397829000|UMLS_CUI:C0600228|SNOMEDCT_US_2016_03_01:251189000|SNOMEDCT_US_2016_03_01:397912004|SNOMEDCT_US_2016_03_01:195090009|NCI:C50479|UMLS_CUI:C0018790|SNOMEDCT_US_2016_03_01:195085006|SNOMEDCT_US_2016_03_01:410429000', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060320', 'inguinal hernia', 'An intestinal disease characterized by a protrusion of abdominal cavity contests through the inguinal canal', '', 'SNOMEDCT_US_2016_03_01:73147001|ICD9CM:550|SNOMEDCT_US_2016_03_01:266440002|NCI:C34690|SNOMEDCT_US_2016_03_01:266509007|SNOMEDCT_US_2016_03_01:266508004|SNOMEDCT_US_2016_03_01:44297005|SNOMEDCT_US_2016_03_01:196828002|SNOMEDCT_US_2016_03_01:65626001|SNOMEDCT_US_2016_03_01:261478001|UMLS_CUI:C0019295|SNOMEDCT_US_2016_03_01:196822001|SNOMEDCT_US_2016_03_01:286968003|SNOMEDCT_US_2016_03_01:266510002|ICD10CM:K40.90|SNOMEDCT_US_2016_03_01:155738001|SNOMEDCT_US_2016_03_01:396232000|SNOMEDCT_US_2016_03_01:196827007|UMLS_CUI:C0019294|ICD10CM:K40|UMLS_CUI:C0019296|SNOMEDCT_US_2016_03_01:286969006|SNOMEDCT_US_2016_03_01:196800008|SNOMEDCT_US_2016_03_01:261480007|SNOMEDCT_US_2016_03_01:155741005|NCI:C34691|MESH:D006552|NCI:C34692|SNOMEDCT_US_2016_03_01:155744002', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060321', 'umbilical hernia', 'A intestinal disease characterized by the protrusion by part of the intestine though an opening in the abdominal muscles', '', 'NCI:C98997|ICD9CM:756.72|SNOMEDCT_US_2016_03_01:196854005|MESH:D006554|ICD10CM:Q79.2|UMLS_CUI:C1306503|SNOMEDCT_US_2016_03_01:49324006|UMLS_CUI:C0795690|SNOMEDCT_US_2016_03_01:396347007|SNOMEDCT_US_2016_03_01:271017007|SNOMEDCT_US_2016_03_01:18735004|SNOMEDCT_US_2016_03_01:5867007|SNOMEDCT_US_2016_03_01:196872004|SNOMEDCT_US_2016_03_01:205516007|SNOMEDCT_US_2016_03_01:157007005', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060322', 'mastoiditis', 'A middle ear disease characterized by an inflammation of the mucosal lining of the mastoid antrum and the mastoid air cell system inside the mastoid process', '', 'ICD9CM:383.9|UMLS_CUI:C0024904|ICD10CM:H70.90|SNOMEDCT_US_2016_03_01:155230007|SNOMEDCT_US_2016_03_01:52404001|MESH:D008417|ICD10CM:H70.9|SNOMEDCT_US_2016_03_01:194309002', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060323', 'breast abscess', 'A breast disease characterized by a collection of pus in the breast', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060324', 'dental abscess', 'A tooth disease characterized by a localized collection of pus associated with a tooth', '', 'ICD10CM:K04.6', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060325', 'cervical polyp', 'A cervix disease characterized by a benign polyp on the surface of the cervical canal', '', 'ICD10CM:D26.9|ICD9CM:219|ICD10CM:D26|SNOMEDCT_US_2016_03_01:154628008|UMLS_CUI:C0153996|SNOMEDCT_US_2016_03_01:189107007', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060326', 'myelomeningocele', 'A spina bifida characterized by protrusion of the spinal cord through an opening, covered by meningeal membranes', '', 'SNOMEDCT_US_2016_03_01:82058009|UMLS_CUI:C0025312|SNOMEDCT_US_2016_03_01:268308005|SNOMEDCT_US_2016_03_01:203995002|SNOMEDCT_US_2016_03_01:203988006|SNOMEDCT_US_2016_03_01:7096005|SNOMEDCT_US_2016_03_01:203994003|SNOMEDCT_US_2016_03_01:203989003|SNOMEDCT_US_2016_03_01:203993009|MESH:D008591|ICD10CM:Q05|NCI:C98874|SNOMEDCT_US_2016_03_01:414667000|SNOMEDCT_US_2016_03_01:203984008|SNOMEDCT_US_2016_03_01:156890007|NCI:C101201|UMLS_CUI:C0751316|UMLS_CUI:C0086664|SNOMEDCT_US_2016_03_01:203999008', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060327', 'omphalocele', 'A physical disorder characterized by a defect in the development of the abdominal wall muscles, resulting in the intestines, liver and other organs to remain outside of the abdomen in a sac', 'omphalocoele', 'NCI:C98997|SNOMEDCT_US_2016_03_01:271017007|ICD9CM:756.72|SNOMEDCT_US_2016_03_01:49324006|UMLS_CUI:C1306503|SNOMEDCT_US_2016_03_01:5867007|SNOMEDCT_US_2016_03_01:18735004|OMIM:164750|UMLS_CUI:C0795690|SNOMEDCT_US_2016_03_01:396347007|SNOMEDCT_US_2016_03_01:196872004|SNOMEDCT_US_2016_03_01:205516007|SNOMEDCT_US_2016_03_01:196854005|MESH:D006554|ICD10CM:Q79.2|SNOMEDCT_US_2016_03_01:157007005', '5', 'OMIM:164750');
INSERT INTO `disease_info` VALUES ('DOID:0060328', 'anal fistula', 'An anus disease characterized by is an abnormal connection between the epithelialised surface of the anal canal and the perianal skin', '', 'ICD10CM:K60.3', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060329', 'ectopic pregnancy', 'A female reproductive system disease characterized by the implantation of the embryo outside the uterine cavity', 'eccyesis', 'SNOMEDCT_US_2016_03_01:156080003|ICD10CM:O00.9|SNOMEDCT_US_2016_03_01:156083001|ICD10CM:O00|SNOMEDCT_US_2016_03_01:34801009|MESH:D011271|UMLS_CUI:C0032987|ICD9CM:633|SNOMEDCT_US_2016_03_01:198630007|ICD9CM:633.9|NCI:C34945', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060330', 'Rapp-Hodgkin syndrome', 'An autosomal dominant disease characterized by abnormal development of ectodermal tissues including the skin, hair, nails, teeth and sweat glands and anhidrotic ectodermal dysplasia with cleft lip/palate', 'anhidrotic ectodermal dysplasia with cleft lip/palate', 'OMIM:129400|ORDO:3022', '1', 'OMIM:129400');
INSERT INTO `disease_info` VALUES ('DOID:0060331', 'mitochondrial complex V (ATP synthase) deficiency nuclear type 2', 'A mitochondrial complex V (ATP synthase) deficiency that has material basis in mutation in the TMEM70 gene on chromosome 8q21', 'MC5DN2|neonatal mitochondrial encephalocardiomyopathy due to ATP synthase deficiency', 'ICD10CM:G71.3|OMIM:614052|ORDO:1194', '1', 'OMIM:614052');
INSERT INTO `disease_info` VALUES ('DOID:0060332', 'mitochondrial complex V (ATP synthase) deficiency nuclear type 3', 'A mitochondrial complex V (ATP synthase) deficiency that has material basis in mutation in the ATP5E gene on chromosome 20q13', 'MC5DN3', 'ORDO:254913|ICD10CM:E88.8|OMIM:614053', '1', 'OMIM:614053');
INSERT INTO `disease_info` VALUES ('DOID:0060333', 'mitochondrial complex V (ATP synthase) deficiency nuclear type 4', 'A mitochondrial complex V (ATP synthase) deficiency that has material basis in mutation in the ATP5A1 gene on chromosome 18q', 'MC5DN4', 'OMIM:615228|ICD10CM:E88.8|ORDO:254913', '1', 'OMIM:615228');
INSERT INTO `disease_info` VALUES ('DOID:0060334', 'transient neonatal diabetes mellitus', 'A neonatal diabetes mellitus characterized by hyperglycemia during the neonatal period that remits during infancy but recurs in later life in most patients', '', 'OMIM:610582|OMIM:610374|ICD10CM:P70.2|ORDO:99886|OMIM:601410', '1', 'OMIM:610582|OMIM:610374|OMIM:601410');
INSERT INTO `disease_info` VALUES ('DOID:0060335', 'autosomal dominant sideroblastic anemia', 'A sideroblastic anemia characterized by an autosomal dominant inheritance pattern', '', 'OMIM:182170', '1', 'OMIM:182170');
INSERT INTO `disease_info` VALUES ('DOID:0060336', '3-methylglutaconic aciduria', 'An organic acidemia that is characterized by elevated levels of 3-methylglutaconic acid and 3-methylglutaric acid in the urine', '', 'ORDO:289902|ICD10CM:E71.111|MESH:C579867', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060337', 'CEDNIK syndrome', 'An autosomal recessive disease that has material basis in homozygous mutation in the SNAP29 gene and characterized by a unique constellation of clinical manifestations including microcephaly, severe neurologic impairment, psychomotor retardation, failure to thrive, facial dysmoprhism, palmoplantar keratoderma and late-onset ichthyosis', 'cerebral dysgenesis, neuropathy, ichthyosis and keratoderma syndrome', 'MESH:C537943|OMIM:609528|ORDO:66631|UMLS_CUI:C1836033', '1', 'OMIM:609528');
INSERT INTO `disease_info` VALUES ('DOID:0060338', 'parameningeal embryonal rhabdomyosarcoma', 'An embryonal rhabdomyosarcoma located in the parameningeal region', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060339', 'chronic atrial and intestinal dysrhythmia', 'A syndrome characterized by a unique combination of cardiac arrhythmias and intestinal pseudo-obstruction. It has material basis in the mutated SGOL1 protein. Distinctive clinical features include atrial dysrhythmias, sick sinus syndrome (SSS) and valve anomalies and chronic intestinal pseudo-obstruction (CIPO)', 'CAID syndrome', 'OMIM:616201', '1', 'OMIM:616201');
INSERT INTO `disease_info` VALUES ('DOID:0060340', 'ciliopathy', 'A genetic disease associated with mutations encoding defective proteins, which result in either abnormal function formation or function of cilia', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060341', 'agnathia-otocephaly complex', 'A physical disorder characterized by mandibular hypoplasia or agnathia, ventromedial auricular malposition (melotia) and/or auricular fusion (synotia), and microstomia with oroglossal hypoplasia or aglossia. Holoprosencephaly is the most commonly identified association, but skeletal, genitourinary and cardiovascular anomalies and situs inversus have been reported', 'otocephaly|agnathia-holoprosencephaly-situs inversus syndrome|dysgnathia complex agnathia-holoprosencephaly|holoprosencephaly-agnathia', 'ICD10CM:Q18.2|ORDO:990|OMIM:202650', '1', 'OMIM:202650');
INSERT INTO `disease_info` VALUES ('DOID:0060342', 'acromelic frontonasal dysostosis', 'A dysostosis characterized by cranium bifidum, severe hypertelorism, median cleft lip and palate, nasal bifurcation, brachycephaly, large fontanelle, tibial hemimelia, preaxial polydactyly of the feet and brain malformations', '', 'OMIM:603671', '1', 'OMIM:603671');
INSERT INTO `disease_info` VALUES ('DOID:0060343', 'glucocorticoid-induced osteoporosis', 'An osteoporosis caused by chronic glucocorticoid use. Glucocorticoids impair the replication, differentiation and function of osteoblasts and induce the apoptosis of mature osteoblasts and osteocytes; the also favor osteoclastogenesis leading to an increase in bone resorption', 'steroid-induced osteoporosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060344', 'acrodermatitis chronica atrophicans', 'An acrodermatitis characterized by a chronically progressive course, leading to widespread atrophy of the skin. It is a clinical manifestation of Lyme borreliosis', 'Herxheimer disease|primary diffuse atrophy', 'SNOMEDCT_US_2016_03_01:201088002|DERMO:0002165|SNOMEDCT_US_2016_03_01:201079006|ICD9CM:701.8|UMLS_CUI:C0029805', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060345', 'bacillary angiomatosis', 'A bartonellosis that has_material_basis_in Bartonella henselae or has_material_basis_in Bartonella quintana. The disease is characterized by the proliferation of blood vessels, resulting in them forming tumour-like masses in the skin and other organs', '', 'UMLS_CUI:C0085434|NCI:C3477|SNOMEDCT_US_2016_03_01:58213005|MESH:D016917', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060346', 'Native American myopathy', 'A neuromuscular disease characterized by congenital weakness, arthrogryposis, cleft palate, ptosis, myopathic facies, short stature, kykphoscoliosis, talipes deformities and susceptibility to malignant hyperthermia provoked by anesthesia; that has material basis in homozygous mutation in the STAC3 gene on chromosome 12q13', '', 'OMIM:255995|UMLS_CUI:C1850625|ORDO:168572|MESH:C538343', '1', 'OMIM:255995');
INSERT INTO `disease_info` VALUES ('DOID:0060347', 'acrorenal syndrome', 'A syndrome characterized by limb defects, usually bilateral, like cleft hands or feet and longitudinal defects involving radius or ulna, tibia or fibula and renal anomalies which include agenesis, hypoplasia and rarely polycystic kidneys. Additional malformations may involve the oro-mandibular region, the trachea and lungs, skin derivatives including sweat glands, mammary glands, the uterus, vas deferens, the nasal placodes and the eyes', '', 'OMIM:201310|OMIM:102520|UMLS_CUI:C3495490|MESH:C563159', '5', 'OMIM:201310|OMIM:102520');
INSERT INTO `disease_info` VALUES ('DOID:0060348', 'hypoparathyroidism-retardation-dysmorphism syndrome', 'An autosomal recessive disease characterized by permanent parathyroid hormone (PTH) deficiency, hypocalcemia, hyperphosphatemia, facial anomalies, and psychomotor retardation; it is seen among children born to consanguineous couple of Arab ethnicity', 'HRD syndrome|Sanjad-Sakati syndrome|hypoparathyroidism with short stature, mental retardation and seizures', 'OMIM:241410|ORDO:2323|UMLS_CUI:C1855840|MESH:C537157', '1', 'OMIM:241410');
INSERT INTO `disease_info` VALUES ('DOID:0060349', 'microcephaly with or without chorioretinopathy, lymphedema, or mental retardation', 'A syndrome characterized byvariable expression of microcephaly, ocular disorders including chorioretinopathy, congenital lymphedema of the lower limbs, and mild to moderate intellectual disability', 'lymphedema and retinal folds with ficrocephaly and microphthalmos|lymphedema, microcephaly and chorioretinopathy syndrome|microcephaly, lymphedema, chorioretinal dysplasia syndrome|chorioretinal dysplasia-microcephaly-mental retardation syndrome|microcephaly lymphedema chorioretinal dysplasia', 'UMLS_CUI:C1835265|OMIM:152950|MESH:C537711|ORDO:2526', '1', 'OMIM:152950');
INSERT INTO `disease_info` VALUES ('DOID:0060350', 'adenine phosphoribosyltransferase deficiency', 'An amino acid metabolic disorder characterized by the formation 2,8-dihydroxyadenine stones and renal failure secondary to intratubular crystalline precipitation. It has an autosomal recessive inheritance pattern', 'APRT deficiency|2,8-dihydroxyadenine urolithiasis', 'UMLS_CUI:C3665382|OMIM:614723|SNOMEDCT_US_2016_03_01:124274002|MESH:C538228|UMLS_CUI:C0268120|SNOMEDCT_US_2016_03_01:11852004|NCI:C121564', '1', 'OMIM:614723');
INSERT INTO `disease_info` VALUES ('DOID:0060351', 'mitochondrial complex III deficiency nuclear type 2', 'A mitochondrial metabolism disease characterized by motor disability, with ataxia, apraxia, dystonia, and dysarthria, associated with necrotic lesions throughout the brain and has material basis in mutation in the TTC19 gene on chromosome 17. It has an autosomal recessive inheritance pattern', 'MC3DN2', 'OMIM:615157', '1', 'OMIM:615157');
INSERT INTO `disease_info` VALUES ('DOID:0060352', 'Kleefstra syndrome', 'A syndrome characterized by childhood hypotonia, a distinctive facial appearance, speech impediments and developmental disability, as well as epilepsy, congenital and urogenetic defects, microcephaly, corpulence, and psychiatric disorders. It is caused either by a microdeletion in the chromosome region 9q34.3 or by a point mutation in the EHMT1 gene located in that region', '9q34 deletion syndrome|9q subtelomeric deletion syndrome|9q-syndrome', 'UMLS_CUI:C0795833|OMIM:610253|MESH:C563043|ORDO:261494', '1', 'OMIM:610253');
INSERT INTO `disease_info` VALUES ('DOID:0060353', 'acrofacial dysostosis Cincinnati type', 'An acrofacial dysostosis characterized by a spectrum of mandibulofacial dysostosis phenotypes, such as cleft palate, micrognathia, malar flattening, microcephaly and, in some cases, extrafacial skeletal defects. It is that has material basis in heterozygous mutation in the POLR1A gene on chromosome 2p11', '', 'OMIM:616462', '1', 'OMIM:616462');
INSERT INTO `disease_info` VALUES ('DOID:0060354', 'Stormorken syndrome', 'A blood platelet disease characterized by  thrombocytopathy, thrombocytopenia, mild anemia, asplenia, tubular aggregate myopathy, miosis, headache, and ichthyosis. It has material basis in heterozygous mutation in the STM1 gene on chromosome 11p15. It has an autosomal dominant inheritance pattern', 'thrombocytopathy, asplenia and miosis', 'SNOMEDCT_US_2016_03_01:711407000|OMIM:185070|ORDO:3204|MESH:C566108|UMLS_CUI:C1861451', '5', 'OMIM:185070');
INSERT INTO `disease_info` VALUES ('DOID:0060355', 'amyotrophic lateral sclerosis type 22', 'An amyotrophic lateral sclerosis that has material basis in mutation in the TUBA4A gene on chromosome 2q35', 'amyotrohpic lateral sclerosis 22 with or without frontotemporal dementia|ALS 22|amyotrophic lateral sclerosis 22', 'OMIM:616208', '1', 'OMIM:616208');
INSERT INTO `disease_info` VALUES ('DOID:0060356', 'Vici syndrome', 'An autosomal recessive disease characterized by callosal agenesis, cataracts, cardiomyopathy, combined immunodeficiency and hypopigmentation. It has material basis in mutation in the EPG5 gene on chromosome 18q12.3', 'immunodeficiency with cleft lip/palate, cataract, hypopigmentation, and absent corpus callosum', 'UMLS_CUI:C1855772|ORDO:1493|OMIM:242840|MESH:C535566', '1', 'OMIM:242840');
INSERT INTO `disease_info` VALUES ('DOID:0060357', 'chylomicron retention disease', 'A lipid metabolism disorder characterized by malnutrition, failure to thrive, growth failure, vitamin E deficiency and the absence of chylomicrons and apolipoprotein B48 post-prandially. It has an autosomal recessive inheritance pattern and has material basis in mutations in the SAR1B gene on chromosome 5q31.1', 'CMRD|Anderson disease', 'MESH:C535460|OMIM:246700|ICD10CM:E78.3|ORDO:71|SNOMEDCT_US_2016_03_01:190792005|UMLS_CUI:C0795956|SNOMEDCT_US_2016_03_01:702364003', '1', 'OMIM:246700');
INSERT INTO `disease_info` VALUES ('DOID:0060358', 'multiple acyl-CoA dehydrogenase deficiency', 'An inherited metabolic disorder characterized by the body\'s inability to break down proteins and fats to produce energy. It is a disorder of fatty acid, amino acid, and choline metabolism and has an autosomal recessive inheritance pattern. It has material basis in mutations in the ETFA, ETFB and ETFDH genes. It presents three clinical phenotypes: a neonatal-onset form with congenital anomalies (type I), a neonatal-onset form without congenital anomalies (type II), and a late-onset form (type III). The neonatal-onset forms are usually fatal', 'MADD|electron transfer flavoprotein deficiency|glutaric aciduria type 2|glutaric acidemia type 2|electron transfer flavoprotein ubiquinone oxidoreductase deficiency|MAD deficiency', 'MESH:D054069|SNOMEDCT_US_2016_03_01:22886006|NCI:C84907|UMLS_CUI:C1856405|OMIM:231680|ICD10CM:E71.313|UMLS_CUI:C1856403|ORDO:26791|UMLS_CUI:C0268596|NCI:C99102|UMLS_CUI:C1856401', '1', 'OMIM:231680');
INSERT INTO `disease_info` VALUES ('DOID:0060359', 'Sakati-Nyhan syndrome', 'An acrocephalosyndactylia characterized by abnormalities in the bones of the legs, congenital heart defects and craniofacial defects and craniosynostosis. The patients suffer from cyanosis and other respiratory and breathing infections', 'acrocephalopolysyndactyly type 3|ACPS with leg hypoplasia|acrocephalopolysyndactyly Type III|Sakati-Nyhan-Tisdale syndrome', 'ICD10CM:Q87.0|MESH:C537227|OMIM:101120|ORDO:3128', '5', 'OMIM:101120');
INSERT INTO `disease_info` VALUES ('DOID:0060360', 'hereditary papulotranslucent acrokeratoderma', 'A keratosis  of the hands and feet characterized by persistent, asymptomatic, yellowish to white papules and plaques associated with fine-textured scalp hair and an atopic diathesis', '', 'OMIM:101840|MESH:C566323', '5', 'OMIM:101840');
INSERT INTO `disease_info` VALUES ('DOID:0060361', 'punctate palmoplantar keratoderma', 'A palmoplantar keratosis characterized by keratoses with a \\\"raindrop\\\" pattern on the palmoplantar surface, skin lesions which may involve the whole of the palmoplantar surface, or may be more restricted in their distribution', 'punctate palmoplantar hyperkeratosis', 'ORDO:307967|SNOMEDCT_US_2016_03_01:402773000|UMLS_CUI:C1274216', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060362', 'punctate palmoplantar keratoderma type III', 'punctate palmoplantar keratoderma type III', 'acrokeratoelastoidosis of Costa|punctate palmoplantar keratoderma type 3|punctate palmoplantar hyperkeratosis type 3', 'MESH:C535653|SNOMEDCT_US_2016_03_01:111029001|ORDO:38|UMLS_CUI:C0545044|OMIM:101850', '5', 'OMIM:101850');
INSERT INTO `disease_info` VALUES ('DOID:0060363', 'glycerol kinase deficiency', 'An inherited metabolic disorder characterized_by wide range of phenotypic variability; patients can have severe metabolic and CNS abnormalities, while others possess hyperglycerolemia and glyceroluria with no other apparent phenotype. It has material basis in mutation in the GK gene on chromosome Xp21', '', 'ORDO:408|UMLS_CUI:C0574108|OMIM:307030|SNOMEDCT_US_2016_03_01:297256008', '1', 'OMIM:307030');
INSERT INTO `disease_info` VALUES ('DOID:0060364', 'Galloway-Mowat syndrome', 'An autosomal recessive disease characterized_by is a rare autosomal recessive disease, characterized by microcephaly with brain anomalies including CA in some cases, intellectual disability, and early-infantile-onset nephrotic syndrome', 'microcephaly, hiatal hernia and nephrotic syndrome|Galloway syndrome|nephrosis-microcephaly syndrome|nephrosis-neuronal dysmigration syndrome', 'UMLS_CUI:C0795949|OMIM:251300|ORDO:2065|MESH:C537548', '1', 'OMIM:251300');
INSERT INTO `disease_info` VALUES ('DOID:0060365', 'mandibulofacial dysostosis with alopecia', 'A syndrome characterized_by malar and mandibular hypoplasia, typically associated with abnormalities of the ears and eyelids, and with alopecia', 'MFDA', 'OMIM:616367', '1', 'OMIM:616367');
INSERT INTO `disease_info` VALUES ('DOID:0060366', 'Hennekam syndrome', 'A lymphatic system disease characterized by he presence of intestinal lymphangiectasia, mental retardation, and characteristic facial anomalies. It is inherited in an autosomal recessive pattern. Most individuals with Hennekam syndrome have characteristic facial abnormalities, such as a flat face with accompanying puffy eyelids and hypertelorism; the nasal bridge is typically flat and the ears are typically small. Congenital extremity and genital lymphedema is present in most patients', 'lymphedem-lymphangiectasia-intellectual disability syndrome|Hennekam lymphangiectasia-lymphedema syndrome', 'OMIM:235510|SNOMEDCT_US_2016_03_01:234146006|UMLS_CUI:C0340834|OMIM:616006|ORDO:2136|MESH:C537255', '1', 'OMIM:235510|OMIM:616006');
