INSERT INTO `disease_info` VALUES ('DOID:0060369', 'autosomal recessive early-onset Parkinson\'s disease 6', 'A Parkinson\'s disease that has_material_basis_in mutations in the PINK1 gene on chromosome 1p36.12', 'early-onset Parkinson disease 6|autosomal recessive early-onset Parkinson disease 6', 'OMIM:605909', '1', 'OMIM:605909');
