INSERT INTO `disease_info` VALUES ('DOID:0060469', 'Miller-Dieker lissencephaly syndrome', 'A syndrome characterized by classical lissencephaly and distinct facial features. Visible and submicroscopic deletions of 17p13.3, including the LIS1 gene, are found in almost 100% of patients', 'MDS|Miller-Dieker syndrome', 'ORDO:531|ICD10CM:Q04.3|OMIM:247200|UMLS_CUI:C0265219', '5', 'OMIM:247200');
