INSERT INTO `disease_info` VALUES ('DOID:0060473', 'Kabuki syndrome', 'A syndrome characterized by  multiple congenital anomalies and mental retardation. Other characteristics include a peculiar facial gestalt, short stature, skeletal and visceral abnormalities, cardiac anomalies, and immunological defects', 'Niikawa-Kuroki syndrome|Kabuki make up syndrome|KMS', 'UMLS_CUI:C0796004|OMIM:300867|ORDO:2322|OMIM:147920|SNOMEDCT_US_2016_03_01:313426007|MESH:C537705|SNOMEDCT_US_2016_03_01:205805008', '1', 'OMIM:300867|OMIM:147920');
INSERT INTO `disease_info` VALUES ('DOID:0060474', 'Chuvash polycythemia', 'Chuvash polycythemia', 'familial erythrocytosis 2|Chuvash type polycythemia|Chuvash erythromatosis|autosomal recessive benign erythrocytosis', 'ICD10CM:D75.1|OMIM:263400|ORDO:238557', '1', 'OMIM:263400');
INSERT INTO `disease_info` VALUES ('DOID:0060475', 'childhood onset epileptic encephalopathy', 'An idiopathic generalized epilepsy characterized by onset of multiple seizure types in the first few years of life and associated with poor prognosis. Affected individuals have cognitive regression and intellectual disability', 'EEOC', 'OMIM:615369', '1', 'OMIM:615369');
INSERT INTO `disease_info` VALUES ('DOID:0060476', 'Perlman syndrome', 'A syndrome characterized by polyhydramnios with neonatal macrosomia, nephromegaly, distinctive facial appearance, renal dysplasia, nephroblastomatosis, and predisposition to Wilms tumor. It shows similarities to Beckwith-Wiedemann syndrome', 'renal hamartomas, nephroblastomatosis and fetal gigantism|nephroblastomatosis - fetal ascites - macrosomia - Wilms tumor|nephroblastomatosis, fetal ascites, macrosomia and Wilms tumor', 'OMIM:267000|MESH:C536399|ORDO:2849|ICD10CM:Q87.3', '1', 'OMIM:267000');
INSERT INTO `disease_info` VALUES ('DOID:0060478', 'Zika fever@en', 'A viral infectious disease that has_material_basis in Zika virus, which is transmitted_by Aedes aegypti mosquitoes and targets neural progenitor cells and  neuronal cells in all stages of maturity and has_symptom fever, has_symptom rash, has_symptom headaches and has_symptom joint pain', 'Zika virus disease', 'MESH:D000071243|ICD10CM:A92.8|ICD10:U06', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060479', 'Shwachman-Diamond syndrome@en', 'A syndrome characterized by exocrine pancreatic insufficiency, bone marrow failure and skeletal abnormalities', 'pancreatic insufficiency and bone marrow dysfunction|Shwachman syndrome|Shwachman-Bodian-Diamond syndrome', 'ICD10CM:D61.0|MESH:C537330|OMIM:260400', '1', 'OMIM:260400');
INSERT INTO `disease_info` VALUES ('DOID:0060480', 'left ventricular noncompaction@en', 'An intrinsic cardiomyopathy characterized by distinctive (spongy) morphological appearance of the LV myocardium', 'left ventricular hypertrabeculation', 'ORDO:54260|OMIM:604169', '1', 'OMIM:604169');
INSERT INTO `disease_info` VALUES ('DOID:0060481', 'Goldberg-Shprintzen syndrome@en', 'A syndrome characterized by intellectual disability, specific facial gestalt and Hirschsprung\'s disease (HSCR). It has material basis in homozygous mutation in the KIAA1279 gene on chromosome 10q21.1', 'Goldberg-Shprintzen megacolon syndrome', 'UMLS_CUI:C1836123|MESH:C537279|OMIM:609460|ORDO:66629', '1', 'OMIM:609460');
INSERT INTO `disease_info` VALUES ('DOID:0060482', 'oculoauricular syndrome@en', 'A syndrome characterized by microcornea, microphthalmia, anterior-segment dysgenesis, cataract, coloboma of various parts of the eye, abnormalities of the retinal pigment epithelium, and rod-cone dystrophy and a particular cleft ear lobule', '', 'ORDO:157962|OMIM:612109|MESH:C567416|ICD10CM:Q87.8', '1', 'OMIM:612109');
INSERT INTO `disease_info` VALUES ('DOID:0060483', 'MEDNIK syndrome@en', 'A syndrome characterized by mental retardation, enteropathy, deafness, peripheral neuropathy, ichthyosis, and keratoderma. It is cause by homozygous mutation in the AP1S1 gene on chromosome 7q22', 'mental retardation, enteropathy, deafness, neuropathy, ichthyosis, keratodermia|erythrokeratodermia variabilis 3|erythrokeratodermia variabilis, Kamouraska type', 'ORDO:171851|OMIM:609313', '1', 'OMIM:609313');
INSERT INTO `disease_info` VALUES ('DOID:0060484', 'EAST syndrome@en', 'A syndrome characterize by seizures, sensorineural deafness, ataxia, mental retardation, and electrolyte imbalance. It has material basis in homozygous or compound heterozygous mutation in the KCNJ10 gene on chromosome 1q23', 'SeSAME syndrome|epilepsy, ataxia, sensorineural deafness and tubulopathy|seizures, sensorineural deafness, ataxia, mental retardation and electrolyte imbalance', 'OMIM:612780|UMLS_CUI:C2748572|MESH:C557674|ORDO:199343', '1', 'OMIM:612780');
INSERT INTO `disease_info` VALUES ('DOID:0060485', 'Mowat-Wilson syndrome@en', 'A syndrome characterized by a distinct facial phenotype (high forehead, frontal bossing, large eyebrows, medially flaring and sparse in the middle part, hypertelorism, deep set but large eyes, large and uplifted ear lobes, with a central depression, saddle nose with prominent rounded nasal tip, prominent columella, open mouth, with M-shaped upper lip, frequent smiling, and a prominent but narrow and triangular pointed chin), moderate-to-severe intellectual deficiency, epilepsy and variable congenital malformations including Hirschsprung disease, genitourinary anomalies (in particular hypospadias in males), congenital heart defects, agenesis of the corpus callosum and eye anomalies. It has material basis in de novo heterozygous mutation in the ZEB2 gene on chromosome 2q22', 'microcephaly, mental retardation, and distinct facial featrues, with or without Hirschprung disease|Hirschsprung disease mental retardation syndrome', 'OMIM:235730|ORDO:2152|MESH:C536990|UMLS_CUI:C1856113|SNOMEDCT_US_2016_03_01:703535000|NCI:C74999', '1', 'OMIM:235730');
INSERT INTO `disease_info` VALUES ('DOID:0060486', 'Perry syndrome@en', 'A syndrome characterized by parkinsonism, hypoventilation, depression, and weight loss; that has material basis in heterozygous mutation in the DCTN1 gene on chromosome 2p13.. The mean age at onset is 48 years; the mean disease duration is five years. Parkinsonism and psychiatric changes (depression, apathy, character changes, and withdrawal) tend to occur early; severe weight loss and hypoventilation manifest later', 'parkinsonism with alveolar hypoventilation and mental depression', 'ORDO:178509|OMIM:168605|MESH:C566822', '1', 'OMIM:168605');
INSERT INTO `disease_info` VALUES ('DOID:0060488', 'Pitt-Hopkins syndrome@en', 'A syndrome characterized by intellectual disability and developmental delay, breathing problems, recurrent seizures (epilepsy), and distinctive facial features. It has material basis in heterozygous de novo mutations in the TCF4 gene in chromosome 18q21', '', 'OMIM:610954|UMLS_CUI:C1970431|SNOMEDCT_US_2016_03_01:702344008|MESH:C537403|ORDO:2896', '1', 'OMIM:610954');
INSERT INTO `disease_info` VALUES ('DOID:0060490', 'Schimke immuno-osseous dysplasia@en', 'A spondyloepiphyseal dysplasia characterized by short stature with hyperpigmented macules, unusual facies, proteinuria with progressive renal failure, lymphopenia with recurrent infections, and cerebral ischaemia. It has material basis in mutations in the SMARCAL1 gene', 'Schimke immunoosseous dysplasia|Schimke syndrome|spondyloepiphyseal dysplasia - nephrotic syndrome|immunoosseous dysplasia Schimke type', 'OMIM:242900|ORDO:1830|MESH:C536629|UMLS_CUI:C0877024', '1', 'OMIM:242900');
INSERT INTO `disease_info` VALUES ('DOID:0060491', 'SPOAN syndrome@en', 'A neurodegenerative disease characterized by spastic paraplegia, axonal neuropathy, dysarthria, acoustic startle, and congenital optical atrophy. It has material basis in homozygous mutation in the KLC2 gene on chromosome 11q13.2', 'spastic paraplegia, optic atropy, and neuropathy syndrome|spastic paraplegia, optic atropy, and neuropathy', 'ICD10CM:G11.4|OMIM:609541|MESH:C563702|ORDO:320406', '1', 'OMIM:609541');
