INSERT INTO `disease_info` VALUES ('DOID:0060535', 'Warsaw breakage syndrome@en', 'A syndrome mainly characterized by severe growth retardation and microcephaly. It is a new form of cohesinopathy showing defects in sister chromatid cohesion and hypersensitivity to chemicals that induce replication stress, thus combining distinct cytogenetic features seen in Roberts syndrome and Fanconi anemia, respectively. It has material basis in homozygous or compound heterozygous mutation in the DDX11 gene on chromosome 12p11', 'WABS', 'ORDO:280558|OMIM:613398', '1', 'OMIM:613398');
INSERT INTO `disease_info` VALUES ('DOID:0060536', 'mitochondrial complex I deficiency@en', 'A mitochondrial metabolism disease characterized by a wide range of manifestations including marked and often fatal lactic acidosis, cardiomyopathy, leukoencephalopathy, pure myopathy and hepatopathy with tubulopathy. Among the numerous clinical phenotypes observed are Leigh syndrome, Leber hereditary optic neuropathy and MELAS syndrome. It can have material basis in mutations in multiple different genes, both nuclear-encoded and mitochondrial-encoded', 'isolated NADH-coenzyme Q reductase deficiency|isolated mitochondrial respiratory chain complex I deficiency|isolated NADH-CoQ reductase deficiency|isolated NADH-ubiquinone reductase deficiency', 'ORDO:2609|UMLS_CUI:C2936907|MESH:C537475|OMIM:252010', '1', 'OMIM:252010');
INSERT INTO `disease_info` VALUES ('DOID:0060537', 'mitochondrial complex II deficiency@en', 'A mitochondrial metabolism disease characerized by a highly variable phenotype. Some patients have multisystem involvement of the brain, heart, muscle, liver, and kidneys resulting in death in infancy, whereas others have only isolated cardiac or muscle involvement with onset in adulthood and normal cognition. It has material basis in homozygous or compound heterozygous mutation in the nuclear-encoded SDHA gene on chromosome 5p, the nuclear-encoded SDHAF1 gene on chromosome 19q, or the nuclear-encoded SDHD gene on chromosome 11q23', 'isolated succinate-coenzyme Q reductase deficiency|isolated mitochondrial respiratory chain complex II deficiency|isolated succinate-ubiquinone reductase deficiency|isolated succinate-CoQ reductase deficiency', 'ORDO:3208|MESH:C565375|OMIM:252011|ICD10CM:G71.3', '1', 'OMIM:252011');
INSERT INTO `disease_info` VALUES ('DOID:0060538', 'purpura fulminans@en', 'A purpura characterized  blood spots, bruising and discolouration of the skin resulting from coagulation in small blood vessels within the skin and rapidly leads to skin necrosis and disseminated intravascular coagulation. It is often fatal', 'purpura gangrenosa', 'MESH:D055665|ICD10CM:D65', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060539', 'Hermansky-Pudlak syndrome 1@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the HPS1 gene on chromosome 10q24', '', 'OMIM:203300', '1', 'OMIM:203300');
INSERT INTO `disease_info` VALUES ('DOID:0060540', 'Hermansky-Pudlak syndrome 2@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding the beta-3A subunit of the AP3 complex (AP3B1) on chromosome 5q14.1', '', 'OMIM:608233', '1', 'OMIM:608233');
INSERT INTO `disease_info` VALUES ('DOID:0060541', 'Hermansky-Pudlak syndrome 3@en', 'A Hermasky-Pudlak syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the HPS3 gene on chromosome 3q24', '', 'OMIM:614072', '1', 'OMIM:614072');
INSERT INTO `disease_info` VALUES ('DOID:0060542', 'Hermansky-Pudlak syndrome 4@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the HPS4 gene on chromosome 22q12.1', '', 'OMIM:614073', '1', 'OMIM:614073');
INSERT INTO `disease_info` VALUES ('DOID:0060543', 'Hermansky-Pudlak syndrome 5@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous mutation in the HPS5 gene on chromosome 11p14', '', 'OMIM:614074', '1', 'OMIM:614074');
INSERT INTO `disease_info` VALUES ('DOID:0060544', 'Hermansky-Pudlak syndrome 6@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the HPS6 gene on chromosome 10q24', '', 'OMIM:614075', '1', 'OMIM:614075');
INSERT INTO `disease_info` VALUES ('DOID:0060545', 'Hermansky-Pudlak syndrome 7@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous mutation in the DTNBP1 gene on chromosome 6p22.3', '', 'OMIM:614076', '1', 'OMIM:614076');
INSERT INTO `disease_info` VALUES ('DOID:0060546', 'Hermansky-Pudlak syndrome 8@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous mutation in the BLOC1S3 gene on chromosome 19q13', '', 'OMIM:614077', '1', 'OMIM:614077');
INSERT INTO `disease_info` VALUES ('DOID:0060547', 'Hermansky-Pudlak syndrome 9@en', 'A Hermansky-Pudlak syndrome that has_material_basis_in homozygous mutation in the gene encoding palladin (BLOC1S6) on chromosome 15q21', '', 'OMIM:614171', '1', 'OMIM:614171');
INSERT INTO `disease_info` VALUES ('DOID:0060548', 'luminal breast carcinoma@en', 'luminal breast carcinoma@en', 'luminal breast cancer|breast tumor luminal', 'EFO:0000306', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060549', 'Barber-Say syndrome@en', 'A syndrome characterized by d by the association of excessive hair growth (hypertrichosis), papery thin and fragile (atrophic) skin, outward turned eyelids (ectropion) and a large mouth (macrostomia). It is that has material basis in heterozygous mutation in the TWIST2 gene on chromosome 2q37', '', 'UMLS_CUI:C1319466|SNOMEDCT_US_2016_03_01:408537003|ORDO:1231|OMIM:209885|MESH:C537908', '1', 'OMIM:209885');
INSERT INTO `disease_info` VALUES ('DOID:0060550', 'ablepharon macrostomia syndrome@en', 'A syndrome characterized by  by the association of ablepharon, macrostomia, abnormal external ears, syndactyly of the hands and feet, skin findings (such as dry and coarse skin or redundant folds of skin), absent or sparse hair, genital malformations and developmental delay. Other reported manifestations include malar hypoplasia, absent or hypoplastic nipples, umbilical abnormalities and growth retardation. It is that has material basis in heterozygous mutation in the TWIST2 gene on chromosome 2q37', 'poikiloderma with neutropenia, Clericuzio type', 'UMLS_CUI:C1860224|ORDO:920|OMIM:200110|MESH:C535557', '1', 'OMIM:200110');
INSERT INTO `disease_info` VALUES ('DOID:0060551', 'poikiloderma with neutropenia@en', 'A skin disease characterized by poikiloderma, hyperkeratotic nails, generalized hyperkeratosis on palms and soles, neutropenia, short stature, and recurrent pulmonary infections. It has material basis in mutation in the C16ORF57 gene on chromosome 16q13', '', 'ORDO:221046|OMIM:604173|ICD10CM:D82.8', '1', 'OMIM:604173');
INSERT INTO `disease_info` VALUES ('DOID:0060556', 'Kufor-Rakeb syndrome@en', 'A disease that is characterized by supranuclear gaze palsy, spasticity, and dementia and has_material_basis_in homozygous or compound heterozygous mutation in a lysosomal type 5 ATPase encoding gene (ATP13A2) on chromosome 1p36', 'autosomal recessive juvenile onset Parkinson disease 9|autosomal recessive Parkinson disease 9', 'OMIM:606693|UMLS_CUI:C1847640|MESH:C537177|ORDO:306674', '1', 'OMIM:606693');
INSERT INTO `disease_info` VALUES ('DOID:0060557', 'ataxia with oculomotor apraxia type 3@en', 'ataxia with oculomotor apraxia type 3@en', 'ataxia-oculomotor apraxia 3', 'OMIM:615217', '1', 'OMIM:615217');
INSERT INTO `disease_info` VALUES ('DOID:0060558', 'lethal congenital contracture syndrome@en', 'A syndrome characterized by congenital nonprogressive joint contractures. The contractures can involve the upper or lower limbs and/or the vertebral column, leading to various degrees of flexion or extension limitations evident at birth', '', 'ORDO:294965|OMIM:PS253310|ICD10CM:Q68.8', '5', 'OMIM:PS253310');
INSERT INTO `disease_info` VALUES ('DOID:0060559', 'lethal congenital contracture syndrome 1@en', 'A lethal congenital contracture syndrome that has material basis in homozygous or compound heterozygous mutation in the mRNA export mediator GLE1 on chromosome 9q34', 'multiple contracture syndrome, Finnish type|LCCS1', 'OMIM:253310|ORDO:1486|MESH:C537194|UMLS_CUI:C1854664', '1', 'OMIM:253310');
INSERT INTO `disease_info` VALUES ('DOID:0060560', 'lethal congenital contracture syndrome 2@en', 'A lethal congenital contracture syndrome that can be that has material basis in homozygous mutation in the ERBB3 gene on chromosome 12q13', 'multiple contracture syndrome, Israeli-Bedouin type|LCCS2', 'OMIM:607598|ORDO:137783|ICD10CM:Q68.8|MESH:C564369', '1', 'OMIM:607598');
INSERT INTO `disease_info` VALUES ('DOID:0060561', 'DMD-related dilated cardiomyopathy', 'A dilated cardiomyopathy that has_material_basis_in mutations in the DMD gene', '', 'MESH:C580047', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060562', 'anomalous left coronary artery from the pulmonary artery@en', 'A coronary artery anomaly in which the left coronary artery (LCA) branches off the pulmonary artery instead of the aortic sinus', 'White-Garland syndrome|Bland-White-Garland syndrome|ALCAPA', 'MESH:D063748', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060563', 'Char syndrome@en', 'A patent ductus arteriosus with facial dysmorphism and abnormal fifth digits', '', 'OMIM:169100|MESH:C566815', '1', 'OMIM:169100');
INSERT INTO `disease_info` VALUES ('DOID:0060564', 'spinal disease@en', 'spinal disease@en', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060565', 'Ritscher-Schinzel syndrome', 'A syndrome characterized by craniofacial (prominent occiputal and forehead, hypertelorism, ocular coloboma, cleft palate), cerebellar (Dandy-Walker malformation, cerebellar vermis hypoplasia) and cardiac (tetralogy of Fallot, atrial and ventricular septal defects) anomalies', '3C syndrome@en|craniocerebellocardiac dysplasia|CCC dysplasia', 'UMLS_CUI:C0796137|ICD10CM:Q87.8|ORDO:7|OMIM:PS220210|MESH:C535313', '5', 'OMIM:PS220210');
INSERT INTO `disease_info` VALUES ('DOID:0060566', 'Holzgreve-Wagner-Rehder Syndrome@en', 'A syndrome characterized by Potter sequence, heart defect, cleft palate, polydactyly, and skeletal defects', 'Holzgreve syndrome|Holzgreve Wagner Rehder Syndrome', 'MESH:C535327|ORDO:2167|OMIM:236110|UMLS_CUI:C1856095|ICD10CM:Q87.8', '5', 'OMIM:236110');
INSERT INTO `disease_info` VALUES ('DOID:0060567', 'erythema elevatum diutinum@en', 'A vasculitis characterised by red, purple, brown or yellow papules (raised spot), plaques, or nodules, found on the backs of the hands, other extensor surfaces overlying joints, and on the buttocks', '', 'UMLS_CUI:C0263398|ORDO:90000|MESH:C535509|ICD10CM:L95.1', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060569', 'hypertrichotic osteochondrodysplasia Cantu type@en', 'An osteochondrodysplasia characterized by congenital hypertrichosis, neonatal macrosomia, and cardiomegaly', 'Cantu syndrome', 'OMIM:239850|MESH:C535572', '1', 'OMIM:239850');
INSERT INTO `disease_info` VALUES ('DOID:0060570', 'cardiac tuberculosis@en', 'cardiac tuberculosis@en', '', 'MESH:D014381', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060571', 'Ritscher-Schinzel syndrome 1', 'A Ritscher-Schinzel syndrome that has_material_basis_in homozygous mutation in the KIAA0196 gene on chromosome 8q24', '', 'ORDO:7|OMIM:220210', '1', 'OMIM:220210');
INSERT INTO `disease_info` VALUES ('DOID:0060572', 'Ritscher-Schinzel syndrome 2', 'A Ritscher-Schinzel syndrome that has_material_basis_in mutation in the CCDC22 gene on chromosome Xp11', '', 'ORDO:7|OMIM:300963', '1', 'OMIM:300963');
INSERT INTO `disease_info` VALUES ('DOID:0060573', 'von Willebrand\'s disease 1', 'A von Willebrand\'s disease characterized by quantitative partial deficiency of circulating VWF that has material_basis_in heterozygous mutation in the VWF gene on chromosome 12p13', 'von Willebrand disease type I|VWD type 1|VWD1|von Willebrand disease type 1', 'OMIM:193400|MESH:D056725|UMLS_CUI:C1264039|ICD10CM:D68.0', '1', 'OMIM:193400');
INSERT INTO `disease_info` VALUES ('DOID:0060574', 'von Willebrand\'s disease 2', 'A von Willebrand\'s disease characterized by qualitative but not quantitative abnormalities of the VWF protein that has material_basis_in mutation in the VWF gene which maps to chromosome 12p13', 'VWD type 2|von Willebrand disease type II|VWD2|von Willebrand disease type 2', 'OMIM:613554|UMLS_CUI:C1264040|ORDO:166081|MESH:D056728', '1', 'OMIM:613554');
INSERT INTO `disease_info` VALUES ('DOID:0060575', '3MC syndrome 1', 'A 3MC syndrome that has_material_basis_in homozygous mutation in the MASP1 gene on chromosome 3q27', '', 'OMIM:257920', '1', 'OMIM:257920');
INSERT INTO `disease_info` VALUES ('DOID:0060576', '3MC syndrome 2', 'A 3MC syndrome that has_material_basis_in homozygous mutation in the COLEC11 gene on chromosome 2p25', '', 'OMIM:265050', '1', 'OMIM:265050');
INSERT INTO `disease_info` VALUES ('DOID:0060577', '3MC syndrome 3', 'A 3MC syndrome that has_material_basis_in a compound heterozygous mutation in the COLEC10 gene on chromosome 8q24', '', 'OMIM:248340', '1', 'OMIM:248340');
INSERT INTO `disease_info` VALUES ('DOID:0060578', 'Noonan syndrome 1', 'A Noonan syndrome that has_material_basis_in the PTPN11 gene on chromosome 12q24', 'NS1', 'OMIM:163950|ICD10CM:Q87.1', '1', 'OMIM:163950');
INSERT INTO `disease_info` VALUES ('DOID:0060580', 'Noonan syndrome 2', 'A Noonan syndrome characterized by hypertrophic obstructive cardiomyopathy and that has_material_basis_in an autosomal recessive inheritance', 'NS2', 'OMIM:605275|ICD10CM:Q87.1', '5', 'OMIM:605275');
INSERT INTO `disease_info` VALUES ('DOID:0060581', 'Noonan syndrome 3', 'A Noonan syndrome that has_material_basis_in heterozygous mutation in the KRAS gene', 'NS3', 'OMIM:609942|ICD10CM:Q87.1', '1', 'OMIM:609942');
INSERT INTO `disease_info` VALUES ('DOID:0060582', 'Noonan syndrome 4', 'A Noonan syndrome that has_material_basis_in heterozygous mutation in the SOS1 gene on chromosome 2p22', 'NS4', 'OMIM:610733|ICD10CM:Q87.1', '1', 'OMIM:610733');
INSERT INTO `disease_info` VALUES ('DOID:0060583', 'Noonan syndrome 5', 'A Noonan syndrome that has_material_basis_in mutation in the RAF1 gene', 'NS5', 'OMIM:611553|ICD10CM:Q87.1', '1', 'OMIM:611553');
INSERT INTO `disease_info` VALUES ('DOID:0060584', 'Noonan syndrome 6', 'A Noonan syndrome that has_material_basis in  heterozygous mutation in the NRAS gene on chromosome 1p13', 'NS6', 'OMIM:613224|ICD10CM:Q87.1', '1', 'OMIM:613224');
INSERT INTO `disease_info` VALUES ('DOID:0060585', 'Noonan syndrome 7', 'A Noonan syndrome that has_material_basis in heterozygous mutation in the BRAF gene', 'NS7', 'OMIM:613706|ICD10CM:Q87.1', '1', 'OMIM:613706');
INSERT INTO `disease_info` VALUES ('DOID:0060586', 'Noonan syndrome 8', 'A Noonan syndrome that has_material_basis_in aused by heterozygous mutation in the RIT1 gene on chromosome 1q22', 'NS8', 'OMIM:615355|ICD10CM:Q87.1', '1', 'OMIM:615355');
INSERT INTO `disease_info` VALUES ('DOID:0060587', 'Noonan syndrome 9', 'A Noonan syndrome that has_material_basis_in heterozygous mutation in the SOS2 gene on chromosome 14q21', 'NS9', 'OMIM:616559|ICD10CM:Q87.1', '1', 'OMIM:616559');
INSERT INTO `disease_info` VALUES ('DOID:0060588', 'Noonan syndrome 10', 'A Noonan syndrome that has_material_basis_in heterozygous mutation in the LZTR1 gene on chromosome 22q11', 'NS10', 'OMIM:616564|ICD10CM:Q87.1', '1', 'OMIM:616564');
INSERT INTO `disease_info` VALUES ('DOID:0060589', 'Yunis-Varon syndrome', 'A syndrome characterized by skeletal defects, including cleidocranial dysplasia and digital anomalies, and severe neurologic involvement with neuronal loss. Enlarged cytoplasmic vacuoles are found in neurons, muscle, and cartilage. It is usually lethal in infancy and has material basis in homozygous or compound heterozygous mutation in the FIG4 gene on chromosome 6q21', 'cleidocranial dysplasia with micrognathia, absent thumbs, and distal aphalangia|cleidocranial dysplasia-micrognathia-absent thumbs syndrome', 'ICD10CM:Q87.8|UMLS_CUI:C1857663|OMIM:216340|MESH:C536719', '1', 'OMIM:216340');
INSERT INTO `disease_info` VALUES ('DOID:0060590', 'XFE progeroid syndrome', 'A syndrome characterized by aged bird-like facies, lack of subcutaneous fat, dwarfism, cachexia and microcephaly. Additional features include sun-sensitivity from birth, learning disabilities, hearing loss, and visual impairment. It has material basis in homozygous mutation in the ERCC4 gene on chromosome 16p13', 'XPF-ERCC1 progeroid syndrome|XFEPS', 'OMIM:610965|MESH:C567043', '1', 'OMIM:610965');
INSERT INTO `disease_info` VALUES ('DOID:0060591', 'WHIM syndrome', 'An immunodeficiency disease characterized by neutropenia, hypogammaglobulinemia, and extensive human papillomavirus (HPV) infection. It has material basis in heterozygous mutation in the CXCR4 gene on chromosome 2q22', 'warts-hypogammaglobulinemia-infections-myelokathexis syndrome|warts, hypogammaglobulinemia, infections, and myelokathexis|WHIMS', 'ICD10CM:D81.8|MESH:C536697|OMIM:193670|UMLS_CUI:C0472817', '1', 'OMIM:193670');
INSERT INTO `disease_info` VALUES ('DOID:0060592', 'B-cell adult acute lymphocytic leukemia', 'B-cell adult acute lymphocytic leukemia', 'adult b-cell lymphocytic leukemia|adult b-cell acute lymphoblastic leukemia|adult B-lymphoblastic leukemia|adult B acute lymphoblastic leukemia', 'NCI:C9143', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060597', 'atypical chronic myeloid leukemia', 'A myelodysplastic myeloproliferative neoplasm characterized by the principal involvement of the neutrophil series with leukocytosis and multilineage dysplasia. The neoplastic cells do not have a Philadelphia chromosome or the BCR/ABL fusion gene', 'subacute myeloid leukemia|atypical CML|subacute myelogenous leukemia|atypical chronic myeloid leukemia BCR-ABL1 negative|aCML|subacute granulocytic leukemia', 'UMLS_CUI:C0349640|ICD10CM:C92.2|ORDO:98824|MESH:D054438|NCI:C3519', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060599', 'Nance-Horan syndrome', 'An X-linked disease that has_material_basis_in mutation in the NHS gene on chromosome Xp22. It is characterized by congenital cataract leading to profound vision loss, characteristic dysmorphic features and dental anomalies', '', 'ORDO:627|ICD10CM:Q87.0|OMIM:302350|MESH:C538336|UMLS_CUI:C0796085', '1', 'OMIM:302350');
INSERT INTO `disease_info` VALUES ('DOID:0060600', 'hereditary motor and sensory neuropathy with agenesis of the corpus callosum', 'A neuropathy that has_material_basis_in homozygous or compound heterozygous mutation in the SLC12A6 gene on chromosome 15q14. It is an autosomal recessive disease of early onset characterized by a delay in developmental milestones, a severe sensory-motor polyneuropathy with areflexia, a variable degree of agenesis of the corpus callosum, amyotrophy, hypotonia, and cognitive impairment', 'peripheral neuropathy associated with agenesis of the corpus callosum|agenesis of the corpus callosum with peripheral neuropathy|Andermann syndrome|Charlevoix disease|corpus callosum agenesis-neuronopathy syndrome', 'ORDO:1496|MESH:C536446|OMIM:218000|ICD10CM:G60.0|UMLS_CUI:C0795950', '1', 'OMIM:218000');
INSERT INTO `disease_info` VALUES ('DOID:0060601', 'alpha-2-plasmin inhibitor deficiency', 'A hemorrhagic disease that has_material_basis_in mutation in the PLI gene. It is characterized by a hemorrhagic tendency presenting from childhood with prolonged bleeding and ecchymoses following minor trauma and spontaneous bleeding episodes', 'plasmin inhibitor deficiency|antiplasmin defiency', 'ICD10CM:D68.8|OMIM:262850|ORDO:79', '1', 'OMIM:262850');
INSERT INTO `disease_info` VALUES ('DOID:0060602', 'alpha-methylacyl-CoA racemase deficiency', 'A peroxisomal disease that has_material_basis in homozygous mutation in the AMACR gene on chromosome 5p13.2-q11.1. It is characterized by retinitis pigmentosa resulting in progressive visual failure, learning difficulties, a peripheral neuropathy, and hypogonadism', 'AMACR deficiency', 'OMIM:614307', '1', 'OMIM:614307');
INSERT INTO `disease_info` VALUES ('DOID:0060603', 'isolated anhidrosis with normal sweat glands', 'An anhidrosis that has_material_basis in homozygous mutation in the ITPR2 gene on chromosome 12p11', 'Dann-Epstein-Sohar syndrome', 'OMIM:106190', '1', 'OMIM:106190');
INSERT INTO `disease_info` VALUES ('DOID:0060604', 'ankyloglossia', 'A tongue disease characterized by an unusually short, thick lingual frenulum, a membrane connecting the underside of the tongue to the floor of the mouth', 'tongue-tie', 'OMIM:106280|MESH:C562396|ICD10CM:Q38.1', '5', 'OMIM:106280');
INSERT INTO `disease_info` VALUES ('DOID:0060605', 'anterior segment mesenchymal dysgenesis', 'anterior segment mesenchymal dysgenesis', '', 'ORDO:88632|OMIM:107250|ICD10CM:Q13.8', '1', 'OMIM:107250');
INSERT INTO `disease_info` VALUES ('DOID:0060606', 'fetal nicotine spectrum disorder', 'A specific developmental disorder that is characterized by physical, behavioral and learning birth defects resulting from maternal ingestion of nicotine during pregnancy', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060608', 'microcephalic osteodysplastic primordial dwarfism type I@en', 'A microcephalic osteodysplastic primordial dwarfism that has_material_basis_in homozygous or compound heterozygous mutation in the RNU4ATAC gene, encoding a small nuclear RNA (snRNA) component of the U12-dependent (minor) spliceosome, on chromosome 2q14.2. It is characterized by dwarfism, microcephaly, and neurologic abnormalities, including mental retardation, brain malformations, and ocular, auditory sensory deficits', 'cephaloskeletal dysplasia|brachymelic primordial dwarfism|Taybi-Linder syndrome|osteodysplastic primordial dwarfism type I|low-birth-weight dwarfism with skeletal dysplasia', 'ORDO:2636|OMIM:210710|ICD10CM:Q87.1', '1', 'OMIM:210710');
INSERT INTO `disease_info` VALUES ('DOID:0060609', 'microcephalic osteodysplastic primordial dwarfism type II@en', 'A microcephalic osteodysplastic primordial dwarfism that has_material_basis_in homozygous or compound heterozygous mutation in the PCNT gene, encoding pericentrin, on chromosome 21q22. It is characterized by intrauterine growth retardation, severe proportionate short stature, and microcephaly', 'osteodysplastic primordial dwarfism type II|Majewski osteodysplastic primordial dwarfism type II', 'OMIM:210720|ICD10CM:Q87.1|ORDO:2637', '1', 'OMIM:210720');
INSERT INTO `disease_info` VALUES ('DOID:0060610', 'megacystis-microcolon-intestinal hypoperistalsis syndrome', 'A syndrome that is characterized by marked dilatation of the bladder and microcolon and decreased intestinal peristalsis', 'Berdon syndrome|visceral myopathy', 'ORDO:2241|UMLS_CUI:C1608393|OMIM:155310|MESH:C536138|ICD10CM:Q43.8', '5', 'OMIM:155310');
INSERT INTO `disease_info` VALUES ('DOID:0060611', 'abdominal obesity-metabolic syndrome@en', 'abdominal obesity-metabolic syndrome@en', '', 'OMIM:PS605552', '5', 'OMIM:PS605552');
INSERT INTO `disease_info` VALUES ('DOID:0060612', 'abdominal obesity-metabolic syndrome 3', 'An abdominal obesity-metabolic syndrome that has_material_basis_in heterozygous mutation in the DYRK1B gene on chromosome 19q13', '', 'OMIM:615812', '1', 'OMIM:615812');
INSERT INTO `disease_info` VALUES ('DOID:0060613', 'X-linked cleft palate with or without ankyloglossia', 'A cleft palate that has_material_basis in mutation in the TBX22 gene on chromosome Xq21', 'X-linked cleft palate and ankyloglossia', 'ORDO:324601|OMIM:303400', '1', 'OMIM:303400');
INSERT INTO `disease_info` VALUES ('DOID:0060614', 'ulnar-mammary syndrome', 'A syndrome that has_material_basis_in heterozygous mutation in the TBX3 gene. It is characterized by posterior limb deficiencies or duplications, apocrine/mammary gland hypoplasia and, or dysfunction, abnormal dentition, delayed puberty in males, and genital anomalies', 'Schinzel syndrome|Pallister ulnar-mammary syndrome', 'UMLS_CUI:C1866994|MESH:C536937|ICD10CM:Q71.8|ORDO:3138|OMIM:181450', '1', 'OMIM:181450');
INSERT INTO `disease_info` VALUES ('DOID:0060638', 'neonatal diabetes mellitus with congenital hypothyroidism', 'A neonatal diabetes mellitus characterized by intrauterine growth retardation, hypothyroidism and onset of nonimmune diabetes mellitus within the first few weeks of life; it has_material_basis_in homozygous or compound heterozygous mutations in the GLIS3 gene on chromosome 9p24', 'NDH syndrome', 'ORDO:79118|OMIM:610199', '1', 'OMIM:610199');
INSERT INTO `disease_info` VALUES ('DOID:0060639', 'permanent neonatal diabetes mellitus', 'A neonatal diabetes mellitus that has_material_basis_in homozygous mutation in the glucokinase gene (GCK), heterozygous mutation in the KCNJ11 and INS genes, or by heterozygous or homozygous mutation in the ABCC8 gene', 'permanent diabetes mellitus of infancy|PNDM|PDMI', 'OMIM:606176', '1', 'OMIM:606176');
INSERT INTO `disease_info` VALUES ('DOID:0060640', 'ethylmalonic encephalopathy', 'A mitochondrial metabolism disease that is characterized by neurodevelopmental delay and regression, prominent pyramidal and extrapyramidal signs, recurrent petechiae, orthostatic acrocyanosis, and chronic diarrhea; it has_material_basis_in homozygous or compound heterozygous mutation in the ETHE1 gene, which encodes a mitochondrial matrix protein, on chromosome 19q13', '', 'ORDO:51188|UMLS_CUI:C1865349|OMIM:602473|MESH:C535737|ICD10CM:G31.8', '1', 'OMIM:602473');
INSERT INTO `disease_info` VALUES ('DOID:0060641', 'endocrine-cerebro-osteodysplasia syndrome', 'A syndrome that is characterized by multiple congenital defects in endocrine, cerebral, and skeletal systems leading to neonatal mortality; it has_material_basis_in mutation in the gene encoding intestinal cell kinase (ICK)', 'ECO syndrome', 'ORDO:199332|OMIM:612651|ICD10CM:Q87.8', '1', 'OMIM:612651');
INSERT INTO `disease_info` VALUES ('DOID:0060642', 'recessive dystrophic epidermolysis bullosa', 'An epidermolysis bullosa dystrophica characterized by recurrent blistering at the level of the sublamina densa beneath the cutaneous basement membrane; it has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding type VII collagen (COL7A1) on chromosome 3p21', 'autosomal recessive dystrophic epidermolysis bullosa generalisata gravis|RDEB, Hallopeau-Siemens type|autosomal recessive dystrophic epidermolysis bullosa, Hallopeau-Siemens type', 'OMIM:226600|ICD10CM:Q81.2|ORDO:79408', '1', 'OMIM:226600');
INSERT INTO `disease_info` VALUES ('DOID:0060643', 'primary sclerosing cholangitis', 'A sclerosing cholangitis characterized by fibroobliterative inflammation of the biliary tract, leading to cirrhosis and portal hypertension', '', 'UMLS_CUI:C0566602|ORDO:171|OMIM:613806|ICD10CM:K83.0', '5', 'OMIM:613806');
INSERT INTO `disease_info` VALUES ('DOID:0060644', 'chondrodysplasia-pseudohermaphroditism syndrome', 'A syndrome characterized by the clinical features of 46,XY complete gonadal dysgenesis in association with severe dwarfism with generalized chondrodysplasia', 'chondrodysplasia-disorder of sex development syndrome|Nivelon-Nivelon-Mabille syndrome', 'ORDO:1422|ICD10CM:Q87.1|UMLS_CUI:C1838654|OMIM:600092', '5', 'OMIM:600092');
