INSERT INTO `disease_info` VALUES ('DOID:0060728', 'NGLY1-deficiency', 'A carbohydrate metabolic disorder that has_material_basis_in homozygous or compound heterozygous mutation in the NGLY1 gene on chromosome 1p24. It is characterized by global developmental delay, hypotonia, abnormal involuntary movements, and alacrima or poor tear production', 'NGLY1-CDDG|congenital disorder of deglycosylation|deficiency of N-glycanase 1|congenital disorder of glycosylation type Iv', 'ICD10CM:E77.8|OMIM:615273|ORDO:404454', '1', 'OMIM:615273');
INSERT INTO `disease_info` VALUES ('DOID:0060730', 'torsion dystonia 1', 'A generalized dystomia characterized by autosomal dominant inheritance of dystonia usually presenting initially as focal, typically in the limbs, but often generalizes with age that has_material_basis_in heterozygous mutation in the TOR1A gene on chromosome 9q34', 'dystonia musculorum deformans', 'ORDO:256|OMIM:128100|ICD10CM:G24.1', '1', 'OMIM:128100');
INSERT INTO `disease_info` VALUES ('DOID:0060731', 'congenital central hypoventilation syndrome', 'An autonomic nervous system disease characterized by reduced responsiveness of the respiratory center to carbon dioxide, diminished pupillary light responses, and other symptoms related to defects in the autonomic nervous system and that has_material_basis_in most commonly heterozygous mutation in the PHOX2B gene on chromosome 4p13 and less frequently mutations in the RET, GDNF, EDN3, BDNF, or ASCL1 genes', 'Ondine curse|CCHS|Ondine syndrome|central congenital hypoventilation syndrome|congenital central alveolar hypoventilation syndrome', 'OMIM:209880|ORDO:661|ICD10CM:G47.3', '1', 'OMIM:209880');
INSERT INTO `disease_info` VALUES ('DOID:0060732', 'chromosome 9p deletion syndrome', 'A chromosome deletion syndrome characterized by trigonocephaly, flattened occiput midface hypoplasia, long philtrum, prominent forehead, broad flat nasal bridge, anteverted nares, malformed external ears, hypertelorism, hypertonia, delayed psychomotor development and that has_material_basis_in a contiguous gene deletion on the short arm of chromosome 9', '9p syndrome|monosomy 9p syndrome|Alfi syndrome', 'OMIM:158170|ICD10CM:Q93.5|ORDO:261112', '5', 'OMIM:158170');
INSERT INTO `disease_info` VALUES ('DOID:0060733', 'junctional epidermolysis bullosa with pyloric atresia', 'A junctional epidermolysis bullosa characterized by generalized blistering at birth with congenital atresia of the pylorus and rarely of other portions of the gastrointestinal tract and that has_material_basis_in  mutations in the ITGB4 or ITGA6 genes', 'epidermolysis bullosa junctionalis with pyloric atresia|junctional epidermolysis bullosa-pyloric atresia syndrome|JEB-PA|Carmi syndrome', 'OMIM:226730|ORDO:79403|ICD10CM:Q81.8', '1', 'OMIM:226730');
INSERT INTO `disease_info` VALUES ('DOID:0060735', 'epidermolysis bullosa simplex Dowling-Meara type', 'An epidermolysis bullosa simplex characterized by generalized non-scarring skin blistering that often occurs in clusters, progressive hyperkeratosis of the palms and soles, clumping of keratin filaments in basal epidermal cells and that has_material_basis_in mutation in either the KRT5 or KRT14 genes. This is the most severe of the epidermolysis bullosa simplex types and may result in neonatal or infant lethality in some cases', 'epidermolysis bullosa herpetiformis Dowling-Meara type|epidermolysis bullosa simplex, herpetiformis|EBSDM|EBS-gen sev|generalized severe epidermolysis bullosa simplex', 'ORDO:79396|ICD10CM:Q81.0|OMIM:131760', '1', 'OMIM:131760');
INSERT INTO `disease_info` VALUES ('DOID:0060736', 'epidermolysis bullosa simplex Ogna type', 'An epidermolysis bullosa simplex characterized by skin blisters originating in the deepest areas of the basal cell cytoplasm just above the hemidesmosomes, skin bruising and that has_material_basis_in heterozygous mutation in the PLEC1 gene on chromosome 8q24', 'EBS-O|EBS-Og|EBSOG', 'ORDO:79401|ICD10CM:Q81.0|OMIM:131950', '1', 'OMIM:131950');
INSERT INTO `disease_info` VALUES ('DOID:0060737', 'junctional epidermolysis bullosa Herlitz type', 'A junctional epidermolysis bullosa characterized by autosomal recessive inheritance of severe blisters and extensive erosions, localized to the skin and mucous membranes, resulting in a failure to thrive and that has_material_basis_in  mutations in any 1 of the 3 genes encoding the subunits of laminin-5: LAMA3, LAMB3, and LAMC2. The Herlitz type is more severe than the related non-Herlitz type of junctional epidermolysis bullosa', 'epidermolysis bullosa letalis|Herlitz type epidermolysis bullosa junctionalis|junctional epidermolysis bullosa generalisata gravis|Herlitz-Pearson-type epidermolysis bullosa|JEB-H|junctional epidermolysis bullosa, Herlitz-Pearson type|JEB-Herlitz type', 'OMIM:226700|ORDO:79404|ICD10CM:Q81.1', '1', 'OMIM:226700');
INSERT INTO `disease_info` VALUES ('DOID:0060738', 'junctional epidermolysis bullosa non-Herlitz type', 'A junctional epidermolysis bullosa characterized by skin and mucosal blistering, nail dystrophy or nail absence and enamel hypoplasia and that has_material_basis_in homozygous or compound heterozygous mutation in several genes including COL17A1, ITGB4 and the 3 genes that encode the subunits of laminin-5: LAMA3, LAMB3, and LAMC2. The non-Herlitz type is less severe than the related Herlitz type of junctional epidermolysis bullosa', 'GABEB|JEB-nH gen|junctional epidermolysis bullosa generalisata mitis|JEN-nH|junctional epidermolysis bullosa, Disentis type|generalized junctional epidermolysis bullosa, non-Herlitz type|generalized atrophic benign epidermolysis bullosa', 'ICD10CM:Q81.8|OMIM:226650|ORDO:79402|ORDO:89840', '1', 'OMIM:226650');
INSERT INTO `disease_info` VALUES ('DOID:0060739', 'hand-foot-genital syndrome', 'A autosomal dominant disease characterized by distal limb defects (short thumbs and first toes, clinodactyly of the fifth fingers, delayed ossification of the wrist and ankle bones), urogenital defects and that has_material_basis_in heterozygous mutation in the HOXA13 gene on chromosome 7p15', 'HFGS|hand-foot-uterus syndrome', 'OMIM:140000|ICD10CM:Q51.2|ORDO:2438', '1', 'OMIM:140000');
INSERT INTO `disease_info` VALUES ('DOID:0060740', 'methylmalonic aciduria due to methylmalonyl-CoA mutase deficiency', 'A methylmalonic acidemia characterized by accumulation of methylmalonic acid in the blood that is unresponsive to vitamn B12 therapy and that has_material_basis_in mutation in the MUT gene on chromosome 6p12.3', 'methylmalonic aciduria mut type|vitamin B12-unresponsive methylmalonic aciduria|methylmalonic acidemia due to methylmalonyl-CoA mutase deficiency', 'ORDO:27|OMIM:251000|ICD10CM:E71.1', '1', 'OMIM:251000');
INSERT INTO `disease_info` VALUES ('DOID:0060741', 'methylmalonic acidemia due to transcobalamin receptor defect', 'A methylmalonic acidemia characterized by autosomal recessive inheritance of low uptake of transcobalamin-bound cobalamin, but normal conversion to adenosylcobalamin and methylcobalamin and that has_material_basis_in mutation in the CD320 gene', 'methylmalonic aciduria due to transcobalamin receptor defect|methylmalonic acidemia, TCb1R type|methylmalonic acidemia, TCbIR type', 'ICD10CM:E71.1|ORDO:280183|OMIM:613646', '1', 'OMIM:613646');
INSERT INTO `disease_info` VALUES ('DOID:0060742', 'methylmalonic acidemia cb1A type', 'A methylmalonic acidemia characterized by autosomal recessive inheritance, defects in the synthesis of AdoCbl, vitamin B12 therapy responsiveness and that has_material_basis_in homozygous or compound heterozygous mutation in the MMAA gene on chromosome 4q31', 'methylmalonic aciduria, vitamin B12-responsive due to a defect in synthesis of adenosylcobalamin cb1A type|methylmalonic aciduria cb1A type', 'OMIM:251100|ORDO:79310|ICD10CM:E71.1', '1', 'OMIM:251100');
INSERT INTO `disease_info` VALUES ('DOID:0060743', 'methylmalonic acidemia cb1B type', 'A methylmalonic acidemia characterized by autosomal recessive inheritance, defects in the synthesis of AdoCbl, vitamin B12 therapy responsiveness and that has_material_basis_in homozygous or compound heterozygous mutation in the MMAB gene on chromosome 12q24', 'methylmalonic aciduria cb1B type|methylmalonic aciduria, vitamin B12-responsive, due to defect in synthesis of adenosylcobalamin, cblB complementation type', 'ORDO:79311|OMIM:251110|ICD10CM:E71.1', '1', 'OMIM:251110');
INSERT INTO `disease_info` VALUES ('DOID:0060744', 'Pendred Syndrome', 'An autosomal recessive disease characterized by bilateral prelingual sensorineural hearing loss and euthyroid goiter and that has_material_basis_in homozygous or compound heterozygous mutation in the SLC26A4 gene on chromosome 7q', 'TDH2B|deafness with goiter|goiter-deafness syndrome|genetic defect in thyroid hormonogenesis 2B|thyroid dyshormonogenesis 2B|congenital hypothyroidism due to dyshormonogenesis 2B', 'OMIM:274600|MESH:C536648|UMLS_CUI:C0271829|ORDO:705|ICD10CM:E07.1', '1', 'OMIM:274600');
INSERT INTO `disease_info` VALUES ('DOID:0060745', 'Doyne honeycomb retinal dystrophy', 'A retinal drusen characterized by yellow-white deposits (drusen) that accumulate beneath the retinal pigment epithelium in the posterior pole of the eye in a honeycomb pattern and that has_material_basis_in mutations in the EFEMP1 gene on chromosome 2p16', 'DHRD|Doyne honeycomb degeneration of retina', 'ICD10CM:H35.5|ORDO:75376|OMIM:126600', '1', 'OMIM:126600');
INSERT INTO `disease_info` VALUES ('DOID:0060746', 'basal laminar drusen', 'A retinal drusen characterized by yellow-white deposits (drusen) that accumulate beneath the retinal pigment epithelium on Bruch membrane and that has_material_basis_in mutations in the CFH gene on chromosome 1q31.3', 'drusen of bruch membrane|early adult-onset grouped drusen|cuticular drusen', 'ORDO:75376|ICD10CM:H35.5|OMIM:126700', '1', 'OMIM:126700');
INSERT INTO `disease_info` VALUES ('DOID:0060747', 'Duane-radial ray syndrome', 'An autosomal dominant disease characterized by upper limb anomalies, ocular anomalies, and, in some cases, renal anomalies and that has_material_basis_in heterozygous mutation in the SALL4 gene on chromosome 20q13', 'Okihiro syndrome|acrorenocular syndrome|Duane anomaly with radial ray abnormalities and deafness|DR syndrome', 'ORDO:93293|ICD10CM:Q87.8|OMIM:607323', '1', 'OMIM:607323');
INSERT INTO `disease_info` VALUES ('DOID:0060748', 'familial temporal lobe epilepsy 1', 'A temporal lobe epilepsy characterized by autosomal dominant inheritance of partial seizures originating from the temporal lobe that are often accompanied by auditory symptoms and that has_material_basis_in heterozygous mutation in the LGI1 gene on chromosome 10q24', 'partial epilepsy with auditory features|ETL1', 'ORDO:101046|OMIM:600512', '1', 'OMIM:600512');
INSERT INTO `disease_info` VALUES ('DOID:0060749', 'familial temporal lobe epilepsy 6', 'A temporal lobe epilepsy that has_material_basis_in variation in the chromosome region 3q25-q26', 'ETL6', 'ORDO:163717|OMIM:615697', '5', 'OMIM:615697');
INSERT INTO `disease_info` VALUES ('DOID:0060750', 'familial temporal lobe epilepsy 3', 'A temporal lobe epilepsy characterized by simple or complex partial seizures often accompanied by intense feelings of deja or altered awareness and that has_material_basis_in variation in the chromosome region 4q13.2-q21.3', 'familial mesial temporal lobe epilepsy|FMTLE', 'ORDO:163717|OMIM:611630', '5', 'OMIM:611630');
INSERT INTO `disease_info` VALUES ('DOID:0060751', 'familial temporal lobe epilepsy 7', 'A temporal lobe epilepsy characterized by autosomal dominant inheritance of focal seizures with prominent auditory symptoms and that has_material_basis_in heterozygous mutation in the RELN gene on chromosome 7q22', 'ETL7', 'ORDO:101046|OMIM:616436', '5', 'OMIM:616436');
INSERT INTO `disease_info` VALUES ('DOID:0060752', 'familial temporal lobe epilepsy 5', 'A temporal lobe epilepsy that has_material_basis_in heterozygous mutation in the CPA6 gene on chromosome 8q13', 'ETL5', 'ORDO:163717|OMIM:614417', '1', 'OMIM:614417');
INSERT INTO `disease_info` VALUES ('DOID:0060753', 'familial temporal lobe epilepsy 4', 'A temporal lobe epilepsy characterized by autosomal dominant inheritance of occipitotemporal lobe epilepsy and migraine with visual aura and that has_material_basis_in variation in the chromosome region 9q21-q22', 'occipitotemporal lobe epilepsy and migraine with aura|ETL4|EPOLM', 'ORDO:98819|OMIM:611631', '5', 'OMIM:611631');
INSERT INTO `disease_info` VALUES ('DOID:0060754', 'familial temporal lobe epilepsy 8', 'A temporal lobe epilepsy characterized by autosomal dominant inheritance of complex partial seizures with occasional secondary generalization and that has_material_basis_in heterozygous mutation in the GAL gene on chromosome 11q13', 'ETL8', 'ORDO:101046|OMIM:616461', '1', 'OMIM:616461');
INSERT INTO `disease_info` VALUES ('DOID:0060755', 'familial temporal lobe epilepsy 2', 'A temporal lobe epilepsy characterized by autosomal dominant inheritance of complex or partial seizures and childhood febrile seizures that has_material_basis_in variation in the chromosome region 12q22-q23.3', 'ETL2', 'ORDO:98819|OMIM:608096', '5', 'OMIM:608096');
INSERT INTO `disease_info` VALUES ('DOID:0060756', 'sclerosteosis 1', 'A sclerosteosis that has_material_basis_in homozygous mutation in the SOST gene on chromosome 17q21', 'SOST1', 'ORDO:3152|OMIM:269500|ICD10CM:M85.2', '1', 'OMIM:269500');
INSERT INTO `disease_info` VALUES ('DOID:0060757', 'sclerosteosis 2', 'A sclerosteosis that has_material_basis_in heterozygous or homozygous mutation in the LRP4 gene on chromosome 11p11', 'SOST2', 'ORDO:3152|OMIM:614305|ICD10CM:M85.2', '1', 'OMIM:614305');
INSERT INTO `disease_info` VALUES ('DOID:0060758', 'immunodeficiency with hyper-IgM type 2', 'A hyperimmunoglobulin syndrome characterized by normal or elevated serum IgM levels with absence of IgG, IgA, and IgE, resulting in a profound susceptibility to bacterial infections that has_material_basis_in homozygous or compound heterozygous mutation in the AICDA gene on chromosome 12p13', 'HIGM2|hyper-IgM syndrome type 2|activation-induced cytidine deaminase deficiency|AID deficiency', 'OMIM:605258|ICD10CM:D80.5|ORDO:101089|ORDO:183666', '1', 'OMIM:605258');
INSERT INTO `disease_info` VALUES ('DOID:0060759', 'immunodeficiency with hyper IgM type 5', 'A hyperimmunoglobulin syndrome characterized by normal or increased serum IgM concentrations associated with low or absent serum IgG, IgA, and IgE concentrations, indicating a defect in the class-switch recombination (CSR) process that has_material_basis_in homozygous or compound heterozygous mutation in the UNG gene on chromosome 12q23-q24.1', 'hyper-IgM syndrome 5|hyper-IgM syndrome due to uracil N-glycosylase|HIGM5|hyper-IgM syndrome due to UNG deficiency', 'ORDO:183666|ORDO:101092|ICD10CM:D80.5|OMIM:608106', '1', 'OMIM:608106');
INSERT INTO `disease_info` VALUES ('DOID:0060760', 'immunodeficiency with hyper-IgM type 4', 'A hyperimmunoglobulin syndrome characterized by normal or increased serum IgM concentrations associated with low or absent serum IgG, IgA, and IgE concentrations, indicating a defect in the class-switch recombination (CSR) process', 'hyper-IgM syndrome type 4|HIGM4', 'OMIM:608184|ICD10CM:D80.5|ORDO:183666|ORDO:101091', '5', 'OMIM:608184');
INSERT INTO `disease_info` VALUES ('DOID:0060761', 'familial chronic myelocytic leukemia-like syndrome', 'A chronic myeloid leukemia characterized by chronic myelocytic leukemia in early infancy and absence of the BCR/ABL fusion gene (Philadelphia chromosome)', 'familial CML-like syndrome', 'OMIM:600080', '5', 'OMIM:600080');
INSERT INTO `disease_info` VALUES ('DOID:0060762', 'lethal restrictive dermopathy', 'A skin disease characterized by thin, tightly adherent translucent skin with erosions at flexure sites, superficial vessels, typical facial dysmorphism, and generalized joint ankylosis that has_material_basis_in heterozygous mutation in the LMNA gene on chromosome 1q22 or by homozygous or compound heterozygous mutation in the ZMPSTE24 gene on chromosome 1p34', 'tight skin contracture syndrome|hyperkeratosis-contracture syndrome|lethal restrictive dermopathy', 'ICD10CM:Q82.8|UMLS_CUI:C0406585|OMIM:275210|ORDO:1662', '1', 'OMIM:275210');
INSERT INTO `disease_info` VALUES ('DOID:0060763', 'X-linked juvenile retinoschisis 1', 'A retinoschisis characterized by schisis (splitting) of the neural retina leading to reduced visual acuity in males due that has_material_basis_in the RS1 gene on chromosome Xp22', 'X-linked retinoschisis|X-linked juvenile retinoschisis|XLRS', 'ORDO:792|ICD10CM:Q14.1|OMIM:312700', '1', 'OMIM:312700');
INSERT INTO `disease_info` VALUES ('DOID:0060764', 'autosomal recessive Robinow syndrome', 'A Robinow syndrome characterized by autosomal recessive inheritance of severe skeletal dysplasia characterized by dysmorphic facial features, including frontal bossing, hypertelorism, and broad nose, short-limbed dwarfism, vertebral segmentation, and genital hypoplasia that has_material_basis_in homozygous or compound heterozygous mutations in the ROR2 gene on chromosome 9q22', 'COVESDEM syndrome|costovertebral segmentation defect-mesomelia syndrome|RRS', 'ORDO:1507|ICD10CM:Q87.1|ORDO:97360|OMIM:268310', '1', 'OMIM:268310');
INSERT INTO `disease_info` VALUES ('DOID:0060765', 'autosomal dominant Robinow syndrome 2', 'A Robinow syndrome characterized by autosomal dominant inheritance of mesomelic limb shortening, genital hypoplasia, and distinctive facial features that has_material_basis_in heterozygous mutation in the DVL1 gene on chromosome 1p36', 'DRS2', 'ICD10CM:Q87.1|ORDO:3107|ORDO:97360|OMIM:616331', '1', 'OMIM:616331');
INSERT INTO `disease_info` VALUES ('DOID:0060766', 'autosomal dominant Robinow syndrome 1', 'A Robinow syndrome characterized by autosomal dominant inheritance of dysmorphic features resembling a fetal face, mesomelic limb shortening, hypoplastic external genitalia in males, and renal and vertebral anomalies that has_material_basis_in heterozygous mutation in the WNT5A gene on chromosome 3p', 'DRS1', 'OMIM:180700|ORDO:3107|ICD10CM:Q87.1|ORDO:97360', '1', 'OMIM:180700');
INSERT INTO `disease_info` VALUES ('DOID:0060767', 'autosomal dominant Robinow syndrome 3', 'A Robinow syndrome characterized by autosomal dominant inheritance of mesomelia, genital hypoplasia, and distinctive facial features comprising frontal bossing, prominent eyes, and a depressed nasal bridge that has_material_basis_in heterozygous mutation in the DVL3 gene on chromosome 3q27', 'DRS3', 'ORDO:3107|ICD10CM:Q87.1|ORDO:97360|OMIM:616894', '1', 'OMIM:616894');
INSERT INTO `disease_info` VALUES ('DOID:0060768', 'Smith-Magenis syndrome', 'A chromosome deletion syndrome characterized by mild-to-moderate infantile hypotonia, minor skeletal anomalies, prepubertal short stature, brachydactyly, ophthalmologic and otolaryngologic abnormalities, peripheral neuropathy, developmental delay, cognitive impairment, and behavioral abnormalities that has_material basis_in a 3.7-Mb interstitial deletion in chromosome 17p11.2 or sometimes by mutations in the RAI1 gene in the same region', '17p11.2 microdeletion syndrome|chromosome 17p11.2 deletion syndrome', 'ICD10CM:Q93.5|ORDO:819|OMIM:182290', '1', 'OMIM:182290');
INSERT INTO `disease_info` VALUES ('DOID:0060769', 'T-cell immunodeficiency, congenital alopecia, and nail dystrophy', 'A severe combined immunodeficiency characterized by congenital alopecia, severe T-cell immunodeficiency, and ridging, pitting or curving of all nails that has_material_basis_in homozygous mutation in the FOXN1 gene on chromosome 17q11-q12', 'winged helix deficiency|alymphoid cystic thymic dysgenesis|severe T-cell immunodeficiency-congenital alopecia-nail dystrophy syndrome', 'ICD10CM:D82.8|OMIM:601705|ORDO:169095', '1', 'OMIM:601705');
INSERT INTO `disease_info` VALUES ('DOID:0060770', 'dextro-looped transposition of the great arteries', 'A congenital heart disease characterized by complete inversion of the great vessels where the aorta incorrectly arises from the right ventricle and the pulmonary artery incorrectly arises from the left ventricle', 'congenitally uncorrected transposition of the great vessels|congenitally uncorrected transposition of the great arteries|isolated ventriculoarterial discordance|ventriculoarterial discordance with atrioventricular concordance|D-TGA', 'ORDO:860|OMIM:PS608808|ICD10CM:Q20.3', '5', 'OMIM:PS608808');
INSERT INTO `disease_info` VALUES ('DOID:0060771', 'dextro-looped transposition of the great arteries 1', 'A dextro-looped transposition of the great arteries that has_material_basis_in heterozygous missense mutation in the MED13L gene on chromosome 12q24', 'DTGA1', 'OMIM:608808|ICD10CM:Q20.3', '1', 'OMIM:608808');
INSERT INTO `disease_info` VALUES ('DOID:0060772', 'dextro-looped transposition of the great arteries 3', 'A dextro-looped transposition of the great arteries that has_material_basis_in heterozygous mutation in the GDF1 gene on chromosome 19p13', 'DTGA3', 'OMIM:613854|ICD10CM:Q20.3', '1', 'OMIM:613854');
INSERT INTO `disease_info` VALUES ('DOID:0060773', 'cleft lip-palate-ectodermal dysplasia syndrome', 'An autosomal recessive disease characterized by cleft lip, cleft palate, hypodontia, anodontia, microdontia, syndactyly, palmoplantar hyperkeratosis, onychodysplasia, and sparse hair that has_material_basis_in homozygous mutation in the NECTIN1 gene on chromosome 11q23', 'Zlotogora-Zilberman-Tenenbaum syndrome|syndactyly-ectodermal dysplasia-cleft/lip palate|cleft lip/palate-syndactyly-pili torti syndrome|Margarita type of ectodermal dysplasia|CLPED1', 'ORDO:3253|OMIM:225060', '1', 'OMIM:225060');
INSERT INTO `disease_info` VALUES ('DOID:0060774', 'congenital diarrhea', 'A diarrhea characterized by frequent loose or liquid bowel movements where the disease is present from birth', '', 'OMIM:PS214700', '5', 'OMIM:PS214700');
INSERT INTO `disease_info` VALUES ('DOID:0060775', 'microvillus inclusion disease', 'A congenital diarrhea characterized by onset of intractable life-threatening watery diarrhea during infancy, lack of microvilli on the surface of enterocytes and occurrence of intracellular vacuolar structures containing microvilli that has_material_basis_in homozygous or compound heterozygous mutation in the MYO5B gene on chromosome 18q21', 'MVD|congenital familial protracted diarrhea with enterocyte brush-border abnormalities|Davidson disease|diarrhea 2 with microvillus atrophy|intractable diarrhea of infancy|congenital microvillus atrophy', 'ICD10CM:P78.3|ORDO:2290|OMIM:251850', '1', 'OMIM:251850');
INSERT INTO `disease_info` VALUES ('DOID:0060776', 'congenital diarrhea 5 with tufting enteropathy', 'A congenital diarrhea characterized by intractable diarrhea of infancy with villous atrophy, absence of inflammation, and intestinal epithelial cell dysplasia manifesting as focal epithelial tufts in the duodenum and jejunum that has_material_basis_in homozygous or compound heterozygous mutation in the EPCAM gene on chromosome 2p21', 'congenital tufting enteropathy|DIAR5|congenital familial intractable diarrhea with epithelial or epithelium abnormalities|tufting enteropathy', 'OMIM:613217|ICD10CM:P78.3|ORDO:92050', '1', 'OMIM:613217');
INSERT INTO `disease_info` VALUES ('DOID:0060777', 'congenital secretory sodium diarrhea 8', 'A secretory diarrhea that has_material_basis_in homozygous or compound heterozygous mutation in the SLC9A3 gene on chromosome 5p15', 'DIAR8', 'ORDO:103908|OMIM:616868|ICD10CM:P78.3', '1', 'OMIM:616868');
INSERT INTO `disease_info` VALUES ('DOID:0060778', 'congenital diarrhea 7 with exudative enteropathy', 'A congenital diarrhea characterized by watery diarrhea, protein-losing enteropathy, patchy areas of dystrophic microvilli in the duodenum and patchy areas of villous atrophy that has_material_basis_in homozygous mutation in the DGAT1 gene on chromosome 8q24.3', 'congenital chronic diarrhea with protein-losing enteropathy|congenital chronic diarrhea with exudative enteropathy', 'OMIM:615863|ORDO:329242|ICD10CM:P78.3', '1', 'OMIM:615863');
INSERT INTO `disease_info` VALUES ('DOID:0060779', 'congenital malabsorptive diarrhea 4', 'A congenital diarrhea characterized by chronic unremitting malabsorptive diarrhea and a profound dysgenesis of the enteroendocrine cells that has_material_basis_in mutation in the gene encoding neurogenin-3 (NEUROG3) on chromosome 10q21.3', 'enteric anendocrinosis|congenital malabsorptive diarrhea due to paucity of enteroendocrine cells', 'ORDO:83620|ICD10CM:P78.3|OMIM:610370', '1', 'OMIM:610370');
INSERT INTO `disease_info` VALUES ('DOID:0060780', 'congenital diarrhea 6', 'A congenital diarrhea characterized by mild, early-onset chronic diarrhea that has_material_basis_in heterozygous mutation in the GUCY2C gene on chromosome 12p12', 'chronic diarrhea due to guanylate cyclase 2C overactivity', 'ORDO:314373|OMIM:614616|ICD10CM:P78.3', '1', 'OMIM:614616');
INSERT INTO `disease_info` VALUES ('DOID:0060781', 'congenital secretory sodium diarrhea 3', 'A secretory diarrhea that has_material_basis_in homozygous or compound heterozygous mutation in the SPINT2 gene on chromosome 19q13', 'congenital secretory sodium diarrhea 3 with or without other congenital anomalies|congenital secretory sodium diarrhea 3 syndromic', 'ORDO:103908|ICD10CM:P78.3|OMIM:270420', '1', 'OMIM:270420');
INSERT INTO `disease_info` VALUES ('DOID:0060782', 'EEC syndrome', 'An autosomal dominant disease characterized by ectrodactyly, ectodermal dysplasia, and orofacial clefts (cleft lip-palate)', 'ectrodactyly, ectodermal dysplasia, and cleft lip-palate syndrome|Rudiger syndrome 1|Walker-Clodius syndrome|ectrodactyly-ectodermal dysplasia-clefting syndrome', 'ORDO:1896|UMLS_CUI:C0406704|ICD10CM:Q82.4', '3', 'ORPHA:1896');
INSERT INTO `disease_info` VALUES ('DOID:0060783', 'ectrodactyly, ectodermal dysplasia, and cleft lip-palate syndrome 3', 'An EEC syndrome characterized by autosomal dominant inheritance of absence of the central parts of the hands and feet, resulting in split-hand/foot malformation, ectodermal dysplasia, and cleft lip with or without cleft palate that has_material basis in heterozygous mutation in the TP63 gene on chromosome 3q28', 'EEC3|EEC syndrome 3', 'UMLS_CUI:C0406704|ORDO:1896|OMIM:604292|ICD10CM:Q82.4', '1', 'OMIM:604292');
INSERT INTO `disease_info` VALUES ('DOID:0060784', 'ectrodactyly, ectodermal dysplasia, and cleft lip-palate syndrome 1', 'An EEC syndrome characterized by autosomal dominant inheritance that has_material basis in variation in the chromosome region 7q11.2-q21.3', 'EEC1|EEC syndrome 1', 'ORDO:1896|UMLS_CUI:C0406704|ICD10CM:Q82.4|OMIM:129900', '5', 'OMIM:129900');
INSERT INTO `disease_info` VALUES ('DOID:0060785', 'adult-onset autosomal dominant demyelinating leukodystrophy', 'A leukodystrophy characterized by onset in the 4th or 5th decade of life of autonomic abnormalities, pyramidal and cerebellar dysfunction, and symmetric demyelination of the CNS that has_material_basis_in heterozygous tandem genomic duplication resulting in an extra copy of the LMNB1 gene on chromosome 5q', 'ADLD|adult-onset autosomal dominant leukodystrophy|autosomal-dominant or late-onset type Pelizaeus-Merzbacher disease', 'UMLS_CUI:C3164344|ICD10CM:E75.2|ORDO:99027|OMIM:169500', '1', 'OMIM:169500');
INSERT INTO `disease_info` VALUES ('DOID:0060786', 'hypomyelinating leukodystrophy', 'A leukodystrophy characterized by T2 hyperintensity and T1 iso- or hyperintensity of affected white matter in the central nervous system', 'HLD', 'OMIM:PS312080', '5', 'OMIM:PS312080');
INSERT INTO `disease_info` VALUES ('DOID:0060787', 'hypomyelinating leukodystrophy 2', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of nystagmus, impaired motor development, ataxia, choreoathetotic movements, dysarthria, and progressive spasticity that has_material_basis_in homozygous or compound heterozygous mutation in the GJC2 gene on chromosome 1q42', 'HLD2|Pelizaeus-Merzbacher-like disease 1|PMLD1|Pelizaeus-Merzbacher-like disease due to GJC2 mutation', 'ICD10CM:E75.2|ORDO:280282|OMIM:608804', '1', 'OMIM:608804');
INSERT INTO `disease_info` VALUES ('DOID:0060788', 'hypomyelinating leukodystrophy 10', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of progressive postnatal microcephaly, severely delayed psychomotor development and hypomyelination that has_material_basis_in homozygous mutation in the PYCR2 gene on chromosome 1q42', 'HLD10', 'OMIM:616420', '1', 'OMIM:616420');
INSERT INTO `disease_info` VALUES ('DOID:0060789', 'hypomyelinating leukodystrophy 4', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of hypotonia, nystagmus, psychomotor developmental delay, and severe hypomyelinating leukoencephalopathy that has_material_basis_in homozygous mutation in the HSPD1 gene on chromosome 2q33', 'MitCHAP60 disease|Pelizaeus-Merzbacher-like disease due to HSPD1 mutation|mitochondrial HSP60 chaperonopathy|HLD4', 'OMIM:612233|ORDO:280288|ICD10CM:E75.2', '1', 'OMIM:612233');
INSERT INTO `disease_info` VALUES ('DOID:0060790', 'hypomyelinating leukodystrophy 3', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of early infantile onset of global developmental delay, lack of development, lack of speech acquisition, and peripheral spasticity associated with decreased myelination in the central nervous system that has_material_basis_in homozygous mutation in the AIMP1 gene on chromosome 4q24', 'HLD3|Pelizaeus-Merzbacher-like disease due to AIMP1 mutation', 'ORDO:280293|ICD10CM:E75.2|OMIM:260600', '1', 'OMIM:260600');
INSERT INTO `disease_info` VALUES ('DOID:0060791', 'hypomyelinating leukodystrophy 9', 'A hypomyelinating leukodystrophy characterized by delayed psychomotor development, spasticity, and nystagmus starting in the first year of life that has_material_basis_in compound heterozygous mutation in the RARS gene on chromosome 5q34', 'RARS-related autosomal recessive hypomyelinating leukodystrophy|HLD9', 'ICD10CM:E75.2|OMIM:616140|ORDO:438114', '1', 'OMIM:616140');
INSERT INTO `disease_info` VALUES ('DOID:0060792', 'hypomyelinating leukodystrophy 11', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of delayed psychomotor development and other neurologic features associated with hypomyelination that has_material_basis_in homozygous or compound heterozygous mutation in the POLR1C gene on chromosome 6p21', 'HLD11', 'OMIM:616494|ICD10CM:G11.1', '1', 'OMIM:616494');
INSERT INTO `disease_info` VALUES ('DOID:0060793', 'hypomyelinating leukodystrophy 5', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of congenital cataract, progressive neurologic impairment, and diffuse myelin deficiency that has_material_basis_in homozygous mutation in the FAM126A gene on chromosome 7p15', 'HLD5|hypomyelination-congenital cataract syndrome', 'ORDO:85163|OMIM:610532|ICD10CM:G37.8', '1', 'OMIM:610532');
INSERT INTO `disease_info` VALUES ('DOID:0060794', 'hypomyelinating leukodystrophy 7 with or without oligodontia and-or hypogonadotropic hypogonadism', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of hildhood onset of progressive motor decline manifest as spasticity, ataxia, tremor, and cerebellar signs, as well as mild cognitive regression that has_material_basis_in homozygous or compound heterozygous mutation in the POLR3A gene on chromosome 10q22', 'dentoleukoencephalopathy|leukodystrophy with oligodontia|HLD7|TACH syndrome|tremor-ataxia-central hypomyelination syndrome|ataxia-delayed dentition-hypomyelination syndrome; odontoleukodystrophy|leukoencephalopathy-ataxia-hypodontia-hypomyelination syndrome|hypomyelination-cerebellar atrophy-hypoplasia of the corpus callosum syndrome', 'ORDO:137639|ORDO:447896|OMIM:607694|ORDO:447893|ORDO:77295|ICD10CM:G11.1', '1', 'OMIM:607694');
INSERT INTO `disease_info` VALUES ('DOID:0060795', 'hypomyelinating leukodystrophy 13', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of infantile onset of delayed psychomotor development, axial hypotonia, and spasticity associated with delayed myelination and periventricular white matter abnormalities that has_material_basis_in homozygous mutation in the C11ORF73 gene on chromosome 11q14', 'HLD13', 'OMIM:616881', '1', 'OMIM:616881');
INSERT INTO `disease_info` VALUES ('DOID:0060796', 'hypomyelinating leukodystrophy 12', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of severely delayed or even lack of psychomotor development that becomes apparent in the first months of life, acquired microcephaly and delayed myelination that has_material_basis_in homozygous mutation in the VPS11 gene on chromosome 11q23', 'HLD12', 'OMIM:616683', '1', 'OMIM:616683');
INSERT INTO `disease_info` VALUES ('DOID:0060797', 'hypomyelinating leukodystrophy 8 with or without oligodontia and-or hypogonadotropic hypogonadism', 'A hypomyelinating leukodystrophy characterized by autosomal recessive inheritance of early childhood onset of cerebellar ataxia, mild intellectual disabilities associated with diffuse hypomyelination and variable development of oligodontia and/or  hypogonadotropic hypogonadism that has_material_basis_in compound heterozygous mutation in the POLR3B gene on chromosome 12q23', 'HLD8', 'OMIM:614381|ICD10CM:G11.1', '1', 'OMIM:614381');
INSERT INTO `disease_info` VALUES ('DOID:0060798', 'hypomyelinating leukodystrophy 6', 'A hypomyelinating leukodystrophy characterized by infant or early childhood onset of delayed motor development and gait instability, followed by extrapyramidal movement disorders, progressive spastic tetraplegia, ataxia, hypomyelination, cerebellar atrophy, and atrophy or disappearance of the putamen that has_material_basis_in heterozygous mutation in the TUBB4A gene on chromosome 19p13', 'hypomyelinating leukodystrophy with atrophy of the basal ganglia and cerebellum|HLD6|hypomyelination with atrophy of basal ganglia and cerebellum|HABC|H-ABC', 'ORDO:139441|OMIM:612438|ICD10CM:E75.2', '5', 'OMIM:612438');
INSERT INTO `disease_info` VALUES ('DOID:0060799', 'syndromic X-linked intellectual disability Lubs type', 'A syndromic X-linked intellectual disability characterized by moderate to profound intellectual disability, infantile hypotonia, mild dysmorphic features, poor speech development, autistic features, seizures, progressive spasticity, and recurrent infections in males that has_material_basis_in duplication or triplication of the MECP2 gene on chromosome Xq28', 'mental retardation, X-linked, with recurrent respiratory infections|mental retardation, X-linked, syndromic, Lubs type|X-linked intellectual disability-hypotonia-recurrent Infections syndrome|MECP2 duplication syndrome|Lubs X-linked mental retardation syndrome|MRXSL', 'UMLS_CUI:C1846058|MESH:C537723|ORDO:85281|OMIM:300260|ICD10CM:Q87.8', '1', 'OMIM:300260');
INSERT INTO `disease_info` VALUES ('DOID:0060800', 'syndromic X-linked intellectual disability 5', 'A syndromic X-linked intellectual disability characterized by intellectual disability and variable features including; choreoathetosis, hydrocephalus, Dandy-Walker malformation, seizures, and iron or calcium deposition in the brain that has_material_basis_in mutation in the AP1S2 gene on chromosome Xp22', 'X-linked intellectual disability-Dandy-Walker malformation-basal ganglia disease-seizures syndrome|syndromic X-linked mental retardation Fried type|MRXS21|X-linked metal retardation with Dandy-Walker malformation, basal ganglia disease, and seizures|Pettigrew syndrome|syndromic X-linked mental retardation 21|Mental retardation, X-linked syndromic 5|MRX59|X-linked mental retardation 59|Fried syndrome', 'ORDO:85335|ICD10CM:Q87.8|UMLS_CUI:C0796254|OMIM:304340|ORDO:1568', '5', 'OMIM:304340');
INSERT INTO `disease_info` VALUES ('DOID:0060801', 'MEHMO syndrome', 'A syndromic X-linked intellectual disability characterized by severe intellectual deficit, epilepsy, microcephaly, hypogenitalism and obesity with variable occurrence of growth delay and diabetes that has_material_basis_in variation in the chromosome region Xp22.13-p21.1', 'syndromic X-linked mental retardation 25|MRXS20|X-linked intellectual disability-epileptic seizures-hypogenitalism-microcephaly-obesity syndrome|syndromic X-linked mental retardation 20|MRXS25|mental retardation, epileptic seizures, hypogonadism and hypogenitalism, microcephaly, and obesity', 'OMIM:300148|ICD10CM:Q87.8|UMLS_CUI:C2931496|MESH:C537451|ORDO:85282', '4', 'OMIM:300148|ORPHA:85282');
INSERT INTO `disease_info` VALUES ('DOID:0060802', 'syndromic X-linked intellectual disability Snyder type', 'A syndromic X-linked intellectual disability characterized by mild to profound intellectual disability, facial asymmetry, marfanoid habitus, asthenic habitus, unsteady gait, thickened lower lip, nasal dysarthic speech, narrow or cleft palate, osteoporosis, kyphoscoliosis, long great toes, short stature, pectus carinatum, and myopia that has_material_basis_in mutation in the SMS gene on chromosome Xp22', 'Snyder-Robinson mental retardation syndrome|mental retardation, X-linked, Snyder-Robinson type|spermine synthase deficiency|SRS|Snyder-Robinson syndrome', 'ICD10CM:Q87.8|ORDO:3063|OMIM:309583', '1', 'OMIM:309583');
INSERT INTO `disease_info` VALUES ('DOID:0060803', 'syndromic X-linked intellectual disability 17', 'A syndromic X-linked intellectual disability characterized by global developmental delay, delayed motor development, lack of speech development, intellectual disability, alacrima and in some patients achalasia and/or anisocoria that has_material_basis_in variation in the chromosome region Xp21.1-p11.23', 'intellectual disability-alacrima-achalasia syndrome|mental retardation, X-linked, syndromic 17|X-linked mental retardation with alacrima and achalasia', 'OMIM:300858|ORDO:289483', '5', 'OMIM:300858');
INSERT INTO `disease_info` VALUES ('DOID:0060804', 'syndromic X-linked intellectual disability 12', 'A syndromic X-linked intellectual disability characterized by severe intellectual deficit, mutism, epilepsy, growth retardation or failure and recurrent infections that has_material_basis_in variation in the chromosome region Xp11', 'mental retardation, X-linked, syndromic 12|X-linked intellectual disability, Wilson type', 'ORDO:85290|ICD10CM:Q87.8|OMIM:309545', '5', 'OMIM:309545');
INSERT INTO `disease_info` VALUES ('DOID:0060805', 'Prieto syndrome', 'A syndromic X-linked intellectual disability characterized by intellectual disability, facial dysmorphism, patella luxation, clinodactyly, subcortical cerebral atrophy, and abnormal growth of the teeth that has_material_basis_in variation in the chromosome region Xp11-q21', 'X-linked intellectual disability-dysmorphism-cerebral atrophy syndrome|Prieto-Badia-Mulas syndrome', 'ORDO:2958|OMIM:309610', '5', 'OMIM:309610');
INSERT INTO `disease_info` VALUES ('DOID:0060806', 'syndromic X-linked intellectual disability Hedera type', 'A syndromic X-linked intellectual disability characterized by mild to moderate mental retardation and epilepsy that has_material_basis_in mutation in the ATP6AP2 gene on chromosome Xp11', 'mental retardation, X-linked, syndromic, Hedera type|MRXSH|X-linked mental retardation with epilepsy|MRXE', 'ORDO:93952|OMIM:300423', '1', 'OMIM:300423');
INSERT INTO `disease_info` VALUES ('DOID:0060807', 'syndromic X-linked intellectual disability Najm type', 'A syndromic X-linked intellectual disability characterized by severe intellectual disability, microcephaly with pontine and cerebellar hypoplasia that has_material_basis_in heterozygous mutation or deletion in the CASK gene on chromosome Xp11', 'mental retardation and microcephaly with pontine and cerebellar hypoplasia|X-linked intellectual disability-microcephaly-pontocerebellar hypoplasia syndrome|MICPCH', 'OMIM:300749|ORDO:163937|ICD10CM:Q04.3', '1', 'OMIM:300749');
INSERT INTO `disease_info` VALUES ('DOID:0060808', 'syndromic X-linked intellectual disability 7', 'A syndromic X-linked intellectual disability characterized by intellectual deficit, obesity, hypogonadism, and tapering fingers that has_material_basis_in variation in the chromosome region Xp11.3-q22', 'X-linked intellectual disability, Ahmad type|MRXS7|mental retardation, X-linked syndromic 7', 'MESH:C537449|UMLS_CUI:C1846170|ICD10CM:Q87.8|OMIM:300218|ORDO:85274', '5', 'OMIM:300218');
INSERT INTO `disease_info` VALUES ('DOID:0060809', 'syndromic X-linked intellectual disability Claes-Jensen type', 'A syndromic X-linked intellectual disability characterized by severe intellectual deficit associated with variable clinical manifestations including spasticity, cryptorchidism, maxillary hypoplasia, alopecia areata, epilepsy, short stature, impaired speech and behavioural problems that has_material_basis_in mutation in the KDM5C gene on chromosome Xp11', 'syndromic X-linked mental retardation JARID1C-related|mental retardation, X-linked, syndromic, Claes-Jensen type|MRXSCJ|syndromic X-linked intellectual disability due to JARID1C mutation|MRXSJ', 'ORDO:85279|ICD10CM:Q87.8|OMIM:300534', '1', 'OMIM:300534');
INSERT INTO `disease_info` VALUES ('DOID:0060810', 'syndromic X-linked intellectual disability type 10', 'A syndromic X-linked intellectual disability characterized by mild intellectual deficit associated with choreoathetosis and abnormal behaviour that has_material_basis_in mutation in the HSD17B10 gene on chromosome Xp11.22', 'mental retardation, X-linked syndromic 10|HSD10 disease, atypical type|MRXS10|X-linked intellectual disability-choreoathetosis-abnormal behavior syndrome|HSD10 deficiency, atypical type', 'ORDO:85295|ICD10CM:G25.5|OMIM:300438', '1', 'OMIM:300438');
INSERT INTO `disease_info` VALUES ('DOID:0060811', 'syndromic X-linked intellectual disability Turner type', 'A syndromic X-linked intellectual disability characterized by moderate to severe intellectual deficit in boys and moderate intellectual deficit in girls, macrocephaly, and holoprosencephaly present in some cases that has_material_basis_in mutation in the HUWE1 gene on chromosome Xp11.22', 'MRXST|mental retardation and macrocephaly syndrome|mental retardation, X-linked syndromic, Turner type', 'ORDO:85328|ICD10CM:Q87.8|OMIM:300706', '1', 'OMIM:300706');
INSERT INTO `disease_info` VALUES ('DOID:0060812', 'syndromic X-linked intellectual disability Siderius type', 'A syndromic X-linked intellectual disability characterized by mild to moderate intellectual disability, long face and a broad nasal tip with in some cases cleft lip/palate, preaxial polydactyly and cryptorchidism that has_material_basis_in mutation in the PHF8 gene on chromosome Xp11.22', 'Siderius X-linked mental retardation syndrome|MRXSSD|Siderius-Hamel syndrome|mental retardation syndrome, X-linked, Siderius type', 'ORDO:85287|ICD10CM:Q87.8|OMIM:300263|UMLS_CUI:C1846055|MESH:C537333', '1', 'OMIM:300263');
INSERT INTO `disease_info` VALUES ('DOID:0060813', 'syndromic X-linked intellectual disability Shrimpton type', 'A syndromic X-linked intellectual disability characterized by evere mental retardation, microcephaly, speech delay and variable short stature that has_material_basis_in variation in the chromosomal region Xq12-q21.31', 'mental retardation, X-linked, syndromic 9|MRXS9', 'ICD10CM:Q87.8|OMIM:300709|ORDO:85324', '5', 'OMIM:300709');
INSERT INTO `disease_info` VALUES ('DOID:0060814', 'Wilson-Turner syndrome', 'A syndromic X-linked intellectual disability characterized by intellectual disability, truncal obesity, gynecomastia, hypogonadism, dysmorphic facial features, and short stature  that has_material_basis_in hemizygous mutation in the LAS1L gene on chromosome Xq12', 'MRXS6|X-linked intellectual disability-gynecomastia-obesity syndrome|WTS|mental retardation, X-linked, syndromic 6|mental retardation, X-linked, with gynecomastia and obesity', 'ORDO:3459|OMIM:309585', '1', 'OMIM:309585');
INSERT INTO `disease_info` VALUES ('DOID:0060815', 'Miles-Carpenter syndrome', 'A syndromic X-linked intellectual disability characterized by severe intellectual deficit, microcephaly, exotropia, distal muscle wasting and low digital arches that has_material_basis_in variation in chromosomal region Xq13-q22', 'mental retardation, X-linked, with congenital contractures and low fingertip arches|X-linked intellectual disability, Miles-Carpenter type|mental retardation, X-linked, syndromic 4|MRXS4|MCS', 'UMLS_CUI:C1839735|OMIM:314580|ORDO:85283|ICD10CM:Q87.8|MESH:C537472', '5', 'OMIM:314580');
INSERT INTO `disease_info` VALUES ('DOID:0060816', 'corpus callosum agenesis-intellectual disability-coloboma-micrognathia syndrome', 'A syndromic X-linked intellectual disability characterized by agenesis of the corpus callosum, intellectual disability, ocular coloboma, micrognathia,  sensorineural hearing loss, skeletal anomalies, and short stature that has_material_basis_in mutation in the IGBP1 gene on chromosome Xq13.1', 'corpus callosum, agenesis of, with mental retardation, ocular coloboma and micrognathia|mental retardation, X-linked, syndromic 28|Graham-Cox syndrome|MRXS28', 'ORDO:52055|OMIM:300472|ICD10CM:Q87.8', '1', 'OMIM:300472');
INSERT INTO `disease_info` VALUES ('DOID:0060817', 'syndromic X-linked intellectual disability 34', 'A syndromic X-linked intellectual disability characterized by delayed psychomotor development, intellectual disability, impaired speech, dysmorphic facial features, and mild structural brain abnormalities, including thickening of the corpus callosum that has_material_basis_in mutation in the NONO gene on chromosome Xq13', 'syndromic X-linked mental retardation Mircsof-Langouet type|MRXS34|MRXSML|mental retardation, X-linked, syndromic 34|macrocephaly-intellectual disability-left ventricular non compaction syndrome', 'OMIM:300967|ORDO:466791', '1', 'OMIM:300967');
INSERT INTO `disease_info` VALUES ('DOID:0060818', 'syndromic X-linked intellectual disability Abidi type', 'A syndromic X-linked intellectual disability characterized by intellectual disability with variable occurrence of short stature, small head circumference, sloping forehead, hearing loss, abnormally shaped ears, and small testes that has_material_basis_in variation in the chromosomal region Xq13.2', 'MRXSAB|syndromic X-linked mental retardation Abidi type|mental retardation, X-linked syndromic, Abidi type', 'ORDO:85273|MESH:C535556|OMIM:300262|ICD10CM:Q87.8|UMLS_CUI:C1846056', '5', 'OMIM:300262');
INSERT INTO `disease_info` VALUES ('DOID:0060819', 'syndromic X-linked intellectual disability Chudley-Schwartz type', 'A syndromic X-linked intellectual disability characterized by moderate intellectual disability, seizures, dysmorphic facial features and in some older patients slowly progressive unsteady gait and progressive weakness that has_material_basis_in variation in the chromosomal region Xq21.33-q23', 'mental retardation, X-linked, syndromic, Chudley-Schwartz type|X-linked mental retardation with seizures, hypogammaglobinemia, and gait disturbance|MRXSCS', 'OMIM:300861', '5', 'OMIM:300861');
INSERT INTO `disease_info` VALUES ('DOID:0060820', 'syndromic X-linked intellectual disability Nascimento type', 'A syndromic X-linked intellectual disability characterized by intellectual disability with dysmorphic features, including large head, synophrys, prominent supraorbital ridges, almond-shaped and deep-set eyes, large ears, wide mouth, myxedematous appearance, hirsutism, abnormal hair whorls, micropenis, and onychodystrophy that has_material_basis_in mutation in the UBE2A gene on chromosome Xq24', 'X-linked intellectual disability-nail dystrophy-seizures syndrome|mental retardation, X-linked syndromic, Nascimento-type', 'ICD10CM:Q87.8|ORDO:163956|OMIM:300860', '1', 'OMIM:300860');
INSERT INTO `disease_info` VALUES ('DOID:0060821', 'syndromic X-linked intellectual disability 14', 'A syndromic X-linked intellectual disability characterized by mild to severe intellectual disability, autistic features, slender build, poor musculature, long, thin face, high-arched palate, high nasal bridge, and pectus deformities that has_material_basis_in mutation in the UPF3B gene on chromosome Xq24', 'mental retardation, X-linked, syndromic 14', 'UMLS_CUI:C0796022|ORDO:323|ICD10CM:Q87.8|MESH:C537923|OMIM:300676|ORDO:776', '1', 'OMIM:300676');
INSERT INTO `disease_info` VALUES ('DOID:0060822', 'syndromic X-linked intellectual disability Cabezas type', 'A syndromic X-linked intellectual disability characterized by intellectual deficit, muscle wasting, short stature, hypogonadism, and  bnormal gait, with variable occurrence of prominent lower lip, kyphosis, joint hyperextensibility, tremor, decreased fine motor coordination and impaired speech that has_material_basis_in  mutation in the CUL4B gene on chromosome Xq23', 'MRXSC|mental retardation, X-linked, syndromic 15|MRSS|Cabezas syndrome; syndromic X-linked mental retardation 15|MRXS15|X-linked mental retardation with short stature, hypogonadism, and abnormal gait|mental retardation, X-linked, syndromic 15 (Cabezas type)|X-linked mental retardation with short stature', 'ORDO:85293|OMIM:300354|ICD10CM:Q87.8', '1', 'OMIM:300354');
INSERT INTO `disease_info` VALUES ('DOID:0060823', 'syndromic X-linked intellectual disability 94', 'A syndromic X-linked intellectual disability characterized by moderate intellectual disability with variable occurrence of asthenic body habitus, dysmorphic features, autistic features, macrocephaly, seizures, myoclonic jerks, and hyporeflexia that has_material_basis_in mutation in the GRIA3 gene on chromosome Xq25', 'mental retardation, X-linked 94|syndromic X-linked mental retardation 29|syndromic X-linked mental retardation Wu type|MRX94|MRXS29|syndromic X-linked intellectual disability due to GRIA3 anomalies', 'ORDO:364028|OMIM:300699|ICD10CM:F72', '1', 'OMIM:300699');
INSERT INTO `disease_info` VALUES ('DOID:0060824', 'syndromic X-linked intellectual disability Raymond type', 'A syndromic X-linked intellectual disability characterized by intellectual disability and marfanoid habitus that has_material_basis_in mutation in the ZDHHC9 gene on chromosome Xq26.1', 'MRXSR|mental retardation, X-linked syndromic, Raymond type', 'ORDO:163953|OMIM:300799|ICD10CM:Q87.8', '1', 'OMIM:300799');
