INSERT INTO `disease_info` VALUES ('DOID:0060826', 'syndromic X-linked intellectual disability Shashi type', 'A syndromic X-linked intellectual disability characterized by moderate intellectual deficit, obesity, macroorchidism and a characteristic facies that has_material_basis_in mutation in the RBMX gene on chromosome Xq26', 'mental retardation, X-linked, syndromic 11, Shashi type|Shashi X-linked mental retardation syndrome|syndromic X-linked intellectual disability type 11|SMRXS|MRXS11|X-linked mental retardation Shashi type', 'OMIM:300238|ICD10CM:Q87.8|ORDO:85286', '1', 'OMIM:300238');
INSERT INTO `disease_info` VALUES ('DOID:0060827', 'X-linked intellectual disability-psychosis-macroorchidism syndrome', 'A syndromic X-linked intellectual disability characterized by moderate intellectual deficit, manic-depressive psychosis, pyramidal signs and macroorchidism that has_material_basis_in mutation in the MECP2 gene on chromosome Xq28', 'X-linked mental retardation with spasticity|X-linked mental retardation 79|PPM-X|mental retardation, X-linked, syndromic 13|MRXS13|Lindsay-Burn syndrome|mental retardation with psychosis, pyramidal signs, and macroorchidism', 'ORDO:3077|ICD10CM:F71.1|OMIM:300055', '1', 'OMIM:300055');
INSERT INTO `disease_info` VALUES ('DOID:0060828', 'X-linked intellectual disability-cardiomegaly-congestive heart failure syndrome', 'A syndromic X-linked intellectual disability characterized by intellectual disability, delayed psychomotor development, seizures, large joint contractures, cardiac abnormalities, and abnormal positioning of the thumbs that has_material_basis_in mutation in the CLIC2 gene on chromosome Xq28', 'mental retardation, X-linked, syndromic 32|MRXS32', 'ORDO:324410|OMIM:300886', '1', 'OMIM:300886');
INSERT INTO `disease_info` VALUES ('DOID:0060829', 'Brooks-Wisniewski-Brown syndrome', 'A syndromic X-linked intellectual disability characterized by intellectual disability, distinct facial appearance and growth retardation that has_material_basis_in variation on the X chromosome', 'X-linked intellectual disability, Brooks type', 'ORDO:3056|OMIM:300612|ICD10CM:Q87.8', '5', 'OMIM:300612');
INSERT INTO `disease_info` VALUES ('DOID:0060830', 'deafness-intellectual disability, Martin-Probst type syndrome', 'A syndromic X-linked intellectual disability characterized by severe bilateral deafness, intellectual disability, umbilical hernia and abnormal dermatoglyphics that has_material_basis_in variation on the X chromosome', 'Martin-Probst syndrome|mental retardation, X-linked, syndromic, Martin-Probst type', 'ICD10CM:Q87.8|ORDO:85321|OMIM:300519', '5', 'OMIM:300519');
INSERT INTO `disease_info` VALUES ('DOID:0060831', 'Griscelli syndrome', 'An autosomal recessive disease characterized by silvery gray sheen of the hair and hypopigmentation of the skin', 'Griscelli-Pruniéras syndrome|partial albinism-immunodeficiency syndrome|Chédiak-Higashi-like syndrome', 'ICD10CM:E70.3|ORDO:381|OMIM:PS214450', '5', 'OMIM:PS214450');
INSERT INTO `disease_info` VALUES ('DOID:0060832', 'Griscelli syndrome type 1', 'A Griscelli syndrome characterized by silvery gray sheen of the hair, hypopigmentation of the skin and neurological impairment without immunodeficiency that has_material_basis_in mutations in the MYO5A gene on chromosome 15q21.2', 'hypopigmentation-neurologic impairment syndrome|Griscelli-Pruniéras syndrome type 1|GS1|Griscelli syndrome with neurological impairment|Griscelli syndrome, cutaneous and neurological type', 'OMIM:214450|ICD10CM:E70.3|MESH:C537301|UMLS_CUI:C1859194|ORDO:79476', '1', 'OMIM:214450');
INSERT INTO `disease_info` VALUES ('DOID:0060833', 'Griscelli syndrome type 2', 'A Griscelli syndrome characterized by silvery gray sheen of the hair, hypopigmentation of the skin and immunodeficiency with or without neurologic impairment that has_material_basis_in mutation in the RAB27A gene on chromosome 15q21.3', 'Griscelli syndrome with hemophagocytic syndrome|GS2|PAID syndrome|hypopigmentation-immunodeficiency with or without neurologic impairment syndrome|Griscelli-Pruniéras syndrome type 2|partial albinism and immunodeficiency syndrome', 'OMIM:607624|ORDO:79477|UMLS_CUI:C1868679|ICD10CM:E70.3|MESH:C537302', '1', 'OMIM:607624');
INSERT INTO `disease_info` VALUES ('DOID:0060834', 'Griscelli syndrome type 3', 'A Griscelli syndrome characterized by isolated silvery gray sheen of the hair and hypopigmentation of the skin that has_material_basis_in mutation in the MLPH or MYO5A genes', 'Griscelli-Pruniéras syndrome type 3|GS3', 'UMLS_CUI:C1836573|OMIM:609227|ORDO:79478|ICD10CM:E70.3|MESH:C537303', '1', 'OMIM:609227');
INSERT INTO `disease_info` VALUES ('DOID:0060835', 'isolated microphthalmia 6', 'A microphthalmia characterized by autosomal recessive inheritance reduction in eye size that is restricted to the posterior segment of the eye, extreme hyperopia, and short axial length that has_material_basis_in homozygous or compound heterozygous mutation in the PRSS56 gene on chromosome 2q37', 'MCOP6|posterior nonsyndromic microphthalmia', 'OMIM:613517|ICD10CM:Q11.0|ORDO:2542', '1', 'OMIM:613517');
INSERT INTO `disease_info` VALUES ('DOID:0060836', 'isolated microphthalmia 4', 'A microphthalmia that has_material_basis_in mutation in the GDF6 gene on chromosome 8q22', 'MCOP4', 'ORDO:2542|OMIM:613094|ICD10CM:Q11.0', '1', 'OMIM:613094');
INSERT INTO `disease_info` VALUES ('DOID:0060837', 'isolated microphthalmia 5', 'A microphthalmia characterized by autosomal recessive inheritance of posterior microphthalmia, hypermetropia, night blindness, decreased visual acuity, reduced macular reflex, scleral thickening, impared rod and cone responses on ERG, foveoschisis and in some patients retinal pigment epithelium atrophy, arteriolar attenuation, angle-closure glaucoma and optic disc drusen that has_material_basis_in homozygous or compound heterozygous mutation in the MFRP gene on chromosome 11q23', 'posterior microphthalmia with retinitis pigmentosa, foveoschisis and optic disc drusen|microphthalmia-retinitis pigmentosa-foveoschisis-optic disc drusen syndrome|MCOP5', 'OMIM:611040|ICD10CM:Q15.8|ORDO:251279', '1', 'OMIM:611040');
INSERT INTO `disease_info` VALUES ('DOID:0060838', 'isolated microphthalmia 7', 'A microphthalmia characterized by unilateral microphthalmia that has_material_basis_in caused by mutation in the GDF3 gene on chromosome 12p13', 'MCOP7', 'ORDO:2542|OMIM:613704|ICD10CM:Q11.0', '1', 'OMIM:613704');
INSERT INTO `disease_info` VALUES ('DOID:0060839', 'isolated microphthalmia 2', 'A microphthalmia characterized by autosomal recessive inheritance of bilateral profound microphthalmia without associated anomalies and with normal intelligence that has_material_basis_in homozygous mutation in the CHX10 gene on chromosome 14q24', 'MCOP2', 'ORDO:2542|OMIM:610093|ICD10CM:Q11.0', '1', 'OMIM:610093');
INSERT INTO `disease_info` VALUES ('DOID:0060840', 'isolated microphthalmia 1', 'A microphthalmia that has_material_basis_in variation in the chromosomal region 14q32', 'MCOP1', 'ORDO:2542|OMIM:251600|ICD10CM:Q11.0', '5', 'OMIM:251600');
INSERT INTO `disease_info` VALUES ('DOID:0060841', 'isolated microphthalmia 8', 'A microphthalmia characterized by  bilateral severe microphthalmia autosomal recessive inheritance of that has_material_basis_in homozygous mutation in the ALDH1A3 gene on chromosome 15q26', 'MCOP8', 'ORDO:2542|OMIM:615113|ICD10CM:Q11.0', '1', 'OMIM:615113');
INSERT INTO `disease_info` VALUES ('DOID:0060842', 'isolated microphthalmia 3', 'A microphthalmia characterized by clinical anophthalmia and/or microphthalmia that has_material_basis_in compound heterozygous mutation in the RAX gene on chromosome 18q21', 'MCOP3', 'ORDO:2542|OMIM:611038|ICD10CM:Q11.0', '1', 'OMIM:611038');
INSERT INTO `disease_info` VALUES ('DOID:0060843', 'hereditary neuropathy with liability to pressure palsies', 'A neuropathy characterized by autosomal dominant inheritance of peroneal muscle weakness, peripheral neuropathy, hyporeflexia, tomacula, segmental demyelination/remyelination, decreased motor nerve conduction that has_material_basis_in deletion or point mutation of the PMP22 gene on chromosome 17p12', 'HNPP|tomaculous neuropathy|potato-grubbing palsy|current pressure-sensitive neuropathy|heterozygous microdeletion 17p11.2p12|tulip-bulb digger\'s palsy|familial recurrent polyneuropathy', 'ORDO:640|ICD10CM:G60.0|UMLS_CUI:C0393814|OMIM:162500', '1', 'OMIM:162500');
INSERT INTO `disease_info` VALUES ('DOID:0060844', 'Norrie disease', 'A X-linked disease characterized by X-linked recessive inheritance of degenerative and proliferative changes of the neuroretina resulting in congenital blindness along with progressive mental disorders in about 50% of patients and sensorineural deafness in about 33% of patients that has_material_basis_in mutation in the NDP gene on chromosome Xp11', 'atrophia bulborum hereditaria|Norrie-Warburg disease|Episkopi blindness', 'UMLS_CUI:C0266526|ORDO:649|ICD10CM:H35.5|OMIM:310600|MESH:C537849', '1', 'OMIM:310600');
INSERT INTO `disease_info` VALUES ('DOID:0060847', 'Leri-Weill dyschondrosteosis', 'An osteochondrodysplasia characterized by abnormal shortening of the forearms and lower legs, abnormal misalignment of the wrist (Madelung deformity of the wrist), and associated short stature and has_material_basis_in heterozygous defects in the pseudoautosomal genes SHOX or SHOXY or by deletion of the SHOX downstream regulatory domain', '', 'UMLS_CUI:C0265309|MESH:C537119|OMIM:127300|ORDO:240|ICD10CM:Q77.8', '5', 'OMIM:127300');
INSERT INTO `disease_info` VALUES ('DOID:0060848', 'early infantile epileptic encephalopathy 9', 'An infantile epileptic encephalopathy that has_material_basis_in the gene encoding protocadherin-19 (PCDH19) on chromosome Xq22', 'female restricted epilepsy with mental retardation|Juberg Hellman syndrome|EIEE9|EFMR|early infantile female-limited epilecptic encephalopathy', 'OMIM:300088|ORDO:101039', '1', 'OMIM:300088');
INSERT INTO `disease_info` VALUES ('DOID:0060849', 'osteoporosis-pseudoglioma syndrome', 'An autosomal recessive disease characterized by congenital or infancy-onset blindness, very low bone mass, decreased trabecular bone volume, severe juvenile-onset osteoporosis and spontaneous fractures, pseudoglioma, microphthalmia  that has_material_basis_in homozygous or compound heterozygous mutation in the LRP5 gene on chromosome 11q13', 'ocular form of osteogenesis imperfecta|OPPG', 'ICD10CM:Q87.5|UMLS_CUI:C0432252|ORDO:2788|MESH:C536063|OMIM:259770', '1', 'OMIM:259770');
INSERT INTO `disease_info` VALUES ('DOID:0060850', 'annular pancreas', 'A pancreas disease characterized by autosomal dominant inheritance of the annular pancreas (head of the pancreas forming a ring around the second portion of the duodenum) and duodenal stenosis', '', 'ORDO:675|OMIM:167750|UMLS_CUI:C0149955|MESH:C536376|ICD10CM:Q45.1', '5', 'OMIM:167750');
INSERT INTO `disease_info` VALUES ('DOID:0060851', 'pemphigus vulgaris', 'A pemphigus characterized by autosomal dominant blisters and erosions on the skin and mucous membranes erosions cause by autoantibodies to intercellular cement substance', 'familial pemphigus vulgaris', 'ICD10CM:L10.0|OMIM:169610|UMLS_CUI:C0030809|ORDO:704', '5', 'OMIM:169610');
INSERT INTO `disease_info` VALUES ('DOID:0060852', 'Pierson syndrome', 'An autosomal recessive disease characterized by nephrotic syndrome with diffuse mesangial sclerosis, proteinuria, microcoria, absence of the pupillary dilator muscle in the iris, ciliary muscle atrophy, and abnormal eye development with lens-shape, retinal and corneal anomalies that has_material_basis_in homozygous or compound heterozygous mutation in the LAMB2 on chromosome 3p21', 'microcoria-congenital nephrosis syndrome', 'MESH:C537185|ORDO:2670|ICD10CM:N04.8|UMLS_CUI:C1836876|OMIM:609049', '1', 'OMIM:609049');
INSERT INTO `disease_info` VALUES ('DOID:0060853', 'Potocki-Lupski syndrome', 'A chromosomal duplication syndrome characterized by hypotonia, failure to thrive, mental retardation, pervasive developmental disorders and congenital anomalies that has_material_basis_in duplication of a region of chromosome 17p11.2', '17p11.2 microduplication syndrome|chromosome 17p11.2 duplication syndrome|trisomy 17p11.2', 'ORDO:1713|ICD10CM:Q92.3|UMLS_CUI:C2931246|OMIM:610883|MESH:C536578', '1', 'OMIM:610883');
INSERT INTO `disease_info` VALUES ('DOID:0060854', 'autosomal recessive pseudohypoaldosteronism type 1', 'A pseudohypoaldosteronism characterized by enal salt wasting and high concentrations of sodium in sweat, stool, and saliva that has_material_basis_in homozygous or compound heterozygous mutation in any one of 3 genes encoding subunits of the epithelial sodium channel (ENaC): SCNN1A, SCNN1B, or SCNN1G', 'autosomal recessive PHA 1|PHA1B', 'OMIM:264350|MESH:D011546|ORDO:756|ICD10CM:N25.8|UMLS_CUI:C0268436|ORDO:171876', '1', 'OMIM:264350');
INSERT INTO `disease_info` VALUES ('DOID:0060855', 'autosomal dominant pseudohypoaldosteronism type 1', 'A pseudohypoaldosteronism characterized by Salt wasting resulting from renal unresponsiveness to mineralocorticoids that has_material_basis_in heterozygous mutation in the NR3C2 gene on chromosome 4q31', 'PHA1A|autosomal dominant PHA 1', 'ORDO:756|OMIM:177735|UMLS_CUI:C1449843|ICD10CM:N25.8|MESH:D011546', '1', 'OMIM:177735');
INSERT INTO `disease_info` VALUES ('DOID:0060856', 'right atrial isomerism', 'A visceral heterotaxy characterized by complete atrioventricular septal defect with a common atrium and univentricular AV connection, total anomalous pulmonary drainage, and transposition or malposition of the great arteries and may be associated with bilateral trilobed lungs, midline liver, asplenia and situs inversus affecting other organs that has_material_basis_in homozygous mutation in the GDF1 gene on chromosome 19p12', 'asplenia with cardiovascular anomalies|Ivemark syndrome', 'OMIM:208530|ORDO:97548|ICD10CM:Q20.6', '1', 'OMIM:208530');
INSERT INTO `disease_info` VALUES ('DOID:0060857', 'septooptic dysplasia', 'An autosomal genetic disease characterized by the classical triad of optic nerve hypoplasia, pituitary gland hypoplasia and midline brain defects that has_material_basis_in mutation in the HESX1 gene on chromosome 3p14', 'De Morsier syndrome|septo-optic dysplasia|SOD', 'ORDO:3157|ICD10CM:Q04.8|MESH:D025962|UMLS_CUI:C0338503|OMIM:182230', '1', 'OMIM:182230');
INSERT INTO `disease_info` VALUES ('DOID:0060858', 'hypotonia-cystinuria syndrome@en', 'A syndrome that has_material_basis_in homozygous deletion on chromosome 2p21 that disrupts the SLC3A1 and PREPL genes. The deletion ranges in size from 23.8 to 75.5 kb. Itis characterized_by neonatal and infantile hypotonia and failure to thrive, cystinuria type 1 and nephrolithiasis, growth retardation due to growth hormone deficiency, and minor facial dysmorphism', 'cystinuria with mitochondrial disease', 'ORDO:163690|OMIM:606407|ICD10CM:E72.0', '5', 'OMIM:606407');
INSERT INTO `disease_info` VALUES ('DOID:0060859', 'salmonellosis', 'A primary bacterial infectious disease caused by the bacteria of the genus Salmonella. It has sypmtoms diarrhea, fever, vomiting, and abdominal cramps 12 to 72 hours after infection. In most cases, the illness lasts four to seven days, and most people recover without treatment', 'Salmonella infection', 'ICD9CM:003.0|ICD10CM:A02.0', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060861', 'microphthalmia with limb anomalies@en', 'A an autosomal recessive disease that is characterized by autosomal recessive inheritance of bilateral or unilateral clinical anophthalmia or microphthalmia and synostosis, syndactyly, oligodactyly and/or polydactyly that has material_basis_in homozygous mutation in the SMOC1 gene on chromosome 14q24', 'Waardenburg anophthalmia syndrome|ophthalmoacromelic syndrome|OAS|MLA|anophthalmia-syndactyly syndrome', 'ORDO:1106|OMIM:206920|ICD10CM:Q87.2', '1', 'OMIM:206920');
INSERT INTO `disease_info` VALUES ('DOID:0060862', 'mal de Meleda@en', 'A palmoplantar keratosis characterized by autosomal recessive inheritance of symmetric palmoplantar hyperkeratosis that progressively extends to the dorsal surfaces of hands and feet and ichthyotic changes elsewhere that has material_basis_in  homozygous mutation in the SLURP1 gene on chromosome 8q24', 'transgrediens palmoplantar keratoderma of Siemens|keratosis palmoplantaris transgrediens of Siemens|Meleda disease', 'OMIM:248300|ORDO:87503|ICD10CM:Q82.8', '1', 'OMIM:248300');
INSERT INTO `disease_info` VALUES ('DOID:0060863', 'patterned macular dystrophy', 'A macular degeneration characterized by abnormal accumulation of lipofuscin in the retinal pigment epithelium in a distinct pattern, patterns include; reticular (\'fishnet-like\'), macroreticular (\'spider-shaped\'), and butterfly-shaped', 'patterned dystrophy of retinal pigment epithelium', 'ORDO:99001|OMIM:PS169150|ICD10CM:H35.5', '5', 'OMIM:PS169150');
INSERT INTO `disease_info` VALUES ('DOID:0060864', 'patterned macular dystrophy 2', 'A patterned macular dystrophy characterized by bilateral accumulation of pigmented or yellowish material at the level of the retinal pigment epithelium in lesions that resemble the wings of a butterfly that has material_basis_in heterozygous mutation in the CTNNA1 gene on chromosome 5q31', 'butterfly-shaped pigmentary maculary dystrophy 2|MDPT2', 'OMIM:608970', '1', 'OMIM:608970');
INSERT INTO `disease_info` VALUES ('DOID:0060865', 'patterned macular dystrophy 3', 'A patterned macular dystrophy characterized by a \'dry desert land\' pattern of the fundus, involving the posterior pole initially and progressing from the temporal fovea to the periphery of the retina developing in the fourth or fifth decade of life that has material_basis_in heterozygous mutation in the MAPKAPK3 gene on chromosome 3p21', 'Martinique crinkled retinal pigment epitheliopathy|MDPT3', 'OMIM:617111', '1', 'OMIM:617111');
INSERT INTO `disease_info` VALUES ('DOID:0060866', 'patterned macular dystrophy 1', 'A patterned macular dystrophy characterized by bilateral accumulation of pigmented or yellowish material at the level of the retinal pigment epithelium in lesions that resemble the wings of a butterfly that has material_basis_in heterozygous mutation in the PRPH2 gene on chromosome 6p21', 'butterfly-shaped pigmentary maculary dystrophy 1|MDPT1', 'OMIM:169150', '1', 'OMIM:169150');
INSERT INTO `disease_info` VALUES ('DOID:0060867', 'macrocephaly-autism syndrome', 'An autosomal dominant disease characterized by macrocephaly, facial phenotypes including square outline with frontal bossing, \'dished-out\' midface, biparietal narrowing, and long philtrum, developmental delay and autism that has material_basis_in heterozygous mutation in the PTEN gene on chromosome 10q23', 'macrocephaly-intellectual disability-autism syndrome', 'ORDO:210548|OMIM:605309', '1', 'OMIM:605309');
INSERT INTO `disease_info` VALUES ('DOID:0060868', 'leukoencephalopathy with vanishing white matter', 'A leukodystrophy characterized by variable neurologic features resulting from deficiency in astrocyte maturation, including progressive cerebellar ataxia, spasticity, and cognitive impairment associated with white matter lesions on brain imaging with onset from early infancy to adulthood that has material_basis_in homozygous or compound heterozygous mutation in any of the 5 genes encoding subunits of the translation initiation factor EIF2B: EIF2B1 on chromosome 12q24, EIF2B2 on chromosome 14q24, EIF2B3 on chromosome 1p34, EIF2B4 on chromosome 2p23, or EIF2B5 on chromosome 3q27', 'Cree leukoencephalopathy|vanishing white matter leukodystrophy|CLE|childhood ataxia with central nervous system hypomyelination|CACH', 'ICD10CM:E75.2|OMIM:603896|ORDO:135', '1', 'OMIM:603896');
INSERT INTO `disease_info` VALUES ('DOID:0060869', 'late-onset retinal degeneration', 'A retinal degeneration characterized by autosomal dominant inheritance of night blindness and drusen deposits, progressing to severe central and peripheral degeneration, with choroidal neovascularization and chorioretinal atrophy with onset in the fifth to sixth decade of life that has material_basis_in heterozygous mutation in the C1QTNF5 gene on chromosome 11q23', 'autosomal dominant late-onset retinal degeneration|LORD', 'ORDO:67042|OMIM:605670', '1', 'OMIM:605670');
INSERT INTO `disease_info` VALUES ('DOID:0060870', 'isolated growth hormone deficiency', 'A hypopituitarism characterized by abnormally low levels, absence or impaired function of growth hormone in the absence of abnormalities in other pituitary hormones', 'congenital isolated GH deficiency|familial isolated growth hormone deficiency|non-acquired isolated growth hormone deficiency|congenital isolated growth hormone deficiency|congenital IGHD|IGHD', 'ICD10CM:E23.0|ORDO:631|UMLS_CUI:C0013338', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060871', 'autosomal dominant keratitis-ichthyosis-deafness syndrome', 'An autosomal dominant disease characterized by congenital deafness, keratopachydermia and constrictions of fingers and toes that has material_basis_in heterozygous mutation in the GJB2 gene on chromosome 13q', 'autosomal dominant KID syndrome', 'ORDO:477|OMIM:148210|ICD10CM:Q80.8', '1', 'OMIM:148210');
INSERT INTO `disease_info` VALUES ('DOID:0060872', 'isolated growth hormone deficiency type II', 'An isolated growth hormone deficiency characterized by autosomal dominant inheritance of low but detectable levels of GH1 resulting in variable degrees of dwarfism which are responsive to growth hormone therapy that has material_basis_in dominant negative mutations in the GH1 gene on chromosome 17q23.3', 'IGHD II|autosomal dominant pituitary dwarfism due to isolated growth hormone deficiency|congenital isolated growth hormone deficiency type II|autosomal dominant isolated growth hormone deficiency|congenital isolated GH deficiency type II|congenital IGHD type II', 'ICD10CM:E23.0|OMIM:173100|ORDO:231679', '1', 'OMIM:173100');
INSERT INTO `disease_info` VALUES ('DOID:0060873', 'isolated growth hormone deficiency type IA', 'An isolated growth hormone deficiency characterized by autosomal recessive inheritance of severe dwarfism with onset by 6 months of age and variable development of antibodies to growth hormone following exogenous supplementation that has material_basis_in null mutations in the GH1 gene on chromosome 17q23.3', 'sexual ateleiotic dwarfism|IGHD IA|Illig-type growth hormone deficiency|primordial dwarfism|autosomal recessive isolated growth hormone deficiency|pituitary dwarfism I', 'OMIM:262400|ORDO:231662|ICD10CM:E23.0', '1', 'OMIM:262400');
INSERT INTO `disease_info` VALUES ('DOID:0060874', 'isolated growth hormone deficiency type IB', 'An isolated growth hormone deficiency characterized by autosomal recessive inheritance of low but detectable levels of GH, short stature, significantly retarded bone age, and a positive response and immunologic tolerance to growth hormone therapy that has material_basis_in mutation in the GH1 or GHRHR genes on chromosomes 17q23.3 and 7p14.3, respectively', 'congenital isolated growth hormone deficiency type IB|congenital IGHD type IB|dwarfism of Sindh|IGHD IB|congenital isolated GH deficiency type IB', 'OMIM:612781|ORDO:231671|ICD10CM:E23.0', '1', 'OMIM:612781');
INSERT INTO `disease_info` VALUES ('DOID:0060875', 'isolated growth hormone deficiency type III', 'An isolated growth hormone deficiency characterized by dwarfism, variable occurence of hypogammaglobulinemia, and a generally good response to growth hormone therapy that has material_basis_in mutation in the BTK gene on chromosome Xq22.1', 'Fleisher syndrome|X-linked IGHD|congenital isolated GH deficiency type III|IGHD III|X-linked hypogammaglobulinemia and isolated growth hormone deficiency|congenital isolated growth hormone deficiency type III|X-linked isolated growth hormone deficiency|congenital IGHD type III|growth hormone deficiency with hypogammaglobulinemia|X-linked agammaglobulinemia and isolated growth hormone deficiency', 'ORDO:231692|ICD10CM:E23.0|OMIM:307200', '1', 'OMIM:307200');
INSERT INTO `disease_info` VALUES ('DOID:0060877', 'ichthyosis bullosa of Siemens', 'An ichthyosis characterized by autosomal dominant inheritance of congenital erythema and widespread skin blistering, blisters develop into gray hyperkeratoses with a lichenified appearance  that has material_basis_in heterozygous mutation in the KRT2 gene on chromosome 12q13', 'superficial epidermolytic ichthyosis|bullous type ichthyosis', 'ORDO:455|MESH:D053560|OMIM:146800|ICD10CM:Q80.8|UMLS_CUI:C0432306', '1', 'OMIM:146800');
INSERT INTO `disease_info` VALUES ('DOID:0060878', 'hypoparathyroidism-deafness-renal disease syndrome', 'A characterized by autosomal dominant inheritance of hypoparathyroidism, sensorineural deafness and progressive renal failure that has material_basis_in chromosome deletion that results in haploinsufficiency of the GATA3 gene on chromosome 10p14', 'HDR syndrome|Barakat syndrome|hypoparathyroidism, sensorineural deafness, and renal disease', 'UMLS_CUI:C1840333|ORDO:2237|OMIM:146255|ICD10CM:Q87.8', '1', 'OMIM:146255');
INSERT INTO `disease_info` VALUES ('DOID:0060879', 'primary hypomagnesemia', 'A metal metabolism disorder characterized by very low serum magnesium levels often with secondary hypocalcemia with onset typically in the first months of life', 'HOMG|primary familial hypomagnesemia', 'OMIM:PS602014|ICD10CM:E83.4|ORDO:34526', '5', 'OMIM:PS602014');
INSERT INTO `disease_info` VALUES ('DOID:0060880', 'renal hypomagnesemia 3', 'A hypomagnesemia characterized by autosomal recessive inheritance of excessive urinary Ca(2+) and Mg(2+) excretion that has material_basis_in homozygous or compound heterozygous mutation in the CLDN16 gene on chromosome 3q28', 'renal hypomagnesemia type 3|FHHNC without severe ocular involvement|familial primary hypomagnesemia with hypercalciuria and nephrocalcinosis without severe ocular involvement|primary hypomagnesemia due to defect in renal tubular transport of magnesium|isolated renal hypomagnesemia|HOMG3', 'OMIM:248250|ORDO:31043|ICD10CM:E83.4', '1', 'OMIM:248250');
INSERT INTO `disease_info` VALUES ('DOID:0060881', 'renal hypomagnesemia 5 with ocular involvement', 'A hypomagnesemia characterized by autosomal recessive inheritance of renal magnesium wasting with hypercalcinosis, progressive renal failure and severe ocular involvement that has material_basis_in homozygous mutation in the CLDN19 gene on chromosome 1p34.2', 'bilateral macular coloboma with hypercalciuria|hypercalciuria-bilateral macular coloboma syndrome|FHHNC with severe ocular involvement|Meier-Blumberg-Imahorn syndrome|familial hypomagnesemia with hypercalciuria, nephrocalcinosis and severe ocular involvement', 'UMLS_CUI:C2931121|OMIM:248190|ICD10CM:E83.4|ORDO:2196', '1', 'OMIM:248190');
INSERT INTO `disease_info` VALUES ('DOID:0060882', 'renal hypomagnesemia 4', 'A hypomagnesemia characterized by isolated hypomagnesemia due to renal loss with normal serum calcium levels and urinary calcium excretion that has material_basis_in variation in the chromosome region 4q25', 'HOMG4', 'ORDO:34527|OMIM:611718|ICD10CM:E83.4', '1', 'OMIM:611718');
INSERT INTO `disease_info` VALUES ('DOID:0060883', 'intestinal hypomagnesemia 1', 'A hypomagnesemia characterized by very low serum magnesium levels due to defects in intestinal absorbtion and kidney excretion and secondary hypocalcemia that has material_basis_in homozygous or compound heterozygous mutations in the TRPM6 gene on chromosome 9q21', 'primary hypomagnesemia with secondary hypocalcemia|hypomagnesemia intestinal type 1|HOMG1|hypomagnesemia caused by selective magnesium malabsorption|hypomagnesemic tetany|intestinal hypomagnesemia with secondary hypocalcemia', 'ORDO:30924|OMIM:602014|ICD10CM:E83.4', '1', 'OMIM:602014');
INSERT INTO `disease_info` VALUES ('DOID:0060884', 'renal hypomagnesemia 6', 'A hypomagnesemia characterized by autosomal dominant inheritance of severely lowered serum magnesium levels without other electrolyte disturbances or abnormalities in urinary magnesium excretion that has material_basis_in heterozygous mutation in the CNNM2 gene on chromosome 10q24', 'HOMG6', 'ORDO:34527|OMIM:613882|ICD10CM:E83.4', '1', 'OMIM:613882');
INSERT INTO `disease_info` VALUES ('DOID:0060885', 'renal hypomagnesemia 2', 'A hypomagnesemia characterized by autosomal dominant inheritance of hypomagnesemia due to renal magnesium loss that has material_basis_in heterozygous mutation in the FXYD2 gene on chromosome 11q23', 'HOMG2|autosomal dominant primary hypomagnesemia with hypocalciuria', 'ICD10CM:E83.4|ORDO:34528|OMIM:154020', '1', 'OMIM:154020');
INSERT INTO `disease_info` VALUES ('DOID:0060886', 'osteopathia striata with cranial sclerosis@en', 'An osteosclerosis characterized by longitudinal striations of the metaphyses of the long bones, sclerosis of the craniofacial bones, macrocephaly, cleft palate and hearing loss in females and fetal or neonatal lethality in males that has material_basis_in mutation in the AMER1 gene on chromosome Xq11', 'hyperostosis generalisata with striations|Robinow-Unger syndrome', 'ORDO:2780|OMIM:300373|ICD10CM:Q78.8|UMLS_CUI:C0432268|MESH:C536053', '1', 'OMIM:300373');
INSERT INTO `disease_info` VALUES ('DOID:0060887', 'ossification of the posterior longitudinal ligament of spine@en', 'A connective tissue disease characterized by ectopic ossification of the posterior longitudinal spinal ligament resulting in spinal cord compression, myelopathy and hyperreflexia', 'OPLL', 'OMIM:602475', '5', 'OMIM:602475');
INSERT INTO `disease_info` VALUES ('DOID:0060888', 'transient myeloproliferative syndrome@en', 'A myeloproliferative neoplasm characterized by leukocytosis in newborns with Down syndrome and rarely in non-Down\'s infants', 'transient leukemia|TAM|transient myeloproliferative disease|MST|transient abnormal myelopoiesis|transient leurkemia of Down syndrome', 'ICD10CM:D47.7|OMIM:159595|ORDO:420611', '5', 'OMIM:159595');
INSERT INTO `disease_info` VALUES ('DOID:0060889', 'prune belly syndrome@en', 'A syndrome that has_material_basis in homozygous mutation in the CHRM3 gene on chromosome 1q43. It is characterized by megacystis (massively enlarged bladder) with disorganized detrusor muscle, cryptorchidism, and thin abdominal musculature with overlying lax skin', 'Obrisnksy syndrome|Eagle-Barret syndrome|abdominal muscle deficiency syndrome', 'ICD10CM:Q79.4|ORDO:2970|MESH:D011535|OMIM:100100', '1', 'OMIM:100100');
INSERT INTO `disease_info` VALUES ('DOID:0060890', 'ectopic Cushing syndrome@en', 'A primary hyperaldosteronism that is characterized by a tumor outside the pituitary gland produces a hormone called adrenocorticotropic hormone', 'ectopic ACTH secreting tumor|Cushing syndrome due to ectopic ACTH secretion', 'ORDO:99889|ICD10CM:E24.3', '5', 'ORPHA:99889');
INSERT INTO `disease_info` VALUES ('DOID:0060891', 'juvenile onset Parkinson\'s disease 19A', 'A Parkinson\'s disease that has_material_basis_in homozygous mutation in the DNAJC6 gene on chromosome 1p31', 'juvenile onset Parkinson disease 19A', 'ORDO:391411|OMIM:615528|ICD10CM:G20', '1', 'OMIM:615528');
INSERT INTO `disease_info` VALUES ('DOID:0060892', 'late onset Parkinson\'s disease', 'late onset Parkinson\'s disease', 'late onset Parkinson disease', 'ORDO:411602', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0060893', 'juvenile-onset Parkinson\'s disease', 'juvenile-onset Parkinson\'s disease', 'juvenile-onset Parkinson disease', '', '5', null);
