INSERT INTO `disease_info` VALUES ('DOID:0080106', 'microcephaly and chorioretinopathy 2', 'A syndrome that is characterized by delayed psychomotor development, visual impairment, and short stature and has_material_basis_in homozygous mutation in the PLK4 gene', '', 'OMIM:616171', '1', 'OMIM:616171');
INSERT INTO `disease_info` VALUES ('DOID:0080107', 'microcephaly and chorioretinopathy 3', 'A syndrome that is characterized by congenital microcephaly and chorioretinal dysplasia associated with poor vision and nystagmus and has_material_basis_in compound heterozygous mutation in the TUBGCP4 gene', '', 'OMIM:616335', '1', 'OMIM:616335');
INSERT INTO `disease_info` VALUES ('DOID:0080108', 'myoglobinuria@en', 'A myopathy that is characterized by an increased urinary excretion of myoglobin', '', 'OMIM:550500|OMIM:268200|OMIM:160010', '1', 'OMIM:550500|OMIM:268200|OMIM:160010');
INSERT INTO `disease_info` VALUES ('DOID:0080109', 'infantile myofibromatosis@en', 'A connective tissue benign neoplasm that is characterized by the development of benign tumors in the skin, striated muscles, bones, and in exceptional cases, visceral organs', '', 'ORDO:2591|OMIM:615293|OMIM:228550', '1', 'OMIM:615293|OMIM:228550');
INSERT INTO `disease_info` VALUES ('DOID:0080110', 'multiple pterygium syndrome', 'A genetic disease that is characterized by permanently bent fingers (camptodactyly), short stature, rocker-bottom or club feet, joints that are bent in a fixed position (contractures), union or webbing of the skin between the fingers (syndactyly), and/or webbing of the neck, inside bend of the elbows, back of the knees and armpits', '', 'OMIM:253290|OMIM:178110|OMIM:312150|OMIM:265000', '1', 'OMIM:253290|OMIM:178110|OMIM:312150|OMIM:265000');
INSERT INTO `disease_info` VALUES ('DOID:0080111', 'mitochondrial complex III deficiency nuclear type 1@en', 'A mitochondrial complex III deficiency characterized by onset at birth of lactic acidosis, hypotonia, hypoglycemia, failure to thrive, encephalopathy, and delayed psychomotor development and that has_material_basis_in homozygous or compound heterozygous mutation in the nuclear-encoded BCS1L gene on chromosome 2q35', '', 'OMIM:124000', '1', 'OMIM:124000');
INSERT INTO `disease_info` VALUES ('DOID:0080112', 'mitochondrial complex III deficiency nuclear type 3@en', 'A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCRB gene on chromosome 8q22', '', 'OMIM:615158', '1', 'OMIM:615158');
INSERT INTO `disease_info` VALUES ('DOID:0080113', 'mitochondrial complex III deficiency nuclear type 4@en', 'A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCRQ gene on chromosome 5q31', '', 'OMIM:615159', '1', 'OMIM:615159');
INSERT INTO `disease_info` VALUES ('DOID:0080114', 'mitochondrial complex III deficiency nuclear type 5@en', 'A mitochondrial complex III deficiency characterized by neonatal onset of severe metabolic acidosis associated with hyperammonemia and hypoglycemia and that has_material_basis_in homozygous mutation in the UQCRC2 gene on chromosome 16p12', '', 'OMIM:615160', '1', 'OMIM:615160');
INSERT INTO `disease_info` VALUES ('DOID:0080115', 'mitochondrial complex III deficiency nuclear type 6@en', 'A mitochondrial complex III deficiency characterized by onset in early childhood of episodic acute lactic acidosis, ketoacidosis, and insulin-responsive hyperglycemia, usually associated with infection and that has_material_basis_in homozygous mutation in the CYC1 gene on chromosome 8q24', '', 'OMIM:615453', '1', 'OMIM:615453');
INSERT INTO `disease_info` VALUES ('DOID:0080116', 'mitochondrial complex III deficiency nuclear type 7@en', 'A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCC2 gene on chromosome 6p21', '', 'OMIM:615824', '1', 'OMIM:615824');
INSERT INTO `disease_info` VALUES ('DOID:0080117', 'mitochondrial complex III deficiency nuclear type 8@en', 'A mitochondrial complex III deficiency characterized by childhood onset of progressive neurodegeneration that has_material_basis_in homozygous mutation in the LYRM7 gene on chromosome 5q23', '', 'OMIM:615838', '1', 'OMIM:615838');
