INSERT INTO `disease_info` VALUES ('DOID:0080143', 'congenital fibrosis of the extraocular muscles@en', 'An ocular motility disease that is characterized by the inability to move the eyes in certain directions, droopy eyelids and eyes that are fixed in an abnormal position', 'Tukel syndrome', 'OMIM:135700|OMIM:600638|OMIM:609384|OMIM:602078|OMIM:609428|OMIM:616219', '1', 'OMIM:135700|OMIM:600638|OMIM:609384|OMIM:602078|OMIM:609428|OMIM:616219');
