INSERT INTO `disease_info` VALUES ('DOID:0080147', 'lymphoblastic lymphoma@en', 'A lymphoma that has_material_basis_in immature malignant lymphocytes (lymphoblasts) committed to the B-cell or T-cell lineage and located_in primarily lymph nodes or located_in extranodal sites', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080148', 'T-cell childhood lymphoblastic lymphoma@en', 'A lymphoblastic lymphoma that has_material_basis_in T-cells and that occurs during childhood', 'Childhood T lymphoblastic lymphoma', 'NCI:C7210', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080149', 'adult acute monocytic leukemia', 'An acute monocytic leukemia occurring in adults', '', 'NCI:C8263', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080150', 'adrenocorticotropic hormone deficiency@en', 'A hypopituitarrium that is characterized by a decreased or absent production of adrenocorticotropic hormone by the pituitary gland', '', 'OMIM:201400', '1', 'OMIM:201400');
INSERT INTO `disease_info` VALUES ('DOID:0080153', 'medium chain acyl-CoA dehydrogenase deficiency@en', 'A lipid metabolism disorder that is characterized by a deficiency of the enzyme medium chain acyl-CoA dehydrogenase that results in the inability to convert medium chain fatty acids to energy, particularly during fasting', '', 'OMIM:201450', '1', 'OMIM:201450');
INSERT INTO `disease_info` VALUES ('DOID:0080154', 'short chain acyl-CoA dehydrogenase deficiency@en', 'A lipid metabolism disorder that is characterized by deficiency of the enzyme short chain acyl-CoA dehydrogenase that results in the inability to convert short chain fatty acids', '', 'OMIM:201470', '1', 'OMIM:201470');
INSERT INTO `disease_info` VALUES ('DOID:0080155', 'very long chain acyl-CoA dehydrogenase deficiency@en', 'A lipid metabolism disorder that is characterized by deficiency of the enzyme very long chain acyl-CoA dehydrogenase that results in the inability to convert very long chain fatty acids', '', 'OMIM:201475', '1', 'OMIM:201475');
INSERT INTO `disease_info` VALUES ('DOID:0080156', 'X-linked adrenal hypoplasia congenita@en', 'An adrenal cortical hypofunction that is characterized by a reduction in adrenal gland function resulting from incomplete development of the adrenal cortex and has_material_basis_in the nuclear receptor NR0B1 (DAX1) gene', 'congenital adrenal hypoplasia', 'OMIM:300200', '1', 'OMIM:300200');
INSERT INTO `disease_info` VALUES ('DOID:0080158', 'herpes simplex virus keratitis@en', 'A keratitis that has_material_basis_in herpes simplex type infection', 'dendritic keratitis', 'MESH:D016849|MESH:D007635', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080159', 'Cryptococcal meningitis@en', 'A fungal meningitis that has_material_basis in Crypococcus fungal infection', '', 'MESH:D016919', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080160', 'Cytomegalovirus retinitis@en', 'A retinitis that has_material_basis_in Cytomegalovirus', 'CMV retinitis', 'MESH:D017726', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080161', 'cutaneous candidiasis@en', 'A candidiasis that is characterized by Candida infection located_in the skin', '', 'MESH:D002179', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080162', 'lupus nephritis@en', 'A glomerulonephritis that is characterized by inflammation of the kidneys resulting from systemic lupus erythematosus', '', 'MESH:D008181', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080163', 'otulipenia@en', 'An immune system disease that is characterized by neonatal onset of recurrent fever, erythematous rash with painful nodules, painful joints, and lipodystrophy and has_material_basis_in autosomal recessive inheritance of homozygous loss-of-function mutations in the OTULIN gene encoding a deubiquitinase with linear linkage specificity on chromosome 5p15', 'otulin-related autoinflammatory syndrome|autoinflammation, panniculitis and dermatosis syndrome', 'OMIM:617099', '1', 'OMIM:617099');
INSERT INTO `disease_info` VALUES ('DOID:0080164', 'myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1@en', 'A myeloid neoplasm that is characterized by the formation of abnormal fusion genes that encode constitutively activated tyrosine kinases', 'Myeloid and lymphoid neoplasms with eosinophilia and abnormalities of platelet-derived growth factor receptor alpha (PDGFRA), platelet-derived growth factor receptor beta (PDGFRB), and fibroblast growth factor receptor-1 (FGFR1) are a group of hematologic neoplasms|Myeloid and Lymphoid Neoplasms with Eosinophilia and Rearrangement of PDGFRA, PDGFRB, or FGFR1, or with PCM1-JAK2', 'UMLS_CUI:C2827356|NCI:C84270', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080165', 'myeloid and lymphoid neoplasms associated with PDGFRA rearrangement@en', 'A myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1 that is characterized by the rearrangement of the PDGFRA gene, most often resulting in the formation of FIP1L1-PDGFRA fusion transcripts', 'Myeloid and Lymphoid Neoplasms with PDGFRA Rearrangement', 'NCI:C84275', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080166', 'myeloid neoplasms associated with PDGFRB rearrangement@en', 'A myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1 that is characterized by the rearrangement of the PDGFRB gene, most often resulting in the formation of ETV6-PDGFRB fusion transcripts', 'Myeloid and Lymphoid Neoplasms with PDGFRB Rearrangement', 'NCI:C84276', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080167', 'myeloid and lymphoid neoplasms associated with FGFR1 abnormalities@en', 'A myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1 that is characterized by the rearrangement of the FGFR1 gene, resulting in translocations with an 8p11 breakpoint', '', 'NCI:C84277', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080169', 'tricuspid atresia@en', 'A tricuspid valve disease characterized by a missing or abnormally developed tricuspid heart value at birth. ', '', 'OMIM:605067', '5', 'OMIM:605067');
INSERT INTO `disease_info` VALUES ('DOID:0080170', 'normophosphatemic familial tumoral calcinosis@en', 'A calcinosis that is characterized by massive periarticular, and seldom visceral, deposition of calcified tumors', '', 'OMIM:610455', '1', 'OMIM:610455');
INSERT INTO `disease_info` VALUES ('DOID:0080171', 'esophageal atresia/tracheoesophageal fistula@en', 'A gastrointestinal system disease that is characterized by abnormal development of the esophagus and trachea where the upper esophagus does not connect (atresia) to the lower esophagus and stomach and may also include tracheoesophageal fistula where the esophagus and the trachea are abnormally connected which allows fluids from the esophagus to get into the airways and interfere with breathing', 'tracheoesophageal fistula with or without esohageal atresia|esophageal atresia and/or tracheoesophageal fistula', 'OMIM:189960', '1', 'OMIM:189960');
INSERT INTO `disease_info` VALUES ('DOID:0080172', 'thiopurine S-methyltransferase deficiency@en', 'An inherited metabolic disease that is characterized by significantly reduced activity of an enzyme that helps the body process drugs called thiopurines', 'poor metabolism of thiopurines-1|TPMT deficiency', 'OMIM:610460', '5', 'OMIM:610460');
INSERT INTO `disease_info` VALUES ('DOID:0080173', 'bladder exstrophy-epispadias-cloacal exstrophy complex@en', 'A physical disorder that is characterized as a spectrum of anomalies involving the urinary tract, genital tract, musculoskeletal system and sometimes the intestinal tract', 'exstrophy-epispadias complex', 'ORDO:322|OMIM:258040', '5', 'OMIM:258040');
INSERT INTO `disease_info` VALUES ('DOID:0080174', 'bladder exstrophy@en', 'A bladder exstrophy-epispadias-cloacal exstrophy complex that is characterized by an evaginated bladder plate, epispadias and an anterior defect of the pelvis, pelvic floor and abdominal wall. The rear portion of the bladder wall (posterior vesical wall) turns outward (exstrophy) through an opening in the abdominal wall and urine is excreted through this opening', '', 'ORDO:93930|OMIM:600057|ICD9CM:753.5|ICD10:Q64.1', '5', 'OMIM:600057');
INSERT INTO `disease_info` VALUES ('DOID:0080175', 'cloacal exstrophy', 'A bladder exstrophy-epispadias-cloacal exstrophy complex that is characterized by a defect in the urethra, bladder and bowel', '', 'OMIM:258040', '5', 'OMIM:258040');
INSERT INTO `disease_info` VALUES ('DOID:0080176', 'meningococcal meningitis@en', 'A bacterial meningitis that has_material_basis_in Neisseria meningitidis infection', '', 'MESH:D008585|ICD9CM:036.0|ICD10:A39.0', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080177', 'hepatic veno-occlusive disease@en', 'A hepatic vascular disease that is characterized by obstruction of some of the small veins of the liver', 'veno-occlusive disease', 'MESH:D006504|ICD10:K76.5', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080178', 'mucositis@en', 'A gastrointestinal system disease that is characterized by painful inflammation and ulceration of the mucous membranes lining the digestive tract', '', 'MESH:D052016', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080179', 'haemophilus meningitis@en', 'A bacterial meningitis that has_material_basis_in Haemophilus influenzae infection', '', 'MESH:D008583|ICD9CM:320.0|ICD10:G00.0', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080180', 'Zika virus congenital syndrome@en', 'A syndrome that is characterized in neonates by microcephaly, craniofacial disproportion, spasticity, seizures, irritability and brainstem dysfunction including feeding difficulties, ocular abnormalities and findings on neuroimaging such as calcifications, cortical disorders and ventriculomegaly and has_material_basis_in the acquisition of Zika virus infection in utero', 'ZIKV congenital infection', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080181', 'PHARC syndrome@en', 'An autosomal recessive disease that is characterized by polyneuropathy, hearing loss, cerebellar ataxia, retinitis pigmentosa and early-onset cataract', 'polyneyropathy, hearing loss, ataxia, retinitis pigmentosa, and cataract', 'ORDO:171848|OMIM:612674', '1', 'OMIM:612674');
INSERT INTO `disease_info` VALUES ('DOID:0080182', 'mixed fibrolamellar hepatocellular carcinoma@en', 'A fibrolamellar carcinoma that is characteirzed by the presence of both pure fibrolamellar hepatocellular carcinoma and and conventional hepatocellular carcinoma components', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080183', 'medullary colon carcinoma@en', 'A colon carcinoma that is characterized by a solid growth pattern', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080184', 'mixed mucinous and nonmucinous bronchioloalveolar adenocarcinoma@en', 'A bronchiolo-alveolar adenocarcinoma that is characterized by a mixed array of different patterns (acinar, papillary, bronchioloalveolar, solid with mucin)', 'mixed mucinous and non-mucinous bronchioloalveolar adenocarcinoma|indeterminate bronchioloalveolar carcinoma', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080185', 'mucinous bronchioloalveolar adenocarcinoma@en', 'A bronchiolo-alveolar adenocarcinoma that is characterized by a tumour cells containing abundant mucin in their cytoplasm and composed of tall columnar cells growing along alveolar walls without stromal invasion', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080186', 'nonmucinous bronchioloalveolar adenocarcinoma@en', 'A bronchiolo-alveolar adenocarcinoma that is characterized by cells with cuboidal or columnar morphology with eosinophilic or clear cytoplasm and shows Clara cell or type 2 pneumocyte differentiation', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080187', 'chronic neutrophilic leukemia@en', 'A chronic leukemia characterized by neutrophilic leukocytosis with no detectable Philadelphia chromosome or BCR/ABL fusion gene', '', 'NCI:C3179', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080188', 'chronic myelomonocytic leukemia@en', 'A chronic leukemia characterized by monocytosis, increased monocytes in the bone marrow, variable degrees of dysplasia, but an absence of immature granulocytes in the blood', '', 'NCI:C3178', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080189', 'malignant hemangioma@en', 'A cell type cancer of vascular origin, characterized by proliferation of endothelial cells in and about the vascular lumen', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080190', 'malignant epithelioid hemangioendothelioma@en', 'A malignant hemangioma characterized by the presence of epithelioid endothelial cells. The neoplastic cells are arranged in cords and nests, which are embedded in a myxoid to hyalinized stroma', '', 'NCI:C3800', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080191', 'PTEN hamartoma tumor syndrome@en', 'A syndrome characterized as a spectrum of disorders (Cowden syndrome, Bannayan-Riley-Ruvalcaba syndrome, PTEN-related Proteus syndrome, and Proteus-like syndrome) caused by germline mutations of the PTEN gene', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080192', 'relapsed/refractory diffuse large B-cell lymphoma@en', 'A diffuse large B-cell lymphoma characterized by less than 50 percent decrease in lesion size with induction therapy or the appearance of new lesions or the appearance of new lesions after attainment of complete remission', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080193', 'superior semicircular canal dehiscence@en', 'An inner ear disease characterized by dehiscence in the bone overlying the superior semicircular canal experience with symptoms of pressure or sound-induced vertigo, bone conduction hyperacusis, and pulsatile tinnitus', 'third mobile window syndrome|canal dehiscence syndrome|superior canal dehiscence|superior canal syndrome|superior semicircular canal dehiscence syndrome|minor’s syndrome', 'ORDO:420402|ICD10:H83.8', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080194', 'Carey-Fineman-Ziter syndrome@en', 'A syndrome characterized by hypotonia, Moebius sequence (bilateral congenital facial palsy with impairment of ocular abduction), Pierre Robin complex (micrognathia, glossoptosis, and high-arched or cleft palate), delayed motor milestones, and failure to thrive', '', 'OMIM:254940', '1', 'OMIM:254940');
INSERT INTO `disease_info` VALUES ('DOID:0080195', 'Marinesco-Sjogren syndrome@en', 'An autosomal recessive disease characterized by congenital cataracts, cerebellar ataxia, progressive muscle weakness due to myopathy, and delayed psychomotor development', 'hereditary oligophrenic cerebello-lental degeneration|Marinesco-Garland syndrome|Garland-Moorhouse syndrome', 'OMIM:248800', '1', 'OMIM:248800');
INSERT INTO `disease_info` VALUES ('DOID:0080196', 'mandibulofacial dysostosis, Guion-Almeida type@en', 'An autosomal dominant disease characterized by progressive microcephaly, micrognathia, microtia, dysplastic ears, preauricular skin tags, speech delay, significant developmental delay,  midface and malar hypoplasia,', 'mandibulofacial dysostosis with microcephaly', 'OMIM:610536', '1', 'OMIM:610536');
INSERT INTO `disease_info` VALUES ('DOID:0080197', 'congenital muscular dystrophy with cataracts and intellectual disability@en', 'A congenital muscular dystrophy characterized by onset of progressive muscle weakness in early childhood with autosomal recessive inheritance that has_material_basis_in homozygous or compound heterozygous mutation in the INPP5K gene (607875) on chromosome 17p13', '', 'OMIM:617404', '1', 'OMIM:617404');
INSERT INTO `disease_info` VALUES ('DOID:0080198', 'infantile histiocytoid cardiomyopathy@en', 'An intrinsic cardiomyopathy characterized by the presence of characteristic pale granular foamy histiocyte-like cells within the myocardium and has_material_basis_in a mutation in the gene encoding mitochondrial cytochrome b', '', 'OMIM:500000', '5', 'OMIM:500000');
INSERT INTO `disease_info` VALUES ('DOID:0080199', 'colorectal carcinoma@en', 'A colorectal cancer that arises from the colon or rectum and invades through the muscularis mucosa into the submucosa', '', 'NCI:C2955|EFO:1001951', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080200', 'bilateral renal aplasia@en', 'A renal agenesis that is characterized by the absence of both kidneys at birth', '', 'ORDO:1848', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080201', 'Peters plus syndrome@en', 'A syndrome that is characterized by anterior chamber eye anomalies, short limbs with broad distal extremities, characteristic facial features, cleft lip/palate, and variable developmental delay/intellectual disability', 'Peters-plus syndrome|Peters anomaly-short limb dwarfism syndrome|Krause-Kivlin syndrome', 'OMIM:261540', '1', 'OMIM:261540');
INSERT INTO `disease_info` VALUES ('DOID:0080202', 'adenoid cystic carcinoma@en', 'An adenocarcinoma that is characterized by bands or cylinders of hyalinized or mucinous stroma separating or surrounded by nests or cords of small epithelial cells', '', 'NCI:C2970|MESH:D003528', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:0080204', 'renal hypoplasia@en', 'A kidney disease that is characterized by abnormally small kidneys with normal morphology and reduced number of nephrons', '', 'url:http://www.orpha.net/consor/cgi-bin/OC_Exp.php?lng=en&Expert=93101|ORDO:93101', '5', null);
