INSERT INTO `disease_info` VALUES ('DOID:0090001', 'Fraser syndrome', 'An autosomal recessive disease characterized by cryptophthalmos, syndactyly, ambiguous genitalia, laryngeal and genitourinary malformations, oral clefting, and mental retardation that has_material_basis_in homozygous or compound heterozygous mutation in the FRAS1 gene on chromosome 4q21, the FREM2 gene on chromosome 13q13, or the GRIP1 gene on chromosome 12q14', 'cryptophthalmos with other malformations', 'ICD10CM:Q87.0|ORDO:2052|OMIM:219000', '1', 'OMIM:219000');
INSERT INTO `disease_info` VALUES ('DOID:0090002', 'Tietz syndrome', 'An monogenic disease that is characterized by congenital profound bilateral sensorineural hearing loss and generalized albino-like hypopigmentation of skin, eyes and hair that has_material_basis_in mutation in the MITF gene on chromosome 3p13', 'albinism-deafness of Tietz|Tietz albinism-deafness syndrome|hypopigmentation/deafness of Tietz', 'OMIM:103500|ORDO:42665', '1', 'OMIM:103500');
INSERT INTO `disease_info` VALUES ('DOID:0090003', 'agenesis of the corpus callosum with peripheral neuropathy', 'A neurodegenerative disease characterized by autosomal recessive inheritance with early onset of severe sensory-motor polyneuropathy, variable degree of agenesis of the corpus callosum, amyotrophy, hypotonia, and cognitive impairment that has_material_basis_in homozygous or compound heterozygous mutation in the SLC12A6 gene on chromosome 15q14', 'Charlevoix disease|corpus callosum agenesis-neuronopathy syndrome|Andermann syndrome', 'ORDO:1496|ICD10CM:G60.0|OMIM:218000', '1', 'OMIM:218000');
INSERT INTO `disease_info` VALUES ('DOID:0090004', 'progressive pseudorheumatoid arthropathy of childhood', 'A osteochondrodysplasia characterized by autosomal recessive inheritance with typical onset around 3 years of age, progressive severe degenerative joint disease, platyspondyly, epiphyseal enlargement but absence of inflammatory joint disease that has_material_basis_in homozygous or compound heterozygous mutation in the CHST3 gene on chromosome 10q22', 'spondyloepiphyseal dysplasia tarda-progressive arthropathy syndrome', 'ORDO:1159|ICD10CM:Q77.7|OMIM:208230', '1', 'OMIM:208230');
INSERT INTO `disease_info` VALUES ('DOID:0090005', 'Schwartz-Jampel syndrome 1', 'An autosomal recessive disease characterized by neuromyotonia and chondrodysplasia that has_material_basis_in hypomorphic mutations in the HSPG2 gene on chromosome 1p36', 'Catel-Hempel syndrome|Schwartz-Jampel-Aberfeld syndrome|Burton skeletal dysplasia|Burton syndrome|myotonic chondrodystrophy|Schwartz-Jampel syndrome type 1|Aberfeld syndrome|myotonic myopathy, dwarfism, chondrodystrophy, ocular and facial anomalies|Catel-Hempel type dysostosis enchondralis metaepiphysaria|osteochondromuscular dystrophy', 'OMIM:255800|ORDO:800|ICD10CM:G71.1', '1', 'OMIM:255800');
INSERT INTO `disease_info` VALUES ('DOID:0090006', 'renal coloboma syndrome', 'An autosomal dominant disease characterized by optic nerve coloboma and renal disease that has_material_basis_in heterozygous mutation in the PAX2 gene on chromosome 10q24', 'congenital anomalies of the kidney and urinary tract with or without ocular abnormalities|optic coloboma, vesicoureteral reflux and renal anomalies|papillo-renal syndrome, optic nerve coloboma with renal disease|CAKUT with or without ocular abnormalities|papillorenal syndrome|coloboma of optic nerve with renal disease|renal-coloboma syndrome with macular abnormalities', 'ICD10CM:Q60.4|ORDO:1475|OMIM:120330', '1', 'OMIM:120330');
INSERT INTO `disease_info` VALUES ('DOID:0090007', 'immunodeficiency-centromeric instability-facial anomalies syndrome', 'An autosomal recessive disease characterized by immunodeficiency, rearrangements in the vicinity of the centromeres of chromosomes 1, 9, and 16 and facial anomalies in most cases', 'ICF syndrome', 'ORDO:2268|OMIM:PS242860|ICD10CM:D84.8', '4', 'OMIM:PS242860|ORPHA:2268');
INSERT INTO `disease_info` VALUES ('DOID:0090008', 'immunodeficiency-centromeric instability-facial anomalies syndrome 1', 'An immunodeficiency-centromeric instability-facial anomalies syndrome characterized by autosomal recessive inheritance, facial dysmorphism and immunoglobulin deficiency of lymphocytes that has_material_basis_in homozygous or compound heterozygous mutation in the DNMT3B gene on chromosome 20q11.2', 'ICF syndrome 1', 'OMIM:242860|ICD10CM:D84.8', '1', 'OMIM:242860');
INSERT INTO `disease_info` VALUES ('DOID:0090009', 'immunodeficiency-centromeric instability-facial anomalies syndrome 2', 'An immunodeficiency-centromeric instability-facial anomalies syndrome characterized by autosomal recessive inheritance, facial dysmorphism, immunoglobulin deficiency resulting in recurrent infections, and mental retardation that has_material_basis_in homozygous or compound heterozygous mutation in the ZBTB24 gene on chromosome 6q21', 'ICF syndrome 2', 'OMIM:614069|ICD10CM:D84.8', '1', 'OMIM:614069');
INSERT INTO `disease_info` VALUES ('DOID:0090010', 'immunodeficiency-centromeric instability-facial anomalies syndrome 3', 'An immunodeficiency-centromeric instability-facial anomalies syndrome characterized by autosomal recessive inheritance, recurrent infections in childhood and variable dysmorphic facial features that has_material_basis_in homozygous mutation in the CDCA7 gene on chromosome 2q31', 'ICF syndrome 3', 'OMIM:616910|ICD10CM:D84.8', '1', 'OMIM:616910');
INSERT INTO `disease_info` VALUES ('DOID:0090011', 'immunodeficiency-centromeric instability-facial anomalies syndrome 4', 'An immunodeficiency-centromeric instability-facial anomalies syndrome characterized by autosomal recessive inheritance, recurrent infections in childhood and variable dysmorphic facial features that has_material_basis_in  homozygous or compound heterozygous mutation in the HELLS gene on chromosome 10q23', 'ICF syndrome 4', 'OMIM:616911|ICD10CM:D84.8', '1', 'OMIM:616911');
INSERT INTO `disease_info` VALUES ('DOID:0090012', 'severe combined immunodeficiency with sensitivity to ionizing radiation', 'A severe combined immunodeficiency characterized by being T cell-negative, B cell-negative and natural killer cell-positive with sensitivity to ionizing radiation and that has_material_basis_in mutation in the DCLRE1C gene on chromosome 10p13', 'SCID, Athabaskan type|SCID due to DCLRE1C deficiency|SCID, Athabascan type|SCID due to artemis deficiency|Severe combined immunodeficiency, Athabaskan type|Severe combined immunodeficiency, Athabascan type|Severe combined immunodeficiency due to DCLRE1C deficiency|Severe combined immunodeficiency due to artemis deficiency', 'OMIM:602450|ORDO:275|ICD10CM:D81.1', '1', 'OMIM:602450');
INSERT INTO `disease_info` VALUES ('DOID:0090013', 'severe combined immunodeficiency, autosomal recessive, T cell-negative, B cell-negative, Nk cell-positive', 'A severe combined immunodeficiency characterized by being T cell-negative, B cell-negative and natural killer cell-positive and that has_material_basis_in mutation in the RAG1 and RAG2 genes on chromosome 11p12', 'Severe combined immunodeficiency due to complete RAG1-2 deficiency|SCID due to complete RAG1-2 deficiency', 'ICD10CM:D81.1|ORDO:331206|OMIM:601457', '1', 'OMIM:601457');
INSERT INTO `disease_info` VALUES ('DOID:0090014', 'severe combined immunodeficiency, autosomal recessive, T cell-negative, B cell-positive, Nk cell-positive', 'A severe combined immunodeficiency characterized by being T cell-negative, B cell-positive and natural killer cell-positive and that has_material_basis_in homozygous or compound heterozygous mutation in the IL7R gene on chromosome 5p13 or the CD45 gene on chromosome 1q31', 'autosomal recessive T cell-negative, B-cell negative, NK cell-positive SCID', 'ICD10CM:D81.2|ORDO:169154|OMIM:608971', '1', 'OMIM:608971');
INSERT INTO `disease_info` VALUES ('DOID:0090015', 'Cenani-Lenz syndactyly syndrome', 'A dysostosis characterized by syndactyly, malformation of the forearm and lower limb bones, renal hypoplasia or aplasia and that has_material_basis_in homozygous or compound heterozygous mutation in the LRP4 gene on chromosome 11p11', 'syndactyly type 7', 'ORDO:3258|ICD10CM:Q78.4|OMIM:212780', '1', 'OMIM:212780');
INSERT INTO `disease_info` VALUES ('DOID:0090016', 'chromosome 5q deletion syndrome', 'A chromosome deletion syndrome characterized by severe macrocytic anemia erythroid hypoplasia in the bone marrow, hypolobated micromegakaryocytes and that has material basis in somatic deletion of 1 allele of the RPS14, MIR145, MIR146A and/or DDX41 genes on chromosome 5q', 'myelodysplastic syndrome associated with isolated del(5q) chromosome abnormality|5q- syndrome, refractory macrocytic anemia due to 5q deletion', 'ORDO:86841|OMIM:153550|ICD10CM:D46.7', '1', 'OMIM:153550');
