INSERT INTO `disease_info` VALUES ('DOID:0090018', 'autosomal dominant familial periodic fever', 'A characterized by autosomal dominant inheritance of recurrent fever, abdominal pain, localized tender skin lesions, arthralgia and myalgia associated with skin, joint, ocular and serosal inflammation that has_material_basis_in heterozygous mutation in the TNFRSF1A gene on chromosome 12p13', 'tumor necrosis factor receptor 1 associated periodic syndrome|TNF receptor 1-associated periodic syndrome|familial hibernian fever', 'ORDO:32960|OMIM:142680|ICD10CM:E85.0', '1', 'OMIM:142680');
