INSERT INTO `disease_info` VALUES ('DOID:0090020', 'split hand-foot malformation', 'A bone development disease characterized by malformation of the central rays of the autopod and presenting with syndactyly, median clefts of the hands and feet, and aplasia and/or hypoplasia of the phalanges, metacarpals, and metatarsals. Some patients also have mental retardation, ectodermal and craniofacial findings, and orofacial clefting', 'split-hand deformity|lobster-claw deformity', 'OMIM:PS183600|ORDO:2440|ICD10CM:Q71.6|UMLS_CUI:C0265554', '5', 'OMIM:PS183600');
