INSERT INTO `disease_info` VALUES ('DOID:0090088', 'hypogonadotropic hypogonadism 24 without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in homozygous or compound heterozygous mutation in the FSHB gene on chromosome 11p14', 'isolated follicle-stimulating hormone deficiency', 'ICD10CM:E23.6|ORDO:52901|OMIM:229070', '1', 'OMIM:229070');
INSERT INTO `disease_info` VALUES ('DOID:0090089', 'hypogonadotropic hypogonadism 10 with or without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in homozygous mutation in the TAC3 gene on chromosome 12q13', '', 'OMIM:614839|ICD10CM:E23.0', '1', 'OMIM:614839');
INSERT INTO `disease_info` VALUES ('DOID:0090090', 'hypogonadotropic hypogonadism 19 with or without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in heterozygous mutation in the DUSP6 gene on chromosome 12q22, sometimes in association with mutations in other genes', '', 'OMIM:615269|ICD10CM:E23.0', '1', 'OMIM:615269');
INSERT INTO `disease_info` VALUES ('DOID:0090091', 'hypogonadotropic hypogonadism 23 with or without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in homozygous or compound heterozygous mutation in the LHB gene on chromosome 19q13.\n', 'leydig cell hypoplasia due to LHB deficiency|Pasqualini syndrome|46,XY disorder of sex development due to luteinizing hormone subunit beta deficiency|Leydig cell hypoplasia due to luteinizing hormone subunit beta deficiency|46,XY DSD due to luteinizing hormone subunit beta deficiency|fertile eunuch syndrome|46,XY DSD due to LHB deficiency|46,XY disorder of sex development due to LHB deficiency', 'OMIM:228300|ICD10CM:Q56.1|ORDO:325448', '1', 'OMIM:228300');
INSERT INTO `disease_info` VALUES ('DOID:0090092', 'hypogonadotropic hypogonadism 3 with or without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in heterozygous mutation in the PROKR2 gene on chromosome 20p12, sometimes in association with mutation in another gene', '', 'OMIM:244200|ICD10CM:E23.0', '1', 'OMIM:244200');
INSERT INTO `disease_info` VALUES ('DOID:0090093', 'hypogonadotropic hypogonadism 21 with or without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in heterozygous mutation in the FLRT3 gene on 20p11, sometimes in association with mutations in other genes', '', 'OMIM:615271|ICD10CM:E23.0', '1', 'OMIM:615271');
INSERT INTO `disease_info` VALUES ('DOID:0090094', 'hypogonadotropic hypogonadism 1 with or without anosmia', 'A hypogonadotropic hypogonadism that has_material_basis_in mutation in the KAL1 gene on chromosome Xp22.3, sometimes in association with mutation in another gene', 'dysplasia olfactogenitalis of de morsier', 'OMIM:308700|ICD10CM:E23.0', '1', 'OMIM:308700');
INSERT INTO `disease_info` VALUES ('DOID:0090100', 'ocular albinism with sensorineural deafness', 'A digenic disease characterized by ocular albinism, deafness and vestibular dysfunction that has_material_basis_in mutations in the MITF gene on chromosome 3p13 and at least one other gene. The second gene mutation has been reported to be in the gene TYR on chromosome 11q14.3 and in the gene TYRP1 on chromosome 9p23', 'WS2-OA|digenic Waardenburg syndrome/albinism|digenic Waardenburg syndrome/ocular albinism|autosomal recessive Waardenburg syndrome type 2 with ocular albinism', 'ORDO:352740 |OMIM:103470|ICD10CM:E70.3', '1', 'OMIM:103470');
INSERT INTO `disease_info` VALUES ('DOID:0090101', 'lethal congenital glycogen storage disease of heart', 'A glycogen storage disease characterized by autosomal dominant inheritance of glycogenosis confined to the heart, hypoglycemia and cyanosis that has material_basis_in heterozygous mutation in the PRKAG2 gene on chromosome 7q36', 'fatal congenital hypertrophic cardiomyopathy due to GSD| fatal congenital nonlysosomal cardiac glycogenosis|phosphorylase kinase deficiency of heart|fatal congenital hypertrophic cardiomyopathy due to glycogenosis', 'OMIM:261740|ORDO:439854|ICD10CM:G73.6*|ICD10CM:E74.0+', '1', 'OMIM:261740');
INSERT INTO `disease_info` VALUES ('DOID:0090102', 'autosomal dominant macrothrombocytopenia TUBB1-related ', 'A thrombocytopenia characterized by autosomal dominant inheritance of macrothrombocytopenia with normal platelet aggregation that has material_basis_in mutation in the TUBB1 gene on chromosome 20q13.3', '', 'ORDO:140957|OMIM:613112|ICD10CM:D69.4', '1', 'OMIM:613112');
INSERT INTO `disease_info` VALUES ('DOID:0090103', 'Huntington\'s disease-like 1', 'A prion disease characterized by a phenocopy of Huntington disease (unwanted choreatic movements, behavioral and psychiatric disturbances and dementia) that has material_basis_in the presence of 8 extra octapeptide repeats in the PRNP gene on chromosome 20p13', 'HLN1|early-onset prion disease with prominent psychiatric features|HDL1|autosomal dominant Huntington-like neurodegenerative disorder|Huntington-like neurodegenerative disorder 1|Huntington disease-like 1', 'ORDO:157941|ICD10CM:G10|OMIM:603218', '1', 'OMIM:603218');
INSERT INTO `disease_info` VALUES ('DOID:0090104', 'Huntington\'s disease-like 2', 'A neurodegenerative disease characterized by autosomal dominant inheritance of a involuntary movements and abnormalities of voluntary movements, psychiatric symptoms, weight loss, and dementia with onset in the fourth decade and death about 20 years after disease onset that has material_basis_in a heterozygous expansion of a CAG/CTG repeat in the JPH3 gene on chromosome 16q24', 'HDL2|Huntington disease-like 2', 'ICD10CM:G10|OMIM:606438|ORDO:98934', '1', 'OMIM:606438');
INSERT INTO `disease_info` VALUES ('DOID:0090105', 'autosomal recessive hypercholesterolemia', 'A familial hypercholesterolemia characterized by autosomal inheritance that has material_basis_in homozygous mutation in the LDLRAP1 gene on chromosome 1p36', 'FHCB1|ARH2|autosomal recessive hypercholesterolemia 1|FHCB2|ARH1| familial autosomal recessive hypercholesterolemia|autosomal recessive hypercholesterolemia 2|ARH', 'ICD10CM:E78.0|ORDO:391665|OMIM:603813', '1', 'OMIM:603813');
INSERT INTO `disease_info` VALUES ('DOID:0090106', 'Bh4-deficient hyperphenylalaninemia A', 'An amino acid metabolic disorder characterized by autosomal recessive inheritance of hyperphenylalaninemia, depletion of the neurotransmitters dopamine and serotonin, and progressive cognitive and motor deficits that has material_basis_in mutation in the PTS gene on chromosome 11q23.1', 'PTS deficiency|tetrahydobioperin-deficient hyperphenylalaninemia due to PTS deficiency|hyperphenylalaninemia due to 6-pyruvoyltetrahydropterin synthase deficiency|HPABH4A|6-pyruvoyl-tetrahydropterin synthase deficiency', 'GARD:5682|ORDO:13|ICD10CM:E70.1|UMLS_CUI:C0878676|OMIM:261640|MESH:C535325', '1', 'OMIM:261640');
INSERT INTO `disease_info` VALUES ('DOID:0090107', 'autosomal dominant hypocalcemia 1', 'An autosomal dominant hypocalcemia disease that has material_basis_in heterozygous mutation in the CASR gene on chromosome 3q21', 'HYPOC1', 'OMIM:601198', '1', 'OMIM:601198');
INSERT INTO `disease_info` VALUES ('DOID:0090108', 'autosomal dominant hypocalcemia 2', 'An autosomal dominant hypocalcemia disease that has material_basis_in heterozygous mutation in the GNA11 gene on chromosome 19p13', 'HYPOC2', 'OMIM:615361', '5', 'OMIM:615361');
INSERT INTO `disease_info` VALUES ('DOID:0090109', 'autosomal dominant hypocalcemia', 'A calcium metabolism disease characterized by autosomal dominant inheritance of variable degrees of hypocalcemia with normal to low levels of parathyroid hormone', 'HYPOC', 'ICD10CM:E20.8|ORDO:428|GARD:2877|OMIM:PS601198', '5', 'OMIM:PS601198');
INSERT INTO `disease_info` VALUES ('DOID:0090110', 'immune dysregulation-polyendocrinopathy-enteropathy-X-linked syndrome', 'A hypersensitivity reaction type II disease characterized by onset in infancy of refractory diarrhea, endocrinopathies, type 1 diabetes mellitus, and dermatitis that has material_basis_in mutation in the FOXP3 gene on chromosome Xp11', 'XPID|immunodeficiency, polyendocrinopathy, and enteropathy, X-linked| autoimmunity-immunodeficiency syndrome, X-linked|IDDM-secretory diarrhea syndrome|diarrhea, polyendocrinopathy, fatal infection syndrome, X-linked|immunodysregulation, polyendocrinopathy, and enteropathy, X-Linked|diabetes mellitus, congenital insulin-dependent, with fatal secretory diarrhea|XLAAD|Autoimmune enteropathy type 1| X-linked autoimmunity-allergic dysregulation syndrome|IPEX|DMSD', 'GARD:1850|ORDO:37042|OMIM:304790|ICD10CM:E31.0', '1', 'OMIM:304790');
INSERT INTO `disease_info` VALUES ('DOID:0090111', 'PCWH syndrome', 'An autosomal dominant disease characterized by the association of the features of Waardenburg-Shah syndrome (sensorineural hearing loss, pigmentary abnormalities and Hirschsprung disease; see this term) with neurological features, including; neonatal hypotonia, intellectual deficit (of variable severity), nystagmus, progressive spasticity, ataxia and epilepsy that has_material_basis_in heterozygous mutation in the SOX10 gene on chromosome 22q13', 'Peripheral Demyelinating Neuropathy, Central Dysmyelination, Waardenburg Syndrome, and Hirschsprung Disease|Neurologic Waardenburg-Shah syndrome|PCWH|Peripheral demyelinating neuropathy-central dysmyelinating leukodystrophy-Hirschsprung disease-Waardenburg syndrome', 'ORDO:163746|OMIM:609136|ICDCM10:E75.2', '1', 'OMIM:609136');
INSERT INTO `disease_info` VALUES ('DOID:0090112', 'Nasu-Hakola disease', 'An autosomal recessive disease characterized by progressive presenile dementia and recurrent bone fractures due to polycystic osseous lesions of the lower and upper extremities that has_material_basis_in homozygous mutation in the TYROBP gene on chromosome 19q13 or homozygous mutation in the TREM2 gene on chromosome 6p21', 'presenile dementia with bone cysts|PLOSL|PLO-SL|polycystic lipomembranous osteodysplasia with sclerosing leukoencephalopathy|progressive dementia with lipomembranous polycystic osteodysplasia; brain-bone-fat disease|NHD', 'OMIM:221770|MESH:C536329|UMLS_CUI:C1857316|ICDCM10:E75.2|ORDO:2770|GARD:9921', '1', 'OMIM:221770');
INSERT INTO `disease_info` VALUES ('DOID:0090113', 'RIDDLE syndrome', 'An autosomal recessive disease characterized by increased radiosensitivity, immunodeficiency, mild motor control and learning difficulties, facial dysmorphism, and short stature that has_material_basis_in homozygous or compound heterozygous mutation in the RNF168 gene on chromosome 3q29', 'Radiosensitivity-immunodeficiency-dysmorphic features-learning difficulties syndrome|RNF168 deficiency', 'ORDO:420741|ICD10CM:D82.8|OMIM:611943', '1', 'OMIM:611943');
INSERT INTO `disease_info` VALUES ('DOID:0090114', 'Sorsby\'s fundus dystrophy', 'A hereditary retinal dystrophy characterized by autosomal dominant inheritance of loss of central vision as a result of macular disease by the fourth to fifth decade and peripheral visual loss in late life that has_material_basis_in heterozygous mutation in the TIMP3 gene on chromosome 22q12', 'hemorrhagic macular dystrophy|pseudoinflammatory fundus dystrophy of Sorsby|SFD', 'OMIM:136900', '1', 'OMIM:136900');
INSERT INTO `disease_info` VALUES ('DOID:0090115', 'spinocerebellar ataxia type 1 with axonal neuropathy', 'A nervous system disease characterized by autosomal recessive inheritance of spinocerebellar ataxia and peripheral neuropathy that has_material_basis_in homozygosity for a mutation in the TDP1 gene on chromosome 14q32.11', 'SCAN1|autosomal recessive spinocerebellar ataxia with axonal neuropathy', 'OMIM:607250|GARD:10000|ICD10CM:G60.2|ORDO:94124', '1', 'OMIM:607250');
INSERT INTO `disease_info` VALUES ('DOID:0090116', 'spondylocarpotarsal synostosis syndrome', 'A bone development disease characterized by postnatal progressive vertebral fusions frequently manifesting as block vertebrae, contributing to an undersized trunk and a disproportionate short stature, scoliosis, lordosis, carpal and tarsal synostosis, with club feet and a mild facial dysmorphism that has_material_basis_in mutation in the FLNB gene on chromosome 3p14.3', 'vertebral fusion with carpal coalition|spondylocarpotarsal synostosis|spondylocarpotarsal syndrome|congenital synspondylism|SCT|congenital scoliosis with unilateral unsegmented bar', 'OMIM:272460|ORDO:3275|GARD:4974|ICD10CM:Q76.4', '1', 'OMIM:272460');
INSERT INTO `disease_info` VALUES ('DOID:0090117', 'thiamine-responsive megaloblastic anemia syndrome', 'An autosomal recessive disease characterized by megaloblastic anemia, non-type I diabetes mellitus, and sensorineural deafness where the anemia and sometimes diabetes is repsonsive to high doses of thiamine that has_material_basis_in homozygous mutation in the SLC19A2 gene on chromosome 1q24', 'THMD1|thiamine metabolism dysfunction syndrome 1|Rogers syndrome|thiamine-responsive megaloblastic anemia with diabetes mellitus and sensorineural deafness|thiamine-responsive myelodysplasia|TRMA|thiamine-responsive anemia syndrome', 'ICD10CM:Q21.0|MESH:C536510|ORDO:498277|OMIM:249270|UMLS_CUI:C0342287|GARD:9210', '1', 'OMIM:249270');
INSERT INTO `disease_info` VALUES ('DOID:0090118', 'congenital amegakaryocytic thrombocytopenia', 'A thrombocytopenia characterized by a severe reduction in megakaryocyte and platelet numbers that has_material_basis_in homozygous or compound heterozygous mutation in the MPL gene on chromosome 1p34', 'CAMT|congenital amegakaryocytic thrombocytopenic purpura', 'ICD10CM:D61.0|GARD:640|MESH:C535982|OMIM:604498|ORDO:3319|UMLS_CUI:C1327915', '1', 'OMIM:604498');
INSERT INTO `disease_info` VALUES ('DOID:0090119', 'ankyloblepharon-ectodermal defects-cleft lip/palate syndrome', 'An autosomal dominant disease characterized by autosomal dominant inheritance in tissues arising from the ectoderm including: ankyloblepharon filiforme adnatum and cleft lip and palate that has_material_basis_in heterozygous mutation in the TP63 gene on chromosome 3q27', 'Hay-Wells syndrome|AEC syndrome|ankyloblepharon-ectodermal defects-cleft lip and palate syndrome', 'UMLS_CUI:C1785148|OMIM:106260|ICD10CM:Q82.4|MESH:C535289|ORDO:1071', '1', 'OMIM:106260');
INSERT INTO `disease_info` VALUES ('DOID:0090120', 'hereditary neutrophilia', 'A leukocyte disease characterized by autosomal dominant inheritance of lifelong, persistent elevated neutrophil counts primarily consisting of segmented neutrophils that has_material_basis_in heterozygous mutation in the CSF3R gene on chromosome 1p34', '', 'OMIM:162830|ICD10CM:D72.8|ORDO:279943|UMLS_CUI:C0543669', '1', 'OMIM:162830');
INSERT INTO `disease_info` VALUES ('DOID:0090121', 'apparent mineralocorticoid excess', 'An adrenal gland hyperfunction characterized by decreased conversion of biologically active cortisol to inactive cortisone resulting in low aldosterone levels, metabolic alkalosis, hypernatremia, hypokalemia and early-onset severe hypertension that has_material_basis_in homozygous or compound heterozygous mutation in the HSD11B2 gene on chromosome 16', 'cortisol 11-beta-ketoreductase deficiency|APE|11-beta-hydroxysteroid dehydrogenase deficiency type 2|Ulick syndrome', 'ICD10CM:E26.1|ORDO:320|UMLS_CUI:C0342488|UMLS_CUI:C2936861|OMIM:218030|MESH:D043204|MESH:C537422', '1', 'OMIM:218030');
INSERT INTO `disease_info` VALUES ('DOID:0090122', 'aromatase excess syndrome', 'A reproductive system disease characterized by autosomal dominant inheritance of  increased extraglandular aromatization of steroids resulting in heterosexual precocity in males and isosexual precocity in females that has_material_basis_in fusion of the CYP19A1 gene with various partners, brought about by translocations and resulting in gain of function of the CYP19A1 gene', 'hereditary prepubertal gynecomastia|AEXS|familial hyperestrogenism|increased aromatase activity', 'GARD:12949|OMIM:139300|ICD10CM:E30.1|ORDO:178345', '1', 'OMIM:139300');
INSERT INTO `disease_info` VALUES ('DOID:0090123', 'aromatic L-amino acid decarboxylase deficiency', 'An inherited metabolic disorder characterized by reduced production of serotonin and dopamine resulting in hypotonia, hypokinesia, ptosis oculogyric crises, and signs of autonomic dysfunction with onset in infancy or childhood that has_material_basis_in homozygous or compound heterozygous mutation in the DDC gene on chromosome 7p12', 'AADC deficiency', 'UMLS_CUI:C1291564|ORDO:35708|ICD10CM:G24.8|GARD:770|OMIM:608643', '1', 'OMIM:608643');
INSERT INTO `disease_info` VALUES ('DOID:0090124', 'neurogenic arthrogryposis multiplex congenita', 'A nervous system disease characterized by congenital contractures at the elbows and knees, myopathy, absence of muscle spindles, congenital heart disease and spinal motor nueron depletion that has_material_basis_in variation in the chromosome region 5q35', 'arthrogryposis multiplex congenita neurogenic type|AMC neurogenic type|AMCN', 'OMIM:208100|MESH:C536614|ICD10CM:Q74.3|ORDO:1143|UMLS_CUI:C1859721', '5', 'OMIM:208100');
INSERT INTO `disease_info` VALUES ('DOID:0090125', 'COL4A1-related familial vascular leukoencephalopathy', 'A brain disease characterized by autosomal dominant inheritance of fragile small blood vessels in the brain, leukoencephalopathy, increased risk of stroke, seizure and migraine and in some cases Axenfeld-Riegar anomaly that has_material_basis_in heterozygous mutation in the COL4A1 gene on chromosome 13q34', 'brain small vessel disease with hemorrhage|autosomal dominant retinal arteriolar tortuosity, infantile hemiparesis, and leukencephalopathy|COL4A1-related brain small vessel disease with hemorrhage|brain small vessel disease with or without ocular anomalies|BSVD|brain small vessel disease with Axenfeld-Riegar anomaly|infantile hemiparesis|leukoencephalopathy with Axenfeld-Riegar anomaly|COL4A1-related retinal arteriolar tortuosity-infantile hemiparesis-autosomal dominant leukoencephalopathy syndrome', 'OMIM:607595|ORDO:36383', '1', 'OMIM:607595');
INSERT INTO `disease_info` VALUES ('DOID:0090126', 'branched-chain keto acid dehydrogenase kinase deficiency', 'An autosomal recessive disease characterized by autism, epilepsy, intellectual disability, and reduced levels of branched-chain amino acids that has_material_basis_in homozygous mutation in the BCKDK gene on chromosome 16p11', 'autism-epilepsy syndrome due to branched chain ketoacid dehydrogenase kinase deficiency|BCKDKD|BCKDK deficiency', 'OMIM:614923|ORDO:308410|ICD10CM:E71.1', '1', 'OMIM:614923');
INSERT INTO `disease_info` VALUES ('DOID:0090127', 'camptodactyly-arthropathy-coxa vara-pericarditis syndrome', 'An autosomal recessive disease characterized by congenital or early-onset camptodactyly, noninflammatory arthropathy with synovial hyperplasia and in some patients progressive coxa vara deformity, and/or noninflammatory pericardial or pleural effusion that has_material_basis_in homozygous mutation in the PRG4 gene on chromosome 1q31', 'CAP syndrome|CACP syndrome|Jacobs syndrome|familial fibrosing serositis|camptodactyly-arthropathy-pericarditis syndrome|CACP|arthropathy-camptodactyly syndrome|PAC syndrome|pericarditis-arthropathy-camptodactyly syndrome|congenital familial hypertrophic synovitis', 'OMIM:208250|UMLS_CUI:C1859690|ORDO:2848', '1', 'OMIM:208250');
INSERT INTO `disease_info` VALUES ('DOID:0090128', 'dilated cardiomyopathy with woolly hair and keratoderma', 'An autosomal recessive disease characterized by autosomal recessive inheritance of dilated cardiomyopathy, woolly hair, and keratoderma that has_material_basis_in  homozygous mutation in the DSP gene on chromosome 6p24', 'DCWHK|Carvajal syndrome|palmoplantar keratoderma with left ventricular cardiomyopathy and woolly hair', 'OMIM:605676', '1', 'OMIM:605676');
INSERT INTO `disease_info` VALUES ('DOID:0090129', 'carnitine palmitoyltransferase I deficiency', 'A lipid metabolism disorder characterized by autosomal recessive inheritance of impaired mitochondrial oxidation of long chain fatty acids in the liver and kidneys resulting in episodes of illness- or fasting-induced hypoketotic hypoglycemia that has_material_basis_in homozygous or compound heterozygous mutation in the CPT1A gene on chromosome 11q13', 'hepatic carnitine palmitoyl transferase I deficiency|hepatic CPT deficiency type I|hepatic carnitine palmitoyl transferase 1 deficiency|CPT I deficiency|L-CPT1 deficiency|carnitine palmitoyl transferase 1A deficiency|carnitine palmitoyl transferase IA deficiency|CPT1A deficiency', 'ORDO:156|OMIM:255120|ICD10CM:E71.3', '1', 'OMIM:255120');
INSERT INTO `disease_info` VALUES ('DOID:0090130', 'cortical dysplasia-focal epilepsy syndrome', 'A brain disease characterized by cortical dysplasia, focal epilepsy, macrocephaly, and diminished deep-tendon reflexes that has material basis in homozygous or compound heterozygous mutation in the CNTNAP2 gene on chromosome 7q35-q36', 'CDFES|CDFE syndrome', 'ORDO:163681|ICD10CM:Q04.8|OMIM:610042', '1', 'OMIM:610042');
INSERT INTO `disease_info` VALUES ('DOID:0090131', 'complex cortical dysplasia with other brain malformations', 'A brain disease characterized by aberrant neuronal migration and disturbed axonal guidance resulting in variable brain malformations including; polymicrogyria, gyral disorganization, fusion of the basal ganglia, thin corpus callosum, hypoplastic brainstem, and dysplastic cerebellar vermis and behavioral phenotypes including; intellectual disablility, strabismus, axial hypotonia, and spasticity', 'CDCBM', 'OMIM:PS614039', '5', 'OMIM:PS614039');
INSERT INTO `disease_info` VALUES ('DOID:0090132', 'complex cortical dysplasia with other brain malformations 7', 'A complex cortical dysplasia with other brain malformations characterized by autosomal dominant inheritance of abnromalities in coritcal brain development that has_material_basis_in heterozygous mutation in the TUBB2B gene on chromosome 6p25', 'polymicrogyria due to TUBB2B mutation|CDCBM7', 'ICD10CM:Q04.3|ORDO:208444|ORDO:300573|GARD:10783|OMIM:610031', '1', 'OMIM:610031');
INSERT INTO `disease_info` VALUES ('DOID:0090133', 'complex cortical dysplasia with other brain malformations 2', 'A complex cortical dysplasia with other brain malformations that has_material_basis_in heterozygous mutation in the KIF5C gene on chromosome 2q23', 'CDCBM2', 'OMIM:615282', '1', 'OMIM:615282');
INSERT INTO `disease_info` VALUES ('DOID:0090134', 'complex cortical dysplasia with other brain malformations 3', 'A complex cortical dysplasia with other brain malformations that has_material_basis_in heterozygous mutation in the KIF2A gene on chromosome 5q12', 'CDCBM3', 'OMIM:615411', '1', 'OMIM:615411');
INSERT INTO `disease_info` VALUES ('DOID:0090135', 'complex cortical dysplasia with other brain malformations 5', 'A complex cortical dysplasia with other brain malformations that has_material_basis_in heterozygous mutation in the TUBB2A gene on chromosome 6p25', 'CDCBM5', 'OMIM:615763', '1', 'OMIM:615763');
INSERT INTO `disease_info` VALUES ('DOID:0090136', 'complex cortical dysplasia with other brain malformations 6', 'A complex cortical dysplasia with other brain malformations that has_material_basis_in heterozygous mutation in the TUBB gene on chromosome 6p21', 'CDCBM56', 'OMIM:615771', '1', 'OMIM:615771');
