INSERT INTO `disease_info` VALUES ('DOID:10074', 'hymenolepiasis', 'A parasitic helminthiasis infectious disease that involves infection of the bowel by Hymenolepis nana or Hymenolepis diminuta. The symptoms include diarrhea, gastrointestinal discomfort, itchy anus, poor appetite and weakness', 'dwarf tapeworm infection|Hymenolepis infectious disease', 'SNOMEDCT_US_2016_03_01:44917000|ICD10CM:B71.0|SNOMEDCT_US_2016_03_01:187153007|UMLS_CUI:C0020413|ICD9CM:123.6|MESH:D006925|NCI:C84768', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10075', 'diphyllobothriasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection caused by Diphyllobothrium latum through the consumption of raw or undercooked fish. The symptoms include abdominal discomfort, diarrhea, vomiting, weight loss and vitamin B12 deficiency with pernicious anemia', 'Diphyllobothrium infection|fish tapeworm', 'ICD9CM:123.4|SNOMEDCT_US_2016_03_01:187151009|UMLS_CUI:C0012561|SNOMEDCT_US_2016_03_01:359799003|ICD10CM:B70.0|MESH:D004169|SNOMEDCT_US_2016_03_01:49047003', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10079', 'cysticercosis', 'A taeniasis that results from ingestion of eggs or larvae of the Taenia solium tapeworm in undercooked pork or fecally contaminated food or water, which subsequently infect the central nervous system, heart, muscles, subcutaneous tissues, and eyes. Neurocysticercosis causes seizures, mental disturbances, focal neurologic deficits and intracerebral lesions', 'intestinal taenia solium infection|neurocysticercosis|tenia solium infectious disease|Pork tapeworm infection|Tapeworm infection: intestinal taenia solum|Tapeworm infection: pork', 'ICD10CM:B69|ICD10CM:B69.9|UMLS_CUI:C0010678|ICD9CM:123.1|SNOMEDCT_US_2016_03_01:105684008|MESH:D003551|SNOMEDCT_US_2016_03_01:59051007|SNOMEDCT_US_2016_03_01:187527007|NCI:C34520', '2', 'DOID:10079');
INSERT INTO `disease_info` VALUES ('DOID:10080', 'sparganosis', 'A parasitic helminthiasis infectious disease that involves parasitic infection by the genus Spirometra. A painful nodule develops after the plerocercoid larvae migrate to the brain causing cerebral sparganosis. Subcutaneous tissue, breast, orbit, urinary tract, pleural cavity, lungs, abdominal viscera and inner ear can be infected', 'Infection by Sparganum|Sparganosis', 'SNOMEDCT_US_2016_03_01:187152002|ICD10CM:B70.1|MESH:D013031|ICD9CM:123.5|SNOMEDCT_US_2016_03_01:31659000|NCI:C35030|UMLS_CUI:C0037753', '5', null);
