INSERT INTO `disease_info` VALUES ('DOID:10112', 'sleeping sickness', 'A trypanosomiasis that results from infection by Trypanosoma brucei and gambiense, which is transmitted by the bite of an infected tsetse fly (Glossina spp). The symptoms include fever, headache, joint pain, itching, confusion, sensory disturbances, poor coordination and sleep disturbances', 'African sleeping sickness|African trypanosomiasis', 'SNOMEDCT_US_2016_03_01:27031003|UMLS_CUI:C0041228|KEGG:05143|SNOMEDCT_US_2016_03_01:78940002|MESH:D014353|ICD10CM:B56.9|ICD10CM:B56|SNOMEDCT_US_2016_03_01:187512007|ICD9CM:086.5|NCI:C84541|SNOMEDCT_US_2016_03_01:186818008', '2', 'DOID:10112');
INSERT INTO `disease_info` VALUES ('DOID:10113', 'trypanosomiasis', 'A parasitic protozoa infectious disease that involves infection caused by parasitic protozoan of the genus Trypanosoma in animals and humans', '', 'SNOMEDCT_US_2016_03_01:266205000|ICD9CM:086.9|SNOMEDCT_US_2016_03_01:154375001|SNOMEDCT_US_2016_03_01:78940002|UMLS_CUI:C0041227|ICD9CM:086|ICD10CM:B57.2|MESH:D014352|SNOMEDCT_US_2016_03_01:186819000', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10114', 'Trypanosoma brucei rhodesiense infectious disease', 'A sleeping sickness that involves infection caused by Trypanosoma brucei rhodesiense, which is carried by the tsetse fly. The symptoms include fever, severe headache, irritability, extreme fatigue, swollen lymph nodes, aching muscles and joints, skin rash, progressive confusion, personality changes, and other neurologic problems', 'trypanosoma rhodesiense infectious disease|East African trypanosomiasis|Rhodesian sleeping sickness|Rhodesian trypanosomiasis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10116', 'Trypanosoma brucei gambiense infectious disease', 'A sleeping sickness that involves infection caused by Trypanosoma brucei gambiense, which is carried by the tsetse fly. The symptoms include fever, rash, swelling of the face and hands, headaches, fatigue, aching muscles and joints, itching skin, swollen lymph nodes, progressive confusion, personality changes, daytime sleepiness with nighttime sleep disturbances, and other neurologic problems', 'West African trypanosomiasis|Gambian sleeping sickness|Gambian Trypanosomiasis', '', '5', null);
