INSERT INTO `disease_info` VALUES ('DOID:10312', 'Mumps virus pancreatitis', 'A Mumps virus infectious disease that results_in inflammation located_in pancreas, has_material_basis_in Mumps virus, which is transmitted_by droplet spread of saliva or mucus from the mouth, nose, or throat of an infected person, or transmitted_by contaminated fomites. The infection has_symptom abdominal pain, has_symptom chills, has_symptom fever, and has_symptom persistent vomiting', 'Mumps pancreatitis (disorder)', '', '5', null);
