INSERT INTO `disease_info` VALUES ('DOID:10456', 'tonsillitis', 'An upper respiratory tract disease which involves inflammation of the tonsils resulting from bacterial (Group A streptococcus) and viral (Epstein-Barr virus, adenovirus) infections. Symptoms include a severe sore throat (which may be experienced as referred pain to the ears), painful/difficult swallowing, coughing, headache, myalgia (muscle aches), fever and chills. Tonsillitis is characterized by signs of red, swollen tonsils which may have a purulent exudative coating of white patches (i.e. pus). Swelling of the cheeks and neck may occur', 'Throat infection - tonsillitis|chronic tonsillitis', 'SNOMEDCT_US_2016_03_01:195794009|SNOMEDCT_US_2016_03_01:155530006|SNOMEDCT_US_2016_03_01:90979004|SNOMEDCT_US_2016_03_01:195665006|UMLS_CUI:C0040425|SNOMEDCT_US_2016_03_01:90176007|ICD10CM:J35.01|MESH:D014069|UMLS_CUI:C0149517|ICD9CM:474.00|NCI:C116006', '2', 'DOID:10456');
INSERT INTO `disease_info` VALUES ('DOID:10457', 'Legionnaires\' disease', 'A legionellosis that is characterized by severe form of infection producing pneumonia. Symptoms include fever, chills, and cough', 'Legionella pneumonia|Legionnaire\'s disease|Infection by Legionella pneumophilia|Legionella', 'SNOMEDCT_US_2016_03_01:154315008|SNOMEDCT_US_2016_03_01:266186009|SNOMEDCT_US_2016_03_01:195889001|SNOMEDCT_US_2016_03_01:74881002|MESH:D007877|ICD9CM:482.84|ICD10CM:A48.1|SNOMEDCT_US_2016_03_01:269574000|UMLS_CUI:C0023241|SNOMEDCT_US_2016_03_01:312403005', '2', 'DOID:10457');
INSERT INTO `disease_info` VALUES ('DOID:10458', 'legionellosis', 'A primary bacterial infectious disease that results_in infection located_in respiratory tract, has_material_basis_in Legionella pneumophila, which is transmitted_by inhalation of droplets containing bacteria. The symptoms include dry cough, fever, headache and diarrhea', 'Legionella infection', 'MESH:D007876|SNOMEDCT_US_2016_03_01:26726000|UMLS_CUI:C0023240', '2', 'DOID:10458');
INSERT INTO `disease_info` VALUES ('DOID:10459', 'common cold', 'An upper respiratory tract disease which involves inflammation of the mucous membranes of the nose, throat, eyes, and eustachian tubes with watery then purulent discharge. This is an acute contagious disease caused by rhinoviruses, human parainfluenza viruses, human respiratory syncytial virus, influenza viruses, adenoviruses, enteroviruses, or metapneumovirus', 'acute rhinitis|acute coryza|rhino-sinusitis|acute Nasopharyngitis|acute nasopharyngitis|Nasopharyngitis - acute|Acute viral rhinopharyngitis|Nasopharyngitis, acute', 'SNOMEDCT_US_2016_03_01:232341009|SNOMEDCT_US_2016_03_01:266377009|SNOMEDCT_US_2016_03_01:195648002|SNOMEDCT_US_2016_03_01:155497009|SNOMEDCT_US_2016_03_01:54150009|UMLS_CUI:C0009443|MESH:D003139|SNOMEDCT_US_2016_03_01:82272006|SNOMEDCT_US_2016_03_01:232342002|NCI:C34500|NCI:C78599|ICD10CM:J00|ICD9CM:460', '2', 'DOID:10459');
