INSERT INTO `disease_info` VALUES ('DOID:10508', 'Bacillus anthracis pneumonia', 'A primary Bacillaceae infectious disease involving Bacillus anthracis infection resulting in pulmonary infiltrates and necrosis', 'Woolsorters\' pneumonia|Pneumonia in anthrax|Anthrax pneumonia (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10510', 'influenza virus pneumonia', 'A viral infectious disease that results_in inflammation located_in lung, has_material_basis_in Influenza A virus, has_material_basis_in Influenza B virus, or has_material_basis_in Influenza C virus, which can directly damage the respiratory epithelium, allowing free access to invading bacteria. The mucous membranes are covered with foamy, bloody fluid from the pulmonary edema in the more acute cases. Interstitial fibrosis has been observed. The infection has_symptom cough, has_symptom pain in the chest and throughout body, has_symptom headache, has_symptom weakness, and has_symptom chills', 'influenzal pneumonia|influenza pneumonia', '', '2', 'DOID:10510');
INSERT INTO `disease_info` VALUES ('DOID:10516', 'malignant otitis externa', 'An otitis externa which involves infection of the external ear that has spread to involve the skull bone containing part of the ear canal, the middle ear, and the inner ear. It is caused by the bacteria Pseudomonas. This is common in people with weakened immune systems and in older people with diabetes', '', 'ICD10CM:H60.2|SNOMEDCT_US_2016_03_01:194206006|ICD9CM:380.14|ICD10CM:H60.20|SNOMEDCT_US_2016_03_01:94146005|UMLS_CUI:C0155395', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10518', 'beach ear', 'An otitis externa which is a microbial infection that occurs suddenly, rapidly worsens, and becomes very painful and alarming. It is caused by swimming in polluted water, scratching the ear or inside the ear and object stuck in the ear. It is occasionally associated with middle ear infection or upper respiratory infections such as colds', 'acute swimmers\' ear|acute bacterial inflammation of external ear|acute otitis externa, diffuse|Tank ear|acute swimmer\'s ear', 'UMLS_CUI:C0155393|SNOMEDCT_US_2016_03_01:30250000|SNOMEDCT_US_2016_03_01:194201001|ICD9CM:380.12|SNOMEDCT_US_2016_03_01:39149004', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10519', 'chronic fungal otitis externa', 'A otomycosis which is persistent and long-lasting or recurrent', 'chronic mycotic otitis externa', 'SNOMEDCT_US_2016_03_01:111898002|UMLS_CUI:C0155396|ICD9CM:380.15|SNOMEDCT_US_2016_03_01:194209004', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10520', 'acute infection of pinna', 'An otitis externa which involves bacterial infections often related to underlying comorbidities as well as trauma. Common sources of trauma include ear piercing, boxing, blunt trauma, burns, bite wounds and iatrogenic insults. The common bacterial pathogens are staphylococcal and streptococcal species', '', 'UMLS_CUI:C0155392|SNOMEDCT_US_2016_03_01:56663002|ICD9CM:380.11', '5', null);
