INSERT INTO `disease_info` VALUES ('DOID:10527', 'Haemophilus influenzae pneumonia', 'A Haemophilus influenzae infectious disease that is caused by the strains of Haemophilus influenzae resulting in pleural effusions. This disease occurs in individuals with disorders that impaired the normal defense mechanisms and with pre-existing lung disease. H. influenzae causes bronchopneumonia making the patients wheezy and progressively more breathless', 'Pneumonia due to H. influenzae|pneumonia due to hemophilus influenzae|Pneumonia due to Hemophilus influenzae [H. influenzae]|Haemophilus influenzae pneumonia (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10528', 'Haemophilus influenzae infectious disease', 'Haemophilus influenzae infectious disease', 'Haemophilus influenzae [h influenzae] as the cause of disease classified to other chapters|HEMOPHILUS INFLUENZA INFECTION|Hemophilus Influenza Infection|Haemophilus influenzae [h influenzae] as the cause of disease classified to other chapters (disorder)|Haemophilus influenzae infection (disorder)|Haemophilus influenzae infection, unspecified (disorder)', '', '5', null);
