INSERT INTO `disease_info` VALUES ('DOID:1053', 'developmental dislocation of joint', 'developmental dislocation of joint', 'Developmental dislocation of ankle and foot joint|Developmental dislocation of upper arm joint|Developmental dislocation of hand joint|Developmental dislocation of joint of shoulder region|Developmental dislocation of forearm joint|Developmental dislocation of joint of pelvic region and thigh|Developmental dislocation of lower leg joint|Developmental dislocation of joint of multiple sites', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10531', 'pneumococcal pneumonia', 'A pneumococcal infectious disease that involves infection by the bacterium Streptococcus pneumoniae, also known as pneumococcus. In adults, pneumococcal pneumonia is often characterized by sudden onset of illness with symptoms including shaking chills, fever, shortness of breath or rapid breathing, pain in the chest that is worsened by breathing deeply, and a productive cough. In infants and young children, signs and symptoms may not be specific, and may include fever, cough, rapid breathing or grunting', 'Lobar -pneumococcal -pneumonia|Pneumococcal pneumonia [Streptococcus pneumoniae pneumonia]|Pneumococcal lobar pneumonia (disorder)|Pneumococcal pneumonia (disorder)|Pneumococcal pneumonia (disorder) [Ambiguous]|Lobar pneumonia (disorder)|Streptococcus pneumoniae pneumonia|Chest infection - pneumococcal pneumonia', '', '2', 'DOID:10531');
INSERT INTO `disease_info` VALUES ('DOID:10532', 'streptococcal pneumonia', 'A bacterial pneumonia caused due to the infection by Gram-positive bacteria of genus Streptococcus which are the most common cause of community-acquired pneumonias', '', '', '2', 'DOID:10532');
INSERT INTO `disease_info` VALUES ('DOID:10533', 'viral pneumonia', 'A pneumonia described as an inflammatory illness of the lung commonly caused by viruses such as influenza virus, parainfluenza, adenovirus, rhinovirus, herpes simplex virus, respiratory syncytial virus, hantavirus, and cytomegalovirus', '', 'SNOMEDCT_US_2016_03_01:75570004|SNOMEDCT_US_2016_03_01:195880002|UMLS_CUI:C0032310|MESH:D011024|SNOMEDCT_US_2016_03_01:155549005|ICD10CM:J12.9|ICD9CM:480.9|ICD9CM:480|SNOMEDCT_US_2016_03_01:195883000', '2', 'DOID:10533');
