INSERT INTO `disease_info` VALUES ('DOID:10535', 'coxsackie myocarditis', 'A coxsackie carditis that results_in inflammation located_in myocardium, has_material_basis_in group B coxsackievirus, which are transmitted_by ingestion of food contaminated with feces, transmitted_by contact with pharyngeal secretions, or transmitted_by droplet spread of oronasal secretions. The infection has_symptom fever, has_symptom lethargy, has_symptom heart failure, has_symptom pallor, has_symptom cyanosis, has_symptom dyspnea, has_symptom tachycardia, and has_symptom enlargement of heart', '', '', '5', null);
