INSERT INTO `disease_info` VALUES ('DOID:10841', 'Eastern equine encephalitis', 'A viral infectious disease that results_in inflammation located_in brain of horses and humans, has_material_basis_in Eastern equine encephalitis virus, which is transmitted_by Aedes, transmitted_by Coquillettidia, and transmitted_by Culex species of mosquitoes. The infection has_symptom sudden onset of headache, has_symptom high fever, has_symptom chills, has_symptom vomiting, has_symptom disorientation, has_symptom seizures, and has_symptom coma', 'Neuroinvasive Eastern equine encephalitis virus infection', 'UMLS_CUI:C0153065|ICD10CM:A83.2|SNOMEDCT_US_2016_03_01:40177004|SNOMEDCT_US_2016_03_01:417496004|ICD9CM:062.2|SNOMEDCT_US_2016_03_01:416925005|MESH:D020242', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10842', 'Murray Valley encephalitis', 'A viral infectious disease that results_in inflammation located_in brain, has_material_basis_in Murray Valley encephalitis virus, which is transmitted_by Culex annulirostris mosquitoes. The infection has_symptom fever, has_symptom headache, has_symptom nausea, has_symptom vomiting, has_symptom drowsiness, has_symptom confusion, has_symptom fitting, and has_symptom weakness', 'Australian encephalitis|Australian X disease', 'ICD10CM:A83.4|SNOMEDCT_US_2016_03_01:66454007|ICD9CM:062.4|UMLS_CUI:C0153066', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10843', 'Western equine encephalitis', 'A viral infectious disease that results_in inflammation located_in brain of horses and humans, has_material_basis_in Western equine encephalomyelitis virus, which is transmitted_by Culex and transmitted_by Aedes species of mosquitoes. The infection has_symptom fever, has_symptom headache, has_symptom nausea, has_symptom vomiting, has_symptom anorexia, has_symptom malaise, has_symptom altered mental status, and has_symptom weakness', '', 'MESH:D020241|ICD9CM:062.1|SNOMEDCT_US_2016_03_01:47523006|ICD10CM:A83.1|UMLS_CUI:C0153064|NCI:C85227', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10844', 'Japanese encephalitis', 'A viral infectious disease that results_in infection located_in brain, has_material_basis_in Japanese encephalitis virus, which is transmitted_by Culex tritaeniorhynchus mosquito bite. The infection has_symptom headache, has_symptom high fever, has_symptom neck stiffness, has_symptom stupor, has_symptom disorientation, has_symptom coma, has_symptom tremors, has_symptom convulsions, and has_symptom spastic paralysis', 'Japanese B encephalitis', 'NCI:C34577|SNOMEDCT_US_2016_03_01:266194002|SNOMEDCT_US_2016_03_01:154345006|ICD10CM:A83.0|ICD9CM:062.0|SNOMEDCT_US_2016_03_01:52947006|MESH:D004672|UMLS_CUI:C0014057', '2', 'DOID:10844');
