INSERT INTO `disease_info` VALUES ('DOID:10881', 'hand, foot and mouth disease', 'A viral infectious disease that results_in infection located_in skin, has_material_basis_in Human coxsackievirus A16 or has_material_basis_in Human enterovirus 71, which are transmitted_by contaminated fomites, and transmitted_by contact with nose and throat secretions, saliva, blister fluid and stool of infected persons. The infection has_symptom fever, has_symptom poor appetite, has_symptom malaise, has_symptom sore throat, has_symptom painful sores in the mouth, and has_symptom skin rash on the palms of the hands and soles of the feet', 'Vesicular stomatitis and exanthem', 'SNOMEDCT_US_2016_03_01:266108008|SNOMEDCT_US_2016_03_01:186664000|SNOMEDCT_US_2016_03_01:154357002|SNOMEDCT_US_2016_03_01:175497008|ICD9CM:074.3|SNOMEDCT_US_2016_03_01:67171006|ICD10CM:B08.4|UMLS_CUI:C0018572|MESH:D006232', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10882', 'epidemic pleurodynia', 'A viral infectious disease that results in necrosis located in intercostal muscle, has material basis in Human enterovirus B. The infection has symptom severe chest pain, has symptom fever, has symptom malaise, has symptom pleuritis, and has symptom headache', 'epidemic myalgia|Bamble disease|Epidemic, myositis|Bornholm disease|Epidemic pleurisy|devil\'s grip', 'MESH:D011000|SNOMEDCT_US_2016_03_01:83264000|UMLS_CUI:C0032238|SNOMEDCT_US_2016_03_01:154356006|ICD10CM:B33.0|ICD9CM:074.1', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:10883', 'herpangina', 'A viral infectious disease that results_in infection located_in mouth, has_material_basis_in Human coxsackievirus A16, has_material_basis_in Human enterovirus 71, has_material_basis_in group B coxsackievirus, or has_material_basis_in echoviruses, which are transmitted_by ingestion of food contaminated with feces, transmitted_by contact with pharyngeal secretions, or transmitted_by droplet spread of oronasal secretions. The infection has_symptom fever, has_symptom sore throat, and has_symptom lesions in the back area of the mouth, particularly the soft palate or tonsillar pillars', 'Vesicular pharyngitis', 'SNOMEDCT_US_2016_03_01:266197009|UMLS_CUI:C0019338|SNOMEDCT_US_2016_03_01:274102007|SNOMEDCT_US_2016_03_01:37428001|SNOMEDCT_US_2016_03_01:154358007|SNOMEDCT_US_2016_03_01:186659004|ICD10CM:B08.5|MESH:D006557|ICD9CM:074.0', '2', 'DOID:10883');
INSERT INTO `disease_info` VALUES ('DOID:10887', 'lepromatous leprosy', 'A leprosy that results in early cutaneous lesions which consist of pale macules that are small, diffuse, and symmetric. This form of leprosy is characterized by hypoesthesia over extensor surfaces of the distal extremities, alopecia affecting lateral aspects of the eyebrows, saddle-nose deformity and oral lepromas', 'type L leprosy|Lepromatous leprosy', 'SNOMEDCT_US_2016_03_01:21560005|MESH:D015440|ICD9CM:030.0|UMLS_CUI:C0023348|ICD10CM:A30.5', '2', 'DOID:10887');
