INSERT INTO `disease_info` VALUES ('DOID:10902', 'pulmonary actinomycosis', 'An actinomycosis that results_in infection, has_material_basis_in Actinomyces israelii or has_material_basis_in Actinomyces gerencseriae. It results in lung cavities, lung nodules, and pleural effusion. The infection has_symptom chest pain, has_symptom cough with sputum, has_symptom fever, has_symptom lethargy, has_symptom night sweats, has_symptom shortness of breath, has_symptom weight loss, and has_symptom draining of sinuses', 'thoracic actinomycosis|pulmonary actinomycotic infection', '', '5', null);
