INSERT INTO `disease_info` VALUES ('DOID:11076', 'Brucella suis brucellosis', 'A brucellosis that involves an infection caused by Brucella suis [NCBITaxon:29461] in swine and humans. The disease has_symptom fever, has_symptom chills, has_symptom malaise, has_symptom diaphoresis, has_symptom arthralgia, has_symptom myalgia, has_symptom headache, has_symptom anorexia, and has_symptom fatigue', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11077', 'brucellosis', 'A primary bacterial infectious disease that is caused by the bacteria of the genus Brucella, when humans come in contact with contaminated animals or animal products or ingestion of infected food products. The disease has_symptom fever, has_symptom sweat, has_symptom headache, has_symptom back pain, has_symptom physical weakness, has_symptom joint pain and has_symptom fatigue', 'undulant fever|Maltese fever', 'SNOMEDCT_US_2016_03_01:111804008|UMLS_CUI:C0006309|NCI:C84602|ICD9CM:023|ICD10CM:A23|MESH:D002006|ICD9CM:023.9|SNOMEDCT_US_2016_03_01:154296006|SNOMEDCT_US_2016_03_01:187304000|ICD10CM:A23.9|SNOMEDCT_US_2016_03_01:186310006|SNOMEDCT_US_2016_03_01:75702008', '2', 'DOID:11077');
INSERT INTO `disease_info` VALUES ('DOID:11079', 'leech infestation', 'A parasitic ectoparasitic infectious disease that involves parasitic infestation by members of the subclass Hirudinea. The leeches remain attached to their hosts and feed on blood until they become full, at which point they fall off to digest. While feeding, they release an anesthetic and use a combination of mucus and suction to stay attached and secrete an anti-clotting enzyme, hirudin, into the host\'s blood stream', 'Leeches|Leech infestation|Hirudiniasis', 'SNOMEDCT_US_2016_03_01:64351000|SNOMEDCT_US_2016_03_01:154423006|UMLS_CUI:C0019575|ICD10CM:B88.3|SNOMEDCT_US_2016_03_01:266225001|ICD9CM:134.2', '5', null);
