INSERT INTO `disease_info` VALUES ('DOID:11092', 'Salmonella gastroenteritis', 'A Salmonella infectious disease that involves inflammation of the stomach and intestines caused by Salmonella infection. The symptoms include diarrhea, vomiting, abdominal pain, fever and weakness', 'Salmonella gastroenteritis (disorder)|Salmonellosis (& [gastroenteritis] or [food poisoning])|Salmonella gastroenteritis [Ambiguous]|Enteric paratyphosis|Salmonellosis|Salmonella food poisoning (disorder)|Salmonella gastroenteritis|Salmonella food poisoning', '', '2', 'DOID:11092');
INSERT INTO `disease_info` VALUES ('DOID:11093', 'bacterial gastroenteritis', 'A gastroenteritis that involves inflammation of the stomach and intestines caused by bacteria. The symptoms include abdominal cramps and pain, diarrhea, loss of appetite, nausea, and vomiting', 'bacterial diarrhea|Gastroenteritis - bact.|Bacterial gastroenteritis (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11096', 'renal syphilis', 'renal syphilis', 'Syphilis of kidney (disorder)|Syphilis of kidney', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11097', 'pulmonary syphilis', 'A tertiary syphilis that is caused by the spirochetal bacterium Treponema pallidum subspecies pallidum. It is a sexually transmitted disease although congenital syphilis can also occur. Treponema infection of the lung leads to a fibrous induration spreading from the roots of the lungs. Ulcerations occur in the superficial tissues, while in the deep tissues gummata are formed. Symptoms include dry cough, hemoptysis, hemorrhage, dyspnea, pain in the chest, loss of weight and slight fever', 'Syphilis of lung (disorder)', '', '5', null);
