INSERT INTO `disease_info` VALUES ('DOID:11100', 'Q fever', 'A primary bacterial infectious disease that is a zoonotic infectious disease affecting multiple organs, has_material_basis_in Coxiella burnetii, which is transmitted_by inhalation of air contaminated by barnyard dust containing dried placental material, birth fluids, or excreta of infected herd animals, transmitted_by ingestion of contaminated milk, transmitted_by tick bites and transmitted_by contact with infected person. The infection has_symptom fever, has_symptom headache, has_symptom cough, has_symptom pleuritic chest pain, has_symptom myalgia and has_symptom arthralgia', 'Infection due to Coxiella burnetii', 'ICD9CM:083.0|NCI:C34970|MESH:D011778|SNOMEDCT_US_2016_03_01:154375001|SNOMEDCT_US_2016_03_01:186788009|UMLS_CUI:C0034362|ICD10CM:A78|SNOMEDCT_US_2016_03_01:260588007|SNOMEDCT_US_2016_03_01:266205000|SNOMEDCT_US_2016_03_01:86012006', '2', 'DOID:11100');
INSERT INTO `disease_info` VALUES ('DOID:11101', 'trench fever', 'A primary bacterial infectious disease that results_in systemic infection, has_material_basis_in Bartonella quintana, which is transmitted_by body lice (Pediculus humanus corporis). The infection has_symptom relapsing fever, has_symptom headache, has_symptom shin pain, and has_symptom soreness of the muscles of the legs and back', 'Quintan fever|tibialgic fever|Wolhynian fever|Trench fever|His-Werner disease|shin bone fever', 'UMLS_CUI:C0040830|ICD9CM:083.1|SNOMEDCT_US_2016_03_01:82214002|MESH:D014205|ICD10CM:A79.0', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11102', 'bartonellosis', 'A primary bacterial infectious disease that is caused by the bacteria of the genus Bartonella', 'Bartonella infectious disease|bartonelliasis|Rochalimaea infection', 'ICD9CM:088.0|ICD10CM:A44.9|SNOMEDCT_US_2016_03_01:187340003|MESH:D001474|SNOMEDCT_US_2016_03_01:17116008|NCI:C84586|ICD10CM:A44|SNOMEDCT_US_2016_03_01:266123003|SNOMEDCT_US_2016_03_01:240454008|SNOMEDCT_US_2016_03_01:240623002|SNOMEDCT_US_2016_03_01:186824002|UMLS_CUI:C0004771', '2', 'DOID:11102');
INSERT INTO `disease_info` VALUES ('DOID:11103', 'rickettsialpox', 'A spotted fever that has_material_basis_in Rickettsia akari, which is transmitted_by house mouse mite (Liponyssoides sanguineus) found on mice and other rodents. The infection has_symptom fever, has_symptom chills, has_symptom headache, has_symptom myalgia, and has_symptom papulovesicular rash', 'Vesicular rickettsiosis|Rickettsia akari spotted fever', 'MESH:D012288|ICD9CM:083.2|UMLS_CUI:C0035597|SNOMEDCT_US_2016_03_01:75096007|ICD10CM:A79.1', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11104', 'spotted fever', 'A primary bacterial infectious disease that results_in infection, located_in endothelial cell of artery or located_in endothelial cell of vein, has_material_basis_in Rickettsia, which is transmitted_by ticks and mites. The infection has_symptom fever, has_symptom headache, has_symptom fatigue, has_symptom muscle aches, and has_symptom maculopapular or petechial rash. A distinctive eschar (blackened or crusted skin) may develop at the site of a tick bite', 'Spotted fever group rickettsial disease', 'ICD10CM:A77.9|SNOMEDCT_US_2016_03_01:186771002|UMLS_CUI:C0038041|ICD10CM:A77|SNOMEDCT_US_2016_03_01:186773004|SNOMEDCT_US_2016_03_01:187385002|ICD9CM:082.0', '5', null);
