INSERT INTO `disease_info` VALUES ('DOID:11165', 'common wart', 'A viral infectious disease that results_in infection located_in skin, has_material_basis_in human papillomavirus (types 2 and 4). This infection has_symptom raised wart with roughened surface, most common on hands, but can grow anywhere on the body', '', 'ICD10CM:B07.8|SNOMEDCT_US_2016_03_01:154361008|SNOMEDCT_US_2016_03_01:186686004|NCI:C5028|NCI:C27087|SNOMEDCT_US_2016_03_01:367507002|SNOMEDCT_US_2016_03_01:186685000|SNOMEDCT_US_2016_03_01:123201004|ICD10CM:B07|UMLS_CUI:C0043037|ICD9CM:078.1|SNOMEDCT_US_2016_03_01:266198004|SNOMEDCT_US_2016_03_01:75003008|SNOMEDCT_US_2016_03_01:57019003|SNOMEDCT_US_2016_03_01:30285000', '2', 'DOID:11165');
INSERT INTO `disease_info` VALUES ('DOID:11166', 'papillomavirus infectious disease', 'A viral infectious disease that has_material_basis_in human papillomaviruses, which establish productive infections only in the stratified epithelium of the skin or mucous membranes. These viruses cause warts and sometimes tumors. They are transmitted_by sexual contact', 'human papilloma virus infectious disease|Human papilloma virus infection, NOS|Human papilloma virus infection (disorder)|Human papilloma Virus Infection', '', '2', 'DOID:11166');
INSERT INTO `disease_info` VALUES ('DOID:11167', 'uterine cervix condylomata acuminata', 'An anogenital venereal wart that results_in infection located_in cervix, has_material_basis_in human papillomaviruses (types 6 and 11), which are transmitted_by direct sexual contact with the skin of an infected partner. The infection has_symptom cervical warts', 'Condyloma of the Cervix Uteri', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11168', 'anogenital venereal wart', 'A viral infectious disease that results_in infection located_in skin of vagina, cervix, uterus, anus, penis, scrotum, mouth, and throat, has_material_basis_in human papillomaviruses (types 6 and 11), which are transmitted_by direct contact with the skin during oral, genital, or anal sex with an infected partner. The infection has_symptom anogenital warts', 'genital wart virus infectious disease|Genital warts|Anogenital warts|Anogenital Human papilloma Virus Infectious Disease|venereal wart', 'SNOMEDCT_US_2016_03_01:154365004|NCI:C4820|NCI:C2960|MESH:D003218|SNOMEDCT_US_2016_03_01:266113007|SNOMEDCT_US_2016_03_01:186688003|UMLS_CUI:C0009663|SNOMEDCT_US_2016_03_01:22020001|SNOMEDCT_US_2016_03_01:154361008|SNOMEDCT_US_2016_03_01:266198004|ICD9CM:078.11|UMLS_CUI:C0554632|SNOMEDCT_US_2016_03_01:123157002|ICD10CM:A63.0|SNOMEDCT_US_2016_03_01:240542006|SNOMEDCT_US_2016_03_01:302812006', '2', 'DOID:11168');
INSERT INTO `disease_info` VALUES ('DOID:11169', 'vaginal condylomata acuminata', 'An anogenital venereal wart that results_in infection located_in mucosa of vagina, has_material_basis_in human papillomaviruses (types 6 and 11), which are transmitted_by direct sexual contact with the skin of an infected partner. The infection has_symptom vaginal warts', 'vaginal Condyloma Acuminatum', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11170', 'vulvar condylomata acuminata', 'An anogenital venereal wart that results_in infection located_in skin of vulva, has_material_basis_in human papillomaviruses (types 6 and 11), which are transmitted_by direct sexual contact with the skin of an infected partner. The infection has_symptom vulvar warts', 'Condyloma acuminata of vulva (disorder)|Vulvar Condyloma', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11171', 'urethral condylomata acuminata', 'An anogenital venereal wart that results_in infection located_in skin of urethra, has_material_basis_in human papillomaviruses (types 6 and 11), which are transmitted_by direct sexual contact with the skin of an infected partner. The infection has_symptom urethral warts', 'urethral Condylomata', '', '5', null);
