INSERT INTO `disease_info` VALUES ('DOID:11179', 'otitis media with effusion', 'A non-suppurative otitis media which is a collection of fluid that occurs in the middle ear space as a result of the negative pressure produced by altered Eustachian tube function. This can occur from viral upper respiratory infection or bacterial infection, or it can precede and/or follow acute bacterial otitis media', 'Otitis media with effusion - mucoid|Secretory Otitis Media|Otitis media with effusion|Glue ear|Mucoid otitis media NOS (disorder)|Transudative otitis media|Otitis media, transudative|Mucoid otitis media', '', '2', 'DOID:11179');
