INSERT INTO `disease_info` VALUES ('DOID:11254', 'Brill-Zinsser disease', 'An epidemic typhus that is a mild form of the disease, which recurs in someone after a long period of latency due to immunosuppression, malnutrition or other illnesses', 'Recrudescent typhus|Brill\'s disease|Brill Zinsser disease', 'SNOMEDCT_US_2016_03_01:47761007|ICD9CM:081.1|MESH:D014438|UMLS_CUI:C0006181|ICD10CM:A75.1', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11256', 'typhus', 'A primary bacterial infectious disease that refers to a group of diseases, located_in endothelial cells of the small venous, arterial, and capillary vessels, has_material_basis_in Rickettsia bacteria, which are transmitted_by lice, transmitted_by fleas, and transmitted_by mites', 'Louse-borne [epidemic] typhus|endemic flea-borne typhus|Moscow typhus|Endemic Typhus fever|Murine [endemic] typhus|Typhus fever|epidemic louse-borne typhus|Exanthematic Typhus fever|Flea typhus', 'SNOMEDCT_US_2016_03_01:187383009|SNOMEDCT_US_2016_03_01:83838002|ICD10CM:A75.0|ICD9CM:081.9|NCI:C84688|SNOMEDCT_US_2016_03_01:39111003|SNOMEDCT_US_2016_03_01:414263007|SNOMEDCT_US_2016_03_01:154375001|MESH:D014437|UMLS_CUI:C0041473|UMLS_CUI:C0041472|ICD9CM:080|ICD10CM:A75.9|SNOMEDCT_US_2016_03_01:25668000|ICD10CM:A75|SNOMEDCT_US_2016_03_01:266205000|UMLS_CUI:C0041471|MESH:D014438|ICD10CM:A75.2|ICD9CM:081.0|NCI:C84689', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11257', 'social phobia', 'A phobic disorder that involves social anxiety occurring only in specific public or social situations, interactions with others or being evaluated or scrutinized by other people', '', 'SNOMEDCT_US_2016_03_01:191720001|ICD10CM:F40.1|UMLS_CUI:C0031572|MESH:D010698|SNOMEDCT_US_2016_03_01:25501002|NCI:C34927|ICD10CM:F40.10|SNOMEDCT_US_2016_03_01:192395002|ICD9CM:300.23', '2', 'DOID:11257');
INSERT INTO `disease_info` VALUES ('DOID:11258', 'cat-scratch disease', 'A bartonellosis that results_in infection located_in lymph node, has_material_basis_in Bartonella henselae or has_material_basis_in Bartonella clarridgeiae, which are transmitted_by scratch or bite of a kitten, or transmitted_by contact of animal\'s saliva with an eye or through broken skin. The infection has_symptom regional lymphadenopathy, has_symptom headache, has_symptom chills, has_symptom backache, and has_symptom abdominal pain', 'Foshay-Mollaret Cat Scratch Fever|Debre\'s Syndrome|cat scratch fever|benign lymphoreticulosis|Debre-Mollaret Syndrome', 'ICD9CM:078.3|SNOMEDCT_US_2016_03_01:154370006|ICD10CM:A28.1|NCI:C84620|UMLS_CUI:C0007361|SNOMEDCT_US_2016_03_01:79974007|SNOMEDCT_US_2016_03_01:266202002|MESH:D002372|SNOMEDCT_US_2016_03_01:123319006', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11259', 'Cytomegalovirus infectious disease', 'A viral infectious disease that results_in infection in animals and humans, has_material_basis_in Cytomegalovirus, which is transmitted_by contact with the infected person\'s bodily fluids or transmitted_by sexual contact, or transmitted_by blood transfusions', 'cytomegalovirus infection|Cytomegaloviral disease|Cytomegalovirus infection (disorder)|Cytomagalovirus infection|Cytomegaloviral disease, unspecified|Salivary gland virus disease|Cytomegaloviral disease, unspecified (disorder)', '', '2', 'DOID:11259');
INSERT INTO `disease_info` VALUES ('DOID:11260', 'rabies', 'A viral infectious disease that results_in inflammation located_in brain or located_in spinal cord, has_material_basis_in Rabies virus, which is transmitted_by bite of an infected animal, or transmitted_by contact of mucous membranes with saliva of an infected animal. The infection has_symptom fever, has_symptom headache, has_symptom prickling or itching sensation at the site of bite, has_symptom anxiety, has_symptom confusion, has_symptom agitation, has_symptom delirium, has_symptom difficulty swallowing, has_symptom hydrophobia, and has_symptom paralysis', 'Lyssa', 'NCI:C28182|MESH:D011818|SNOMEDCT_US_2016_03_01:187393002|UMLS_CUI:C0034494|ICD10CM:A82|ICD10CM:A82.9|SNOMEDCT_US_2016_03_01:14168008|SNOMEDCT_US_2016_03_01:186644005|ICD9CM:071|SNOMEDCT_US_2016_03_01:275370001', '2', 'DOID:11260');
INSERT INTO `disease_info` VALUES ('DOID:11261', 'foot and mouth disease', 'A viral infectious disease that results_in infection in cattle and swine, has_material_basis_in Foot-and-mouth disease virus, which is transmitted_by contaminated fomites, or transmitted_by ingestion of food contaminated with infected meat or animal products. The infection results_in_formation_of vesicles in the mouth, or on the feet and has_symptom lameness', 'Epizootic stomatitis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11262', 'ornithosis', 'A primary bacterial infectious disease that results_in systemic infection, has_material_basis_in Chlamydia psittaci, which is transmitted_by inhaling aerosolized dried droppings or transmitted_by contact with infected birds. The infection has_symptom fever, has_symptom headache, has_symptom rash, has_symptom chills, and has_symptom pneumonia', 'psittacosis', 'SNOMEDCT_US_2016_03_01:154367007|MESH:D009956|SNOMEDCT_US_2016_03_01:186657002|ICD9CM:073|SNOMEDCT_US_2016_03_01:75116005|UMLS_CUI:C0029291|SNOMEDCT_US_2016_03_01:186653003|SNOMEDCT_US_2016_03_01:154369005|ICD9CM:073.9|SNOMEDCT_US_2016_03_01:266200005|ICD10CM:A70|NCI:C34873', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11263', 'chlamydia', 'A commensal bacterial infectious disease that is caused by Chlamydia trachomatis', 'chlamydial disease|Chlamydia trachomatis infectious disease|Chlamydial Infection', '', '2', 'DOID:11263');
