INSERT INTO `disease_info` VALUES ('DOID:11265', 'trachoma', 'A commensal bacterial infectious disease that results_in infection located_in eye, has_material_basis_in Chlamydia trachomatis (A, B, Ba and C serovars), which is transmitted_by contact with eye discharge from the infected person and transmitted_by congenital method. The infection causes eyelid to turn inward which makes eyelashes to scratch the cornea', 'active stage trachoma|trachoma dubium', 'SNOMEDCT_US_2016_03_01:154367007|MESH:D014141|ICD10CM:A71.1|ICD10CM:A71.9|ICD10CM:A71|SNOMEDCT_US_2016_03_01:2576002|ICD9CM:076.9|SNOMEDCT_US_2016_03_01:186672003|ICD9CM:076|ICD9CM:076.0|UMLS_CUI:C0153108|UMLS_CUI:C0040592|SNOMEDCT_US_2016_03_01:186671005|SNOMEDCT_US_2016_03_01:52812002|UMLS_CUI:C0153107|SNOMEDCT_US_2016_03_01:187379009|ICD9CM:076.1|SNOMEDCT_US_2016_03_01:29976007|ICD10CM:A71.0|SNOMEDCT_US_2016_03_01:266200005', '2', 'DOID:11265');
INSERT INTO `disease_info` VALUES ('DOID:11266', 'hemorrhagic fever with renal syndrome', 'A viral infectious disease that is a hemorrhagic fever, located in kidney, has material basis in Hantaan virus, has material basis in Dobrava-Belgrade virus, has material basis in Seoul virus, or has material basis in Puumala virus, which are carried and transmitted by rodents. The infection has symptom headache, has symptom fever, has symptom muscle pains, has symptom facial flush, has symptom petechiae, has symptom hemorrhagic features, has symptom proteinuria, and has symptom renal failure', 'Hemorrhagic fever, Russian|Hemorrhagic nephrosonephritis|HFRS|Puumala virus nephropathy', 'ICD9CM:078.6|SNOMEDCT_US_2016_03_01:364756009|SNOMEDCT_US_2016_03_01:186701001|UMLS_CUI:C0019101|NCI:C84753|ICD10CM:A98.5|SNOMEDCT_US_2016_03_01:102455002|SNOMEDCT_US_2016_03_01:70826003|MESH:D006480', '2', 'DOID:11266');
