INSERT INTO `disease_info` VALUES ('DOID:11285', 'tick paralysis', 'A tick infestation that is characterized by an acute, ascending, flaccid motor paralysis, which is caused by the introduction of a neurotoxin into humans during attachment and feeding by the females of several tick species such as Dermacentor andersoni, Dermacentor variabilis, Amblyomma americanum, Amblyomma maculatum, Ixodes scapularis, Ixodes pacificus, Ixodes holocyclus, Rhipicephalus sanguineus and Otobius megnini. The symptoms include local inflammation, edema and hemorrhage', '', 'MESH:D013985|SNOMEDCT_US_2016_03_01:74225001|UMLS_CUI:C0040197', '5', null);
