INSERT INTO `disease_info` VALUES ('DOID:11320', 'Kyasanur forest disease', 'A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Kyasanur forest disease virus, which is transmitted_by Haemaphysalis spinigera tick bite. The infection has_symptom fever, has_symptom headache, has_symptom stiffness of the neck, has_symptom severe muscle pain, has_symptom cough, has_symptom dehydration, and has_symptom bleeding problems', '', 'MESH:D007733|UMLS_CUI:C0022810|ICD10CM:A98.2|SNOMEDCT_US_2016_03_01:23097003|ICD9CM:065.2', '5', null);
