INSERT INTO `disease_info` VALUES ('DOID:11329', 'ainhum', 'A connective tissue disease that results in increasing fibrous constriction and ultimately in spontaneous amputation of the toes and especially the little toes. A painful constriction of the base of the fifth toe frequently followed by bilateral spontaneous amputation (autoamputation) a few years later', 'Dactylolysis spontanea|Ainhum', 'NCI:C84544|UMLS_CUI:C0001860|SNOMEDCT_US_2016_03_01:38528001|SNOMEDCT_US_2016_03_01:51404004|OMIM:103400|ICD10CM:L94.6|MESH:D000387|ICD9CM:136.0', '5', 'OMIM:103400');
