INSERT INTO `disease_info` VALUES ('DOID:11335', 'sarcoidosis', 'A hypersensitivity reaction type IV disease characterized by the growth of collections of inflammatory cells (granulomas) in multiple organs', 'lymphogranulomatosis|Boeck sarcoid', 'UMLS_CUI:C0036202|ORDO:797|OMIM:612388|ICD9CM:135|ICD10CM:D80-D89|ICD10CM:D86|NCI:C34995|SNOMEDCT_US_2016_03_01:31541009|SNOMEDCT_US_2016_03_01:154425004|ICD10CM:D86.9|MESH:D012507', '2', 'OMIM:612388|DOID:11335');
INSERT INTO `disease_info` VALUES ('DOID:11336', 'rhinoscleroma', 'A primary bacterial infectious disease that involves the inflammation of mucosa lining the nasal cavity, pharynx, larynx, trachea and bronchi that is characterized by the formation of granulomas, dense induration of the tissues and nodular deformity caused by Klebsiella rhinoscleromatis', '', 'MESH:D012226|ICD9CM:040.1|SNOMEDCT_US_2016_03_01:72409005|UMLS_CUI:C0035468', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11337', 'Lemierre\'s syndrome', 'A commensal bacterial infectious disease that is characterized by systemic sepsis, ulcerative or necrotic lesions and multisystem abscesses caused by Fusobacterium necrophorum. The disease often first presents as a severe tonsillitis or pharyngitis with high-grade fever and chills together with leukocytosis, cervical pain and neck swelling', 'postanginal sepsis|Lemierre syndrome|human necrobacillosis', 'MESH:D005674|ICD9CM:040.3|SNOMEDCT_US_2016_03_01:52542005|UMLS_CUI:C0027537', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:11338', 'tetanus', 'A primary bacterial infectious disease that results_in prolonged contraction of skeletal muscle fibers, has_material_basis_in Clostridium tetani, which produces tetanospasmin, a neurotoxin, which is carried to the brain and spinal cord, where it binds irreversibly to receptors inhibiting neurotransmission. Damaged upper motor neurons cannot control reflex responses to afferent sensory stimuli', 'clostridial tetanus|Infection due to Clostridium tetani', 'SNOMEDCT_US_2016_03_01:76902006|SNOMEDCT_US_2016_03_01:154312006|ICD10CM:A35|NCI:C85185|MESH:D013742|SNOMEDCT_US_2016_03_01:276202003|UMLS_CUI:C0039614|ICD9CM:037', '2', 'DOID:11338');
INSERT INTO `disease_info` VALUES ('DOID:11339', 'pneumocystosis', 'An opportunistic mycosis that is located_in lungs, but can also occur in eyes, ears, skin, thyroid, pituitary, palate, parathyroid, esophagus, pleura, heart, liver, spleen, small intestine, adrenals, kidneys, bone marrow, and lymph nodes, has_material_basis_in Pneumocystis jirovecii that effects interstitial and alveolar tissues and has_symptom nonproductive cough, has_symptom shortness of breath, and has_symptom fever', 'Pneumocystosis|pulmonary pneumocystosis|Pneumocystosis pneumonia|Pneumocystis carinii pneumonia|Pneumocystis pneumonia|Pneumocystis jirovecii pneumonia', 'UMLS_CUI:C1535939|SNOMEDCT_US_2016_03_01:88860002|ICD10CM:B59|ICD9CM:136.3|SNOMEDCT_US_2016_03_01:57541005|SNOMEDCT_US_2016_03_01:415125002|NCI:C3334|SNOMEDCT_US_2016_03_01:155557008|MESH:D011020', '2', 'DOID:11339');
