INSERT INTO `disease_info` VALUES ('DOID:11379', 'gnathomiasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection due to migrating immature worms of Gnathostoma spinigerum or Gnathostoma hispidum, which occurs by eating undercooked fish or poultry containing third-stage larvae, or by drinking water containing infective second-stage larvae in Cyclops. Migration in the subcutaneous tissues causes intermittent, migratory, painful, pruritic swellings (cutaneous larva migrans). Migration to other tissues (visceral larva migrans), result in cough, hematuria, and ocular involvement, with the most serious manifestations eosinophilic meningitis with myeloencephalitis', 'Infectious Disease by Gnathostoma|Gnathostomiasis', 'ICD10CM:B83.1|SNOMEDCT_US_2016_03_01:44086001|MESH:D058429|ICD9CM:128.1|UMLS_CUI:C0018013', '5', null);
