INSERT INTO `disease_info` VALUES ('DOID:11678', 'onchocerciasis', 'A filariasis that involves parasitic infection caused by the nematode Onchocerca volvulus, which is transmitted to humans through the bite of a blackfly of the genus Simulium. The worms spread throughout the body and, when they die, cause intense itching and a strong immune system response that can destroy nearby tissue. The symptoms include pruritus, dermatitis, blindness, onchocercomata (subcutaneous nodules), and lymphadenopathy', 'volvulosis|Onchocerca volvulus infection|Infection by Onchocerca volvulus', 'UMLS_CUI:C0029001|ICD10CM:B73|NCI:C34861|ICD9CM:125.3|SNOMEDCT_US_2016_03_01:38539003|MESH:D009855', '2', 'DOID:11678');
