INSERT INTO `disease_info` VALUES ('DOID:11680', 'ocular onchocerciasis', 'A onchocerciasis that involves parasitic infection of the eye by the larvae of Onchocerca volvulus. The microfilariae migrate to the surface of the cornea. Punctate keratitis occurs in the infected area. In severe infection, sclerosing keratitis occurs, making the affected area become opaque leading to blindness', 'Ocular onchocerciasis (disorder)|Ocular Onchocerciasis|river blindness', '', '5', null);
