INSERT INTO `disease_info` VALUES ('DOID:11722', 'myotonic dystrophy type 1', 'A myotonic disease that is characterized by progressive muscle wasting and weakness affecting the distal skeletal and smooth muscles of lower legs, hands, neck, and face along with myotonia and cataracts and has_physical_basis_in the autosomal dominant inheritance of the DMPK gene containing an expansion of a CTG trinucleotide repeat in the non-coding region', 'myotonic dystrophy of Steinert|Steinert disease|congenital myotonic dystrophy|Dystrophia myotonica', 'UMLS_CUI:C0027126|SNOMEDCT_US_2016_03_01:267713009|NCI:C84914|ICD9CM:359.21|MESH:D009223|OMIM:160900|ICD10CM:G71.11|SNOMEDCT_US_2016_03_01:77956009|SNOMEDCT_US_2016_03_01:155096007', '1', 'OMIM:160900|DOID:11722');
INSERT INTO `disease_info` VALUES ('DOID:11723', 'Duchenne muscular dystrophy', 'A muscular dystrophy that has_material_basis_in X-linked disease that has material basis in mutations in the DMD gene found on the X chromosome. It is characterized by rapidly progressing muscle weakness and muscle atrophy initially involving the lower extremities and eventually affecting the whole body. It affects males whereas females can be carriers. The symptoms start before the age of six and may appear at infancy', 'Muscular dystrophy, Duchenne', 'MESH:D020388|SNOMEDCT_US_2016_03_01:387732009|SNOMEDCT_US_2016_03_01:155095006|UMLS_CUI:C0013264|OMIM:310200|SNOMEDCT_US_2016_03_01:129619006|SNOMEDCT_US_2016_03_01:267712004|SNOMEDCT_US_2016_03_01:76670001|NCI:C75482', '1', 'OMIM:310200|DOID:11723');
