INSERT INTO `disease_info` VALUES ('DOID:12118', 'pulmonary hemosiderosis', 'A lung disease with an unknown etiology affecting the lungs which results in bleeding from tiny alveolar capillaries. Examination of sputum and bronchoalveolar lavage fluid can disclose hemosiderin-laden alveolar macrophages (siderophages), and the lung biopsy shows numerous siderophages in the alveoli. Alveolar hemorrhage is characterized by hemoptysis, dyspnea, alveolar infiltrates on chest radiograph, and various degrees of anaemia. Following a bleeding episode, the alveolar macrophages convert the hemoglobin\'s iron into hemosiderin within 36-72h', 'Idiopathic pulmonary hemosiderosis|brown induration|brown lung', 'ICD9CM:516.1|SNOMEDCT_US_2016_03_01:40527005|SNOMEDCT_US_2016_03_01:190848001|ICD10CM:J84.03|MESH:C536281|UMLS_CUI:C0020807|OMIM:178550|OMIM:235500|ORDO:99931', '5', 'OMIM:178550|OMIM:235500');
