INSERT INTO `disease_info` VALUES ('DOID:12132', 'Wegener\'s granulomatosis', 'An autoimmune disease that is located_in lung, located_in kidney, located_in skin resulting from an autoimmune attack by antineutrophil cytoplasmic antibodies against small and medium-size blood vessels', 'Wegener\'s syndrome|Necrotizing respiratory granulomatosis|Wegener granulomatosis|Granulomatosis - Wegener\'s', 'SNOMEDCT_US_2016_03_01:390001000|SNOMEDCT_US_2016_03_01:266323005|UMLS_CUI:C3495801|NCI:C3444|ICD10CM:M31.3|SNOMEDCT_US_2016_03_01:155445002|ICD10CM:M31.30|ICD9CM:446.4|SNOMEDCT_US_2016_03_01:195353004|SNOMEDCT_US_2016_03_01:23782005|SNOMEDCT_US_2016_03_01:239934006|OMIM:608710|MESH:D014890', '1', 'DOID:12132');
