INSERT INTO `disease_info` VALUES ('DOID:12140', 'Chagas disease', 'A trypanosomiasis that is a tropical parasitic disease caused by the flagellate protozoan Trypanosoma cruzi, which is transmitted to humans and other mammals by an insect vector, the blood-sucking assassin bugs of the subfamily Triatominae (family Reduviidae), most commonly species belonging to the Triatoma, Rhodnius, and Panstrongylus genera. The symptoms include fever, fatigue, body aches, headache, rash, loss of appetite, diarrhea, vomiting, swelling of the eyelids and myocarditis', 'chagas\' disease with other organ involvement|chagas\' disease with digestive system involvement|chagas\' disease with nervous system involvement|Chagas\' disease', 'KEGG:05142|ICD9CM:086.2|SNOMEDCT_US_2016_03_01:186817003|SNOMEDCT_US_2016_03_01:54570006|SNOMEDCT_US_2016_03_01:94371000119107|UMLS_CUI:C0007932', '2', 'DOID:12140');
