INSERT INTO `disease_info` VALUES ('DOID:12177', 'common variable immunodeficiency', 'A hypogammaglobulinemia that is results in insufficient production of antibodies needed to respond to exposure of pathogens and is characterized by low Ig levels with phenotypically normal B cells that can proliferate but do not develop into Ig-producing cells. Patients with common variable immunodeficiency have marked reduction in serum levels of both immunoglobulin G (IgG) and immunoglobulin A (IgA); about half of these patients also have reduced immunoglobulin M (IgM)', 'sporadic hypogammaglobulinemia|acquired agammaglobulinemia|common variable agammaglobulinemia|acquired hypogammaglobulinemia|CVID', 'OMIM:615577|OMIM:607594|ORDO:1572|OMIM:240500|OMIM:615767|SNOMEDCT_US_2016_03_01:23238000|OMIM:613494|UMLS_CUI:C0009447|OMIM:614699|ICD10CM:D83.9|MESH:D017074|ICD10CM:D83|OMIM:613496|SNOMEDCT_US_2016_03_01:191010004|OMIM:613495|ICD9CM:279.06|OMIM:613493|OMIM:614700', '1', 'OMIM:615577|OMIM:607594|OMIM:240500|OMIM:615767|OMIM:613494|OMIM:614699|OMIM:613496|OMIM:613495|OMIM:613493|OMIM:614700|DOID:12177');
