INSERT INTO `disease_info` VALUES ('DOID:12205', 'dengue disease', 'A viral infectious disease that results in infection, has material basis in Dengue virus [NCBITaxon:12637] with four serotypes (Dengue virus 1, 2, 3 and 4), which are transmitted by Aedes mosquito bite. The infection has symptom fever, has symptom severe headache, has symptom severe pain behind the eyes, has symptom joint pain, has symptom muscle and bone pain, has symptom rash, and has symptom mild bleeding', 'breakbone fever|classic dengue|Dengue Fever', 'UMLS_CUI:C0011311|ICD10CM:A90|SNOMEDCT_US_2016_03_01:38362002|MESH:D003715|SNOMEDCT_US_2016_03_01:266194002|SNOMEDCT_US_2016_03_01:154345006|ICD9CM:061|NCI:C34528', '2', 'DOID:12205');
INSERT INTO `disease_info` VALUES ('DOID:12206', 'dengue hemorrhagic fever', 'A dengue disease that occurs when a person experiences a second infection with a heterologous Dengue virus serotype, which is transmitted_by Aedes mosquito bite. The infection has_symptom hemorrhagic lesions of the skin, has_symptom thrombocytopenia, has_symptom reduction in the fluid part of the blood, and has_symptom high fever', 'DHF', 'UMLS_CUI:C0019100|SNOMEDCT_US_2016_03_01:186599009|SNOMEDCT_US_2016_03_01:20927009|SNOMEDCT_US_2016_03_01:186598001|MESH:D019595|NCI:C34683|ICD10CM:A91', '2', 'DOID:12206');
INSERT INTO `disease_info` VALUES ('DOID:1221', 'infiltrative lung tuberculosis', 'A pulmonary tuberculosis that is characterized by filling of airspaces with fluid, inflammatory exudates (pus, proteins and immunological substances) or cells (malignant cells and red blood cells) in a region of the lung', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:12210', 'Wuchereria bancrofti filariasis', 'A filarial elephantiasis that involves parasitic infection of the lymphatic system by a filarial worm Wuchereria bancrofti, which is transmitted by mosquitoes. The symptoms include lymphedema, fever, chills, skin infections, painful lymph nodes, orchitis and epididymitis', 'Wuchereria bancrofti infectious disease|Infection due to Wuchereria bancrofti|Infection by Wuchereria bancrofti (disorder)|Bancroftian filariasis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:12211', 'filarial elephantiasis', 'A filariasis that is characterized by the thickening of the skin and underlying tissues, especially in the legs, male genitals and female breasts, caused by thread-like parasitic worms Wuchereria bancrofti, Brugia malayi or Brugia timori, which inhabit the lymphatics. These nematodes are transmitted by mosquitoes. Acute symptoms include fever, lymphadenitis, lymphangitis, funiculitis, and epididymitis. Chronic symptoms include abscesses, hyperkeratosis, polyarthritis, hydroceles, lymphedema, and elephantiasis', 'Bancroftian filarial chyluria|Elephantiasis of eyelid|Bancroftian elephantiasis|Lymphatic filariasis|elephantiasis of eyelid', 'MESH:D004605|UMLS_CUI:C0013884|SNOMEDCT_US_2016_03_01:240820001|SNOMEDCT_US_2016_03_01:91586009|SNOMEDCT_US_2016_03_01:240825006|ICD10CM:B74.0', '2', 'DOID:12211');
