INSERT INTO `disease_info` VALUES ('DOID:12765', 'peritonsillar abscess', 'A tonsillitis which involves collection of pus beside the tonsil (peritonsillar space). It is caused by both aerobic and anaerobic bacteria. Commonly involved species include streptococci, staphylococci and hemophilus. Progressively worsening unilateral sore throat and pain during swallowing usually are the earliest symptoms. As the abscess develops, persistent pain in the peritonsillar area, fever, malaise, headache and a distortion of vowels informally known as \\\"hot potato voice\\\" may appear. Neck pain associated with tender, swollen lymph nodes, referred ear pain and halitosis are also common', 'Peritonsillar abscess (disorder)|Quinsy|Peritonsillar abscess', '', '5', null);
