INSERT INTO `disease_info` VALUES ('DOID:13047', 'Ancylostoma braziliense ancylostomiasis', 'An ancylostomiasis that is characterized by skin manifestations (cutaneous larva migrans) occuring due to migrating larvae of Ancylostoma braziliense in the upper epidermis. It is marked by the presence of erythematous, serpiginous and pruritic cutaneous eruptions', 'Ancylostomiasis due to ancylostoma braziliense|Ancylostomiasis due to Ancylostoma Braziliense|Ancylostomiasis due to Ancylostoma braziliense (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13049', 'Ancylostoma duodenale ancylostomiasis', 'An ancylostomiasis that involves parasitic infection of the small intestine in humans, cats and dogs by the nematode Ancylostoma duodenale. The symptoms include abdominal pain, loss of appetite, geophagy and anemia', 'Ancylostomiasis due to Ancylostoma duodenale (disorder)|Ancylostomiasis due to Ancylostoma Duodenale|Ancylostomiasis due to Ancylostoma duodenale', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1305', 'AIDS dementia complex', 'A HIV encephalopathy that results_in infection in adults located_in brain, has_material_basis_in Human immunodeficiency virus 1 or has_material_basis_in Human immunodeficiency virus 2. The infection has_symptom cognitive impairment, has_symptom motor dysfunction, has_symptom behavioral change, and has_symptom speech problems', 'HIV associated cognitive and motor complex|HIV-associated dementia|acquired immune deficiency syndrome dementia complex|AIDS Dementia', '', '2', 'DOID:1305');
