INSERT INTO `disease_info` VALUES ('DOID:13074', 'tinea unguium', 'A dermatophytosis that results_in fungal infection located_in nail, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes, which cause separation of the nail plate from the nail bed and has_symptom thickening of subungueal area. Sometimes, white islands are seen on the external nail plates. These gradually coalesce until the entire nail plate is involved', 'dermatophytic onychomycosis|cellulitis and abscess of face|cellulitis and abscess of gluteal region|cellulitis and abscess of upper arm and forearm|Onychomycosis due to dermatophyte|cellulitis and abscess of finger|Dermatophytosis of nail|cellulitis and abscess of trunk|cellulitis and abscess of buttock|Dermatophytic onychia|cellulitis and abscess of finger and toe', 'ICD9CM:681.9|UMLS_CUI:C0007644', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13076', 'abdominal actinomycosis', 'An actinomycosis that involves invasion and infiltration located_in large intestine, located_in greater omentum, or located_in abdominal wall, has_material_basis_in Actinomyces israelii, has_material_basis_in Actinomyces naeslundii, has_material_basis_in Actinomyces odontolyticus, has_material_basis_in Actinomyces viscosus or has_material_basis_in Actinomyces meyeri, which produce a characteristic granulomatous inflammatory response, with pus production and has_symptom abscess formation', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13077', 'cutaneous actinomycosis', 'An actinomycosis that results_in infection located_in skin, has_material_basis_in Actinomyces israelii, which invades the soft tissue resulting in the formation of abnormal channels leading to the skin surface (external sinus tracts) that discharge pale yellow sulfur granules', '', '', '5', null);
