INSERT INTO `disease_info` VALUES ('DOID:13250', 'diarrhea', 'A gastrointestinal system disease described as the condition of having frequent loose or liquid bowel movements. Acute diarrhea is a common cause of death in developing countries and the second most common cause of infant deaths worldwide. The loss of fluids through diarrhea can cause severe dehydration which is one cause of death in diarrhea sufferers. Along with water, sufferers also lose dangerous amounts of important salts, electrolytes, and other nutrients. There are at least four types of diarrhea: secretory diarrhea, osmotic diarrhea, motility-related diarrhea, and inflammatory diarrhea', '', 'SNOMEDCT_US_2016_03_01:154279005|SNOMEDCT_US_2016_03_01:19213003|SNOMEDCT_US_2016_03_01:186165000|SNOMEDCT_US_2016_03_01:186167008|SNOMEDCT_US_2016_03_01:111939009|SNOMEDCT_US_2016_03_01:236076004|MESH:D003967|SNOMEDCT_US_2016_03_01:154268000|UMLS_CUI:C0013369|SNOMEDCT_US_2016_03_01:266173000|SNOMEDCT_US_2016_03_01:266180003|ICD9CM:009.2', '2', 'DOID:13250');
INSERT INTO `disease_info` VALUES ('DOID:13251', 'HIV enteropathy', 'A Human immunodeficiency virus infectious disease that results_in infection characterized by chronic diarrhea lasting longer than 1 month, without an identified infectious cause after thorough evaluation, in an HIV-positive individual, has_material_basis_in Human immunodeficiency virus 1 or has_material_basis_in Human immunodeficiency virus 2. It is observed that HIV-infected individuals have histologic abnormalities of the gastrointestinal mucosa, malabsorption, and lymphocyte depletion causing diarrhea, increased gastrointestinal inflammation, increased intestinal permeability, and malabsorption of bile acid and vitamin B12', '', '', '5', null);
