INSERT INTO `disease_info` VALUES ('DOID:13257', 'Histoplasma duboisii endocarditis', 'An African histoplasmosis that results_in inflammation located_in endocardium, has_material_basis_in Histoplasma capsulatum var duboisii, transmitted_by airborne spores and has_symptom murmurs, has_symptom peripheral edema, has_symptom pulmonary rales, has_symptom petechia and has_symptom skin lesions', 'Histoplasma duboisii with endocarditis (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13258', 'typhoid fever', 'A primary bacterial infectious disease that is a communicable systemic illness, has_material_basis_in Salmonella enterica subsp enterica serovar Typhi, which is transmitted_by ingestion of food or water contaminated with the feces of an infected person. The infection has_symptom fever, has_symptom diarrhea, has_symptom prostration, has_symptom headache, has_symptom splenomegaly, has_symptom liver enlargement, has_symptom eruption of rose-colored spots, and has_symptom leukopenia', 'Typhoid', 'NCI:C35089|SNOMEDCT_US_2016_03_01:186091002|ICD9CM:002.0|UMLS_CUI:C0041466|SNOMEDCT_US_2016_03_01:4834000|ICD10CM:A01.00|SNOMEDCT_US_2016_03_01:154270009|MESH:D014435|ICD10CM:A01.0|SNOMEDCT_US_2016_03_01:266174006', '3', 'DOID:13258');
INSERT INTO `disease_info` VALUES ('DOID:13262', 'hallucinatory state induced by drug', 'hallucinatory state induced by drug', 'Drug-induced psychotic disorder with hallucinations|Drug-induced hallucinosis (disorder)|Drug-induced hallucinatory state', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13268', 'porphyria', 'An inherited metabolic disorder that involves certain enzymes in the heme bio-synthetic pathway resulting in the overproduction and accumulation of the porphyrins', 'Porphyrinopathy|disorder of porphyrin and hem metabolism|disorder of porphyrin metabolism|Hematoporphyria', 'UMLS_CUI:C0032708|MESH:D011164|SNOMEDCT_US_2016_03_01:190912004|SNOMEDCT_US_2016_03_01:86292002|SNOMEDCT_US_2016_03_01:190916001|SNOMEDCT_US_2016_03_01:418470004|ICD9CM:277.1|SNOMEDCT_US_2016_03_01:238052001|NCI:C97096|SNOMEDCT_US_2016_03_01:154768004|SNOMEDCT_US_2016_03_01:29094004|SNOMEDCT_US_2016_03_01:371628009|ICD10CM:E80.20|SNOMEDCT_US_2016_03_01:274090006', '2', 'DOID:13268');
INSERT INTO `disease_info` VALUES ('DOID:13269', 'hereditary coproporphyria', 'hereditary coproporphyria', 'Hereditary coproporphyria|hereditary coproporphyria porphyria|Coproporphyrinogen oxidase deficiency', 'MESH:D046349|UMLS_CUI:C0162531|SNOMEDCT_US_2016_03_01:7425008|OMIM:121300|NCI:C84759|ICD10CM:E80.29|SNOMEDCT_US_2016_03_01:238055004', '1', 'OMIM:121300|DOID:13269');
INSERT INTO `disease_info` VALUES ('DOID:13270', 'erythropoietic protoporphyria', 'An acute porphyria characterized by a deficiency in the enzyme ferrochelatase, leading to abnormally high levels of protoporphyrin in the tissue', 'Erythropoietic protoporphyria|EPP|Protoporphyria', 'SNOMEDCT_US_2016_03_01:51022005|ORDO:79278|NCI:C84698|ICD10CM:E80.0|OMIM:300752|UMLS_CUI:C0162568|MESH:D046351|OMIM:177000', '1', 'OMIM:300752|OMIM:177000|DOID:13270');
INSERT INTO `disease_info` VALUES ('DOID:13271', 'cutaneous porphyria', 'cutaneous porphyria', 'Erythropoietic porphyria', 'NCI:C84697|OMIM:263700|UMLS_CUI:C0162530|MESH:D017092|ICD10CM:E80.0|SNOMEDCT_US_2016_03_01:190913009|SNOMEDCT_US_2016_03_01:22935002|SNOMEDCT_US_2016_03_01:67312003', '1', 'OMIM:263700|DOID:13271');
INSERT INTO `disease_info` VALUES ('DOID:13272', 'Klebsiella pneumonia', 'A commensal bacterial infectious disease involving Klebsiella pneumoniae infection. Patients with Klebsiella pneumonia tend to cough up a characteristic sputum that is said to resemble \\\"red-currant jelly\\\". Klebsiella pneumonia tends to affect people with underlying diseases, such as alcoholism, diabetes and chronic lung disease. The symptoms include high fever, rigors and pleuritic pain, and hemoptysis', 'Pneumonia due to Klebsiella pneumoniae (disorder)|Pneumonia due to Klebsiella pneumoniae', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13273', 'Escherichia coli pneumonia', 'A commensal Escherichia coli infectious disease that is caused by Escherichia coli. The disease results from proliferation of aspirated organisms in terminal airways, usually at multiple sites in the lung. Multifocal area of consolidation result and terminal airways and alveoli are filled with proteinaceous fluid, fibrin, neutrophils, and macrophages', 'Pneumonia due to Escherichia coli (disorder)|pneumonia due to escherichia coli|Pneumonia due to escherichia coli [E. coli]|Pneumonia due to escherichia coli', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13274', 'enzootic pneumonia of calves', 'A bovine respiratory disease complex which is an infectious disease in calves involving stress and possibly an initial respiratory viral infection followed by a secondary bacterial infection of the lower respiratory tract. Mycoplasmal and bacterial agents including Pasteurella multocida, Mannheimia haemolytica, and Mycoplasma bovis represent the most frequently isolated pathogenic organisms', 'Enzootic pneumonia of calves (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13275', 'rickettsial pneumonia', 'A rickettsiosis that is caused by the genus Rickettsia. This infection results in pleural effusions and pulmonary edema', 'Rickettsial pneumonia (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13276', 'Mycoplasma pneumoniae pneumonia', 'A mycoplasmal pneumonia that is caused by the bacterial species Mycoplasma pneumoniae. The symptoms include chest pain, chills, dry cough which is not bloody, excessive sweating, fever, headache and sore throat', 'Pneumonia due to Eaton\'s agent|Pneumonia due to Mycoplasma pneumoniae (disorder)|cold agglutinin positive pneumonia|Pneumonia due to Mycoplasma pneumoniae|Mycoplasmal pneumonia', '', '2', 'DOID:13276');
INSERT INTO `disease_info` VALUES ('DOID:13277', 'Mycoplasma hyopneumoniae pneumonia', 'A mycoplasmal pneumonia that is a contagious infection of pigs caused my Mycoplasma hyopneumoniae resulting in lung lesions and chronic cough', 'mycoplasmal pneumonia of swine', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13278', 'Salmonella pneumonia', 'A Salmonella infectious disease that is caused by Gram-negative bacteria of genus Salmonella which is rare in adults, although more common in children in the tropics. This infection is complicated by suppuration with lung abscess or empyema formation', 'Salmonella pneumonia (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1328', 'Rift Valley fever', 'A viral infectious disease that results_in infection, has_material_basis_in Rift Valley fever virus, which is transmitted_by Aedes mosquitoes. The virus affects domestic animals (cattle, buffalo, sheep, goats, and camels) and humans. The infection has_symptom jaundice, has_symptom vomiting blood, has_symptom passing blood in the feces, has_symptom ecchymoses (caused by bleeding in the skin), has_symptom bleeding from the nose or gums, has_symptom menorrhagia and has_symptom bleeding from venepuncture sites', '', 'SNOMEDCT_US_2016_03_01:402917003|MESH:D012295|SNOMEDCT_US_2016_03_01:7077006|UMLS_CUI:C0035613|ICD10CM:A92.4', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13282', 'intestinal tuberculosis', 'A gastrointestinal tuberculosis that involves diffuse mucosal fold thickening, formation of ulcers and fistulae located_in intestine. The infection has_symptom abdominal pain, has_symptom gastrointestinal bleeding, has_symptom nausea and has_symptom vomiting', 'tuberculosis of intestine', 'ICD9CM:014.8|UMLS_CUI:C0152724', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13285', 'enteroinvasive Escherichia coli infectious disease', 'An Escherichia coli intestinal infectious disease that involves infection of the intestine caused by a serological subgroup of Escherichia coli called enteroinvasive Escherichia coli (EIEC), which penetrate and multiply within epithelial cells of the colon causing cell destruction. They do not produce toxins but they possess a specific adhesin, which is an outer membrane protein. The symptoms include dysentery-like diarrhea with fever', 'Enteroinvasive Escherichia coli gastrointestinal tract infection|intestinal infectious disease due to enteroinvasive E. coli|Enteroinvasive Escherichia coli gastrointestinal tract infection (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13295', 'crater-like holes of optic disc', 'crater-like holes of optic disc', 'Crater-like optic disc holes', 'ICD9CM:377.22|SNOMEDCT_US_2016_03_01:19148004|UMLS_CUI:C0155298|SNOMEDCT_US_2016_03_01:194048008', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:133', 'vaginal Mullerian papilloma', 'vaginal Mullerian papilloma', 'vaginal Muellerian papilloma', 'UMLS_CUI:C1519926|NCI:C40255', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13300', 'Scheuermann\'s disease', 'An osteochondrosis that results_in abnormal bone growth and curvature located_in thoracic vertebral column', 'Juvenile osteochondritis of the spine|Juvenile osteochondrosis of spine|Sherman\'s Disease|Juvenile osteochondrosis of Scheurermann|Scheuermann\'s kyphosis', 'MESH:D012544|UMLS_CUI:C0036310|NCI:C34999|OMIM:181440|ICD9CM:732.0|SNOMEDCT_US_2016_03_01:156816000|SNOMEDCT_US_2016_03_01:203364002|SNOMEDCT_US_2016_03_01:203415006|ICD10CM:M42.0|SNOMEDCT_US_2016_03_01:203361005|SNOMEDCT_US_2016_03_01:53406005|SNOMEDCT_US_2016_03_01:203362003|ICD10CM:M42.00', '5', 'OMIM:181440');
INSERT INTO `disease_info` VALUES ('DOID:13305', 'anterior nasal diphtheria', 'A diphtheria that is characterized by a mucopurulent nasal discharge (containing both mucus and pus) which may become blood-tinged. A white membrane usually forms on the nasal septum. The disease is usually fairly mild because of apparent poor systemic absorption of toxin in this location, and it can be terminated rapidly by antitoxin and antibiotic therapy', 'Anterior nasal diphtheria (disorder)|Anterior nasal diphtheria', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13306', 'diphtheritic cystitis', 'A cystits which involves inflammation and formation of a dense fibrous false membrane on the mucous membrane of the bladder', '', 'SNOMEDCT_US_2016_03_01:48278001|ICD10CM:A36.85|SNOMEDCT_US_2016_03_01:197847008|ICD9CM:032.84|UMLS_CUI:C0152954', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13307', 'pseudomembranous diphtheritic conjunctivitis', 'A pseudomembranous conjunctivitis characterized by swollen and reddened, hot and painful lids. The Corynebacterium diphtheriae bacilli produce profuse exudation which has a tendency to coagulate on the surface of the conjunctiva to form a grayish-white membrane', 'Conjunctival diphtheria (disorder)|Conjunctival diphtheria|Pseudomembranous Diphtheritic Conjunctivitis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13308', 'diphtheritic myocarditis', 'A myocarditis characterized by dilated cardiomyopathy and a variety of types of dysrhythmia and conduction disturbances. It is caused by Corynebacterium diphtheriae', 'Diphtheritic myocarditis (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13309', 'nasopharyngeal diphtheria', 'A diphtheria that involves membrane formation from the faucial tonsil areas over the pharyngeal wall and into the nasopharynx. Severe disease may cause marked edema of the submandibular areas and the anterior neck along with lymphadenopathy, giving a characteristic \\\"bullneck\\\" apprearance', 'Nasopharyngeal diphtheria (disorder)|Nasopharyngeal Diphtheria', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13310', 'diphtheritic peritonitis', 'A peritonitis which involves inflammation of peritoneal cavity by Corynebacterium diphtheriae', '', 'ICD9CM:032.83|UMLS_CUI:C0152953|ICD10CM:A36.89|SNOMEDCT_US_2016_03_01:13596001', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13313', 'pancreatic mucinous ductal ectasia', 'pancreatic mucinous ductal ectasia', '', 'UMLS_CUI:C1335310|NCI:C5717', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13315', 'relapsing pancreatitis', 'relapsing pancreatitis', '', '', '2', 'DOID:13315');
INSERT INTO `disease_info` VALUES ('DOID:13316', 'exocrine pancreatic insufficiency', 'exocrine pancreatic insufficiency', 'Exocrine pancreatic insufficiency', 'SNOMEDCT_US_2016_03_01:47367009|UMLS_CUI:C0267963|NCI:C84316|MESH:D010188', '2', 'DOID:13316');
INSERT INTO `disease_info` VALUES ('DOID:13317', 'hyperinsulinemic hypoglycemia', 'A carbohydrate metabolic disorder that involves low blood glucose resulting from an excess of insulin', 'Islet cell hyperplasia|persistent hyperinsulinemia hypoglycemia of infancy|nesidioblastosis', 'SNOMEDCT_US_2016_03_01:190450004|OMIM:256450|SNOMEDCT_US_2016_03_01:42681006|OMIM:601820|NCI:C4375|SNOMEDCT_US_2016_03_01:360337007|SNOMEDCT_US_2016_03_01:237649006|OMIM:609968|OMIM:609975|OMIM:610021|SNOMEDCT_US_2016_03_01:66149005|ICD10CM:E16.9|UMLS_CUI:C0027773|MESH:D046768|OMIM:602485|OMIM:606762', '1', 'OMIM:256450|OMIM:601820|OMIM:609968|OMIM:609975|OMIM:610021|OMIM:602485|OMIM:606762|DOID:13317');
INSERT INTO `disease_info` VALUES ('DOID:13319', 'lower limb lymph node mast cell malignancy', 'lower limb lymph node mast cell malignancy', 'malignant mast cell tumors involving lymph nodes of inguinal region and lower limb|Mast cell malignancy of lymph nodes of inguinal region and lower limb (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1332', 'Bunyaviridae infectious disease', 'A (-)ssRNA virus infectious disease that results_in infection in rodents and humans, has_material_basis_in Bunyaviridae viruses, which are transmitted_by arthropod vectors', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13326', 'chronic follicular conjunctivitis', 'chronic follicular conjunctivitis', '', 'UMLS_CUI:C0155147|SNOMEDCT_US_2016_03_01:39429002|ICD9CM:372.12|ICD10CM:H10.43', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13327', 'anatomical narrow angle borderline glaucoma', 'anatomical narrow angle borderline glaucoma', '', 'UMLS_CUI:C0154941|ICD9CM:365.02', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13328', 'diabetic cataract', 'diabetic cataract', 'Cataract - diabetic', 'SNOMEDCT_US_2016_03_01:155129005|UMLS_CUI:C0011876|SNOMEDCT_US_2016_03_01:267471001|SNOMEDCT_US_2016_03_01:267722005|SNOMEDCT_US_2016_03_01:154678005|ICD9CM:366.41|SNOMEDCT_US_2016_03_01:43959009', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13329', 'toxic optic neuropathy', 'toxic optic neuropathy', '', 'SNOMEDCT_US_2016_03_01:194053003|SNOMEDCT_US_2016_03_01:26125006|UMLS_CUI:C0155303|ICD10CM:H46.3|ICD9CM:377.34', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1333', 'african horse sickness', 'A viral infectious disease that results_in infection in horses, mules, donkeys and zebras located_in lung, has_material_basis_in African horsesickness virus, which is transmitted_by biting midge, Culicoides imicola, transmitted_by Culex mosquito, transmitted_by Anopheles mosquito, transmitted_by Aedes mosquito, transmitted_by Hyalomma tick, and transmitted_by Rhipicephalus tick. The infection has_symptom tachypnea, has_symptom forced expiration, has_symptom profuse sweating, has_symptom spasmodic coughing, and has_symptom ecchymoses on the tongue', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13333', 'hypertrophy of tongue papillae', 'hypertrophy of tongue papillae', 'Tongue papillary hypertrophy', 'UMLS_CUI:C0392494|ICD10CM:K14.3|ICD9CM:529.3|SNOMEDCT_US_2016_03_01:196584007|SNOMEDCT_US_2016_03_01:6971002', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13335', 'Toxoplasma hepatitis', 'A toxoplasmosis that involves inflammation of the liver caused by the protozoan Toxoplasma gondii, which results in jaundice', 'Toxoplasma hepatitis (disorder)|Hepatitis due to toxoplasmosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13336', 'congenital toxoplasmosis', 'A toxoplasmosis that involves a reactivated infection of the mother transmitted to the fetus during pregnancy. Spontaneous abortion and stillbirth may occur', 'Toxoplasmosis - congen.|Congenital toxoplasmosis', 'ICD10CM:P37.1|NCI:C50503|MESH:D014125|SNOMEDCT_US_2016_03_01:73893000|SNOMEDCT_US_2016_03_01:206335001|SNOMEDCT_US_2016_03_01:157118007|SNOMEDCT_US_2016_03_01:268875000|UMLS_CUI:C0040560', '3', 'DOID:13336');
INSERT INTO `disease_info` VALUES ('DOID:13338', 'Toxoplasma myocarditis', 'A toxoplasmosis that involves infection of the heart with Toxoplasma gondii resulting in shortness of breath and constricting chest pain', 'Myocarditis due to toxoplasmosis|Myocarditis due to acquired toxoplasmosis (disorder)|Toxoplasma myocarditis (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1334', 'Reoviridae infectious disease', 'A dsRNA virus infectious disease that results_in infection in animals and humans, has_material_basis_in Reoviridae viruses', 'Reoviridae disease|disease due to Reovirus (disorder)|disease due to Reoviridae (disorder)|disease due to Orthoreovirus', '', '2', 'DOID:1334');
INSERT INTO `disease_info` VALUES ('DOID:13341', 'parasitic conjunctivitis', 'parasitic conjunctivitis', '', 'UMLS_CUI:C0155148|SNOMEDCT_US_2016_03_01:13816006|ICD9CM:372.15', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13342', 'Toxoplasma pneumonia', 'A toxoplasmosis that is caused by the protozoan Toxoplasma gondii which is recognized as pathogen in immunocompromised patients. Microscopy of the lung shows fibrinous exudate, and necrotic areas with intra and extracellular tachizoites along the interstitium and alveolar spaces. The symptoms are cough, shortness of breath, high fever and rales', 'Toxoplasma pneumonitis (disorder)|Pneumonitis due to toxoplasmosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13343', 'ocular toxoplasmosis', 'A toxoplasmosis that results from reactivation of congenital toxoplasmosis, but rarely with acquired infection. Focal necrotizing retinitis and a secondary granulomatous inflammation of the choroid occur. The symptoms include conjunctivitis, ocular pain, blurred vision, and blindness', 'Toxoplasma conjunctivitis|Conjunctivitis due to acquired toxoplasmosis (disorder)|ocular toxoplasmosis|Conjunctivitis due to toxoplasmosis|Toxoplasmosis chorioretinitis (disorder)|Ocular toxoplasmosis (disorder)|Toxoplasma chorioretinitis|Chorioretinitis due to toxoplasmosis', '', '2', 'DOID:13343');
INSERT INTO `disease_info` VALUES ('DOID:13348', 'laryngeal cartilage cancer', 'laryngeal cartilage cancer', 'malignant neoplasm of laryngeal cartilage|malignant neoplasm of laryngeal cartilages|malignant tumor of laryngeal cartilage', 'SNOMEDCT_US_2016_03_01:187847005|ICD10CM:C32.3|UMLS_CUI:C0153486|ICD9CM:161.3|SNOMEDCT_US_2016_03_01:109370001|SNOMEDCT_US_2016_03_01:363431006', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1335', 'bluetongue', 'A viral infectious disease that results_in infection in ruminants, has_material_basis_in Bluetongue virus, which is transmitted_by Culicoides imicola midge. The infection has_symptom fever, has_symptom excessive salivation, has_symptom swelling of the face and tongue, and has_symptom cyanosis of the tongue', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13350', 'gender identity disorder in children', 'gender identity disorder in children', 'Gender identity disorder of childhood (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13351', 'pedophilia', 'pedophilia', 'Paedophilia', 'SNOMEDCT_US_2016_03_01:84002002|MESH:D010378|SNOMEDCT_US_2016_03_01:154907002|SNOMEDCT_US_2016_03_01:268763002|NCI:C94355|SNOMEDCT_US_2016_03_01:192516001|UMLS_CUI:C0030764|ICD9CM:302.2|ICD10CM:F65.4', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13352', 'ego-dystonic sexual orientation', 'A gender identity disorder that is characterized by having a sexual orientation or an attraction that is at odds with one\'s idealized self-image, causing anxiety and a desire to change one\'s orientation or become more comfortable with one\'s sexual orientation', '', 'SNOMEDCT_US_2016_03_01:52813007|UMLS_CUI:C0233880|ICD9CM:302.0', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13353', 'diffuse interstitial keratitis', 'diffuse interstitial keratitis', '', 'UMLS_CUI:C0155089|ICD10CM:H16.32|SNOMEDCT_US_2016_03_01:267635007|ICD9CM:370.52|SNOMEDCT_US_2016_03_01:193785001|SNOMEDCT_US_2016_03_01:17157001', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13356', 'senile ectropion', 'senile ectropion', 'Involutional ectropion', 'UMLS_CUI:C0155193|SNOMEDCT_US_2016_03_01:71659009|ICD9CM:374.11', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13357', 'chondromalacia patellae', 'chondromalacia patellae', 'Chondromalacia patellae|softening of articular cartilage of patella|Chondromalacia of patella', 'UMLS_CUI:C0008475|MESH:D046789|SNOMEDCT_US_2016_03_01:36071006|ICD10CM:M22.4|ICD9CM:717.7|SNOMEDCT_US_2016_03_01:156521009|OMIM:168900', '5', 'OMIM:168900');
INSERT INTO `disease_info` VALUES ('DOID:13359', 'Ehlers-Danlos syndrome', 'A collagen disease that is characterized by extremely flexible joints, elastic skin, and excessive bruising caused by a heritable defect in collagen synthesis, which leads to marked healing difficulties. EDS has five cardinal signs, which may be present to some degree in all of the subtypes. These five cardinal signs are skin fragility, blood vessel fragility, skin hyperelasticity, joint hypermobility, and characteristic subcutaneous nodules', 'elastic skin|Cutis hyperelastica', 'NCI:C34568|SNOMEDCT_US_2016_03_01:398114001|ICD9CM:756.83|MESH:D004535|UMLS_CUI:C0013720|SNOMEDCT_US_2016_03_01:268352002|SNOMEDCT_US_2016_03_01:2300005|ICD10CM:Q79.6|OMIM:225400|SNOMEDCT_US_2016_03_01:238848002|SNOMEDCT_US_2016_03_01:157008000', '1', 'OMIM:225400|DOID:13359');
INSERT INTO `disease_info` VALUES ('DOID:1336', 'Nairobi sheep disease', 'A viral infectious disease that results_in inflammation located_in stomach and located_in intestine of sheep and goats, has_material_basis_in Nairobi sheep disease virus, which is transmitted_by Rhipicephalus appendiculatus ticks. The infection has_symptom fever, has_symptom leukopenia, has_symptom rapid respiration, has_symptom anorexia, has_symptom profound depression, has_symptom diarrhea, and has_symptom dehydration', 'Nairobi sheep virus gastroenteritis|Nairobi sheep virus disease (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13361', 'nephrotic syndrome with lesion of proliferative glomerulonephritis', 'nephrotic syndrome with lesion of proliferative glomerulonephritis', 'Nephrotic syndrome with Lesion of Proliferative Glomerulonephritis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13364', 'obsolete chronobiology disease', 'obsolete chronobiology disease', '', 'UMLS_CUI:C0236811|MESH:D021081', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13365', 'reading disorder', 'A learning disability involing difficulty reading resulting primarily from neurological factors which affect any part of the reading process', '', 'UMLS_CUI:C0154631|ICD9CM:315.09', '2', 'DOID:13365');
INSERT INTO `disease_info` VALUES ('DOID:13366', 'Stiff-Person syndrome', 'A movement disease that is of unknown etiology characterized by progressive rigidity', 'stiff man syndrome|Stiff-man syndrome', 'UMLS_CUI:C0085292|MESH:D016750|NCI:C85170|ICD9CM:333.91|ICD10CM:G25.82|OMIM:184850|SNOMEDCT_US_2016_03_01:5217008', '1', 'DOID:13366');
INSERT INTO `disease_info` VALUES ('DOID:13368', 'tinea profunda', 'A tinea corporis that results_in fungal infection located_in skin, has_material_basis_in Trichophyton mentagrophytes and results_in_formation_of subcutaneous abscesses', 'Majocchi\'s granuloma|Granuloma trichophyticum|Deep seated dermatophytosis', 'UMLS_CUI:C1279621|SNOMEDCT_US_2016_03_01:214600002|SNOMEDCT_US_2016_03_01:186995009|SNOMEDCT_US_2016_03_01:58950002', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13369', 'tinea manuum', 'A dermatophytosis that results_in fungal skin infection located_in hand, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes and has_symptom itching, has_symptom burning, has_symptom cracking, and has_symptom scaling', 'Tinea manus|Dermatophytosis of hand', 'ICD9CM:110.2|UMLS_CUI:C0153246|SNOMEDCT_US_2016_03_01:48971001|ICD10CM:B35.2', '5', null);
