INSERT INTO `disease_info` VALUES ('DOID:13521', 'tetanus neonatorum', 'A tetanus that occurs in newborn babies when the birth cord stump gets dirty through cutting it with an unclean blade or applying substances containing bacteria to it. The infection has_symptom stiff body, has_symptom muscle spasms, has_symptom difficulty in breathing, and has_symptom exhaustion', 'neonatal tetanus|Tetanus neonatorum', 'SNOMEDCT_US_2016_03_01:43424001|NCI:C116814|SNOMEDCT_US_2016_03_01:206338004|UMLS_CUI:C0343312|ICD10CM:A33|SNOMEDCT_US_2016_03_01:206339007|ICD9CM:771.3', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13523', 'loiasis', 'A filariasis that involves parasitic infection of the skin and eyes caused by the nematode Loa loa, which is transmitted through the bite of a deer fly or mango fly. The disease is characterized by episodic angioedema in the arms and legs, and cyst-like enlargements of the connective tissue around the sheaths of muscle tendons. Dead worms may cause chronic abscesses, which may lead to the formation of granulomatous reactions and fibrosis', '', 'UMLS_CUI:C0023968|ICD10CM:B74.3|SNOMEDCT_US_2016_03_01:44250009|ICD9CM:125.2|MESH:D008118|NCI:C34784', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13526', 'candidal endocarditis', 'A candidiasis that results_in inflammation located_in endocardium, has_material_basis_in Candida, which favors previously damaged or prosthetic heart valves. The source is often an intravascular catheter or contaminated equipment used for illicit intravenous drug injection. The illness has_symptom fever, has_symptom murmur, has_symptom congestive heart failure, has_symptom anemia, and has_symptom splenomegaly', 'Candidal endocarditis (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13527', 'candidal otitis externa', 'A candidiasis that involves fungal infection of the outer ear canal caused by Candida species. The symptoms include discharge, tinnitus, pruritus, and a feeling of fullness in the ear resulting in scratching and further damage to the epidermis', 'Candidal otitis externa (disorder)|otomycosis in moniliasis|Candidal: [otitis externa] or [otomycosis]', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13528', 'candidal enteritis', 'A candidiasis that involves infection of the small intestine caused by Candida species, resulting in ulceration', 'intestinal moniliasis|gastrointestinal candidiasis (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13533', 'osteopetrosis', 'An osteosclerosis that has_material_basis_in lack of bone resorption which results_in abnormally hard and brittle bones', 'Albers-Schonberg disease|marble bone', 'SNOMEDCT_US_2016_03_01:367489004|ORDO:667|ICD9CM:756.52|UMLS_CUI:C0029454|OMIM:PS607634|ICD10CM:Q78.2|SNOMEDCT_US_2016_03_01:63941000|OMIM:PS259700|NCI:C26840|SNOMEDCT_US_2016_03_01:360504006|MESH:D010022|SNOMEDCT_US_2016_03_01:205500005|SNOMEDCT_US_2016_03_01:1926006|SNOMEDCT_US_2016_03_01:205502002', '2', 'OMIM:PS607634|OMIM:PS259700|DOID:13533');
INSERT INTO `disease_info` VALUES ('DOID:13534', 'purulent labyrinthitis', 'A labyrinthitis which is a bacterial infectious disease of the inner ear, often causing deafness and loss of vestibular function. This is caused when bacteria spread to the inner ear during the course of severe acute otitis media, purulent meningitis, or an enlarging cholesteatoma', 'Suppurative labyrinthitis|bacterial labyrinthitis', 'ICD9CM:386.33|UMLS_CUI:C0155506|SNOMEDCT_US_2016_03_01:24817009', '5', null);
