INSERT INTO `disease_info` VALUES ('DOID:13760', 'Pthirus pubis infestation', 'A lice infestation that involves parasitic infestation by pubic lice Pthirus pubis, which are found in the pubic hair, less commonly in eyebrows, eyelashes, beard, mustache, armpit, perianal area, groin, trunk and scalp. The symptoms include itching in the pubic and groin area. Intense itching leads to scratching which can cause sores and secondary bacterial infection of the skin', 'Phthirus pubis|Pediculus pubis|Phthirus/pediculus pubis - pubic lice - crabs|Phthiriasis pubis|Pediculosis Pubis|Infestation by Phthirus pubis|crabs', 'NCI:C35777|ICD10CM:B85.3|SNOMEDCT_US_2016_03_01:71011005|UMLS_CUI:C0030759|SNOMEDCT_US_2016_03_01:187210003|SNOMEDCT_US_2016_03_01:271545007|ICD9CM:132.2|SNOMEDCT_US_2016_03_01:154420009|SNOMEDCT_US_2016_03_01:243683001', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13762', 'bovine trypanosomiasis', 'A trypanosomiasis that involves infection of cattle caused by Trypanosoma vivax, which is transmitted by tsetse flies. The symptoms include fever, anemia, abortion, loss of appetite, lethargy, and progressive weight loss', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13763', 'dourine', 'A trypanosomiasis that is a chronic, sexually transmitted disease of horses and other equids, caused by the protozoan parasite Trypanosoma equiperdum, which is characterized by swelling of the genitalia, cutaneous plaques and neurological signs', 'Infection by Trypanosoma equiperdum (disorder)|Covering disease', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:13767', 'clonorchiasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection of the bile ducts of the liver by Clonorchis sinensis. The symptoms include abdominal pain, nausea, diarrhea, and eosinophilia. In long-standing infections, cholangitis, cholelithiasis, pancreatitis, and cholangiocarcinoma can develop', 'Oriental liver fluke disease', 'SNOMEDCT_US_2016_03_01:11938002|MESH:D003003|ICD10CM:B66.1|UMLS_CUI:C0009021|ICD9CM:121.1', '2', 'DOID:13767');
INSERT INTO `disease_info` VALUES ('DOID:13768', 'opisthorchiasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection of the liver, pancreas and gall bladder by Opisthorchis viverrini or Opisthorchis felineus. The symptoms include dyspepsia, abdominal pain, diarrhea, constipation, hepatomegaly, cholangitis, cholecystitis, and chlolangiocarcinoma', 'Infection by Opisthorchis', 'ICD9CM:121.0|SNOMEDCT_US_2016_03_01:187124006|ICD10CM:B66.0|MESH:D009889|UMLS_CUI:C0029106|SNOMEDCT_US_2016_03_01:1059007', '2', 'DOID:13768');
INSERT INTO `disease_info` VALUES ('DOID:13774', 'Addison\'s disease', 'An adrenal cortical hypofunction that is characterized by insufficient steroid hormone production by the adrenal glands', 'Addison disease, chronic adrenal insufficiency|HYPOADRENOCORTICISM, FAMILIAL|primary hypoadrenalism|Addison disease|primary adrenocortical insufficiency', 'ICD10CM:E27.1|SNOMEDCT_US_2016_03_01:154707007|SNOMEDCT_US_2016_03_01:367376006|SNOMEDCT_US_2016_03_01:111562000|SNOMEDCT_US_2016_03_01:373662000|MESH:D000224|SNOMEDCT_US_2016_03_01:68588005|SNOMEDCT_US_2016_03_01:267483004|UMLS_CUI:C0001403|OMIM:240200|NCI:C26689|OMIM:103230|SNOMEDCT_US_2016_03_01:363732003', '3', 'DOID:13774');
INSERT INTO `disease_info` VALUES ('DOID:13775', 'plantar wart', 'A viral infectious disease that results_in benign epithelial tumors located_in skin of the sole or toes of the foot, has_material_basis_in human papillomavirus (types 1, 2, 4 or 63), has_symptom lesions that appear on the sole of the foot', 'Verruca plantaris|Verruca Plantaris|PLANTAR WART', 'ICD10CM:B07.0|NCI:C26913|UMLS_CUI:C0042548|ICD9CM:078.12|SNOMEDCT_US_2016_03_01:63440008|SNOMEDCT_US_2016_03_01:154363006', '2', 'DOID:13775');
INSERT INTO `disease_info` VALUES ('DOID:13777', 'epidermodysplasia verruciformis', 'An autosomal recessive disease that results_in skin squamous cell carcinoma located_in skin, associated with a high risk of carcinoma. It is characterized by abnormal susceptibility to human papillomaviruses of the skin and has_symptom lesions on the body', '', 'SNOMEDCT_US_2016_03_01:19138001|MESH:D004819|OMIM:226400|UMLS_CUI:C0014522', '1', 'OMIM:226400|DOID:13777');
