INSERT INTO `disease_info` VALUES ('DOID:14338', 'Pseudomonal pneumonia', 'A Pseudomonas infectious disease that is caused by a Gram-negative bacterium Pseudomonas aeruginosa resulting in pulmonary edema. This bacterium releases immunogenic bacterial components that can gain access to airway epithelium and immune cells in the lung thus causing airway inflammation. P. aeruginosa is the common cause of hospital acquired and ventilator-associated pneumonias', 'Pneumonia due to Pseudomonas|Pneumonia due to Pseudomonas (disorder)', '', '5', null);
