INSERT INTO `disease_info` VALUES ('DOID:14415', 'Legg-Calve-Perthes disease', 'An osteochondrosis that results_in death and fracture located_in hip joint', 'Coxa plana|juvenile osteochondrosis of hip and pelvis|osteochondrosis of Legg-Calve-Perthes|Juvenile osteochondrosis of hip and/or pelvis|Calve - Perthes\' disease|Perthes disease|Pseudocoxalgia|pseudocoxalgia|Perthe\'s disease|Juvenile osteochond-hip/pelvis', 'SNOMEDCT_US_2016_03_01:203372000|MESH:D007873|ICD10CM:M91.2|OMIM:150600|SNOMEDCT_US_2016_03_01:240169001|SNOMEDCT_US_2016_03_01:270545000|SNOMEDCT_US_2016_03_01:203367009|SNOMEDCT_US_2016_03_01:203365001|SNOMEDCT_US_2016_03_01:111255008|UMLS_CUI:C0022441|SNOMEDCT_US_2016_03_01:240241003|SNOMEDCT_US_2016_03_01:15739006|ICD10CM:M91.3|NCI:C34766|SNOMEDCT_US_2016_03_01:203371007|SNOMEDCT_US_2016_03_01:156817009|UMLS_CUI:C0023234', '1', 'OMIM:150600|DOID:14415');
INSERT INTO `disease_info` VALUES ('DOID:14418', 'dracunculiasis', 'A parasitic helminthiasis infectious disease that involves parasitic infection by the larvae of the nematode Dracunculus medinensis, which are transmitted to humans by drinking water containing copepods infected with the larvae. The female, which contains larvae, burrows into the deeper connective tissues or adjacent to long bones or joints of the extremities. The worm emerges as a whitish filament in the center of a painful ulcer, accompanied by inflammation and frequently by secondary bacterial infection', 'Dracontiasis|Infection by Dracunculus medinensis', 'ICD10CM:B72|SNOMEDCT_US_2016_03_01:48874008|UMLS_CUI:C0013100|SNOMEDCT_US_2016_03_01:396334002|MESH:D004320|NCI:C84677|ICD9CM:125.7', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14419', 'Mansonella ozzardi infectious disease', 'A mansonelliasis that involves parasitic infection by the nematode Mansonella ozzardi, which resides in the subcutaneous tissues causing arthralgias, headaches, fever, pulmonary symptoms, adenopathy, hepatomegaly, and pruritus. Both midges and blackflies transmit the disease', 'Ozzardian filariasis (disorder)|Filariasis ozzardi infection|Mansonella Ozzardi Infection', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:1442', 'Alpers syndrome', 'A cerebral degeneration that results in progressive degeneration of grey matter in the cerebrum and has_symptom convulsions', 'ALPERS-HUTTENLOCHER SYNDROME|progressive sclerosing poliodystrophy|ALPERS PROGRESSIVE INFANTILE POLIODYSTROPHY|Alpers\' disease or gray-matter degeneration|Alper\'s syndrome|MITOCHONDRIAL DNA DEPLETION SYNDROME 4A', 'MESH:D002549|SNOMEDCT_US_2016_03_01:20415001|NCI:C35257|ICD10CM:G31.81|UMLS_CUI:C0205710|OMIM:203700', '1', 'OMIM:203700|DOID:1442');
INSERT INTO `disease_info` VALUES ('DOID:14421', 'Brugia malayi filariasis', 'A filarial elephantiasis that involves parasitic infection by the nematode Brugia malayi, which inhabits the lymphatics. The symptoms include fever, lymphadenitis, lymphangitis, lymphedema, and secondary bacterial infection', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14422', 'dipetalonemiasis', 'A filariasis that is a zoonotic infection caused by the nematode of the genus Dipetalonema, which is transmitted accidentally to humans from porcupines, beavers and other mammals by mosquitoes. The adult worms live subcutaneously or in body cavities or in the eyes of humans. Dead worms cause hypersensitivity necrosis with eosinophils, followed by granulomatous reaction and fibrosis', 'dipetalonema infectious disease|Infection by Dipetalonema perstans|Infection by Dipetalonema', 'SNOMEDCT_US_2016_03_01:40229007|MESH:D004154|ICD9CM:125.4|SNOMEDCT_US_2016_03_01:360423002|UMLS_CUI:C0012517|SNOMEDCT_US_2016_03_01:15629006|NCI:C34540', '5', null);
