INSERT INTO `disease_info` VALUES ('DOID:14433', 'enterohemorrhagic Escherichia coli infectious disease', 'An Escherichia coli intestinal infectious disease that involves infection of the intestine caused by a serological subgroup of Escherichia coli called enterohemorrhagic Escherichia coli (EHEC), which cause hemorrhagic colitis or bloody diarrhea that can progress to hemolytic uremic syndrome. EHEC are considered to be moderately invasive and are characterized by the production of verotoxin or Shiga toxins. The infection results in copious bloody discharge', 'Verotoxigenic Escherichia coli gastrointestinal tract infection|intestinal infection due to enterohemorrhagic E. coli|Verotoxigenic Escherichia coli gastrointestinal tract infection (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14434', 'enterotoxigenic Escherichia coli infectious disease', 'An Escherichia coli intestinal infectious disease that involves infection of the intestine caused by a serological subgroup of Escherichia coli called enterotoxigenic Escherichia coli (ETEC), which are non-invasive and produce heat-labile enterotoxin (LT) or heat stable toxin (ST). The bacteria colonize the GI tract by means of a fimbrial adhesin. The symptoms include diarrhea without fever', 'Enterotoxigenic Escherichia coli gastrointestinal tract infection|intestinal infection due to enterotoxigenic E. coli|Enterotoxigenic Escherichia coli gastrointestinal tract infection (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14435', 'chronic tubotympanic suppurative otitis media', 'A suppurative otitis media which is an inflammatory disease of the middle ear cleft characterized by the presence of a persisting perforation within the pars tensa of the tympanic membrane, intermittent profuse muco-purulent otorrhea and gradually progressive conductive hearing loss of more than 12 weeks duration. It is caused by episodes of upper respiratory infections', '', 'ICD10CM:H66.1|SNOMEDCT_US_2016_03_01:87665008|ICD9CM:382.1|UMLS_CUI:C0155440|ICD10CM:H66.10', '5', null);
