INSERT INTO `disease_info` VALUES ('DOID:14453', 'farmer\'s lung', 'An extrinsic allergic alveolitis which is induced by the inhalation of spores (Aspergillus sp and thermophilic actinomycetes) in dust from moldy hay or straw. It is characterized by sudden onset, fever, cough, expectoration, and breathlessness', 'Farmers lung|farmer lung', 'NCI:C34605|ICD10CM:J67.0|MESH:D005203|SNOMEDCT_US_2016_03_01:18690003|SNOMEDCT_US_2016_03_01:266399001|ICD9CM:495.0|UMLS_CUI:C0015634|SNOMEDCT_US_2016_03_01:155581001', '2', 'DOID:14453');
INSERT INTO `disease_info` VALUES ('DOID:14456', 'Brucella melitensis brucellosis', 'A brucellosis that involves an infection caused by Brucella melitensis [NCBITaxon:29459] in cattle, goats, sheep and humans. The disease has_symptom fever, has_symptom malaise, has_symptom anorexia, has_symptom limb pain and has_symptom back pain', '', 'SNOMEDCT_US_2016_03_01:186305007|SNOMEDCT_US_2016_03_01:30789005|SNOMEDCT_US_2016_03_01:427999003|ICD9CM:023.0|UMLS_CUI:C0302362|ICD10CM:A23.0', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14457', 'Brucella abortus brucellosis', 'A brucellosis that involves an infection caused by Brucella abortus [NCBITaxon:235] in cattle and humans. The disease has_symptom fever, has_symptom chills, has_symptom sweats, has_symptom weight loss, has_symptom malaise, has_symptom headaches, has_symptom myalgia, and has_symptom arthralgia', '', 'SNOMEDCT_US_2016_03_01:9060000|MESH:D002007|ICD10CM:A23.1|SNOMEDCT_US_2016_03_01:427795000|ICD9CM:023.1|SNOMEDCT_US_2016_03_01:186306008|UMLS_CUI:C0302363', '2', 'DOID:14457');
