INSERT INTO `disease_info` VALUES ('DOID:14464', 'neuroleptic malignant syndrome', 'A nervous system disease that is characterized by hyperthermia, muscular rigidity, autonomic dysfunction and altered consciousness and is associated with administration of antipsychotic and other central dopaminergic blockers', '', 'MESH:D009459|SNOMEDCT_US_2016_03_01:192826000|ICD9CM:333.92|ICD10CM:G21.0|SNOMEDCT_US_2016_03_01:15244003|NCI:C94829|UMLS_CUI:C0027849|ORDO:94093|SNOMEDCT_US_2016_03_01:68977009', '2', 'DOID:14464');
INSERT INTO `disease_info` VALUES ('DOID:14467', 'drug-induced persisting amnestic disease', 'drug-induced persisting amnestic disease', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14472', 'hantavirus pulmonary syndrome', 'A viral infectious disease that results_in infection located_in lung, has_material_basis_in Sin Nombre virus, transmitted_by deer mouse (Myodes glareolus), has_material_basis_in Black Creek Canal virus, transmitted_by cotton rat (Sigmodon hispidus), has_material_basis_in Bayou virus, transmitted_by marsh rice rat (Oryzomys palustris), has_material_basis_in Laguna Negra virus, transmitted_by small vesper mouse (Calomys laucha), or has_material_basis_in Andes virus, transmitted_by rice rat (Oligoryzomys longicaudatus). The infection has_symptom fever, has_symptom muscle pain, has_symptom headache, has_symptom cough, has_symptom vomiting, has_symptom chills which rapidly progress to bilateral interstitial pulmonary infiltrates occurrence, pulmonary edema and hypoxia often resulting in death from shock or cardiac complications', '', 'MESH:D018804|NCI:C84747|SNOMEDCT_US_2016_03_01:120639003|UMLS_CUI:C0243025', '2', 'DOID:14472');
INSERT INTO `disease_info` VALUES ('DOID:14473', 'adenovirus pneumonia', 'An adenovirus infectious disease described as the infection of the lungs by adenoviruses (1,2, 3 and 7) especially in infants and children. In mild form of infection, findings of interstitial inflammatory cell infiltration may predominate, and nuclear inclusion bodies, most prominent in alveolar lining cells, may be identified in infected cells', 'Pneumonia due to adenovirus', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14474', 'respiratory syncytial virus pneumonia', 'A respiratory syncytial virus infectious disease that results_in inflammation located_in lung, has_material_basis_in Human respiratory syncytial virus, which is transmitted_by droplet spread of nasal secretions from an infected person while coughing or sneezing, or transmitted_by contaminated fomites. The disease is characterized by occasional multinucleated syncytial giant cells, hyperplasia of alveolar epithelial cells, epithelial necrosis of bronchioles and bronchi, papillary epithelial hyperplasia, and an inflammatory infiltrate composed of lymphocytes and macrophages in the peribronchial space and interstitium', 'Pneumonia due to respiratory syncytial virus (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14475', 'parainfluenzal pneumonia', 'A viral infectious disease that results_in inflammation located_in lung, has_material_basis_in Human parainfluenza virus 3, which is transmitted_by contact with the respiratory secretions of an infected person. The infection leads to the formation of multinucleated giant cells derived from the respiratory epithelium. The infection has_symptom shortness of breath, has_symptom cough, and has_symptom fever', 'Parainfluenza virus pneumonia (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14476', 'SARS coronavirus pneumonia', 'A severe acute respiratory syndrome that results_in infection located_in lungs, has_material_basis_in SARS coronavirus (SARS-CoV), which is transmitted_by droplet spread of respiratory secretions, transmitted_by ingestion of contaminated food, or transmitted_by fomites. The infection has_symptom fever, has_symptom myalgia, has_symptom lethargy, has_symptom cough, has_symptom sore throat, has_symptom shortness of breath, and other breathing difficulties which may lead to death as a result of respiratory failure', 'SARS-associated coronavirus pneumonia', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14477', 'Cytomegalovirus pneumonia', 'A Cytomegalovirus infectious disease that results_in inflammation, located_in lung, has_material_basis_in Human herpesvirus 5, a member of a group of herpes-type viruses especially in people who have a suppressed immune system and has_symptom cough, has_symptom fatigue, has_symptom shortness of breath, and has_symptom hypoxemia. Cytomegalovirus infection can be demonstrated microscopically by the detection of intranuclear inclusion bodies', 'Cytomegaloviral pneumonia (disorder)', '', '5', null);
