INSERT INTO `disease_info` VALUES ('DOID:14512', 'candidal paronychia', 'A candidiasis that results_in fungal infection of the outer-most layer located_in nail, has_material_basis_in Candida species. The infection causes painful, red, swollen area around the nail, often at the cuticle or at the site of a hangnail or other injury', 'candidiasis of skin and nails|candidiasis of skin', 'UMLS_CUI:C0006842|SNOMEDCT_US_2016_03_01:187014000|ICD9CM:112.3|ICD10CM:B37.2|SNOMEDCT_US_2016_03_01:187018002', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:14515', 'WAGR syndrome', 'A chromosomal deletion syndrome that is a nephroblastoma that results_in a rare genetic syndrome in which affected children are predisposed to develop Wilms tumor, Aniridia (absence of the colored part of the eye, the iris), genitourinary anomalies, and mental retardation. The condition results from a deletion on chromosome 11 resulting in the loss of several genes. As such, it is one of the best studied examples of a condition caused by loss of neighbouring (contiguous) genes', '11p partial monosomy syndrome|Wilms tumor-Aniridia-Genitourinary Anomalies-Mental Retardation syndrome|chromosome 11p13 deletion syndrome', 'OMIM:194072|SNOMEDCT_US_2016_03_01:4135001|UMLS_CUI:C0206115|MESH:D017624|NCI:C3718', '1', 'OMIM:194072|DOID:14515');
