INSERT INTO `disease_info` VALUES ('DOID:2043', 'hepatitis B', 'A viral infectious disease that results_in inflammation located_in liver, has_material_basis_in Hepatitis B virus, which is transmitted_by sexual contact, transmitted_by blood transfusions, and transmitted_by fomites like needles or syringes. The infection has_symptom fever, has_symptom fatigue, has_symptom loss of appetite, has_symptom nausea, has_symptom vomiting, has_symptom abdominal pain, has_symptom clay-colored bowel movements, has_symptom joint pain, and has_symptom jaundice', 'chronic hepatitis B|hepatitis B infection', 'SNOMEDCT_US_2016_03_01:186625003|UMLS_CUI:C0019163|MESH:D006509|EFO:0004197|MESH:D019694|SNOMEDCT_US_2016_03_01:66071002|SNOMEDCT_US_2016_03_01:266195001|NCI:C3097|SNOMEDCT_US_2016_03_01:154348008', '2', 'DOID:2043');
