INSERT INTO `disease_info` VALUES ('DOID:2047', 'hepatitis D', 'A viral infectious disease that results_in inflammation located_in liver, has_material_basis_in Hepatitis delta virus, which is an incomplete virus that requires the helper function of Hepatitis B virus to replicate and only occurs among people who are infected with the Hepatitis B virus. The infection has_symptom fatigue, has_symptom lethargy, has_symptom anorexia, has_symptom nausea, has_symptom jaundice, has_symptom clay-colored stools, has_symptom dark urine, has_symptom changes in personality, has_symptom disturbances in sleep, has_symptom confusion, has_symptom abnormal behavior, has_symptom somnolence, and has_symptom coma', 'delta hepatitis', 'SNOMEDCT_US_2016_03_01:424460009|MESH:D003699|SNOMEDCT_US_2016_03_01:707341005|UMLS_CUI:C0011226', '2', 'DOID:2047');
