INSERT INTO `disease_info` VALUES ('DOID:222', 'perichondritis of auricle', 'An otitis externa involving infection of the tissue surrounding the cartilage of the earlobe (pinna), ear canal, or both. It may be caused by injury, burns, insect bites, ear piercing, or a boil on the ear. The common bacterial causative agent is Pseudomonas aeruginosa. Symptoms include redness, pain, fever, swelling of the earlobe and pus accumulation between the cartilage and the layer of connective tissue around it', 'Perichondritis and chondritis of pinna|Perichondritis of pinna', 'UMLS_CUI:C0155389|SNOMEDCT_US_2016_03_01:194197001|ICD10CM:H61.00|ICD10CM:H61.009|SNOMEDCT_US_2016_03_01:34129005|ICD10CM:H61.0|SNOMEDCT_US_2016_03_01:155210008|ICD9CM:380.00|ICD9CM:380.0|SNOMEDCT_US_2016_03_01:194194008|SNOMEDCT_US_2016_03_01:236871000119109', '5', null);
