INSERT INTO `disease_info` VALUES ('DOID:227', 'ankylosis', 'Ankylosis is a arthropathy where there is a stiffness of a joint, the result of injury or disease. The rigidity may be complete or partial and may be due to inflammation of the tendinous or muscular structures outside the joint or of the tissues of the joint itself', '', 'SNOMEDCT_US_2016_03_01:156559001|SNOMEDCT_US_2016_03_01:202297005|UMLS_CUI:C0003090|SNOMEDCT_US_2016_03_01:202323002|SNOMEDCT_US_2016_03_01:156569007|MESH:D000844|ICD9CM:718.5|ICD9CM:718.50|SNOMEDCT_US_2016_03_01:36504009|ICD10CM:M24.6|SNOMEDCT_US_2016_03_01:111227009', '2', 'DOID:227');
INSERT INTO `disease_info` VALUES ('DOID:2271', 'oropharyngeal candidiasis', 'A candidiasis that involves fungal infection of the oropharynx in immunocompromised patients caused by Candida species resulting in formation of white plaques on the buccal mucosa, tongue, gums, palate, or pharynx. The symptoms include burning or dryness of the mouth, loss of taste, and pain on swallowing', 'oropharyngeal thrush|Oropharyngeal Candidiasis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:2272', 'vulvovaginal candidiasis', 'A candidiasis that involves fungal infection of the vaginal mucous membranes in women caused by Candida albicans. The symptoms include intense vulval pruritus, burning, erythema and dyspareunia associated with a creamy white, curd-like discharge', 'Vulvovaginal Candidiasis|Monilial vulvovaginitis|Candidal vulvovaginitis|Candidal: cervix|Candidiasis of vulva and vagina', 'UMLS_CUI:C0700345|SNOMEDCT_US_2016_03_01:266155003|SNOMEDCT_US_2016_03_01:187009004|NCI:C2914|SNOMEDCT_US_2016_03_01:72605008|ICD9CM:112.1|SNOMEDCT_US_2016_03_01:154404004|ICD10CM:B37.3|MESH:D002181', '2', 'DOID:2272');
