INSERT INTO `disease_info` VALUES ('DOID:2324', 'coxsackie meningitis', 'An Enterovirus infectious disease that results_in inflammation located_in meningeal cluster, has_material_basis_in Human enterovirus B, which is transmitted_by ingestion of food contaminated with feces, transmitted_by contact with pharyngeal secretions, or transmitted_by droplet spread of oronasal secretions. The infection has_symptom fever, has_symptom chills, has_symptom nausea, has_symptom headache, and has_symptom neck pain', 'Coxsackie viral meningitis|Meningitis due to coxsackie virus|Coxsackie meningitis (disorder)', '', '5', null);
