INSERT INTO `disease_info` VALUES ('DOID:2326', 'gastroenteritis', 'A gastrointestinal system infectious disease that involves inflammation of the lining of the stomach and small and large intestines, which is caused by viruses, bacteria, or parasites. Chemicals and drugs also cause gastroenteritis. The symptoms include diarrhea, loss of appetite, nausea, vomiting, cramps, and discomfort in the abdomen', 'infectious colitis, enteritis and gastroenteritis|cholera morbus', 'SNOMEDCT_US_2016_03_01:154278002|SNOMEDCT_US_2016_03_01:197010007|SNOMEDCT_US_2016_03_01:266179001|ICD10CM:K52.9|MESH:D005759|SNOMEDCT_US_2016_03_01:25374005|UMLS_CUI:C0017160|NCI:C34632', '2', 'DOID:2326');
INSERT INTO `disease_info` VALUES ('DOID:2327', 'viral gastritis', 'A gastrointestinal system infectious disease that involves inflammation of the stomach lining caused by viruses. The symptoms include abdominal pain, indigestion, ulcer formation, abdominal bloating, nausea and vomiting', '', 'UMLS_CUI:C0563238|SNOMEDCT_US_2016_03_01:285344007|NCI:C27184', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:2328', 'astrovirus gastroenteritis', 'A viral infectious disease that results_in inflammation located_in stomach and located_in intestine, has_material_basis_in Human astrovirus, which is transmitted_by ingestion of contaminated food. The infection has_symptom watery diarrhea, has_symptom nausea, has_symptom abdominal pain, has_symptom vomiting, and has_symptom fever', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:2329', 'Rotavirus gastroenteritis', 'A viral infectious disease that results_in inflammation located_in stomach and located_in intestine, has_material_basis_in Rotavirus, which is transmitted_by ingestion of contaminated food or water, or transmitted_by fomites. The infection has_symptom fever, has_symptom vomiting, has_symptom diarrhea, and has_symptom abdominal pain', 'rotavirus enteritis|Enteritis due to rotavirus (disorder)', '', '5', null);
