INSERT INTO `disease_info` VALUES ('DOID:2790', 'necatoriasis', 'A parasitic helminthiasis infectious disease that involves infection of the small intestine of humans, dogs and cats by the nematode Necator americanus causing abdominal pain, diarrhea, cramps, weight loss and anemia. Cutaneous larvae migrans in humans is characterized by skin ruptures and severe itching', '', 'ICD10CM:B76.1|MESH:D009332|SNOMEDCT_US_2016_03_01:36667009|NCI:C34838|UMLS_CUI:C0027528', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:2791', 'hookworm infectious disease', 'A Strongylida infectious disease that involves infection of the small intestine of mammals, cats and dogs by the parasitic nematodes of genus Ancylostoma, Necator and Uncinaria', 'ancylostomiasis and necatoriasis', '', '2', 'DOID:2791');
