INSERT INTO `disease_info` VALUES ('DOID:2800', 'acute interstitial pneumonia', 'A idiopathic interstitial pneumonia which develops suddenly and is severe. Initially, the lung shows edema, hyaline membranes, and interstitial acute inflammation. Later,it develops loose organizing fibrosis, mostly within alveolar septa and type II pneumocyte hyperplasia. Fever, cough, and difficulty breathing develop over 1 to 2 weeks, typically progressing to acute respiratory failure', 'accelerated interstitial pneumonia|Idiopathic pulmonary fibrosis, acute fatal form|AIP|Hamman-Rich disease|acute interstitial pneumonitis|Hamman-Rich syndrome', 'OMIM:178500|SNOMEDCT_US_2016_03_01:45157009|SNOMEDCT_US_2016_03_01:35037009|ICD10CM:J84.114|ICD9CM:516.33|UMLS_CUI:C1279945|SNOMEDCT_US_2016_03_01:129459004|SNOMEDCT_US_2016_03_01:236302005|NCI:C35806', '1', 'OMIM:178500|DOID:2800');
INSERT INTO `disease_info` VALUES ('DOID:2801', 'nonspecific interstitial pneumonia', 'An idiopathic interstitial pneumonia that occurs mainly in women, people who do not smoke, and people younger than 50 years with no known cause or risk factors. Lung biopsies may show predominantly interstitial inflammation or fibrosis or a combination of inflammation and fibrosis. A dry cough and shortness of breath develop over 6 to 18 months. Low-grade fever and a feeling of illness (malaise) may occur', 'NSIP', 'NCI:C35717|SNOMEDCT_US_2016_03_01:129452008|UMLS_CUI:C1290344', '2', 'DOID:2801');
