INSERT INTO `disease_info` VALUES ('DOID:3240', 'aspiration pneumonitis', 'A pneumonia that is defined as an acute lung injury after the inhalation of foreign material such as regurgitated acidic gastric contents, petroleum products and laxative oils. This syndrome occurs in patients who have a marked disturbance of consciousness such as that resulting from a drug overdose, seizures, a massive cerebrovascular accident, or the use of anesthesia. Aspiration of gastric contents results in a chemical burn of the tracheobronchial tree and pulmonary parenchyma, causing an intense parenchymal inflammatory reaction. The disease has_symptom non-productive cough, has_symptom tachypnea, has_symptom bronchospasm, has_symptom bloody sputum, has_symptom frothy sputum, or has_symptom respiratory distress, 2-5 hrs after aspiration', 'Chemical pneumonitis|Mendelson\'s Syndrome', 'MESH:D011015|SNOMEDCT_US_2016_03_01:47839005|UMLS_CUI:C0032290|ICD10CM:J69.0|SNOMEDCT_US_2016_03_01:422588002', '2', 'DOID:3240');
INSERT INTO `disease_info` VALUES ('DOID:3241', 'lipid pneumonia', 'An aspiration pneumonitis resulting from the aspiration of lipids. It is the result of a foreign body-type reaction to the presence of lipid material within the lung parenchyma. It is caused by inhalation of nasal drops with oil base or cosmetic oil and aspiration of mineral oil when used as a laxative agent', 'Exogenous lipoid pneumonia|Lipoid pneumonitis', 'UMLS_CUI:C0032298|ICD10CM:J69.1|SNOMEDCT_US_2016_03_01:37629004|SNOMEDCT_US_2016_03_01:416916004|MESH:D011017|SNOMEDCT_US_2016_03_01:196038008|SNOMEDCT_US_2016_03_01:707449006', '5', null);
