INSERT INTO `disease_info` VALUES ('DOID:3292', 'monkeypox', 'A viral infectious disease that results_in infection of primates, rodents and humans, located_in skin, has_material_basis_in Monkeypox virus, which is transmitted_by contact with the animal\'s blood, body fluids, rash, or with the body fluids of a sick person, transmitted_by fomites, and transmitted_by respiratory droplets. The infection has_symptom fever, has_symptom muscle ache, has_symptom headache, and has_symptom lymphadenopathy', '', 'ICD10CM:B04|SNOMEDCT_US_2016_03_01:359811007|MESH:D045908|SNOMEDCT_US_2016_03_01:25157001|UMLS_CUI:C0276180|SNOMEDCT_US_2016_03_01:186582008|ICD9CM:059.01|SNOMEDCT_US_2016_03_01:240466002|SNOMEDCT_US_2016_03_01:359814004', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3293', 'lumpy skin disease', 'A viral infectious disease that results_in infection located_in skin and located_in mucous membrane of cattle, has_material_basis_in Lumpy skin disease virus, which results_in_formation_of nodules on the skin particularly on the head, neck, udder, genitalia, perineum and legs, has_symptom fever, and has_symptom lymphadenopathy', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3295', 'fowlpox', 'A viral infectious disease results_in infection located_in skin, or located_in mucous membranes of the mouth, oesophagus, larynx or trachea of birds, has_material_basis_in Fowlpox virus, has_symptom lesions on the skin, has_symptom diphtheritic lesions in the upper parts of the digestive and respiratory tracts', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3296', 'infectious ectromelia', 'A viral infectious disease that results_in infection located in skin of mice, has_material_basis_in Ectromelia virus. The infection has_symptom swelling of the feet, has_symptom gangrene, and has_symptom lesions on the skin', 'Mousepox (disorder)', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3297', 'infectious myxomatosis', 'A viral infectious disease that results_in infection located_in eyes or located_in upper respiratory tract of domestic rabbits, has_material_basis_in Myxoma virus, which is transmitted_by mosquitos, transmitted_by biting flies or transmitted_by direct contact. The infection has_symptom conjunctivitis with a milky discharge from the inflamed eye and has_symptom breathing difficulties', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3298', 'vaccinia', 'A viral infectious disease that results_in infection, located_in skin, has_material_basis_in Vaccinia virus, which is used as a live vaccine against smallpox. The virus is transmitted_by contact with the vaccination site before it has healed, or transmitted_by fomites that have been contaminated with live virus from the vaccination site. The infection has_symptom rash, has_symptom fever, and has_symptom body aches', '', 'MESH:D014615|SNOMEDCT_US_2016_03_01:111852003|UMLS_CUI:C0042214', '2', 'DOID:3298');
