INSERT INTO `disease_info` VALUES ('DOID:3730', 'pneumonic pasteurellosis', 'A Pasteurella infectious disease that involves infection by the bacterium Mannheimia haemolytica and less frequently by Pasteurella multocida and Histophilus somni. After stress or viral infection, the replication rate of M. haemolytica in the upper respiratory tract increases rapidly, followed by inhalation and colonization of the lungs due to suppression of the host\'s defense mechanism. The bacterium produces exotoxin called leukotxin which interacts with the host\'s defense mechanism resulting in tissue damage with charactersistic necrosis, thrombosis, and exudation and the development of pneumonia', 'Pneumonic pasteurellosis', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3731', 'primary Pasteurellaceae infectious disease', 'primary Pasteurellaceae infectious disease', '', '', '2', 'DOID:3731');
INSERT INTO `disease_info` VALUES ('DOID:3732', 'bovine respiratory disease complex', 'A pneumonia which has a multifactorial etiology and develops as a result of complex interactions between environmental factors, host factors, and pathogens leading to pulmonary lesions caused by various micro organisms ( essentially viruses and bacteria). Environmental factors (eg, weaning, transport, commingling, crowding, and inadequate ventilation) serve as stressors that adversely affect the immune and nonimmune defense mechanisms of the host. In addition, certain environmental factors (eg, crowding and inadequate ventilation) can enhance the transmission of infectious agents among animals', '', '', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3733', 'theileriasis', 'A parasitic protozoa infectious disease that involves infection of humans and cattle caused by a genus of parasitic protozoa Theileria, which is transmitted by ixodid ticks', 'Infection by Theileria|theileriosis', 'UMLS_CUI:C0039753|MESH:D013801|SNOMEDCT_US_2016_03_01:68771000', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:3737', 'verrucous carcinoma', 'A squamous cell carcinoma that is a diffuse, papillary, non metastasizing, well differentiated, malignant neoplasm of epidermis or oral epithelium', 'Warty carcinoma|verrucous squamous carcinoma|verrucous squamous cell carcinoma', 'UMLS_CUI:C0206706|SNOMEDCT_US_2016_03_01:403904009|SNOMEDCT_US_2016_03_01:189563000|NCI:C3781|SNOMEDCT_US_2016_03_01:89906000|MESH:D018289', '2', 'DOID:3737');
