INSERT INTO `disease_info` VALUES ('DOID:4325', 'Ebola hemorrhagic fever', 'A viral infectious disease that is a hemorrhagic fever, has material basis in Zaire ebolavirus, has material basis in Sudan ebolavirus, has material basis in Cote d\'Ivoire ebolavirus, or has material basis in Bundibugyo ebolavirus, which are transmitted by contact with the body fluids of an infected animal or person, transmitted by contaminated fomites, or transmitted by infected medical equipment. The infection has symptom fever, has symptom headache, has symptom joint pain, has symptom muscle aches, has symptom sore throat, has symptom weakness, has symptom diarrhea, has symptom vomiting, has symptom stomach pain, has symptom rash, has symptom red eyes, has symptom hiccups, and has symptom internal and external bleeding', 'Ebola virus disease', 'UMLS_CUI:C0282687|SNOMEDCT_US_2016_03_01:123323003|ICD10CM:A98.4|SNOMEDCT_US_2016_03_01:37109004|NCI:C36171|MESH:D019142|SNOMEDCT_US_2016_03_01:186746000', '3', 'DOID:4325');
