INSERT INTO `disease_info` VALUES ('DOID:4492', 'avian influenza', 'An influenza that results in infection located in respiratory tract of humans, domestic and wild birds, has material basis in Influenza A virus, which is transmitted by contact with infected poultry. Five strains of avian influenza A viruses (H5N1, H7N3, H7N2, H7N7 and H9N2) are known to cause human infections. The infection has symptom fever, has symptom cough, has symptom sore throat, has symptom muscle aches, has symptom nausea, has symptom diarrhea, has symptom vomiting, has symptom neurologic changes, has symptom pneumonia, and has symptom acute respiratory distress', 'avian flu|bird flu', 'ICD10CM:J09.X|MESH:D005585|UMLS_CUI:C0016627|SNOMEDCT_US_2016_03_01:55604004', '2', 'DOID:4492');
