INSERT INTO `disease_info` VALUES ('DOID:4616', 'bovine atypical interstitial pneumonia', 'A bovine respiratory disease complex defined as an acute, noncontagious respiratory distress caused 5-10days after change to a better, often lush, pasture. Metabolites of the naturally occurring amino acid L-tryptophan probably are responsible for the disease. Severely affected cattle show extensive respiratory distress with mouth breathing, extension of the tongue, and drooling. There is extensive edema and emphysema, often with the formation of large air-filled bullae in interlobular and subpleural regions of the lung', 'acute bovine pulmonary emphysema AND edema (disorder)|Fog fever|Atypical interstitial pneumonia of cattle (disorder)', '', '5', null);
