INSERT INTO `disease_info` VALUES ('DOID:4809', 'enzootic porcine encephalomyelitis', 'A viral infectious disease that results_in inflammation located_in brain and located_in spinal cord of pigs, has_material_basis_in Porcine teschovirus, which is transmitted_by ingestion of contaminated food, and transmitted_by contaminated fomites. The infection has_symptom fever, has_symptom anorexia, has_symptom depression, has_symptom incoordination, has_symptom paralysis, has_symptom muscle tremors, has_symptom stiffness, has_symptom nystagmus, has_symptom seizures, and has_symptom loss of the voice', 'Porcine polioencephalomyelitis|Poliomyelitis Suum|Teschen disease|Talfan disease', '', '5', null);
