INSERT INTO `disease_info` VALUES ('DOID:526', 'human immunodeficiency virus infectious disease', 'A viral infectious disease that results_in destruction of immune system, leading to life-threatening opportunistic infections and cancers, has_material_basis_in Human immunodeficiency virus 1 or has_material_basis_in Human immunodeficiency virus 2, which are transmitted_by sexual contact, transmitted_by transfer of blood, semen, vaginal fluid, pre-ejaculate, or breast milk, transmitted_by congenital method, and transmitted_by contaminated needles. The virus infects helper T cells (CD4+ T cells) which are directly or indirectly destroyed, macrophages, and dendritic cells. The infection has_symptom diarrhea, has_symptom fatigue, has_symptom fever, has_symptom vaginal yeast infection, has_symptom headache, has_symptom mouth sores, has_symptom muscle aches, has_symptom sore throat, and has_symptom swollen lymph glands', 'HIV infection', 'ICD10CM:B20|ICD9CM:042|SNOMEDCT_US_2016_03_01:187438009|SNOMEDCT_US_2016_03_01:186705005|SNOMEDCT_US_2016_03_01:123321001|ICD9CM:042-042.99|MESH:D015658|SNOMEDCT_US_2016_03_01:86406008|UMLS_CUI:C0019693|SNOMEDCT_US_2016_03_01:187453001|NCI:C3108|ICD10CM:B20-B20', '2', 'DOID:526');
