INSERT INTO `disease_info` VALUES ('DOID:5501', 'Pediculus humanus capitis infestation', 'A lice infestation that involves colonization of the hair and skin by the parasitic insect Pediculus humanus capitis, which feeds on blood several times daily and resides close to the scalp to maintain its body temperature. The symptoms include tickling feeling of something moving in the hair, itching, caused by an allergic reaction to louse saliva, and irritability', 'Pediculosis capitis|Pediculus capitis|head louse infestation|Pediculus capitis infestation', 'ICD9CM:132.0|SNOMEDCT_US_2016_03_01:81000006|ICD10CM:B85.0|SNOMEDCT_US_2016_03_01:243682006|UMLS_CUI:C0030757|SNOMEDCT_US_2016_03_01:271544006', '5', null);
