INSERT INTO `disease_info` VALUES ('DOID:8252', 'chronic rhinitis', 'A rhinitis which is persistent and long-lasting. It may occur with diseases such as syphilis, tuberculosis, rhinoscleroma, rhinosporidiosis, leishmaniasis, blastomycosis, histoplasmosis, and leprosy, all of which are characterized by the formation of inflamed lesions (granulomas) and the destruction of soft tissue, cartilage, and bone. Chronic rhinitis causes nasal obstruction, pus-filled discharge from the nose, and frequent bleeding', 'Rhinitis - chronic', 'SNOMEDCT_US_2016_03_01:195774000|UMLS_CUI:C0008711|SNOMEDCT_US_2016_03_01:270532004|SNOMEDCT_US_2016_03_01:86094006|ICD10CM:J31.0|SNOMEDCT_US_2016_03_01:195764003|NCI:C34479|SNOMEDCT_US_2016_03_01:155522005|ICD9CM:472.0', '5', null);
