INSERT INTO `disease_info` VALUES ('DOID:8283', 'peritonitis', 'A gastrointestinal system disease that involves inflammation of the peritoneum resulting from perforation of the gastrointestinal tract, which produces immediate chemical inflammation followed shortly by infection from intestinal organisms. Peritonitis can also result from appendicitis, diverticulitis, strangulating intestinal obstruction, pancreatitis, pelvic inflammatory disease, mesenteric ischemia, intraperitoneal blood, barium, or peritoneo-systemic shunts, drains, and dialysis catheters in the peritoneal cavity. The symptoms include abdominal pain and tenderness, fever, fluid in the abdomen, nausea, vomiting and low urine output', 'Retractile mesenteritis|primary bacterial peritonitis|acute generalized peritonitis|sclerosing mesenteritis', 'UMLS_CUI:C0029823|ICD9CM:567.89|SNOMEDCT_US_2016_03_01:197187000|SNOMEDCT_US_2016_03_01:197183001|ICD9CM:567.8', '2', 'DOID:8283');
