INSERT INTO `disease_info` VALUES ('DOID:9360', 'intrinsic asthma', 'An asthma that is triggered by factors not related to allergies such as anxiety, stress, exercise, cold air, dry air, hyperventilation, smoke, viruses, chemical irritants, autonomic imbalance, hormonal deficiencies and psychogenic influences. It is characterized by airway obstruction and inflammation that is at least partially reversible with medication. The symptoms include coughing, wheezing, shortness of breath or rapid breathing, and chest tightness', '', 'ICD10CM:J45|UMLS_CUI:C0155880|SNOMEDCT_US_2016_03_01:266397004|SNOMEDCT_US_2016_03_01:155576005|SNOMEDCT_US_2016_03_01:195973000|SNOMEDCT_US_2016_03_01:195976008|ICD9CM:493.1|SNOMEDCT_US_2016_03_01:266361008|SNOMEDCT_US_2016_03_01:8312004', '2', 'DOID:9360');
