INSERT INTO `disease_info` VALUES ('DOID:9392', 'tracheitis', 'A tracheal disease which involves bacterial infection of the trachea often caused by Staphylococcus aureus and streptococci that follows a recent viral upper respiratory infection. The symptoms include barking croup cough, loud squeaking noise while breathing, scratchy feeling in the throat, high fever, and production of large amounts of pus-filled secretions', 'acute tracheitis|chronic tracheitis', 'UMLS_CUI:C0040584|SNOMEDCT_US_2016_03_01:26650005|SNOMEDCT_US_2016_03_01:195693005|SNOMEDCT_US_2016_03_01:155507000|NCI:C78643|UMLS_CUI:C0149513|MESH:D014136|ICD9CM:464.1|SNOMEDCT_US_2016_03_01:62994001|ICD10CM:J04.1', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:9395', 'croup', 'A respiratory system infectious disease that involves inflammation, edema, and subsequent obstruction of the larynx, trachea, and bronchi. The disease is caused by viruses, bacteria, allergies and inhaled irritants. It is marked by episodes of difficult breathing and hoarse metallic cough in infants and young children. Croup is caused by parainfluenza virus (types 1 and 2), Influenza A and B viruses, Measles virus, adenovirus, respiratory syncytial virus, Staphylococcus and Streptococcus', 'Laryngotracheobronchitis|acute Obstructive Laryngitis|Croup syndrome|acute laryngotracheobronchitis', 'ICD9CM:464.4|UMLS_CUI:C0010380|MESH:D003440|SNOMEDCT_US_2016_03_01:71186008|SNOMEDCT_US_2016_03_01:195702002|ICD10CM:J05.0|NCI:C26735|SNOMEDCT_US_2016_03_01:155510007', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:9396', 'acute laryngitis', 'A laryngitis which lasts less than a few days', '', 'ICD9CM:464.01|SNOMEDCT_US_2016_03_01:195690008|UMLS_CUI:C0949123|SNOMEDCT_US_2016_03_01:408669002|UMLS_CUI:C0001327|ICD10CM:J04.0|ICD9CM:464.0|SNOMEDCT_US_2016_03_01:155506009|SNOMEDCT_US_2016_03_01:6655004|NCI:C26688', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:9398', 'epiglottitis', 'An upper respiratory tract disease which involves inflammation of the epiglottis due to infection. Haemophilus influenzae type B is the most common bacterial causative agent, although some cases are attributable to Streptococcus pneumoniae or Streptococcus pyogenes. The infection can cause the epiglottis to either obstruct or completely close off the windpipe. Epiglottitis typically affects children, and is associated with fever, difficulty in swallowing, drooling, hoarseness of voice, and stridor', 'acute epiglottitis and supraglottitis|acute epiglottitis', 'MESH:D004826|ICD10CM:J05.1|ICD9CM:464.3|SNOMEDCT_US_2016_03_01:155509002|ICD10CM:J05.10|SNOMEDCT_US_2016_03_01:80384002|UMLS_CUI:C0014541|NCI:C116007|SNOMEDCT_US_2016_03_01:195701009|SNOMEDCT_US_2016_03_01:29608009|UMLS_CUI:C0155814', '5', null);
