INSERT INTO `disease_info` VALUES ('DOID:9562', 'primary ciliary dyskinesia', 'A ciliopathy that is characterized by impaired function of the cilia lining the respiratory tract (lower and upper, sinuses, Eustachian tube, middle ear) and fallopian tube', 'immotile ciliary syndrome|ciliary motility disorder', 'OMIM:PS244400|MESH:D002925|ORDO:244|SNOMEDCT_US_2016_03_01:9057007|SNOMEDCT_US_2016_03_01:86204009|UMLS_CUI:C0008780|NCI:C84638', '2', 'OMIM:PS244400|DOID:9562');
INSERT INTO `disease_info` VALUES ('DOID:9563', 'bronchiectasis', 'A bronchial disease that is a chronic inflammatory condition of one or more bronchi or bronchioles marked by dilatation and loss of elasticity of the walls resulting from damage to the airway wall leading to the formation of small sacs on the bronchial wall and impairment of cilia mobility in the lung. Inflammation of the bronchial wall increases mucus secretion which serves as a breeding ground for bacteria. Bronchiectasis is caused by repeated respiratory infections, immune deficiency disorders, hereditary disorders (cystic fibrosis or primary ciliary dyskinesia), mechanical factors (inhaled object or a lung tumor) or inhaling toxic substances', 'Polynesian bronchiectasis', 'SNOMEDCT_US_2016_03_01:12295008|SNOMEDCT_US_2016_03_01:155580000|ORDO:60033|UMLS_CUI:C0006267|ICD10CM:J47|MESH:D001987|ICD10CM:J47.9|SNOMEDCT_US_2016_03_01:195986009|ICD9CM:494|OMIM:613071|OMIM:613021|NCI:C84475|OMIM:211400', '1', 'OMIM:613071|OMIM:613021|OMIM:211400|DOID:9563');
