INSERT INTO `disease_info` VALUES ('DOID:9584', 'Venezuelan equine encephalitis', 'A viral infectious disease that results_in inflammation located_in brain of horses and humans, has_material_basis_in Venezuelan equine encephalitis virus, which is transmitted_by Culex mosquitoes. The infection has_symptom fever, has_symptom chills, has_symptom malaise, has_symptom severe headache, has_symptom photophobia, and has_symptom myalgia in the legs and lumbosacral region', '', 'ICD9CM:066.2|NCI:C35121|MESH:D004685|SNOMEDCT_US_2016_03_01:417067005|UMLS_CUI:C0014078|SNOMEDCT_US_2016_03_01:89990001|SNOMEDCT_US_2016_03_01:417702007|ICD10CM:A92.2', '2', 'DOID:9584');
