INSERT INTO `disease_info` VALUES ('DOID:9784', 'trichinosis', 'A parasitic helminthiasis infectious disease that involves parasitic infection of animals and humans by Trichinella spiralis, Trichinella nativa or Trichinella britovi . Intestinal invasion causes diarrhea, abdominal pain and vomiting. Larval migration into muscle tissues can cause periorbital and facial edema, conjunctivitis, fever, myalgias, splinter hemorrhages, rashes, and blood eosinophilia. Myocarditis, central nervous system involvement, and pneumonitis can also occur', 'Trichinella spiralis infection', 'NCI:C85199|ICD9CM:124|MESH:D014235|SNOMEDCT_US_2016_03_01:709018004|ICD10CM:B75|SNOMEDCT_US_2016_03_01:88264003|SNOMEDCT_US_2016_03_01:266222003|UMLS_CUI:C0040896|SNOMEDCT_US_2016_03_01:154415009', '5', null);
INSERT INTO `disease_info` VALUES ('DOID:9786', 'bulbar polio', 'A paralytic poliomyelitis that results in destruction located in motor neurons of brainstem, has material basis in Human poliovirus 1, has material basis in Human poliovirus 2, or has material basis in Human poliovirus 3, which are transmitted by ingestion of food or water contaminated with feces, or transmitted by direct contact with the oral secretions. The infection has symptom difficulty breathing, has symptom difficulty speaking, has symptom difficulty swallowing, and has symptom difficulty chewing', 'bulbar poliomyelitis', 'MESH:D011052|SNOMEDCT_US_2016_03_01:64764001|ICD9CM:045.0|UMLS_CUI:C0032372|SNOMEDCT_US_2016_03_01:54839009|SNOMEDCT_US_2016_03_01:398327006|SNOMEDCT_US_2016_03_01:186475007', '5', null);
