INSERT INTO `disease_info` VALUES ('DOID:9790', 'toxocariasis', 'A parasitic helminthiasis infectious disease that involves zoonotic infection of humans by the larvae of Toxocara canis or Toxocara cati. The larvae invade multiple tissues like liver, heart, lungs, brain, muscle and eyes causing various symptoms including fever, anorexia, weight loss, cough, wheezing, rashes, hepatosplenomegaly, hypereosinophilia and ophthalmologic lesions', 'visceral larva migrans|Infection by Toxascaris|Toxocara infection', 'UMLS_CUI:C0023049|NCI:C34758|ICD10CM:B83.0|SNOMEDCT_US_2016_03_01:87121004|MESH:D007816', '5', null);
