INSERT INTO `disease_info` VALUES ('DOID:9965', 'toxoplasmosis', 'A coccidiosis that has_material_basis_in protozoan Toxoplasma gondii. The parasite effects most genera of warm-blooded animals, including humans, but the primary host is the felid (cat) family. Animals are infected by eating infected meat, by ingestion of feces of a cat that has itself recently been infected, or transmission_by mother to fetus. The symptoms include bilateral, nontender cervical or axillary lymphadenopathy, fever, malaise, myalgia, hepatosplenomegaly, anemia and leukopenia', 'disseminated toxoplasmosis', 'SNOMEDCT_US_2016_03_01:266225001|ICD9CM:130|NCI:C3418|ICD10CM:B58|ICD9CM:130.9|SNOMEDCT_US_2016_03_01:187515009|SNOMEDCT_US_2016_03_01:187200007|UMLS_CUI:C0040558|SNOMEDCT_US_2016_03_01:9399000|SNOMEDCT_US_2016_03_01:276203008|MESH:D014123|SNOMEDCT_US_2016_03_01:154423006|SNOMEDCT_US_2016_03_01:187192000|ICD10CM:B58.9', '2', 'DOID:9965');
